class Solution {
    public int[] getSumAbsoluteDifferences(int[] nums) {
        int n = nums.length;
        int[] ans = new int[n];
        int[] prefixSum = new int[n];
        int sum = 0;
        for (int i = 0; i < n; i++) {
            sum += nums[i];
            prefixSum[i] = sum;
        }
        for (int i = 0; i < n; i++) {
            int leftSum = i == 0 ? 0 : prefixSum[i - 1];
            int rightSum = prefixSum[n - 1] - prefixSum[i];
            ans[i] = (i + 1) * nums[i] - leftSum + rightSum - (n - i - 1) * nums[i];
        }
        return ans;
    }
}

class Solution {
    public int[] getDivArray(String word, int m) {
        int n = word.length();
        int[] div = new int[n];
        int num = 0;
        for (int i = 0; i < n; i++) {
            num = num * 10 + (word.charAt(i) - '0');
            if (num % m == 0) {
                div[i] = 1;
            }
        }
        int sum = 0;
        for (int i = n - 1; i >= 0; i--) {
            sum = (sum * 10 + (word.charAt(i) - '0')) % m;
            if (sum == 0) {
                div[i] = 1;
            }
        }
        return div;
    }
}

class Solution {
    public int maxMarkedIndices(int[] nums) {
        int n = nums.length;
        int[] marked = new int[n];
        int count = 0;
        for (int i = 0; i < n; i++) {
            if (marked[i] == 1) {
                continue;
            }
            for (int j = i+1; j < n; j++) {
                if (marked[j] == 1) {
                    continue;
                }
                if (2 * nums[i] <= nums[j] || 2 * nums[j] <= nums[i]) {
                    marked[i] = 1;
                    marked[j] = 1;
                    count += 2;
                    break;
                }
            }
        }
        return count;
    }
}

class Solution {
    public int minimumMinimumTimeRequired(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        int[][] dp = new int[m][n];
        for (int i = 0; i < m; i++) {
            Arrays.fill(dp[i], Integer.MAX_VALUE);
        }
        dp[0][0] = 0;
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[2] - b[2]);
        pq.offer(new int[]{0, 0, 0});
        while (!pq.isEmpty()) {
            int[] curr = pq.poll();
            int row = curr[0], col = curr[1], time = curr[2];
            if (row == m - 1 && col == n - 1) {
                return time;
            }
            if (time > dp[row][col]) {
                continue;
            }
            if (row > 0 && time + 1 < dp[row - 1][col]) {
                dp[row - 1][col] = time + 1;
                pq.offer(new int[]{row - 1, col, dp[row - 1][col]});
            }
            if (col > 0 && time + 1 < dp[row][col - 1]) {
                dp[row][col - 1] = time + 1;
                pq.offer(new int[]{row, col - 1, dp[row][col - 1]});
            }
            if (row < m - 1 && time + 1 < dp[row + 1][col]) {
                dp[row + 1][col] = time + 1;
                pq.offer(new int[]{row + 1, col, dp[row + 1][col]});
            }
            if (col < n - 1 && time + 1 < dp[row][col + 1]) {
                dp[row][col + 1] = time + 1;
                pq.offer(new int[]{row, col + 1, dp[row][col + 1]});
            }
        }
        return -1;
    }
}

class Solution {
    public int minOperations(int n) {
        int res = 0;
        for (int i = 0; i < n / 2; i++) {
            res += n - (2 * i + 1);
        }
        return res;
    }
}

class Solution {
    int MOD = 1000000007;
    public int countSquareSummaries(int[] nums) {
        int maxNum = 0;
        for(int num: nums) maxNum = Math.max(maxNum, num);
        int[] squareFree = new int[maxNum + 1];
        squareFree[1] = 1;
        for(int i = 2; i * i <= maxNum; i++) {
            if(squareFree[i] == 0) {
                for(int j = i * i; j <= maxNum; j += i * i) squareFree[j] = 1;
            }
        }
        int[] dp = new int[1 << nums.length];
        Arrays.fill(dp, -1);
        return dfs(nums, dp, squareFree, 0, 1);
    }
    int dfs(int[] nums, int[] dp, int[] squareFree, int state, int prod) {
        if(state != 0 && dp[state] != -1) return dp[state];
        int res = 0;
        if(prod != 1 && squareFree[prod] == 0) res = 1;
        for(int i = 0; i < nums.length; i++) {
            if((state & (1 << i)) != 0) continue;
            res = (res + dfs(nums, dp, squareFree, state | (1 << i), prod * nums[i])) % MOD;
        }
        if(state != 0) dp[state] = res;
        return res;
    }
}

class Solution {
    public String smallestStringWithSwaps(String s, List<List<Integer>> pairs) {
        int n = s.length();
        int[] parent = new int[n];
        for (int i = 0; i < n; i++) parent[i] = i;
        for (List<Integer> pair : pairs) {
            int u = pair.get(0), v = pair.get(1);
            parent[find(parent, u)] = find(parent, v);
        }
        Map<Integer, PriorityQueue<Character>> map = new HashMap<>();
        for (int i = 0; i < n; i++) {
            int root = find(parent, i);
            if (!map.containsKey(root)) map.put(root, new PriorityQueue<>());
            map.get(root).offer(s.charAt(i));
        }
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < n; i++) {
            int root = find(parent, i);
            sb.append(map.get(root).poll());
        }
        return sb.toString();
    }
    private int find(int[] parent, int x) {
        if (parent[x] != x) parent[x] = find(parent, parent[x]);
        return parent[x];
    }
}

class Solution {
    public int[][] merge(int[][] nums1, int[][] nums2) {
        List<int[]> list = new ArrayList<>();
        int i = 0, j = 0;
        while (i < nums1.length || j < nums2.length) {
            if (i < nums1.length && j < nums2.length) {
                if (nums1[i][0] == nums2[j][0]) {
                    list.add(new int[]{nums1[i][0], nums1[i][1] + nums2[j][1]});
                    i++;
                    j++;
                } else if (nums1[i][0] < nums2[j][0]) {
                    list.add(nums1[i]);
                    i++;
                } else {
                    list.add(nums2[j]);
                    j++;
                }
            } else if (i < nums1.length) {
                list.add(nums1[i]);
                i++;
            } else {
                list.add(nums2[j]);
                j++;
            }
        }
        return list.toArray(new int[list.size()][2]);
    }
}

class Solution {
    public int minDifference(int[] nums) {
        if (nums.length <= 4) {
            return 0;
        }
        Arrays.sort(nums);
        int n = nums.length;
        return Math.min(Math.min(nums[n - 1] - nums[3], nums[n - 4] - nums[0]), Math.min(nums[n - 3] - nums[1], nums[n - 2] - nums[2]));
    }
}

class Solution {
    public int minNonZeroProduct(int p, int r) {
        long a = (1L << p) - 1, b = a - 1; 
        return (int)(b % mod * quickPow(a, r - 1) % mod);
    }
    
    private static final int mod = 1000000007; 
    private long quickPow(long a, int b) {
        long res = 1L; 
        while (b != 0) {
            if ((b & 1) == 1) res = res * a % mod;
            a = a * a % mod;
            b >>= 1;
        }
        return (int)res;
    }
}

class Solution {
    public int maxDiff(int num) {
        char[] nums = String.valueOf(num).toCharArray();
        char maxVal = '9', minVal = '0', first = nums[0];
        for(char c : nums) {
            if(c != '9' && maxVal == '9' && c != first) {
                maxVal = '9';
            } else if(c != '1' && first != '1' && minVal == '0') {
                minVal = '1';
            }
            if(c == first) {
                continue;
            } else if(c == '9') {
                continue;
            } else {
                if(maxVal == '9') {
                    maxVal = c;
                }
                if(minVal == '0' && c != '0' && (first != '1' || c != '1')) {
                    minVal = c;
                }
            }
        }
        String maxStr = String.valueOf(num).replace(first, maxVal);
        String minStr = String.valueOf(num).replace(first, minVal);
        return Integer.valueOf(maxStr) - Integer.valueOf(minStr);
    }
}

class Solution {
    public int[] solve(int[] nums1, int[] nums2, int[][] queries) {
        int n = nums1.length;
        int[] res = new int[queries.length];
        int ans = 0;
        for (int i = 0; i < n; i++) {
            ans += nums2[i];
        }
        for (int i = 0; i < queries.length; i++) {
            int[] query = queries[i];
            if (query[0] == 1) {
                int l = query[1], r = query[2];
                for (int j = l; j <= r; j++) {
                    if (nums1[j] == 0) {
                        ans++;
                        nums2[j]++;
                    } else {
                        ans--;
                        nums2[j]--;
                    }
                    nums1[j] ^= 1;
                }
            } else if (query[0] == 2) {
                int p = query[1];
                for (int j = 0; j < n; j++) {
                    nums2[j] += nums1[j] * p;
                }
            } else {
                res[i] = ans;
            }
        }
        return res;
    }
}

class Solution {
    public int minScore(String s, String t) {
        int n = s.length(), m = t.length();
        int i = 0, j = 0;
        int res = m;
        while (i < n && j < m) {
            if (s.charAt(i) == t.charAt(j)) {
                j++;
                res--;
            }
            i++;
        }
        if (j == m) return res;
        return -1;
    }
}

class Solution {
    public int[][] solve(String s, int[][] queries) {
        int n = s.length();
        int[][] ans = new int[queries.length][2];
        for (int i = 0; i < queries.length; i++) {
            int[] query = queries[i];
            int first = query[0], second = query[1];
            int val = first ^ second;
            int left = -1, right = n;
            int curr = 0, last = -1;
            Map<Integer, Integer> map = new HashMap<>();
            map.put(0, -1);
            for (int j = 0; j < n; j++) {
                curr ^= 1 << (s.charAt(j) - '0');
                map.putIfAbsent(curr, j);
                if (map.containsKey(curr ^ val)) {
                    int idx = map.get(curr ^ val);
                    if (last < idx) {
                        left = idx;
                        right = j;
                        last = idx;
                    }
                }
            }
            ans[i] = new int[]{left, right};
        }
        return ans;
    }
}

class Solution {
    public int countPairs(int[] nums, int lower, int upper) {
        int[] cnt = new int[upper - lower + 1];
        int res = 0;
        for (int num : nums) {
            for (int i = lower; i <= upper; i++) {
                if (i - num >= lower && i - num <= upper) {
                    res += cnt[i - num - lower];
                }
            }
            cnt[num - lower]++;
        }
        return res;
    }
}

class Solution {
    public int getConcatenation(int[] nums) {
        int concatenation = 0;
        while (nums.length > 1) {
            int first = nums[0];
            int last = nums[nums.length - 1];
            int concat = Integer.parseInt(String.valueOf(first) + String.valueOf(last));
            concatenation += concat;
            nums = Arrays.copyOfRange(nums, 1, nums.length - 1);
        }
        if (nums.length == 1) {
            concatenation += nums[0];
        }
        return concatenation;
    }
}

class Solution {
    public int countNicePairs(int[] nums) {
        Map<Integer, Integer> freq = new HashMap<>();
        long ans = 0;
        int mod = (int) 1e9 + 7;
        for (int num : nums) {
            int rev = 0;
            int n = num;
            while (n > 0) {
                int digit = n % 10;
                rev = rev * 10 + digit;
                n /= 10;
            }
            int diff = num-rev;
            ans = (ans + freq.getOrDefault(diff, 0)) % mod;
            freq.put(diff, freq.getOrDefault(diff, 0) + 1);
        }
        return (int) ans;
    }
}

class Solution {
    public int maxScore(int[] nums) {
        int n = nums.length;
        int[] left = new int[n];
        int[] right = new int[n];
        left[0] = nums[0];
        right[n-1] = nums[n-1];
        for(int i=1; i<n; i++) {
            left[i] = gcd(left[i-1], nums[i]);
        }
        for(int i=n-2; i>=0; i--) {
            right[i] = gcd(right[i+1], nums[i]);
        }
        int max = 0;
        for(int i=0; i<n-1; i++) {
            max = Math.max(max, gcd(left[i], right[i+1]));
        }
        return max;
    }
    
    private int gcd(int a, int b) {
        if(b == 0) return a;
        return gcd(b, a%b);
    }
}

class Solution {
    public int maxNumberOfGifts(int[] gifts, int k) {
        PriorityQueue<Integer> pq = new PriorityQueue<>(Comparator.reverseOrder());
        for (int g : gifts) {
            pq.offer(g);
        }
        while (k > 0 && pq.peek() > 0) {
            int top = pq.poll();
            int left = top - (int)Math.floor(Math.sqrt(top));
            pq.offer(left);
            k--;
        }
        int sum = 0;
        while (!pq.isEmpty()) {
            sum += pq.poll();
        }
        return sum;
    }
}

class Solution {
    public int[] countVowelStrings(String[] words, int[][] queries) {
        int[] res = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int l = queries[i][0], r = queries[i][1];
            int count = 0;
            for (int j = l; j <= r; j++) {
                count += countVowels(words[j]);
            }
            res[i] = count;
        }
        return res;
    }

    private int countVowels(String word) {
        int[][] dp = new int[word.length()+1][5];
        for (int i = 0; i < 5; i++) {
            dp[0][i] = 1;
        }
        for (int i = 1; i <= word.length(); i++) {
            for (int j = 0; j < 5; j++) {
                for (int k = 0; k <= j; k++) {
                    dp[i][j] += dp[i-1][k];
                }
            }
        }
        return dp[word.length()][4];
    }
}

class Solution {
    public int minCost(int[] nums, int k) {
        int n = nums.length;
        int[] dp = new int[n];
        for (int i = 1; i < k; i++) {
            int[] ndp = new int[n];
            Arrays.fill(ndp, Integer.MAX_VALUE/2);
            for (int j = i; j < n; j++) {
                int val = nums[j];
                for (int p = i-1; j-p >= i; p++) {
                    val = Math.max(val, nums[p] + dp[j-1-p]);
                }
                ndp[j] = Math.min(ndp[j-1], val);
            }
            dp = ndp;
        }
        return dp[n-1];
    }
}

class Solution {
    public int minimumSwap(int[] basket1, int[] basket2) {
        int n = basket1.length;
        int cnt1 = 0, cnt2 = 0;
        for (int i = 0; i < n; i++) {
            if (basket1[i] != basket2[i]) {
                if (basket1[i] < basket2[i]) cnt1++;
                else cnt2++;
            }
        }
        if ((cnt1 + cnt2) % 2 == 1) return -1;
        int ans = 0, m = (cnt1 + cnt2) / 2;
        ans += cnt1 / 2 + cnt2 / 2;
        cnt1 %= 2;
        cnt2 %= 2;
        if (cnt1 > 0 && cnt2 > 0) ans += 2;
        if (cnt1 > 0 || cnt2 > 0) ans += 2;
        return ans;
    }
}

class Solution {
    public int countQuadruplets(int[] nums) {
        int n = nums.length;
        int count = 0;
        for (int i = 0; i < n - 3; i++) {
            for (int j = i + 1; j < n - 2; j++) {
                for (int k = j + 1; k < n - 1; k++) {
                    for (int l = k + 1; l < n; l++) {
                        if (nums[i] < nums[k] && nums[k] < nums[j] && nums[j] < nums[l]) {
                            count++;
                        }
                    }
                }
            }
        }
        return count;
    }
}

class Solution {
    public int minimumDifference(int[] weights, int k) {
        Arrays.sort(weights);
        int res = Integer.MAX_VALUE;
        for (int i = 0; i <= weights.length - k; i++) {
            int diff = weights[i+k-1] - weights[i];
            res = Math.min(res, diff);
        }
        return res;
    }
}

class Solution {
    public int monkeySimulator(int n) {
        int mod = 1000000007;
        long res = 1;
        for (int i = 2; i <= n; i++) {
            res = (res*i) % mod;
        }
        res = (res*n) % mod;
        res = (res*(n-1)/2) % mod;
        if (n%2 == 0) {
            res = (res+n/2) % mod;
        } else {
            res = (res+(n-1)/2+1) % mod;
        }
        return (int)res;
    }
}

class Solution {
    public int count(int n) {
        int[] count = new int[n + 1];
        int[] nextCount = new int[n + 1];
        int cur = 1;
        count[1] = 1;
        for (int i = 0; i < 109; i++) {
            for (int j = 1; j <= n; j++) {
                if (count[j] == cur) {
                    for (int k = 1; k <= n; k++) {
                        if (j % k == 1) {
                            nextCount[k] = cur + 1;
                        }
                    }
                }
            }
            cur++;
            int[] tmp = count;
            count = nextCount;
            nextCount = tmp;
        }
        int res = 0;
        for (int i = 1; i <= n; i++) {
            if (count[i] > 0) {
                res++;
            }
        }
        return res;
    }
}

class Solution {
    public int maxSumTwoNoOverlap(int[] A, int L, int M) {
        int[] prefixSum = new int[A.length+1];
        for (int i = 0; i < A.length; i++) {
            prefixSum[i+1] = prefixSum[i] + A[i];
        }
        int maxL = 0, maxM = 0, result = 0;
        for (int i = L + M; i <= A.length; i++) {
            maxL = Math.max(maxL, prefixSum[i-M] - prefixSum[i-L-M]);
            maxM = Math.max(maxM, prefixSum[i-L] - prefixSum[i-L-M]);
            result = Math.max(result, Math.max(maxL + prefixSum[i] - prefixSum[i-M], maxM + prefixSum[i] - prefixSum[i-L]));
        }
        return result;
    }
}

class Solution {
    public int minTime(int[] ranks, int cars) {
        int lo = 1, hi = (int)1e9;
        while (lo < hi) {
            int mid = (lo + hi) / 2;
            long total = 0;
            for (int rank : ranks) {
                total += (long)cars / mid / rank;
            }
            if (total >= cars) {
                hi = mid;
            } else {
                lo = mid + 1;
            }
        }
        return lo;
    }
}

class Solution {
    public int maxGreater(int[] nums) {
        int[] count = new int[1000001];
        for (int num : nums) {
            count[num]++;
        }
        int res = 0, sum = 0;
        for (int i = nums.length - 1; i >= 0; i--) {
            sum += count[nums[i] + 1];
            res = Math.max(res, sum);
        }
        return res;
    }
}

class Solution {
    public int maxNumberOfChildren(int money, int children) {
        if (money < children || 8*children < money) {
            return -1;
        }
        if (money == children || 8*children == money) {
            return children/2;
        }
        int rem = money % 8;
        if (rem == 0) {
            return Math.min(children, money/8);
        }
        return Math.min(children, money/8 - 1);
    }
}

class Solution {
    public boolean isToeplitzMatrix(int[][] matrix) {
        int m = matrix.length, n = matrix[0].length;
        for (int i = 0; i < m - 1; i++) {
            for (int j = 0; j < n - 1; j++) {
                if (matrix[i][j] != matrix[i+1][j+1]) {
                    return false;
                }
            }
        }
        return true;
    }
}

class Solution {
    public int maxMEX(int[] nums, int value) {
        Arrays.sort(nums);
        int mex = 0;
        for (int num : nums) {
            if (num >= mex) {
                if (num == mex) mex++;
                else break;
            }
        }
        int ans = mex;
        if (value == 0) return ans;
        for (int num : nums) {
            if (num < 0 && num + value >= 0) continue;
            int diff = num - mex;
            int k = Math.abs(diff / value) + (diff % value == 0 ? 0 : 1);
            ans = Math.max(ans, mex + k);
        }
        ans = Math.max(ans, mex + Math.abs(nums[nums.length-1] - mex + value) / value);
        return ans;
    }
}

class Solution {
    public int[] countBits(int n) {
        int even = 0, odd = 0;
        while (n > 0) {
            if ((n & 1) == 1) {
                odd++;
            }
            n >>= 1;
            if ((n & 1) == 1) {
                even++;
            }
            n >>= 1;
        }
        return new int[]{even, odd};
    }
}

class Solution {
    public int minTime(int[][] tasks) {
        Arrays.sort(tasks, (a, b) -> a[1]-b[1]);
        int time = 0, prevEnd = -1;
        for (int[] task : tasks) {
            if (prevEnd < task[0]) {
                time += task[1] - task[0];
                prevEnd = task[1];
            } else {
                time += task[1] - prevEnd;
                prevEnd = task[1];
            }
        }
        return time;
    }
}

class Solution {
    public int countSubIslands(int[][] grid1, int[][] grid2) {
        int m = grid1.length, n = grid1[0].length;
        boolean[][] visited = new boolean[m][n];
        int count = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid2[i][j] == 1 && !visited[i][j]) {
                    if (dfs(grid1, grid2, visited, i, j)) {
                        count++;
                    }
                }
            }
        }
        return count;
    }
    
    private boolean dfs(int[][] grid1, int[][] grid2, boolean[][] visited, int i, int j) {
        int m = grid1.length, n = grid1[0].length;
        if (i < 0 || i >= m || j < 0 || j >= n || visited[i][j] || grid2[i][j] == 0) {
            return true;
        }
        visited[i][j] = true;
        boolean res = true;
        if (grid1[i][j] != grid2[i][j]) {
            res = false;
        }
        res &= dfs(grid1, grid2, visited, i+1, j);
        res &= dfs(grid1, grid2, visited, i-1, j);
        res &= dfs(grid1, grid2, visited, i, j+1);
        res &= dfs(grid1, grid2, visited, i, j-1);
        return res;
    }
}

class Solution {
    public int maxPrefixScore(int[] nums) {
        Arrays.sort(nums);
        int score = 0;
        int sum = 0;
        for (int num : nums) {
            sum += num;
            if (sum > 0) {
                score++;
            }
        }
        return score;
    }
}

class Solution {
    public int countVowelStrings(String[] words, int left, int right) {
        int[][] dp = new int[right+2][6];
        for (int i = 1; i <= 5; i++) {
            dp[1][i] = 1;
        }
        for (int i = 2; i <= right+1; i++) {
            for (int j = 1; j <= 5; j++) {
                dp[i][j] = dp[i][j-1] + dp[i-1][j];
            }
        }
        int ans = 0;
        for (int i = left+1; i <= right+1; i++) {
            ans += dp[i][5];
        }
        return ans;
    }
}

class Solution {
    public int check(int ro, int[][] edges, int[][]g, int k, int n) {
        int [] p = new int[n];
        Arrays.fill(p, -1);
        int cnt = 0;
        for(int i = 0;i < k;i++) {
            int u = g[i][0],v = g[i][1];
            if(p[v] == -1) {
                p[v] = u;
                cnt++;
            }
            else {
                int pv = p[v];
                if(pv != u) {
                    continue;
                }
                cnt--;
            }
        }
        if(cnt < k) {
            return 0;
        }
        boolean vis[] = new boolean[n];
        int sum = 0;
        vis[ro] = true;
        for(int i = 0;i < n-1;i++) {
            int u = edges[i][0],v = edges[i][1];
            if(vis[v]){
                u = u^v;
                v = u^v;
                u = u^v;
            }
            int p1 = p[u],p2 = p[v];
            if(p[v] == -1) {
                p[v] = u;
                sum++;
            }
            else if(p2 == u) {
                continue;
            }
            else {
                if(vis[p2]) {
                    return 0;
                }
                sum--;
                p[roots(edges,p,p2,vis)] = p[u];
            }
        }
        if(sum != k) {
            return 0;
        }
        return 1;
    }
    int roots(int[][]e, int [] p, int u, boolean []vis) {
        if(vis[u]) {
            return -1;
        }
        vis[u] = true;
        if(p[u] == -1) {
            return u;
        }
        int v = roots(e,p,p[u],vis);
        p[u] = v==-1?p[u]:v;
        return p[u];
    }
    public int getRoot(int[][] edges, int[][] guesses, int k) {
        int n = edges.length+1;
        Arrays.sort(guesses, (a,b)->p[n-1+a[0]-a[1]]-p[n-1+b[0]-b[1]]);
        p = new int[2*n+10];
        Arrays.fill(p, -1);
        for(int i = 0;i < n-1;i++) {
            int u = edges[i][0],v = edges[i][1];
            if(p[u] > p[v]) {
                u ^= v;
                v ^= u;
                u ^= v;
            }
            p[n-1+v-u] = u;
        }
        for(int i = 0;i < k;i++) {
            int u = guesses[i][0],v = guesses[i][1];
            if(p[n-1+u-v] > 0) {
                int tmp = u;
                u = v;
                v = tmp;
            }
            p[n-1+u-v] = -p[n-1+u-v]-1;
        }
        for(int i = 0;i < n-1;i++) {
            int u = edges[i][0],v = edges[i][1];
            if(p[n-1+u-v] > 0) {
                int tmp = u;
                u = v;
                v = tmp;
            }
            p[n-1+u-v] = -p[n-1+u-v]-1;
        }
        return roots(edges,p,0,new boolean[n]);
    }
    int p[];
    public int[] countRoots(int[][] edges, int[][] guesses, int k) {
        int n = edges.length+1; 
        int []ans = new int[n];
        int root = getRoot(edges,guesses,k);
        if(root == -1) {
            return new int[]{0};
        }
        ans[root] = check(root,edges,guesses,k,n);
        return ans;
    }
}

class Solution {
    public static final int MOD = 1000000007;
    public int splitArray(int[][] ranges) {
        int n = ranges.length;
        int[] left = new int[n];
        int[] right = new int[n];
        for (int i = 0; i < n; i++) {
            left[i] = ranges[i][0];
            right[i] = ranges[i][1];
        }
        Arrays.sort(left);
        Arrays.sort(right);
        long res = (long)n * (n-1) / 2;
        int cnt = 0;
        for (int i = 0, j = 0; i < n; i++) {
            while (j < n && left[j] <= right[i]) {
                cnt++;
                j++;
            }
            res -= (long)cnt * (cnt-1) / 2;
            cnt--;
        }
        return (int)(res % MOD);
    }
}

class Solution {
    public int splitIntoFibonacci(String num) {
        List<Integer> res = new ArrayList<>();
        backtracking(num, res, 0);
        if (res.size() < 3) return new ArrayList<Integer>();
        int[] ans = new int[res.size()];
        for (int i = 0; i < res.size(); i++) {
            ans[i] = res.get(i);
        }
        return ans;
    }
    
    private boolean backtracking(String num, List<Integer> res, int start) {
        if (start == num.length() && res.size() >= 3) return true;
        for (int i = start; i < num.length(); i++) {
            if (i > start && num.charAt(start) == '0') break;
            long curr = Long.parseLong(num.substring(start, i + 1));
            if (curr > Integer.MAX_VALUE) break;
            int size = res.size();
            if (size >= 2 && curr > res.get(size - 1) + res.get(size - 2)) break;
            if (size <= 1 || curr == res.get(size - 1) + res.get(size - 2)) {
                res.add((int)curr);
                if (backtracking(num, res, i + 1)) return true;
                res.remove(res.size() - 1);
            }
        }
        return false;
    }
}

