class Solution {
    private static final int MOD = 1000000007;
    public int numWays(int target, int[][] types) {
        int n = types.length;
        int[][] dp = new int[n+1][target+1];
        dp[0][0] = 1;
        for (int i = 1; i <= n; i++) {
            int count = types[i-1][0];
            int mark = types[i-1][1];
            for (int j = 0; j <= target; j++) {
                for (int k = 0; k <= count && k*mark <= j; k++) {
                    dp[i][j] = (dp[i][j] + dp[i-1][j-k*mark]) % MOD;
                }
            }
        }
        return dp[n][target];
    }
}

class Solution {
    public int splitArray(int[] nums) {
        int n = nums.length;
        int[] prefixProd = new int[n];
        int[] suffixProd = new int[n];
        int gcdVal = nums[0];

        prefixProd[0] = nums[0];
        suffixProd[n-1] = nums[n-1];

        for (int i = 1; i < n; i++) {
            gcdVal = gcd(gcdVal, nums[i]);
            prefixProd[i] = gcdVal;
        }

        gcdVal = nums[n-1];
        for (int i = n-2; i >= 0; i--) {
            gcdVal = gcd(gcdVal, nums[i]);
            suffixProd[i] = gcdVal;
        }

        for (int i = 0; i <= n-2; i++) {
            if (gcd(prefixProd[i], suffixProd[i+1]) == 1) {
                return i;
            }
        }
        return -1;
    }

    private int gcd(int a, int b) {
        return b == 0 ? a : gcd(b, a%b);
    }
}

class Solution {
    public int kthLargestLevelSum(TreeNode root, int k) {
        Map<Integer, Integer> map = new HashMap<>();
        helper(root, map, 0);
        PriorityQueue<Integer> pq = new PriorityQueue<>(Collections.reverseOrder());
        for (int sum : map.values()) {
            pq.offer(sum);
        }
        for (int i = 1; i < k; i++) {
            pq.poll();
        }
        return pq.isEmpty() ? -1 : pq.peek();
    }
    
    private void helper(TreeNode node, Map<Integer, Integer> map, int level) {
        if (node == null) return;
        map.put(level, map.getOrDefault(level, 0) + node.val);
        helper(node.left, map, level + 1);
        helper(node.right, map, level + 1);
    }
}

class Solution {
