        int idx = 0;
        while (list.size() > 1) {
            idx = (idx + k - 1) % list.size();
            list.remove(idx);
        }
        return list.get(0);
    }
}

class Solution {
    public int minTime(int n, int k, int[][] time) {
        PriorityQueue<int[]> right = new PriorityQueue<>((a, b) -> a[1] - b[1]);
        PriorityQueue<int[]> left = new PriorityQueue<>((a, b) -> a[1] - b[1]);
        PriorityQueue<int[]> bridge = new PriorityQueue<>((a, b) -> a[0] - b[0]);
        for (int i = 0; i < k; i++) {
            right.offer(new int[]{i, time[i][0]});
        }
        int t = 0;
        int[] workerAtSide = new int[2];
        while (n > 0) {
            while (!bridge.isEmpty() && bridge.peek()[0] <= t) {
                int[] w = bridge.poll();
                int id = w[1];
                if (w[2] == 2) {
                    n--;
                } else if (right.isEmpty() && left.size() == 1 && workerAtSide[0] == id) {
                    int[] l = left.poll();
                    l[1] += time[l[2]][1];
                    bridge.offer(new int[]{t + time[l[2]][1], l[0], 1});
                } else if (left.isEmpty()) {
                    workerAtSide[1 - w[2]] = -1;
                } else {
                    int[] l = left.poll();
                    l[1] += time[l[2]][1] + time[l[2]][2];
                    bridge.offer(new int[]{t + time[l[2]][1] + time[l[2]][2], l[0], 1});
                }
            }
            if (n == 0) {
                break;
            }
            if (!right.isEmpty() && workerAtSide[0] == -1) {
                int[] r = right.poll();
                r[1] += time[r[0]][1];
                bridge.offer(new int[]{t + time[r[0]][1], r[0], 0});
                workerAtSide[0] = r[0];
            } else if (!left.isEmpty() && workerAtSide[1] == -1) {
                int[] l = left.poll();
                l[1] += time[l[2]][1] + time[l[2]][2];
                bridge.offer(new int[]{t + time[l[2]][1] + time[l[2]][2], l[0], 1});
                workerAtSide[1] = l[0];
            }
            t = bridge.peek()[0];
            while (!right.isEmpty() && right.peek()[1] <= t) {
                int[] r = right.poll();
                left.offer(new int[]{r[0], t, time[r[0]][3]});
                workerAtSide[0] = -1;
            }
        }
        return t;
    }
}

class Solution {
    public boolean findWhetherExistsPath(int n, int[][] graph, int start, int target) {
        boolean[] visited = new boolean[n];
        List<Integer>[] adjList = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            adjList[i] = new ArrayList<>();
        }
        for (int[] edge : graph) {
            adjList[edge[0]].add(edge[1]);
        }
        return dfs(adjList, visited, start, target);
    }
    
    private boolean dfs(List<Integer>[] adjList, boolean[] visited, int curr, int target) {
        if (visited[curr]) {
            return false;
        }
        visited[curr] = true;
        if (curr == target) {
            return true;
        }
        for (int neighbor : adjList[curr]) {
            if (dfs(adjList, visited, neighbor, target)) {
                return true;
            }
        }
        return false;
    }
}

