class Solution {
    public int maxSum(int[] nums1, int[] nums2, int k) {
        int n = nums1.length;
        long[] pre1 = new long[n], pre2 = new long[n];
        pre1[0] = nums1[0];
        pre2[0] = nums2[0];
        for (int i=1; i<n; i++) {
            pre1[i] = pre1[i-1] + nums1[i];
            pre2[i] = pre2[i-1] + nums2[i];
        }
        long ans = 0;
        for (int i=k-1; i<n; i++) {
            long score = calc(pre1, pre2, i, k);
            ans = Math.max(ans, score);
        }
        return (int)(ans % ((long)(1e9+7)));
    }
    
    private long calc(long[] pre1, long[] pre2, int end, int k) {
        long score = (pre1[end] - (end>=k ? pre1[end-k] : 0)) * pre2[end];
        for (int i=Math.max(0, end-k); i<=end && i+k-1<pre1.length-1; i++) {
            long tmp1 = pre1[end] - (end-i+1>=k ? pre1[end-k+1] : pre1[i-1]);
            long tmp2 = pre2[end] - (end-i+1>=k ? pre2[end-k+1] : pre2[i-1]);
            score = Math.max(score, tmp1 * tmp2);
        }
        return score;
    }
}

class Solution {
    public boolean reachingPoints(int sx, int sy, int tx, int ty) {
        while (tx >= sx && ty >= sy) {
            if (tx == ty) break;
            if (tx > ty) {
                if (ty > sy) tx %= ty;
                else return (tx - sx) % ty == 0;
            }
            else {
                if (tx > sx) ty %= tx;
                else return (ty - sy) % tx == 0;
            }
        }
        return (tx == sx && ty == sy);
    }
}

