class Solution {
    public int minCost(int[] nums, int k) {
        int n = nums.length;
        int[] freq = new int[n+1];
        for (int i=0;i<n;i++) {
            freq[nums[i]]++;
        }
        TreeMap<Integer,Integer> pq = new TreeMap<>();
        for (int i=1;i<=n;i++) {
            int val = k+1;
            if (freq[i]>0) {
                val += freq[i];
                int rem = freq[i] - freq[i]/2;
                pq.put(val, pq.getOrDefault(val,0)+rem);
            }
        }
        int ans = Integer.MAX_VALUE;
        int sum = 0;
        while (pq.size()>0) {
            int key = pq.lastKey();
            int val = pq.get(key);
            pq.remove(key);
            while (val>0) {
                sum += key;
                val--;
                if (pq.containsKey(key-1)) {
                    pq.put(key-1, pq.get(key-1)+1);
                } else {
                    pq.put(key-1,1);
                }
            }
            ans = Math.min(ans, sum);
        }
        return ans;
    }
}

class Solution {
