class Solution {
    public int minimumDeviation(int[] nums) {
        TreeSet<Integer> set = new TreeSet<>();
        for (int num : nums) {
            if (num % 2 == 0)
                set.add(num);
            else
                set.add(num * 2);
        }
        int minDiff = Integer.MAX_VALUE;
        while (true) {
            int max = set.last();
            int min = set.first();
            minDiff = Math.min(minDiff, max - min);
            if (max % 2 == 1)
                break;
            set.remove(max);
            set.add(max / 2);
        }
        return minDiff;
    }
}

class Solution {
    int maxDiff;
    int[] dp;
    int[] sz;
    List<List<Integer>> graph;
    
    public int maxPriceDifference(int n, int[][] edges, int[] price) {
        maxDiff = 0;
        dp = new int[n];
        sz = new int[n];
        graph = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            graph.add(new ArrayList<>());
            dp[i] = price[i];
        }
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1];
            graph.get(u).add(v);
            graph.get(v).add(u);
        }
        dfs(0, -1);
        return maxDiff;
    }
    
    private void dfs(int u, int p) {
        sz[u] = 1;
        int maxSubtree = 0;
        for (int v : graph.get(u)) {
            if (v == p) continue;
            dfs(v, u);
            sz[u] += sz[v];
            dp[u] += dp[v];
            maxSubtree = Math.max(maxSubtree, sz[v]);
        }
        maxSubtree = Math.max(maxSubtree, sz.length - sz[u]);
        maxDiff = Math.max(maxDiff, dp[u] - (dp.length - dp[u]));
    }
}

class Solution {
    public int numberOfSubarrays(int[] nums, int k) {
        int n = nums.length;
        int[] counts = new int[n+1];
        int oddCount = 0;
        int result = 0;
        counts[0] = 1;
        for (int i = 0; i < n; i++) {
            oddCount += nums[i] % 2 == 1 ? 1 : 0;
            if (oddCount >= k) {
                result += counts[oddCount - k];
            }
            counts[oddCount]++;
        }
        return result;
    }
}

