class DataStream {
    Deque<Integer> deque;
    int value;
    int k;
    public DataStream(int value, int k) {
        deque = new LinkedList<>();
        this.value = value;
        this.k = k;
    }
    public boolean consec(int num) {
        deque.offerLast(num);
        if (deque.size() < k) return false;
        if (deque.size() > k) deque.pollFirst();
        return deque.stream().allMatch(n -> n == value);
    }
}

