class Solution {
    public int maxMinPower(int[] stations, int r, int k) {
        int n = stations.length;
        int[] preSum = new int[n+1];
        for (int i = 1; i <= n; i++) {
            preSum[i] = preSum[i-1] + stations[i-1];
        }
        int l = 0, h = preSum[n];
        while (l < h) {
            int mid = (l + h + 1) / 2;
            if (check(preSum, mid, r, k)) {
                l = mid;
            } else {
                h = mid-1;
            }
        }
        return l;
    }

    private boolean check(int[] preSum, int minPower, int r, int k) {
        int n = preSum.length - 1;
        int cnt = 0;
        int left = 0, right = 2 * r + 1;
        if (preSum[right] - preSum[0] < minPower) {
            cnt++;
            if (cnt > k) {
                return false;
            }
        }
        while (right <= n) {
            if (preSum[right] - preSum[left] < minPower) {
                cnt++;
                if (cnt > k) {
                    return false;
                }
                left++;
                right = left + 2 * r + 1;
            } else {
                left++;
                right = left + 2 * r + 1;
            }
        }
        return true;
    }
}

class Solution {
    public int maxSum(int[] nums, int k) {
        int sum = 0;
        PriorityQueue<Integer> pq = new PriorityQueue<>(Collections.reverseOrder());
        for (int num: nums) {
            sum += num;
            pq.offer(num);
        }
        for (int i = 0; i < k; i++) {
            int currMax = pq.poll();
            sum -= currMax;
            int newNum = (int) Math.ceil(currMax / 3.0);
            sum += newNum;
            pq.offer(newNum);
        }
        return sum;
    }
}

