class Solution {
    public int getMaxLen(int[] nums) {
        int maxLen = 0;
        int posCount = 0, negCount = 0;
        for (int num : nums) {
            if (num == 0) {
                posCount = 0;
                negCount = 0;
            } else if (num > 0) {
                posCount++;
                negCount = negCount > 0 ? negCount + 1 : 0;
            } else {
                int temp = posCount;
                posCount = negCount > 0 ? negCount + 1 : 0;
                negCount = temp + 1;
            }
            maxLen = Math.max(maxLen, posCount);
        }
        return maxLen;
    }
}

class Solution {
    public int[] closestPrimeNumbers(int left, int right) {
        int[] ans = new int[2];
        int minDiff = Integer.MAX_VALUE;
        int prev = -1;
        for (int i = left; i <= right; i++) {
            if (isPrime(i)) {
                if (prev != -1 && i - prev < minDiff) {
                    minDiff = i - prev;
                    ans[0] = prev;
                    ans[1] = i;
                }
                prev = i;
            }
        }
        return (ans[0] == 0 && ans[1] == 0) ? new int[]{-1, -1} : ans;
    }
    
    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        for (int i = 2; i <= Math.sqrt(n); i++) {
            if (n % i == 0) {
                return false;
            }
        }
        return true;
    }
}

class Solution {
    public int distinctPrimeFactors(int[] nums) {
        int mod = (int)1e9 + 7;
        int[] count = new int[1001];
        for (int num : nums) {
            for (int i = 2; i <= num; i++) {
                while (num % i == 0) {
                    count[i]++;
                    num /= i;
                }
            }
        }
        int ans = 0;
        for (int i = 2; i <= 1000; i++) {
            if (count[i] > 0) {
                ans++;
            }
        }
        return ans;
    }
}

class Solution {
    public int count(int num) {
        int count = 0;
        int n = num;
        while (n != 0) {
            int digit = n % 10;
            if (digit != 0 && num % digit == 0) {
                count++;
            }
            n /= 10;
        }
        return count;
    }
}

class Solution {
    public int[][] difference(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;
        int[] onesRow = new int[m];
        int[] onesCol = new int[n];
        int[] zerosRow = new int[m];
        int[] zerosCol = new int[n];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    onesRow[i]++;
                    onesCol[j]++;
                } else {
                    zerosRow[i]++;
                    zerosCol[j]++;
                }
            }
        }
        int[][] diff = new int[m][n];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                diff[i][j] = onesRow[i] + onesCol[j] - zerosRow[i] - zerosCol[j];
            }
        }
        return diff;
    }
}

class Solution {
    public int numSplits(String s) {
        int[] leftCount = new int[26];
        int[] rightCount = new int[26];
        int leftDistinct = 0, rightDistinct = 0;
        int count = 0;
        for (char c : s.toCharArray()) {
            if (rightCount[c - 'a'] == 0) {
                rightDistinct++;
            }
            rightCount[c - 'a']++;
        }
        for (char c : s.toCharArray()) {
            if (leftCount[c - 'a'] == 0) {
                leftDistinct++;
            }
            leftCount[c - 'a']++;
            rightCount[c - 'a']--;
            if (rightCount[c - 'a'] == 0) {
                rightDistinct--;
            }
            if (leftDistinct == rightDistinct) {
                count++;
            } else if (leftDistinct > rightDistinct) {
                break;
            }
        }
        return count;
    }
}

class Solution {
    public int minOperations(int[] nums1, int[] nums2, int k) {
        int[] freq1 = new int[6];
        int[] freq2 = new int[6];
        int sum1 = 0;
        int sum2 = 0;
        for (int num : nums1) {
            freq1[num - 1]++;
            sum1 += num;
        }
        for (int num : nums2) {
            freq2[num - 1]++;
            sum2 += num;
        }
        if (sum1 == sum2) {
            return 0;
        }
        if (sum1 > sum2) {
            return minOperations(nums2, nums1, k);
        }
        int minOps = 0;
        int diff = sum2 - sum1;
        for (int i = 0; i < 5 && diff > 0; i++) {
            int diffFreq = freq2[i] + freq1[5 - i - 1];
            int ops = Math.min(diff, (diffFreq + k - 1) / k);
            minOps += ops;
            diff -= ops * k;
        }
        return diff > 0 ? -1 : minOps;
    }
}

class Solution {
    public int[] topKstudents(String[] positive_feedback, String[] negative_feedback, String[] report, int[] student_id, int k) {
        HashMap<String, Boolean> posWords = new HashMap<>();
        HashMap<String, Boolean> negWords = new HashMap<>();
        for (String word : positive_feedback) {
            posWords.put(word, true);
        }
        for (String word : negative_feedback) {
            negWords.put(word, true);
        }
        HashMap<Integer, Integer> scores = new HashMap<>();
        for (int i = 0; i < report.length; i++) {
            String[] words = report[i].split(" ");
            int id = student_id[i];
            int score = 0;
            for (String word : words) {
                if (posWords.containsKey(word)) {
                    score += 3;
                } else if (negWords.containsKey(word)) {
                    score -= 1;
                }
            }
            scores.put(id, scores.getOrDefault(id, 0) + score);
        }
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[1] == b[1] ? a[0] - b[0] : b[1] - a[1]);
        for (Map.Entry<Integer, Integer> entry : scores.entrySet()) {
            pq.offer(new int[]{entry.getKey(), entry.getValue()});
        }
        int[] res = new int[k];
        for (int i = 0; i < k; i++) {
            res[i] = pq.poll()[0];
        }
        return res;
    }
}

class Solution {
    public int getMaximum(int[] forts) {
        int n = forts.length, ans = 0;
        for (int i = 0; i < n; i++) {
            if (forts[i] == 1) {
                for (int j = i + 1, k = i + 1; j < n && forts[j] != 1; j++) {
                    if (forts[j] == 0) ans++;
                    k = j;
                }
                for (int j = i - 1, k = i - 1; j >= 0 && forts[j] != 1; j--) {
                    if (forts[j] == 0) ans++;
                    k = j;
                }
                i = Math.max(i, k);
            }
        }
        return ans;
    }
}

class Solution {
    private static final int MOD = 1000000007;
    public int numberOfGreatPartitions(int[] nums, int k) {
        int n = nums.length;
        long sum = 0;
        for (int num : nums) {
            sum += num;
        }
        if (sum < k * 2) {
            return 0;
        }
        long[] preSum = new long[n + 1];
        for (int i = 0; i < n; i++) {
            preSum[i + 1] = preSum[i] + nums[i];
        }
        long res = 0;
        for (int i = 1; i < n; i++) {
            if (preSum[i] >= k) {
                res = (res + count(preSum, k * 2 - preSum[i], i + 1, n)) % MOD;
            }
        }
        return (int) res;
    }

    private long count(long[] preSum, long target, int start, int end) {
        int l = start, r = end;
        while (l < r) {
            int mid = l + r >> 1;
            if (preSum[mid] < target) {
                l = mid + 1;
            } else {
                r = mid;
            }
        }
        int i = l - 1, j = end;
        long cnt = 0;
        while (i >= start && j > l) {
            if (preSum[i] + preSum[j] >= target) {
                cnt += j - l + 1;
                i--;
            } else {
                j--;
            }
        }
        return cnt;
    }
}

class Solution {
    public int maxTastiness(int[] price, int k) {
        Arrays.sort(price);
        int n = price.length, ans = 0;
        for (int i = k-1; i < n; i++) {
            ans = Math.max(ans, price[i] - price[i-k+1]);
        }
        return ans;
    }
}

class Solution {
    public int minNumberOfFrogs(String croakOfFrogs) {
        int[] count = new int[5];
        int ans = 0;
        for (char c : croakOfFrogs.toCharArray()) {
            if (c == 'c') {
                count[0]++;
            } else if (c == 'r') {
                if (count[0] <= count[1]) {
                    return -1;
                }
                count[1]++;
            } else if (c == 'o') {
                if (count[1] <= count[2]) {
                    return -1;
                }
                count[2]++;
            } else if (c == 'a') {
                if (count[2] <= count[3]) {
                    return -1;
                }
                count[3]++;
            } else if (c == 'k') {
                if (count[3] <= count[4]) {
                    return -1;
                }
                count[4]++;
                for (int i = 0; i < 5; i++) {
                    count[i]--;
                }
            }
            ans = Math.max(ans, count[0]);
        }
        return count[0] == count[1] && count[1] == count[2]
            && count[2] == count[3] && count[3] == count[4] ? ans : -1;
    }
}

class Solution {
    public int shortestDistance(String[] words, String target, int startIndex) {
        int n = words.length;
        int minDist = Integer.MAX_VALUE;
        for (int i = 0; i < n; i++) {
            if (words[i].equals(target)) {
                int dist = Math.min(Math.abs(i - startIndex), n - Math.abs(i - startIndex));
                minDist = Math.min(minDist, dist);
            }
        }
        return minDist == Integer.MAX_VALUE ? -1 : minDist;
    }
}

class Solution {
    public int[] cycleLengthQueries(int n, int[][] queries) {
        int[] ans = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int u = queries[i][0], v = queries[i][1];
            int lca = getLCA(u, v, 1, (1 << n) - 1, 1);
            int len1 = getDist(u, lca, 1, (1 << n) - 1, 1);
            int len2 = getDist(v, lca, 1, (1 << n) - 1, 1);
            int res = len1 + len2;
            if (res % 2 == 0) res /= 2;
            else if (isAncestor((res + 1) / 2, u, 1, (1 << n) - 1, 1) || isAncestor((res + 1) / 2, v, 1, (1 << n) - 1, 1)) res = (res + 1) / 2 + 1;
            else res = (res + 1) / 2;
            ans[i] = res;
        }
        return ans;
    }

    private int getLCA(int x, int y, int l, int r, int rt) {
        if (x == l && y == r) return rt;
        int mid = l + r >> 1;
        if (y <= mid) return getLCA(x, y, l, mid, rt << 1);
        if (x >= mid + 1) return getLCA(x, y, mid + 1, r, rt << 1 | 1);
        int lch = getLCA(x, mid, l, mid, rt << 1);
        int rch = getLCA(mid + 1, y, mid + 1, r, rt << 1 | 1);
        return lch == rch ? lch : rt;
    }

    private int getDist(int x, int y, int l, int r, int rt) {
        if (l == r) return 0;
        int mid = l + r >> 1;
        if (x <= mid) {
            if (y <= mid) return getDist(x, y, l, mid, rt << 1);
            else return getDist(x, mid, l, mid, rt << 1) + getDist(mid + 1, y, mid + 1, r, rt << 1 | 1) + 1;
        } else {
            if (y <= mid) return getDist(mid + 1, y, mid + 1, r, rt << 1 | 1) + getDist(x, mid, l, mid, rt << 1) + 1;
            else return getDist(x, y, mid + 1, r, rt << 1 | 1);
        }
    }

    private boolean isAncestor(int x, int y, int l, int r, int rt) {
        if (x == y) return true;
        int mid = l + r >> 1;
        if (x <= mid) {
            if (y <= mid) return isAncestor(x, y, l, mid, rt << 1);
            else return isAncestor(x, mid, l, mid, rt << 1) || isAncestor(mid + 1, y, mid + 1, r, rt << 1 | 1);
        } else {
            if (y <= mid) return false;
            else return isAncestor(x, y, mid + 1, r, rt << 1 | 1);
        }
    }
}

class Solution {
    public boolean validateEvenDegrees(int n, int[][] edges) {
        int[] degree = new int[n+1];
        for(int[] edge : edges) {
            degree[edge[0]]++;
            degree[edge[1]]++;
        }
        int oddCount = 0;
        for(int d : degree) {
            if(d % 2 != 0) {
                oddCount++;
            }
        }
        if(oddCount == 0 || oddCount == 2) {
            return true;
        }
        return false;
    }
}

class Solution {
    public int getFactorsSum(int n) {
        int sum = 0;
        for (int i = 2; i <= n; i++) {
            while (n % i == 0) {
                sum += i;
                n /= i;
            }
        }
        return sum;
    }
    
    public int getMinimumValue(int n) {
        int slow = n, fast = n;
        do {
            slow = getFactorsSum(slow);
            fast = getFactorsSum(getFactorsSum(fast));
        } while (slow != fast);
        
        int smallest = Integer.MAX_VALUE;
        int curr = n;
        do {
            smallest = Math.min(smallest, curr);
            curr = getFactorsSum(curr);
        } while (curr != slow);
        return smallest;
    }
}

class Solution {
    public int numSimilarGroups(String[] words) {
        int n = words.length;
        int res = n;
        int[] parent = new int[n];
        for (int i = 0; i < n; i++) {
            parent[i] = i;
        }
        for (int i = 0; i < n - 1; i++) {
            for (int j = i + 1; j < n; j++) {
                if (isSimilar(words[i], words[j])) {
                    int parent1 = find(parent, i);
                    int parent2 = find(parent, j);
                    if (parent1 != parent2) {
                        parent[parent2] = parent1;
                        res--;
                    }
                }
            }
        }
        return res;
    }
    
    private boolean isSimilar(String s1, String s2) {
        int n = s1.length();
        int count = 0;
        for (int i = 0; i < n; i++) {
            if (s1.charAt(i) != s2.charAt(i)) {
                count++;
                if (count > 2) {
                    return false;
                }
            }
        }
        return true;
    }
    
    private int find(int[] parent, int x) {
        if (parent[x] != x) {
            parent[x] = find(parent, parent[x]);
        }
        return parent[x];
    }
}

class Solution {
    public int minimumSwap(int[] nums1, int[] nums2) {
        int n = nums1.length;
        int[] dp1 = new int[n];
        int[] dp2 = new int[n];
        Arrays.fill(dp1, n+1);
        Arrays.fill(dp2, n+1);
        dp1[0] = 0;
        dp2[0] = 1;
        for (int i = 1; i < n; i++) {
            if (nums1[i] > nums1[i-1] && nums2[i] > nums2[i-1]) {
                dp1[i] = Math.min(dp1[i], dp1[i-1]);
                dp2[i] = Math.min(dp2[i], dp2[i-1]+1);
            }
            if (nums1[i] > nums2[i-1] && nums2[i] > nums1[i-1]) {
                dp1[i] = Math.min(dp1[i], dp2[i-1]);
                dp2[i] = Math.min(dp2[i], dp1[i-1]+1);
            }
        }
        if (dp1[n-1] <= n && dp2[n-1] <= n) {
            return Math.min(dp1[n-1], dp2[n-1]);
        } else {
            return -1;
        }
    }
}

class Solution {
    public int minCost(int[] stones) {
        int n = stones.length;
        int[][] dp = new int[n][n];
        for (int i = 0; i < n; i++) {
            Arrays.fill(dp[i], Integer.MAX_VALUE);
        }
        dp[0][0] = 0;
        for (int i = 1; i < n; i++) {
            for (int j = 0; j < i; j++) {
                int k = stones[i] - stones[j];
                if (k <= i) {
                    dp[i][k] = Math.min(dp[i][k], dp[j][k]);
                    if (k > 1) {
                        dp[i][k] = Math.min(dp[i][k], dp[j][k - 1]);
                    }
                    if (k + 1 < n) {
                        dp[i][k] = Math.min(dp[i][k], dp[j][k + 1]);
                    }
                    dp[i][k]++;
                }
            }
        }
        int ans = Integer.MAX_VALUE;
        for (int i = 1; i < n; i++) {
            ans = Math.min(ans, dp[n - 1][i]);
        }
        return ans;
    }
}

class Solution {
    public int maxWeight(int[] vals, int[][] edges, int k) {
        int n = vals.length;
        int[] degree = new int[n];
        int[][] adjList = new int[n][];
        int idx = 0;
        for (int[] edge : edges) {
            degree[edge[0]]++;
            degree[edge[1]]++;
        }
        for (int i = 0; i < n; i++) {
            adjList[i] = new int[degree[i]];
        }
        Arrays.fill(degree, 0);
        for (int[] edge : edges) {
            adjList[edge[0]][degree[edge[0]]++] = edge[1];
            adjList[edge[1]][degree[edge[1]]++] = edge[0];
        }
        int ans = Integer.MIN_VALUE;
        for (int i = 0; i < n; i++) {
            if (degree[i] < k) {
                ans = Math.max(ans, vals[i]);
                continue;
            }
            int sum = vals[i];
            for (int j : adjList[i]) {
                sum += vals[j];
            }
            PriorityQueue<Integer> pq = new PriorityQueue<>();
            for (int j : adjList[i]) {
                pq.offer(degree[j] - 1);
            }
            while (pq.size() > k - 1) {
                sum -= vals[adjList[i][pq.poll()]];
            }
            ans = Math.max(ans, sum);
        }
        return ans;
    }
}

class Solution {
    public int maxValue(String[] strs) {
        int max = 0;
        for (String str : strs) {
            int cur;
            try {
                cur = Integer.parseInt(str);
            } catch (NumberFormatException e) {
                cur = str.length();
            }
            max = Math.max(max, cur);
        }
        return max;
    }
}

class Solution {
    public int[] maxPoints(int[][] grid, int[] queries) {
        int m = grid.length, n = grid[0].length;
        int[][] pre = new int[m+1][n+1];
        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                pre[i][j] = Math.max(Math.max(pre[i-1][j], pre[i][j-1]), grid[i-1][j-1]);
            }
        }
        int[] res = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int q = queries[i], ans = 0;
            for (int r = q; r <= m; r++) {
                for (int c = q; c <= n; c++) {
                    int max = pre[r][c] - Math.max(Math.max(pre[r-q][c], pre[r][c-q]), pre[r-q][c-q]);
                    if (max < q) continue;
                    ans += 1;
                    for (int[] d : new int[][]{{1,0},{-1,0},{0,1},{0,-1}}) {
                        int nr = r + d[0], nc = c + d[1];
                        if (nr >= q && nc >= q && pre[nr][nc] - pre[nr-q][nc-q] >= q) ans += 1;
                    }
                }
            }
            res[i] = ans;
        }
        return res;
    }
}

class Allocator {
    int[] memory;
    Map<Integer, List<int[]>> blocks;

    public Allocator(int n) {
        memory = new int[n];
        blocks = new HashMap<>();
    }

    public int allocate(int size, int mID) {
        if (!blocks.containsKey(mID)) {
            blocks.put(mID, new ArrayList<>());
        }
        List<int[]> list = blocks.get(mID);
        for (int i = 0; i < memory.length - size + 1; i++) {
            boolean free = true;
            for (int j = i; j < i + size; j++) {
                if (memory[j] != 0) {
                    free = false;
                    break;
                }
            }
            if (free) {
                int[] block = new int[]{i, size};
                list.add(block);
                for (int j = i; j < i + size; j++) {
                    memory[j] = mID;
                }
                return i;
            }
        }
        return -1;
    }

    public int free(int mID) {
        if (!blocks.containsKey(mID)) {
            return 0;
        }
        List<int[]> list = blocks.get(mID);
        for (int[] block : list) {
            int index = block[0];
            int size = block[1];
            for (int i = index; i < index + size; i++) {
                memory[i] = 0;
            }
        }
        int count = list.size();
        list.clear();
        return count;
    }
}

class Solution {
    public int findLengthOfShortestSubarray(int[] arr) {
        int n = arr.length;
        int left = 0;
        while (left < n - 1 && arr[left] <= arr[left + 1]) {
            left++;
        }
        if (left == n - 1) {
            return 0;
        }
        int right = n - 1;
        while (right > 0 && arr[right] >= arr[right - 1]) {
            right--;
        }
        int result = Math.min(n - left - 1, right);
        int i = 0;
        int j = right;
        while (i <= left && j < n) {
            if (arr[i] <= arr[j]) {
                result = Math.min(result, j - i - 1);
                i++;
            } else {
                j++;
            }
        }
        return result;
    }
}

class Solution {
    public int maximumRemovals(int[] nums, int[][] queries) {
        int n = nums.length;
        int m = queries.length;
        int[] prev = new int[n];
        int[] next = new int[n];
        Arrays.fill(prev, -1);
        Arrays.fill(next, n);
        Stack<Integer> stack = new Stack<>();
        for (int i = 0; i < n; i++) {
            while (!stack.isEmpty() && nums[stack.peek()] < nums[i]) {
                next[stack.pop()] = i;
            }
            if (!stack.isEmpty()) {
                prev[i] = stack.peek();
            }
            stack.push(i);
        }
        int[] ans = new int[m];
        for (int i = 0; i < m; i++) {
            int l = queries[i][0];
            int r = queries[i][1];
            int k = queries[i][2];
            int left = l;
            int right = r;
            while (left < right) {
                int mid = (left + right + 1) >>> 1;
                if (next[queries[i][0]] > queries[i][1] || next[mid] > queries[i][1] ||
                        prev[mid] >= queries[i][0] && nums[prev[mid]] >= k) {
                    right = mid - 1;
                } else {
                    left = mid;
                }
            }
            ans[i] = left - l + 1;
        }
        int res = 0;
        for (int i = 0; i < m; i++) {
            res += ans[i];
        }
        return res;
    }
}

class Solution {
    public int maxNumOfSubgroups(int n, int[][] edges) {
        int[] pos = new int[n+1];
        for(int i=0; i<=n; i++) {
            pos[i]=i;
        }
        Arrays.sort(edges,(a,b) -> {
            return b[1]-a[1];
        });
        int[] ans=new int[n];
        int ansInd=0;
        for(int[] edge: edges) {
            int p1=find(pos,edge[0]);
            int p2=find(pos,edge[1]);
            if(p1!=p2 && (ansInd==0 || ans[ansInd-1]!=edge[1])) {
                ans[ansInd++]=edge[1];
                pos[p1]=p2;
            }
        }
        int maxGroups=ansInd;
        if(maxGroups==0)return 1;
        boolean[] selected=new boolean[maxGroups];
        Arrays.fill(selected,false);
        for(int[] edge: edges) {
            int p1=find(pos,edge[0]);
            int p2=find(pos,edge[1]);
            if(p1!=p2) {
                int pos1=Arrays.binarySearch(ans,edge[0]);
                int pos2=Arrays.binarySearch(ans,edge[1]);
                if(pos1<0)pos1=-pos1-2;
                if(pos2<0)pos2=-pos2-2;
                if(Math.abs(pos1-pos2)>1) {
                    continue;
                }
                selected[Math.min(pos1,pos2)]=true;
            }
        }
        for(int i=0; i<maxGroups; i++) {
            if(selected[i])continue;
            if(i<maxGroups-1 && !selected[i+1]) {
                selected[i+1]=true;
                continue;
            }
            if(i>0 && !selected[i-1]) {
                selected[i-1]=true;
            }
        }
        int ans1=0;
        for(int i=maxGroups-1; i>=0; i--) {
            if(selected[i])ans1++;
        }
        return ans1;
    }
    public int find(int[] pos, int p) {
        if(pos[p]!=p)pos[p]=find(pos,pos[p]);
        return pos[p];
    }
}

class Solution {
    public int minimumScore(int n, int[][] roads) {
        int[] dist = new int[n];
        Arrays.fill(dist, Integer.MAX_VALUE);
        dist[0] = 0;
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[1] - b[1]);
        pq.offer(new int[]{0, 0});
        List<int[]>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int[] road : roads) {
            graph[road[0]-1].add(new int[]{road[1]-1, road[2]});
            graph[road[1]-1].add(new int[]{road[0]-1, road[2]});
        }
        while (!pq.isEmpty()) {
            int[] curr = pq.poll();
            int node = curr[0], d = curr[1];
            if (dist[node] < d) {
                continue;
            }
            for (int[] next : graph[node]) {
                int nei = next[0], w = next[1];
                if (Math.min(dist[node], w) > dist[nei]) {
                    dist[nei] = Math.min(dist[node], w);
                    pq.offer(new int[]{nei, dist[nei]});
                }
            }
        }
        return dist[n-1];
    }
}

class Solution {
    public int calculate(int[] skill, int pos, int cnt, int target, int[] memo) {
        if (cnt == 0) return target; 
        if (pos >= skill.length || cnt * 2 > skill.length - pos) return -1;
        int key = pos * 1000 + cnt * 10 + target;
        if (memo[key] != 0) return memo[key];
        int ans = -1;
        ans = Math.max(ans, calculate(skill, pos + 1, cnt - 1, target + skill[pos], memo));
        ans = Math.max(ans, calculate(skill, pos + 1, cnt, target, memo));
        memo[key] = ans;
        return ans;
    }
    public int sumOfTeamChemistry(int[] skill) {
        Arrays.sort(skill);
        if (skill.length % 2 != 0) return -1;
        int[] memo = new int[skill.length * 1000];
        return calculate(skill, 0, skill.length/2, 0, memo);        
    }
}

