class Solution {
    public int countPalindromicSubsequences(String s) {
        int n = s.length();
        int mod = 1000000007;
        long[][][] dp = new long[n][n][4];
        for (int i = n - 1; i >= 0; i--) {
            for (int j = i; j < n; j++) {
                for (int k = 0; k < 4; k++) {
                    char c = (char) ('a' + k);
                    if (j == i) {
                        if (s.charAt(i) == c) {
                            dp[i][j][k] = 1;
                        } else {
                            dp[i][j][k] = 0;
                        }
                    } else {
                        if (s.charAt(i) != c) {
                            dp[i][j][k] = dp[i+1][j][k];
                        } else if (s.charAt(j) != c) {
                            dp[i][j][k] = dp[i][j-1][k];
                        } else {
                            if (j == i+1) {
                                dp[i][j][k] = 2;
                            } else {
                                dp[i][j][k] = 2;
                                for (int m = 0; m < 4; m++) {
                                    dp[i][j][k] += dp[i+1][j-1][m];
                                    dp[i][j][k] %= mod;
                                }
                            }
                        }
                    }
                }
            }
        }
        long res = 0;
        for (int k = 0; k < 4; k++) {
            res += dp[0][n-1][k];
            res %= mod;
        }
        return (int) res;
    }
}

class Solution {
    public int minimumCustomers(String customers) {
        int n = customers.length();
        int[] prefixSum = new int[n+1];
        for (int i = 0; i < n; i++) {
            prefixSum[i+1] = prefixSum[i] + (customers.charAt(i) == 'Y' ? 1 : 0);
        }
        int[] suffixSum = new int[n+1];
        for (int i = n-1; i >= 0; i--) {
            suffixSum[i] = suffixSum[i+1] + (customers.charAt(i) == 'N' ? 1 : 0);
        }
        int minPenalty = Integer.MAX_VALUE, minHour = 0;
        for (int i = 0; i <= n; i++) {
            int penalty = prefixSum[i] + suffixSum[i];
            if (penalty < minPenalty) {
                minPenalty = penalty;
                minHour = i;
            }
        }
        return minHour;
    }
}

