        int n = nums.length, res = 0;
        for (int i = 0; i < n; i++) {
            int l = i - 1, r = i + 1;
            while (l >= 0 && nums[l] > k) l--;
            while (r < n && nums[r] > k) r++;
            while (l >= 0 && r < n && nums[l] < k && nums[r] < k) {
                res++;
                l--;
                r++;
            }
            if (nums[i] == k) res++;
        }
        return res;
    }
}

class Solution {
    public ListNode removeGreaterNodes(ListNode head) {
        if (head == null || head.next == null) {
            return head;
        }
        ListNode cur = head;
        while (cur != null) {
            ListNode nxt = cur.next;
            boolean removed = false;
            while (nxt != null) {
                if (nxt.val > cur.val) {
                    cur.val = nxt.val;
                    cur.next = nxt.next;
                    removed = true;
                } else {
                    nxt = nxt.next;
                }
            }
            if (!removed) {
                cur = cur.next;
            }
        }
        return head;
    }
}

