class Solution {
    public int findMiddleIndex(int[] nums) {
        int sum = 0;
        for (int num : nums) {
            sum += num;
        }
        int leftSum = 0;
        for (int i = 0; i < nums.length; i++) {
            if (leftSum == sum - leftSum - nums[i]) {
                return i;
            }
            leftSum += nums[i];
        }
        return -1;
    }
}

class Solution {
    private static final int MOD = 1000000007;
    private static final int[][] PRIMES = {{2, 3, 5, 7}, {1, 3, 7, 9}};
    
    public int countBeautifulString(String s, int k, int minLength) {
        int n = s.length();
        int[][][] dp = new int[n + 1][k + 1][2];
        dp[0][0][0] = 1;
        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= k; j++) {
                for (int p = 0; p < 2; p++) {
                    int prime = PRIMES[p][0];
                    int nonPrime = PRIMES[p][1];
                    int val = s.charAt(i - 1) - '0';
                    if (val == nonPrime) {
                        dp[i][j][p] = 0;
                    } else {
                        for (int len = minLength - 1; len < i; len++) {
                            dp[i][j][p] = (dp[i][j][p] + dp[i - len - 1][j - 1][p ^ 1]) % MOD;
                        }
                        dp[i][j][p] = (dp[i][j][p] + dp[i - 1][j][p]) % MOD;
                    }
                }
            }
        }
        return dp[n][k][0];
    }
}

class Solution {
    public int minFuelCost(int[][] roads, int seats) {
        int n = roads.length + 1;
        List<Integer>[] graph = new List[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int[] road : roads) {
            int u = road[0], v = road[1];
            graph[u].add(v);
            graph[v].add(u);
        }
        int[] sizes = new int[n];
        Arrays.fill(sizes, 1);
        int[] fuels = new int[n];
        dfs1(graph, 0, -1, sizes, fuels, seats);
        int[] dists = new int[n];
        dfs2(graph, 0, -1, dists, fuels, sizes, seats);
        return dists[0];
    }
    
    private void dfs1(List<Integer>[] graph, int u, int parent, int[] sizes, int[] fuels, int seats) {
        for (int v : graph[u]) {
            if (v != parent) {
                dfs1(graph, v, u, sizes, fuels, seats);
                sizes[u] += sizes[v];
                fuels[u] += fuels[v] + (sizes[v] + seats - 1) / seats;
            }
        }
    }
    
    private void dfs2(List<Integer>[] graph, int u, int parent, int[] dists, int[] fuels, int[] sizes, int seats) {
        if (u > 0) {
            dists[u] = dists[parent] + 1;
            int size = sizes[0] - sizes[u];
            int fuel = fuels[parent] + fuels[u] - fuels[parent ^ u] + (size + seats - 1) / seats;
            fuels[u] = fuel + fuels[parent ^ u] - fuels[u];
        }
        for (int v : graph[u]) {
            if (v != parent) {
                dfs2(graph, v, u, dists, fuels, sizes, seats);
            }
        }
    }
}

class Solution {
    public int[][] closestNodes(TreeNode root, int[] queries) {
        int[][] ans = new int[queries.length][2];
        for (int i = 0; i < queries.length; i++) {
            ans[i][0] = findMaxSmaller(root, queries[i]);
            ans[i][1] = findMinLarger(root, queries[i]);
        }
        return ans;
    }
    
    private int findMaxSmaller(TreeNode node, int target) {
        if (node == null) return -1;
        if (node.val == target) return target;
        if (node.val < target) {
            int ans = findMaxSmaller(node.right, target);
            return ans == -1 ? node.val : ans;
        } else {
            return findMaxSmaller(node.left, target);
        }
    }
    
    private int findMinLarger(TreeNode node, int target) {
        if (node == null) return -1;
        if (node.val == target) return target;
        if (node.val > target) {
            int ans = findMinLarger(node.left, target);
            return ans == -1 ? node.val : ans; 
        } else {
            return findMinLarger(node.right, target);
        }
    }
}

