            for(int j=i+1; j<nums.length; j++){
                if(square % nums[j] == 0){
                    long product = square / nums[j];
                    for(int k=j+1; k<nums.length; k++){
                        if(nums[k] == product){
                            count++;
                        }
                    }
                }
            }
        }
        for(int i=0; i<nums.length; i++){
            long square = (long)nums[i] * nums[i];
            for(int j=i+1; j<nums.length; j++){
                if(square % nums[j] == 0){
                    long product = square / nums[j];
                    for(int k=j+1; k<nums.length; k++){
                        if(nums[k] == product){
                            count++;
                        }
                    }
                }
            }
        }
        return count;
    }
}

class Solution {
    public int maxMoney(TreeNode[] edges, int bob, int[] amount) {
        List<Integer>[] graph = new List[amount.length];
        for (int i = 0; i < amount.length; i++) {
            graph[i] = new ArrayList<>();
        }
        for (TreeNode edge : edges) {
            graph[edge.x].add(edge.y);
            graph[edge.y].add(edge.x);
        }
        int[] dp = new int[amount.length];
        dfs(graph, dp, amount, bob, 0, -1);
        return dp[0];
    }
    
    private void dfs(List<Integer>[] graph, int[] dp, int[] amount, int bob, int u, int parent) {
        dp[u] = amount[u];
        for (int v : graph[u]) {
            if (v == parent) continue;
            dfs(graph, dp, amount, bob, v, u);
            if (v == bob) {
                dp[u] += dp[v] - dp[bob];
            } else {
                dp[u] += Math.max(dp[v], 0);
            }
        }
    }
}

class Solution {
    public String[] splitMessage(String message, int limit) {
        List<String> parts = new ArrayList<>();
        int start = 0, index = 1;
        while(start < message.length()) {
            int end = Math.min(start + limit, message.length());
            String part = message.substring(start, end) + "<" + index + "/" + ((int)Math.ceil((double)message.length() / limit)) + ">";
            parts.add(part);
            start = end;
            index++;
        }
        if(parts.get(parts.size()-1).length() > limit) return new String[0];
        String[] result = new String[parts.size()];
        for(int i=0; i<parts.size(); i++) {
            result[i] = parts.get(i);
        }
        return result;
    }
}

class Solution {
    private int MOD = 1000000007;

    public int numWays(int low, int high, int zero, int one) {
        int[] dp = new int[high + 1];
        dp[0] = 1;
        dp[1] = 2;
        for (int i = 2; i <= high; i++) {
            dp[i] = (dp[i - 1] + dp[i - 2]) % MOD;
        }

        int[] prefixSum = new int[high + 1];
        for (int i = low; i <= high; i++) {
            prefixSum[i] = (prefixSum[i - 1] + dp[i]) % MOD;
        }

        int ans = 0;
        for (int i = low; i <= high; i++) {
            int j = i - low;
            int k = high - i;
            long count = (long) dp[i] * dp[j] % MOD;
            count = count * prefixSum[k] % MOD;
            count = count * comb(zero + one, zero, MOD) % MOD;
            ans = (ans + (int) count) % MOD;
        }
        return ans;
    }

    private int comb(int n, int m, int MOD) {
        int[] f = new int[n + 1];
        f[0] = 1;
        for (int i = 1; i <= n; i++) {
            f[i] = (int) ((long) f[i - 1] * i % MOD);
        }
        int invnm = inv((int) ((long) f[n - m] * f[m] % MOD), MOD);
        return (int) ((long) f[n] * invnm % MOD);
    }

    private int inv(int a, int b) {
        return a == 1 ? 1 : (int) ((long) (b - b / a) * inv(b % a, b) % b);
    }
}

class Solution {
    public int numberOfArithmeticSlices(int[] A) {
        int n = A.length;
        int count = 0;
        for (int start = 0; start < n - 2; start++) {
            int diff = A[start + 1] - A[start];
            for (int end = start + 2; end < n; end++) {
                if (A[end] - A[end - 1] == diff) {
                    count++;
                } else {
                    break;
                }
            }
        }
        return count;
    }
}

class Solution {
    public int countPalindromicSubstrings(String s, int k) {
        int[][] dp = new int[s.length()][s.length()];
        for (int i = 0; i < s.length(); i++) {
            dp[i][i] = 1;
        }
        for (int len = 2; len <= s.length(); len++) {
            for (int i = 0; i <= s.length() - len; i++) {
                int j = i + len - 1;
                if (s.charAt(i) == s.charAt(j) && (len == 2 || dp[i + 1][j - 1] == 1)) {
                    dp[i][j] = 1;
                }
            }
        }
        int[] maxEnd = new int[s.length()];
        int res = 0;
        Arrays.fill(maxEnd, -1);
        for (int i = 0; i < s.length(); i++) {
            int max = -1;
            for (int j = i; j < s.length(); j++) {
                if (dp[i][j] == 1) {
                    max = Math.max(max, j);
                }
                if (max >= j + k - 1) {
                    maxEnd[j] = Math.max(maxEnd[j], max);
                }
            }
        }
        int end = -1;
        int cnt = 0;
        for (int i = 0; i < s.length(); i++) {
            if (maxEnd[i] > end) {
                cnt++;
                end = maxEnd[i];
            }
        }
        return cnt;
    }
}

class Solution {
    public int minOperations(TreeNode root) {
        Map<Integer, List<Integer>> map = new HashMap<>();
        traverse(root, map, 0);
        int res = 0;
        for (List<Integer> list : map.values()) {
            res += mergeSort(list);
        }
        return res;
    }
    private void traverse(TreeNode root, Map<Integer, List<Integer>> map, int level) {
        if (root == null) return;
        traverse(root.left, map, level + 1);
        map.putIfAbsent(level, new ArrayList<>());
        map.get(level).add(root.val);
        traverse(root.right, map, level + 1);
    }
    private int mergeSort(List<Integer> list) {
        int[] nums = new int[list.size()];
        for (int i = 0; i < nums.length; i++) {
            nums[i] = list.get(i);
        }
        return mergeSort(nums, 0, nums.length - 1);
    }
    private int mergeSort(int[] nums, int left, int right) {
        if (left >= right) return 0;
        int mid = left + (right - left) / 2;
        int res = mergeSort(nums, left, mid) + mergeSort(nums, mid + 1, right);
        int[] temp = new int[right - left + 1];
        int i = left, j = mid + 1, k = 0;
        while (i <= mid && j <= right) {
            if (nums[i] <= nums[j]) {
                temp[k++] = nums[i++];
            } else {
                temp[k++] = nums[j++];
                res += mid - i + 1;
            }
        }
        while (i <= mid) {
            temp[k++] = nums[i++];
        }
        while (j <= right) {
            temp[k++] = nums[j++];
        }
        System.arraycopy(temp, 0, nums, left, temp.length);
        return res;
    }
}

class Solution {
    public int subarraysWithKDistinct(int[] nums, int k) {
        int n = nums.length;
        int[] freq = new int[n+1];
        int left1 = 0, left2 = 0, distinct1 = 0, distinct2 = 0, res = 0;
        for (int right = 0; right < n; right++) {
            if (freq[nums[right]] == 0) {
                distinct1++;
                distinct2++;
            }
            freq[nums[right]]++;
            while (distinct1 > k) {
                freq[nums[left1]]--;
                if (freq[nums[left1]] == 0) distinct1--;
                left1++;
            }
            while (distinct2 >= k) {
                freq[nums[left2]]--;
                if (freq[nums[left2]] == 0) distinct2--;
                left2++;
            }
            res += left2 - left1;
        }
        return res;
    }
}

