class Solution {
    public int minTotalDistance(int[] robot, int[][] factory) {
        Arrays.sort(robot);
        int n = robot.length;
        int[] distances = new int[n];
        for (int i = 0; i < n; i++) {
            distances[i] = Math.abs(factory[0][0] - robot[i]);
        }
        for (int j = 1; j < factory.length; j++) {
            int[] prevDistances = distances.clone();
            int count = 0;
            Arrays.fill(distances, 0);
            for (int i = 0; i < n; i++) {
                while (count < factory[j][1] && i < n && prevDistances[i] >= Math.abs(factory[j][0] - robot[i])) {
                    distances[count] += Math.abs(factory[j][0] - robot[i]);
                    count++;
                    i++;
                }
                i--;
            }
        }
        int totalDistance = 0;
        for (int distance : distances) {
            totalDistance += distance;
        }
        return totalDistance;
    }
}

class Solution {
    public int mincostToHireWorkers(int[] costs, int k, int candidates) {
        int n = costs.length;
        int[][] workers = new int[n][2];
        for (int i = 0; i < n; i++) {
            workers[i][0] = costs[i];
            workers[i][1] = i;
        }
        Arrays.sort(workers, (a, b) -> Integer.compare(a[0], b[0]));
        PriorityQueue<Integer> pq = new PriorityQueue<>(Comparator.reverseOrder());
        int sum = 0;
        int ans = Integer.MAX_VALUE;
        for (int i = 0; i < n; i++) {
            sum += workers[i][0];
            pq.offer(workers[i][1]);
            if (pq.size() > candidates) {
                sum -= costs[pq.poll()];
            }
            if (pq.size() == candidates) {
                ans = Math.min(ans, sum);
            }
        }
        return ans;
    }
}

class Solution {
    public int maxSumSubarray(int[] nums, int k) {
        int n = nums.length;
        int[] freq = new int[100001];
        int sum = 0, ans = 0;
        for (int i = 0; i < n; i++) {
            freq[nums[i]]++;
            sum += nums[i];
            if (i >= k) {
                freq[nums[i-k]]--;
                sum -= nums[i-k];
            }
            if (i >= k-1) {
                if (freq[nums[i]] == 1) {
                    ans = Math.max(ans, sum);
                }
            }
        }
        return ans;
    }
}

class Solution {
    public int[] transformArray(int[] nums) {
        int n = nums.length;
        for (int i = 0; i < n - 1; i++) {
            if (nums[i] == nums[i + 1]) {
                nums[i] *= 2;
                nums[i + 1] = 0;
            }
        }
        int k = 0;
        for (int i = 0; i < n; i++) {
            if (nums[i] != 0) {
                nums[k++] = nums[i];
            }
        }
        for (int i = k; i < n; i++) {
            nums[i] = 0;
        }
        return nums;
    }
}

class Solution {
    public List<String> findWords(String[] queries, String[] dictionary) {
        List<String> ans = new ArrayList<>();
        for (String query : queries) {
            if (dictionaryContain(query, dictionary)) {
                ans.add(query);
            }
        }
        return ans;
    }

    private boolean dictionaryContain(String query, String[] dictionary) {
        for (String word : dictionary) {
            if (word.length() != query.length()) {
                continue;
            }
            int diffCount = 0;
            for (int i = 0; i < word.length(); i++) {
                if (word.charAt(i) != query.charAt(i)) {
                    diffCount++;
                }
                if (diffCount > 1) {
                    break;
                }
            }
            if (diffCount <= 1) {
                return true;
            }
        }
        return false;
    }
}

class Solution {
    public int[] nextGreaterElement(int[] nums) {
        int n = nums.length;
        int[] res = new int[n];
        Arrays.fill(res, -1);
        Stack<Integer> stack = new Stack<>();
        for (int i = 0; i < n; i++) {
            while (!stack.isEmpty() && nums[stack.peek()] < nums[i]) {
                int index = stack.pop();
                if (!stack.isEmpty() && nums[stack.peek()] > nums[index]) {
                    res[index] = nums[stack.peek()];
                }
                res[index] = nums[i];
            }
            stack.push(i);
        }
        return res;
    }
}

class Solution {
    public int getMaxTarget(int[] nums, int space) {
        Arrays.sort(nums);
        int maxTargets = 0;
        int minSeed = nums[0];
        for (int i = 0; i < nums.length; i++) {
            int seed = nums[i];
            int targets = 1;
            for (int j = i+1; j < nums.length; j++) {
                if ((nums[j] - seed) % space == 0) {
                    targets++;
                }
            }
            if (targets > maxTargets) {
                maxTargets = targets;
                minSeed = seed;
            }
        }
        return minSeed;
    }
}

class Solution {
    public String findDifferentString(String[] words) {
        int n = words[0].length();
        Set<Integer> diffs = new HashSet<>();
        for (String word : words) {
            int diff = 0;
            for (int i = 1; i < n; i++) {
                diff = diff * 26 + (word.charAt(i) - word.charAt(i - 1));
            }
            diffs.add(diff);
        }
        for (String word : words) {
            int diff = 0;
            for (int i = 1; i < n; i++) {
                diff = diff * 26 + (word.charAt(i) - word.charAt(i - 1));
            }
            if (!diffs.contains(diff)) {
                return word;
            }
        }
        return "";
    }
}

class Solution {
    public int subarraysWithKDistinct(int[] nums, int k) {
        Map<Integer, Integer> freq = new HashMap<>();
        int ans = 0, left1 = 0, left2 = 0;
        for (int right = 0; right < nums.length; right++) {
            freq.put(nums[right], freq.getOrDefault(nums[right], 0) + 1);
            while (freq.size() > k) {
                freq.put(nums[left1], freq.get(nums[left1]) - 1);
                if (freq.get(nums[left1]) == 0) freq.remove(nums[left1]);
                left1++;
            }
            while (freq.getOrDefault(nums[left2], 0) > 1) {
                freq.put(nums[left2], freq.get(nums[left2]) - 1);
                left2++;
            }
            if (freq.size() == k) ans += left2 - left1 + 1;
        }
        return ans;
    }
}

class Solution {
    public int[] maxDepth(TreeNode root) {
        int[] ans = new int[2];
        if (root == null) {
            return ans;
        }
        int[] left = maxDepth(root.left);
        int[] right = maxDepth(root.right);
        ans[0] = Math.max(left[0], right[0]) + 1;
        if (root.left != null && root.left.val == target || root.right != null && root.right.val == target) {
            ans[1] = 1;
        } else {
            ans[1] = Math.max(left[1], right[1]);
        }
        return ans;
    }
    
    public int[] cutOffTree(List<List<Integer>> forest, List<Integer> trees) {
        List<int[]> list = new ArrayList<>();
        for (int i = 0; i < forest.size(); i++) {
            for (int j = 0; j < forest.get(0).size(); j++) {
                if (forest.get(i).get(j) > 1) {
                    list.add(new int[]{forest.get(i).get(j), i, j});
                }
            }
        }
        Collections.sort(list, (a, b) -> a[0] - b[0]);
        int[] cur = new int[]{0, 0};
        int ans = 0;
        for (int[] tree : list) {
            int[] res = maxDepth(new TreeNode(-1));
            target = tree[0];
            if (res[1] == 0) {
                return new int[]{-1};
            }
            ans += res[1];
            cur[0] = tree[1];
            cur[1] = tree[2];
        }
        return new int[]{ans};
    }
    
    private int target;
    
    private static class TreeNode {
        int val;
        TreeNode left;
        TreeNode right;
        public TreeNode(int val) {
            this.val = val;
        }
    }
}

class Solution {
    public int minimum(int n, int target) {
        int ans = 0;
        long sum = 0;
        while (sum <= target) {
            ans *= 10;
            sum = 0;
            for (char c : Integer.toString(n + ans).toCharArray()) {
                sum += c - '0';
            }
        }
        int lo = ans / 10, hi = ans;
        while (lo < hi) {
            int mid = (lo + hi) / 2;
            sum = 0;
            for (char c : Integer.toString(n + mid).toCharArray()) {
                sum += c - '0';
            }
            if (sum <= target) {
                lo = mid + 1;
            } else {
                hi = mid;
            }
        }
        return lo - 1;
    }
}

class Solution {
    public String[][] findMostPopular(String[] creators, String[] ids, int[] views) {
        Map<String, Integer> creatorViews = new HashMap<>();
        Map<String, String> creatorVideos = new HashMap<>();
        int n = creators.length;
        for (int i = 0; i < n; i++) {
            String creator = creators[i];
            int view = views[i];
            String video = ids[i];
            creatorViews.put(creator, creatorViews.getOrDefault(creator, 0) + view);
            if (!creatorVideos.containsKey(creator) || view > creatorViews.get(creatorVideos.get(creator))) {
                creatorVideos.put(creator, video);
            } else if (view == creatorViews.get(creatorVideos.get(creator)) && video.compareTo(creatorVideos.get(creator)) < 0) {
                creatorVideos.put(creator, video);
            }
        }
        List<String[]> result = new ArrayList<>();
        int maxViews = 0;
        for (Map.Entry<String, Integer> entry : creatorViews.entrySet()) {
            String creator = entry.getKey();
            int view = entry.getValue();
            if (view > maxViews) {
                result.clear();
                maxViews = view;
            }
            if (view == maxViews) {
                String video = creatorVideos.get(creator);
                result.add(new String[] {creator, video});
            }
        }
        return result.toArray(new String[result.size()][2]);
    }
}

class Solution {
