        int count = 0;
        for(int num: nums){
            if(num % 2 == 0 && num % 3 == 0){
                sum += num;
                count++;
            }
        }
        return count == 0 ? 0 : (int) Math.floor(sum / count);
    }
}

class Solution {
    public boolean isSumOfNumAndRev(int num) {
        int rev = 0, temp = num;
        while (temp > 0) {
            rev = rev * 10 + temp % 10;
            temp /= 10;
        }
        for (int i = 0; i <= num; i++) {
            if ((i + rev) == num)
                return true;
            if ((rev > i) && ((rev - i) == num))
                return true;
        }
        return false;
    }
}

class Solution {
    public int minOperations(int[] nums, int[] target) {
        Map<Integer, Integer> map = new HashMap<>();
        for (int num : nums) map.put(num, map.getOrDefault(num, 0) + 1);
        int res = 0;
        for (int i : target) {
            if (map.containsKey(i)) {
                if (map.get(i) > 1) map.put(i, map.get(i) - 1);
                else map.remove(i);
            } else {
                int diff = i - map.keySet().iterator().next();
                if (diff > 0) {
                    int sub = diff / 2;
                    while (!map.isEmpty() && map.keySet().iterator().next() <= i) {
                        int k = map.keySet().iterator().next();
                        if (diff >= k - i) {
                            if (map.get(k) > 1) map.put(k, map.get(k) - 1);
                            else map.remove(k);
                            diff -= k - i;
                        } else {
                            map.put(k - diff, 1);
                            break;
                        }
                    }
                    if (diff > 0) map.put(i - sub, 1);
                } else {
                    int add = -diff / 2;
                    while (!map.isEmpty() && map.keySet().iterator().next() < i) {
                        int k = map.keySet().iterator().next();
                        if (-diff >= i - k) {
                            if (map.get(k) > 1) map.put(k, map.get(k) - 1);
                            else map.remove(k);
                            diff += i - k;
                        } else {
                            map.put(k + diff, 1);
                            break;
                        }
                    }
                    if (diff > 0) map.put(i + add, 1);
                }
                res++;
            }
        }
        return res;
    }
}

class Solution {
