    public int deleteTreeNodes(int n, int[] parent, int[] value) {
        int[] cnt = new int[n];
        int[] sum = new int[n];
        boolean[] del = new boolean[n];

        for (int i = n - 1; i > 0; --i) {
            cnt[parent[i]] += cnt[i] + 1;
            sum[parent[i]] += sum[i] + value[i];
        }

        cnt[0] = n - 1;

        int ans = 0;
        for (int i = n - 1; i >= 0; --i) {
            if (cnt[i] == 0) {
                if (value[i] == sum[i]) continue;
                else ans++;
            }
            else {
                if (del[parent[i]]) continue;
                int ori = sum[parent[i]];
                int now = ori - sum[i] - value[i];
                if (ori == now) continue;
                if (getMaxReuslt(i, parent[i]) > getMaxReuslt2(i, parent[i])) {
                    int tmp = i;
                    i = parent[tmp];
                    parent[tmp] = -1;
                }
            }
        }

        Arrays.fill(cnt, 0);
        for (int i = n - 1; i > 0; --i) {
            if (parent[i] < 0) continue;
            cnt[parent[i]] += cnt[i] + 1;
            sum[parent[i]] += sum[i] + value[i];
        }

        cnt[0] = n - 1;

        for (int i = 1; i < n; ++i) {
            if (cnt[i] == n - cnt[i]) continue;
            if (del[i]) continue;
            if (getMaxReuslt3(i, parent[i]) > getMaxReuslt4(i, parent[i])) {
                ans++;
                for (int j = i; j != -1; j = parent[j]) del[j] = true;
            }

            if (getMaxReuslt5(i, parent[i]) > getMaxReuslt6(i, parent[i])) {
                ans++;
                for (int j = i; j != -1; j = parent[j]) del[j] = true;
            }
        }

        return n - ans;
    }
}

class Solution {
    public int minimumValueAfterDispel(int[] nums) {
        int n = nums.length;
        int max = nums[0];
        for (int i = 1; i < n; ++i) {
            if (nums[i] > nums[i - 1])
                max = nums[i];
        }
        int l = 0, r = max;
        while (l < r) {
            int mid = (l + r) >> 1;
            int cnt = 0;
            for (int x : nums) {
                cnt += (x + mid - 1) / mid - 1;
            }
            if (cnt > mid)
                l = mid + 1;
            else
                r = mid;
        }
        return r + 1;
    }
}

class Solution {
    public int[] getMaximumXor(int[] nums, int maximumBit) {
        int n = nums.length;
        int[] prefixXor = new int[n];
        prefixXor[0] = nums[0];
        for (int i = 1; i < n; i++) {
            prefixXor[i] = prefixXor[i-1] ^ nums[i];
        }
        int maxNum = (1 << maximumBit) - 1;
        int[] res = new int[n];
        for (int i = n-1; i >= 0; i--) {
            res[n-i-1] = prefixXor[i] ^ maxNum;
        }
        return res;
    }
}

class Solution {
    public int numberOfValidTimes(String time) {
        int count = 0;
        for (int hour = 0; hour < 24; hour++) {
            for (int minute = 0; minute < 60; minute++) {
                if (isValid(hour, minute, time)) {
                    count++;
                }
            }
        }
        return count;
    }

    private boolean isValid(int hour, int minute, String time) {
        String[] parts = time.split(":");
        int h = hour;
        int m = minute;
        if (time.charAt(0) == '?') {
            h = hour < 10 ? 10 * (time.charAt(1) - '0') + hour : 10 * hour + (time.charAt(1) - '0');
        }
        if (time.charAt(1) == '?') {
            h = hour < 2 ? 10 * hour + (time.charAt(0) - '0') : 10 * (time.charAt(0) - '0') + hour;
        }
        if (time.charAt(3) == '?') {
            m = minute < 10 ? 10 * (time.charAt(4) - '0') + minute : 10 * minute + (time.charAt(4) - '0');
        }
        if (time.charAt(4) == '?') {
            m = minute < 6 ? 10 * minute + (time.charAt(3) - '0') : 10 * (time.charAt(3) - '0') + minute;
        }
        return h == Integer.parseInt(parts[0]) && m == Integer.parseInt(parts[1]);
    }
}

class Solution {
    public int numSubarrayBoundedMax(int[] nums, int minK, int maxK) {
        int res = 0, dp = 0, prev = -1;
        for (int i = 0; i < nums.length; i++) {
            if (nums[i] > maxK) dp = 0;
            if (nums[i] >= minK && nums[i] <= maxK) {
                dp = i - prev;
                res += dp;
            }
            if (nums[i] < minK) res += dp;
            if (nums[i] >= minK) prev = i;
        }
        return res;
    }
}

class Solution {
    public int longestSubsequence(int[] nums, int k) {
        TreeMap<Integer, Integer> map = new TreeMap<>();
        for (int num : nums) {
            Integer prev = map.floorKey(num - k);
            int count = prev == null ? 1 : map.get(prev) + 1;
            int nextCount = map.getOrDefault(num, 0);
            map.put(num, Math.max(count, nextCount));
        }
        return map.values().stream().mapToInt(i -> i).max().orElse(0);
    }
}

class Solution {
    public int reverse(int n) {
        int rev = 0;
        while (n > 0) {
            int digit = n % 10;
            rev = rev * 10 + digit;
            n /= 10;
        }
        return rev;
    }
    
    public int distinct(int[] nums) {
        Set<Integer> set = new HashSet<>();
        for (int num : nums) {
            set.add(num);
            set.add(reverse(num));
        }
        return set.size();
    }
    
    public int countDistinct(int[] nums) {
        int n = nums.length;
        if (n == 0) return 0;
        return distinct(nums);
    }
}

class Solution {
    public int largestValsFromLabels(int[] values, int[] labels, int num_wanted, int use_limit) {
        int n = values.length;
        int[][] pairs = new int[n][2];
        for (int i = 0; i < n; i++) {
            pairs[i][0] = values[i];
            pairs[i][1] = labels[i];
        }
        Arrays.sort(pairs, (a, b) -> b[0] - a[0]);
        Map<Integer, Integer> count = new HashMap<>();
        int ans = 0;
        for (int[] pair : pairs) {
            int v = pair[0], l = pair[1];
            if (num_wanted > 0 && count.getOrDefault(l, 0) < use_limit) {
                ans += v;
                count.put(l, count.getOrDefault(l, 0) + 1);
                num_wanted--;
            }
        }
        return ans;
    }
}

class Solution {
    public int pathsWithSumDivisibleByK(int[][] grid, int k) {
        int m = grid.length, n = grid[0].length;
        int[][] dp = new int[m][n];
        dp[0][0] = (grid[0][0] % k == 0) ? 1 : 0;
        for (int i = 1; i < m; i++) {
            dp[i][0] = (dp[i-1][0] + ((grid[i][0] % k == 0) ? 1 : 0)) % 1000000007;
        }
        for (int j = 1; j < n; j++) {
            dp[0][j] = (dp[0][j-1] + ((grid[0][j] % k == 0) ? 1 : 0)) % 1000000007;
        }
        for (int i = 1; i < m; i++) {
            for (int j = 1; j < n; j++) {
                dp[i][j] = (dp[i-1][j] + dp[i][j-1]) % 1000000007;
                if ((grid[i][j] % k) == 0) {
                    dp[i][j] = (dp[i][j] + dp[i-1][j-1]) % 1000000007;
                }
            }
        }
        return dp[m-1][n-1];
    }
}

class Solution {
    public String smallestString(String s) {
        Deque<Character> stack = new ArrayDeque<>();
        StringBuilder result = new StringBuilder();
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            while (!stack.isEmpty() && stack.peek() > c) {
                result.append(stack.pop());
            }
            stack.push(c);
        }
        while (!stack.isEmpty()) {
            result.append(stack.pop());
        }
        return result.reverse().toString();
    }
}

