class Solution {
    public int findLongestTime(int n, int[][] logs) {
        int[] times = new int[n];
        for (int i = 0; i < logs.length; i++) {
            int id = logs[i][0];
            int time = logs[i][1];
            if (i == 0) {
                times[id] = time;
            } else {
                times[id] += time - logs[i-1][1];
            }
        }
        int maxTime = 0;
        int longestId = 0;
        for (int i = 0; i < n; i++) {
            if (times[i] > maxTime) {
                maxTime = times[i];
                longestId = i;
            }
        }
        return longestId;
    }
}

class Solution {
    public int maxChunksToSorted(int[] arr) {
        int n = arr.length;
        int[] maxLeft = new int[n];
        int[] minRight = new int[n];
        maxLeft[0] = arr[0];
        for (int i = 1; i < n; i++) {
            maxLeft[i] = Math.max(maxLeft[i - 1], arr[i]);
        }
        minRight[n - 1] = arr[n - 1];
        for (int i = n - 2; i >= 0; i--) {
            minRight[i] = Math.min(minRight[i + 1], arr[i]);
        }
        int chunks = 1;
        for (int i = 0; i < n - 1; i++) {
            if (maxLeft[i] <= minRight[i + 1]) {
                chunks++;
            }
        }
        return chunks;
    }
}

