class Solution {
    public int maxVowels(String s, int k) {
        int vowels = 0;
        for (int i = 0; i < k; i++) {
            if (isVowel(s.charAt(i)))
                vowels++;
        }
        int maxVowels = vowels;
        for (int i = k; i < s.length(); i++) {
            if (isVowel(s.charAt(i-k)))
                vowels--;
            if (isVowel(s.charAt(i)))
                vowels++;
            maxVowels = Math.max(maxVowels, vowels);
            if (maxVowels == k)
                return k;
        }
        return maxVowels;
    }
    
    private boolean isVowel(char c) {
        return c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u';
    }
}

class Solution {
    public int maximumRemovals(String s, String p, int[] removable) {
        char[] arr = s.toCharArray();
        int left = 0, right = removable.length-1, mid;
        while(left <= right) {
            mid = (left + right) / 2;
            for(int i=0;i<=mid;i++) {
                arr[removable[i]] = '/';
            }
            if(isSubsequence(arr,p)) {
                left = mid + 1;
            } else {
                for(int i=0;i<=mid;i++) {
                    arr[removable[i]] = s.charAt(removable[i]);
                }
                right = mid - 1;
            }
        }
        return right + 1;
    }
    
    private boolean isSubsequence(char[] arr, String p) {
        int i = 0, j = 0;
        while(i < arr.length && j < p.length()) {
            if(arr[i] != '/' && arr[i] == p.charAt(j)) {
                j++;
            }
            i++;
        }
        return j == p.length();
    }
}

class Solution {
    public int minimizeXOR(int num1, int num2) {
        int count = Integer.bitCount(num2);
        int mask = (1 << count) - 1;
        int min = Integer.MAX_VALUE;
        for (int i = 0; i <= mask; i++) {
            int x = setBits(num2, i);
            min = Math.min(min, x ^ num1);
        }
        return setBits(num2, mask & (min ^ num1));
    }
    
    private int setBits(int num, int mask) {
        int res = 0;
        int pos = 0;
        while (num > 0) {
            if ((num & 1) == 1) {
                if (((1 << pos) & mask) != 0) {
                    res |= (1 << pos);
                }
                pos++;
            }
            num >>= 1;
        }
        return res;
    }
}

class Solution {
    public int maxHourglassSum(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        int maxSum = Integer.MIN_VALUE;
        for (int i = 1; i < m - 1; i++) {
            for (int j = 1; j < n - 1; j++) {
                int sum = grid[i][j] + grid[i-1][j-1] + grid[i-1][j] + grid[i-1][j+1] 
                          + grid[i+1][j-1] + grid[i+1][j] + grid[i+1][j+1];
                maxSum = Math.max(maxSum, sum);
            }
        }
        return maxSum;
    }
}

class Solution {
    public int findCommonFactors(int a, int b) {
        int count = 0;
        for (int i = 1; i <= Math.min(a, b); i++) {
            if (a % i == 0 && b % i == 0) {
                count++;
            }
        }
        return count;
    }
}

class Solution {
    int ans = 0;
    Map<Integer, List<Integer>> graph = new HashMap<>();
    int[] vals;
    public int countGoodPaths(int[] _vals, int[][] edges) {
        vals = _vals;
        for (int[] edge : edges) {
            graph.computeIfAbsent(edge[0], k -> new ArrayList<>()).add(edge[1]);
            graph.computeIfAbsent(edge[1], k -> new ArrayList<>()).add(edge[0]);
        }
        dfs(0, -1, Integer.MIN_VALUE);
        return ans;
    }
    
    int mod = 1000000000 + 7;
    void dfs(int node, int parent, int max) {
        if (vals[node] == max) ans++;
        List<Integer> neighbors = graph.get(node);
        for (int neighbor : neighbors) {
            if (neighbor == parent) continue;
            if (vals[neighbor] <= vals[node]) {
                dfs(neighbor, node, Math.max(max, vals[node]));
            }
        }
    }
}

class Solution {
    public List<Integer> findGoodIndices(int[] nums, int k) {
        List<Integer> result = new ArrayList<>();
        for (int i = k; i < nums.length - k; i++) {
            boolean leftGood = true;
            for (int j = i - 1; j >= i - k; j--) {
                if (nums[j] < nums[j + 1]) {
                    leftGood = false;
                    break;
                }
            }
            if (!leftGood) continue;
            boolean rightGood = true;
            for (int j = i; j < i + k; j++) {
                if (nums[j] > nums[j + 1]) {
                    rightGood = false;
                    break;
                }
            }
            if (rightGood) result.add(i);                
        }
        return result;
    }
}

class Solution {
    public int maxSubArrayAnd(int[] nums) {
        int max = Integer.MIN_VALUE;
        int k = 0;
        for (int i = 30; i >= 0; i--) {
            k |= (1 << i);
            Set<Integer> set = new HashSet<>();
            int prefix = 0;
            set.add(0);
            for (int num : nums) {
                prefix |= num;
                set.add(prefix);
                if (set.contains(prefix & k)) {
                    max = Math.max(max, Integer.bitCount(prefix & k));
                }
            }
        }
        return max;
    }
}

