class Solution {
    public long minimumAmount(int[][] transactions) {
        Map<Integer, ArrayList<int[]>> map = new HashMap<>();
        Set<Integer> set = new HashSet<>();
        long budget = 0;
        for (int i = 0; i < transactions.length; i++){
            int c = transactions[i][0], b = transactions[i][1];
            budget += c;
            if (!map.containsKey(c)) map.put(c, new ArrayList<>());
            map.get(c).add(new int[]{b, i});
            set.add(i);
        }
        PriorityQueue<int[]> pq = new PriorityQueue<>(new Comparator<>(){
            public int compare(int[] a, int[] b){
                if (a[1] == b[1]) return Integer.compare(a[0], b[0]);
                return Integer.compare(a[1], b[1]);
            }
        });
        pq.offer(new int[]{0, 0});
        long res = 0;
        while (!pq.isEmpty()){
            int[] cur = pq.poll();
            int idx = cur[1], cashback = cur[0];
            if (!set.contains(idx)) continue;
            set.remove(idx);
            res = Math.max(res, budget + cashback);
            if (map.containsKey(cashback)){
                for (int[] nb: map.get(cashback)){
                    int nbCashback = nb[0], nbIdx = nb[1];
                    if (set.contains(nbIdx)){
                        pq.offer(new int[]{nbCashback, nbIdx});
                    }
                }
            }
        }
        return res;
    }
}

class Solution {
    public int[] minSubarray(int[] nums) {
        int n = nums.length;
        int[] ans = new int[n];
        Arrays.fill(ans, Integer.MAX_VALUE);
        int maxBit = 0;
        for (int i = 0; i < n; i++) {
            maxBit |= nums[i];
            int cur = 0;
            for (int j = i; j < n; j++) {
                cur |= nums[j];
                if (cur == maxBit) {
                    ans[i] = j - i + 1;
                    break;
                }
            }
        }
        return ans;
    }
}

