class Solution {
    public int countDays(String arriveAlice, String leaveAlice, String arriveBob, String leaveBob) {
        int[] alice = {Integer.parseInt(arriveAlice.substring(0, 2)), Integer.parseInt(arriveAlice.substring(3))};
        int[] bob = {Integer.parseInt(arriveBob.substring(0, 2)), Integer.parseInt(arriveBob.substring(3))};
        int[] aliceLeave = {Integer.parseInt(leaveAlice.substring(0, 2)), Integer.parseInt(leaveAlice.substring(3))};
        int[] bobLeave = {Integer.parseInt(leaveBob.substring(0, 2)), Integer.parseInt(leaveBob.substring(3))};
        int[] days = {31,28,31,30,31,30,31,31,30,31,30,31};
        int count = 0;
        for(int month = 0; month < 12; month++) {
            int daysInMonth = days[month];
            if(month == 1 && isLeapYear(2020)) daysInMonth = 29;
            int aStart = month == alice[0]-1 ? alice[1] : 1;
            int aEnd = month == aliceLeave[0]-1 ? aliceLeave[1] : daysInMonth;
            int bStart = month == bob[0]-1 ? bob[1] : 1;
            int bEnd = month == bobLeave[0]-1 ? bobLeave[1] : daysInMonth;
            if(aStart > bEnd || bStart > aEnd) continue;
            count += Math.min(aEnd, bEnd) - Math.max(aStart, bStart) + 1;
        }
        return count;
    }
    
    private boolean isLeapYear(int year) {
        return year % 400 == 0 || (year % 4 == 0 && year % 100 != 0);
    }
}

class Solution {
    public int[] prefixSums(String[] words) {
        Map<String, Integer> counts = new HashMap<>();
        for (String word : words) {
            for (int i = 1; i <= word.length(); i++) {
                String prefix = word.substring(0, i);
                counts.put(prefix, counts.getOrDefault(prefix, 0) + 1);
            }
        }
        int[] result = new int[words.length];
        for (int i = 0; i < words.length; i++) {
            int sum = 0;
            for (int j = 1; j <= words[i].length(); j++) {
                String prefix = words[i].substring(0, j);
                sum += counts.getOrDefault(prefix, 0);
            }
            result[i] = sum;
        }
        return result;
    }
}

class Solution {
    public TreeNode reverseOdd(TreeNode root) {
        if (root == null) return null;
        if (root.left != null && root.right != null) {
            Stack<TreeNode> stack = new Stack<>();
            stack.push(root.left);
            stack.push(root.right);
            int level = 3;
            while (!stack.isEmpty()) {
                int size = stack.size();
                if (level % 2 == 1) {
                    List<Integer> list = new ArrayList<>();
                    for (int i = 0; i < size; i++) {
                        TreeNode node = stack.pop();
                        list.add(node.val);
                        if (node.left != null) stack.push(node.left);
                        if (node.right != null) stack.push(node.right);
                    }
                    for (int i = 0; i < list.size(); i++) {
                        stack.push(new TreeNode(list.get(i)));
                    }
                } else {
                    for (int i = 0; i < size; i++) {
                        TreeNode node = stack.pop();
                        if (node.left != null) stack.push(node.left);
                        if (node.right != null) stack.push(node.right);
                    }
                }
                level++;
            }
        }
        return root;
    }
}

class Solution {
    public int longestSubstring(String s) {
        if (s.length() == 0) {
            return 0;
        }
        int maxLen = 1;
        int currLen = 1;
        for (int i = 1; i < s.length(); i++) {
            if (s.charAt(i) >= s.charAt(i-1)) {
                currLen++;
            } else {
                maxLen = Math.max(maxLen, currLen);
                currLen = 1;
            }
        }
        return Math.max(maxLen, currLen);
    }
}

class Solution {
    public int lcm(int a, int b) {
        return a * b / gcd(a, b);
    }
    
    public int gcd(int a, int b) {
        if (b == 0) return a;
        return gcd(b, a % b);
    }
    
    public int findSmallestEvenMultiple(int n) {
        return lcm(n, 2);
    }
}

class Solution {
    public int maxNumberOfFamilies(int n, int[][] reservedSeats) {
        Map<Integer, Set<Integer>> map = new HashMap<>();
        for (int[] reserved : reservedSeats) {
            int row = reserved[0];
            int seat = reserved[1];
            map.putIfAbsent(row, new HashSet<>());
            map.get(row).add(seat);
        }
        int count = 0;
        for (int row : map.keySet()) {
            Set<Integer> reserved = map.get(row);
            boolean left = false, center = false, right = false;
            if (!reserved.contains(2) && !reserved.contains(3) && !reserved.contains(4) && !reserved.contains(5)) {
                left = true;
                count++;
            }
            if (!reserved.contains(6) && !reserved.contains(7) && !reserved.contains(8) && !reserved.contains(9)) {
                right = true;
                count++;
            }
            if (!left && !right && !reserved.contains(4) && !reserved.contains(5) && !reserved.contains(6) && !reserved.contains(7)) {
                center = true;
                count++;
            }
        }
        return count + (n - map.size()) * 2;
    }
}

class Solution {
    public int partitionDisjoint(String s) {
        int[] freq = new int[26];
        int n = s.length();
        int leftMax = 0;
        int currMax = 0;
        int res = 0;
        for (int i = 0; i < n; i++) {
            currMax = Math.max(currMax, freq[s.charAt(i) - 'a']);
            freq[s.charAt(i) - 'a']++;
            if (i == leftMax) {
                res++;
                leftMax = currMax;
            }
        }
        return res;
    }
}

class Solution {
    public int findMostFrequentEvenElement(int[] nums) {
        Arrays.sort(nums);
        int count = 0, maxCount = 0, maxNum = -1;
        for (int i = 0; i < nums.length; i++) {
            if (nums[i] % 2 == 0) {
                count++;
                if (i == nums.length - 1 || nums[i] != nums[i+1]) {
                    if (count > maxCount) {
                        maxCount = count;
                        maxNum = nums[i];
                    }
                    count = 0;
                }
            }
        }
        return maxNum;
    }
}

class Solution {
    public int minDays(int[] tasks, int space) {
        Map<Integer, Integer> lastCompleted = new HashMap<>();
        int n = tasks.length;
        int ans = 0;
        for (int i = 0; i < n; i++) {
            int task = tasks[i];
            int last = lastCompleted.getOrDefault(task, -space-1);
            int curr = Math.max(ans, last+space+1);
            ans = curr;
            lastCompleted.put(task, curr);
        }
        return ans;
    }
}

class Solution {
    public int maxRowByCols(int[][] matrix, int numSelect) {
        int m = matrix.length, n = matrix[0].length;
        int ans = 0;
        for (int mask = 0; mask < (1<<n); ++mask) {
            if (countBits(mask) != numSelect) continue;
            Set<Integer> rows = new HashSet<>();
            for (int i = 0; i < m; ++i) {
                boolean valid = true;
                for (int j = 0; j < n; ++j) {
                    if ((mask & (1<<j)) != 0 && matrix[i][j] == 0) {
                        valid = false;
                        break;
                    }
                }
                if (valid) rows.add(i);
            }
            ans = Math.max(ans, rows.size());
        }
        return ans;
    }
    
    private int countBits(int x) {
        int cnt = 0;
        while (x > 0) {
            cnt += x & 1;
            x >>= 1;
        }
        return cnt;
    }
}

class Solution {
    public boolean isStrictlyPalindromic(int n) {
        if (n <= 2) {
            return true;
        }
        for (int b = 2; b <= n - 2; b++) {
            String str = Integer.toString(n, b);
            if (!isPalindrome(str)) {
                return false;
            }
        }
        return true;
    }
    
    private boolean isPalindrome(String s) {
        int left = 0, right = s.length() - 1;
        while (left < right) {
            if (s.charAt(left) != s.charAt(right)) {
                return false;
            }
            left++;
            right--;
        }
        return true;
    }
}

class Solution {
    public boolean equalsum(int[] nums) {
        for(int i=0;i<nums.length-1;i++){
            int sum1=0;
            int sum2=0;
            for(int j=i;j<i+2;j++){
                sum1+=nums[j];
            }
            for(int k=i+2;k<nums.length-1;k++){
                for(int l=k;l<k+2;l++){
                    sum2+=nums[l];
                }
                if(sum1==sum2){
                    return true;
                }
                sum2=0;
            }
        }
        return false;
    }
}

class Solution {
    public int minMeetingRooms(int[][] meetings) {
        Arrays.sort(meetings, (a, b) -> a[0] - b[0]);
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[1] - b[1]);
        int maxRooms = 0;
        for (int[] meeting : meetings) {
            while (!pq.isEmpty() && pq.peek()[1] <= meeting[0]) {
                pq.poll();
            }
            pq.offer(meeting);
            maxRooms = Math.max(maxRooms, pq.size());
        }
        return maxRooms;
    }
}

class Solution {
    public int longestNiceSubarray(int[] nums) {
        int maxLen = 0;
        Set<Integer> set = new HashSet<>();
        for (int num : nums) {
            set.add(num);
        }
        for (int i = 0; i < nums.length; i++) {
            for (int j = i; j < nums.length; j++) {
                boolean flag = true;
                for (int k = i; k <= j; k++) {
                    int complement = nums[i] ^ nums[k] ^ nums[j];
                    if (!set.contains(complement)) {
                        flag = false;
                        break;
                    }
                }
                if (flag) {
                    maxLen = Math.max(maxLen, j - i + 1);
                }
            }
        }
        return maxLen;
    }
}

class Solution {
    public int countRoutes(int[] locations, int start, int finish, int fuel) {
        int mod = 1000000007;
        int n = locations.length;
        long[][] dp = new long[n][fuel+1];
        for (int i = 0; i < n; i++) {
            dp[i][0] = 1;
        }
        for (int f = 1; f <= fuel; f++) {
            for (int i = 0; i < n; i++) {
                for (int j = 0; j < n; j++) {
                    if (i == j) continue;
                    int need = Math.abs(locations[i] - locations[j]);
                    if (f >= need) {
                        dp[i][f] = (dp[i][f] + dp[j][f-need]) % mod;
                    }
                }
            }
        }
        return (int) dp[start][fuel];
    }
}

class Solution {
    public boolean isWellFormed(String s, int[] distance) {
        Map<Character, Integer> map = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if (map.containsKey(c)) {
                int prev = map.get(c);
                if (i - prev - 1 != distance[c - 'a']) {
                    return false;
                }
            } else {
                map.put(c, i);
            }
        }
        return true;
    }

    public boolean wellFormed(String s, int[] distance) {
        if (s.length() != 52 || distance.length != 26) {
            return false;
        }
        for (int i = 0; i < 26; i++) {
            char c = (char) ('a' + i);
            if (s.indexOf(c) == -1) {
                continue;
            }
            int count = 0;
            for (int j = 0; j < s.length(); j++) {
                if (s.charAt(j) == c) {
                    count++;
                    if (count == 2) {
                        break;
                    }
                }
            }
            if (count != 2) {
                return false;
            }
        }
        return isWellFormed(s, distance);
    }
}

class Solution {
    public String largestPalindrome(String num) {
        int[] count = new int[10];
        for (char c : num.toCharArray()) {
            count[c - '0']++;
        }
        StringBuilder left = new StringBuilder();
        StringBuilder right = new StringBuilder();
        boolean hasMid = false;
        for (int i = 9; i >= 0; i--) {
            while (count[i] > 1) {
                left.append(i);
                right.insert(0, i);
                count[i] -= 2;
            }
            if (count[i] == 1) {
                if (!hasMid) {
                    left.append(i);
                    hasMid = true;
                } else {
                    right.delete(0, right.length());
                    break;
                }
            }
        }
        return left.append(right).toString();
    }
}

class Solution {
    public int maxSum(int[] nums) {
        Map<Integer, Integer> map = new HashMap<>();
        int res = -1;
        for (int num : nums) {
            int sum = 0, n = num;
            while (n > 0) {
                sum += n % 10;
                n /= 10;
            }
            if (map.containsKey(sum)) {
                res = Math.max(res, map.get(sum) + num);
                map.put(sum, Math.max(map.get(sum), num));
            } else {
                map.put(sum, num);
            }
        }
        return res;
    }
}

class Solution {
    public int[][] constructMatrix(int k, int[][] rowConditions, int[][] colConditions) {
        int[][] matrix = new int[k][k];
        boolean[] usedRow = new boolean[k+1];
        boolean[] usedCol = new boolean[k+1];
        for (int i = 0; i < rowConditions.length; i++) {
            int above = rowConditions[i][0];
            int below = rowConditions[i][1];
            int rowAbove = findRow(matrix, above);
            int rowBelow = findRow(matrix, below);
            if (rowAbove >= rowBelow) return new int[][]{};
            matrix[rowBelow][col(matrix, below, usedCol)] = above;
            usedRow[above] = true;
            usedCol[col(matrix, below, usedCol)] = true;
        }
        for (int j = 0; j < colConditions.length; j++) {
            int left = colConditions[j][0];
            int right = colConditions[j][1];
            int colLeft = findCol(matrix, left);
            int colRight = findCol(matrix, right);
            if (colLeft >= colRight) return new int[][]{};
            matrix[row(matrix, right, usedRow)][colLeft] = right;
            usedRow[row(matrix, right, usedRow)] = true;
            usedCol[right] = true;
        }
        fillMatrix(matrix, usedRow, usedCol);
        return matrix;
    }
    
    private int findRow(int[][] matrix, int val) {
        for (int i = matrix.length-1; i >= 0; i--) {
            for (int j = 0; j < matrix[0].length; j++) {
                if (matrix[i][j] == val) return i;
            }
        }
        return -1;
    }
    
    private int findCol(int[][] matrix, int val) {
        for (int j = matrix.length-1; j >= 0; j--) {
            for (int i = 0; i < matrix[0].length; i++) {
                if (matrix[i][j] == val) return j;
            }
        }
        return -1;
    }
    
    private int row(int[][] matrix, int val, boolean[] usedRow) {
        for (int i = 0; i < matrix.length; i++) {
            if (!usedRow[i+1] && col(matrix, val, usedRow) == -1) return i;
        }
        return -1;
    }
    
    private int col(int[][] matrix, int val, boolean[] usedCol) {
        for (int j = 0; j < matrix[0].length; j++) {
            if (!usedCol[matrix[findRow(matrix, val)][j]]) return j;
        }
        return -1;
    }
    
    private void fillMatrix(int[][] matrix, boolean[] usedRow, boolean[] usedCol) {
        int lastVal = 0;
        for (int i = 0; i < matrix.length; i++) {
            for (int j = 0; j < matrix[0].length; j++) {
                if (matrix[i][j] == 0) {
                    while (usedRow[lastVal+1] || usedCol[lastVal+1]) lastVal++;
                    matrix[i][j] = lastVal+1;
                    usedRow[lastVal+1] = true;
                    usedCol[lastVal+1] = true;
                    lastVal++;
                }
            }
        }
    }
}

class Solution {
    public int minTimeToCollectGarbage(String[] garbage, int[] travel) {
        int n = garbage.length;
        int[] cnt = new int[3];
        for (int i = 0; i < n; i++) {
            for (char c : garbage[i].toCharArray()) {
                if (c == 'M') cnt[0]++;
                else if (c == 'P') cnt[1]++;
                else cnt[2]++;
            }
        }
        int ans = Integer.MAX_VALUE;
        for (int i = 0; i < (1<<n-1); i++) {
            if (Integer.bitCount(i) != 1) continue;
            int[] start = new int[3];
            int cur = 0, time = 0;
            for (int j = 0; j < n; j++) {
                for (char c : garbage[j].toCharArray()) {
                    if (c == 'M') start[0]++;
                    else if (c == 'P') start[1]++;
                    else start[2]++;
                }
                if (((1<<j) & i) > 0 || j == n-1) {
                    int tmp = 0;
                    for (int k = 0; k < 3; k++) {
                        tmp += Math.abs(start[k] - cnt[k]);
                    }
                    start = new int[3];
                    time += tmp + (j == n-1 ? 0 : travel[j]);
                    cur = Math.max(cur, tmp);
                }
            }
            ans = Math.min(ans, time - cur);
        }
        return ans;
    }
}

class Solution {
    public String removeStars(String s) {
        StringBuilder sb = new StringBuilder(s);
        int i = 0;
        while (i < sb.length()) {
            if (sb.charAt(i) == '*') {
                int left = i - 1, right = i + 1;
                while (sb.charAt(right) == '*') {
                    right++;
                }
                if (left < 0 || right == sb.length()) {
                    sb.deleteCharAt(i);
                } else if (sb.charAt(left) == sb.charAt(right)) {
                    sb.delete(right, right + 1);
                } else {
                    sb.deleteCharAt(i);
                }
            } else {
                i++;
            }
        }
        return sb.toString();
    }
}

class Solution {
    public int[] maxSubsequence(int[] nums, int[] queries) {
        int[] ans = new int[queries.length];
        Arrays.sort(nums);
        int n = nums.length;
        for (int i = 0; i < queries.length; i++) {
            int q = queries[i];
            int j = n - 1, sum = 0;
            while (j >= 0 && nums[j] > q) j--;
            int k = 0;
            while (k < j) {
                if (nums[k] + nums[j] <= q) {
                    ans[i]++;
                    k++;
                    j--;
                } else {
                    j--;
                }
            }
            if (k == j) ans[i]++;
        }
        return ans;
    }
}

class Solution {
    public int[] maxSumOfEachQuery(int[] nums, int[] removeQueries) {
        int n = nums.length;
        int[] ans = new int[n];
        Stack<Integer> st = new Stack<>();
        int[] preSum = new int[n+1];
        for (int i = 0; i < n; i++) {
            preSum[i+1] = preSum[i] + nums[i];
        }
        int[] left = new int[n];
        int[] right = new int[n];
        for (int i = 0; i < n; i++) {
            left[i] = i == 0 ? -1 : i-1;
            right[i] = i == n-1 ? n : i+1;
        }
        for (int removeIdx : removeQueries) {
            int leftIdx = left[removeIdx];
            int rightIdx = right[removeIdx];
            st.push(removeIdx);
            left[rightIdx] = leftIdx;
            right[leftIdx] = rightIdx;
            while (!st.isEmpty()) {
                int idx = st.pop();
                int l = left[idx];
                int r = right[idx];
                ans[idx] = preSum[r] - preSum[l+1];
                int lr = left[l];
                int rl = right[r];
                if (lr >= 0 && rl < n && nums[lr] <= nums[rl]) {
                    left[r] = lr;
                    right[l] = rl;
                    st.push(l);
                } else if (lr >= 0 && rl < n) {
                    left[r] = l;
                    right[l] = r;
                } else if (lr >= 0) {
                    left[r] = l;
                    right[l] = r;
                    st.push(l);
                } else if (rl < n) {
                    left[r] = l;
                    right[l] = r;
                    st.push(r);
                }
            }
        }
        return ans;
    }
}

class Solution {
    public String shiftingLetters(String s, int[][] shifts) {
        int n = s.length();
        int[] prefixSum = new int[n];
        prefixSum[n-1] = shifts[n-1][2] * shifts[n-1][1];
        for (int i = n-2; i >= 0; i--) {
            prefixSum[i] = prefixSum[i+1] + shifts[i][2] * shifts[i][1]; 
        }
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < n; i++) {
            int shift = (s.charAt(i) - 'a' + prefixSum[i]) % 26;
            sb.append((char) ('a' + shift))
        }
        return sb.toString();
    }
}

class Solution {
    public int reorganizeBinaryString(String s) {
        int count0 = 0, count1 = 0;
        for (char c : s.toCharArray()) {
            if (c == '0') {
                count0++;
            } else {
                count1++;
            }
        }
        if (count1 > count0 + 1 || count0 > count1) {
            return -1;
        }
        int res = 0, i = 0, j = 0, n = s.length();
        char[] arr = s.toCharArray();
        while (i < n && j < n) {
            while (i < n && arr[i] == '1') {
                i++;
            }
            while (j < n && arr[j] == '0') {
                j++;
            }
            if (i < n && j < n && i < j) {
                res += j - i;
                swap(arr, i, j);
            }
        }
        return res;
    }
    
    private void swap(char[] arr, int i, int j) {
        char temp = arr[i];
        arr[i] = arr[j];
        arr[j] = temp;
    }
}

class Solution {
    public int minMoves(String blocks, int k) {
        int n = blocks.length();
        List<Integer> idx = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            if (blocks.charAt(i) == 'B') {
                idx.add(i);
            }
        }
        int m = idx.size();
        int ans = Integer.MAX_VALUE;
        for (int i = k / 2; i < m - (k - 1) / 2; i++) {
            int left = idx.get(i - k / 2);
            int right = idx.get(i + (k - 1) / 2);
            int median = (left + right) / 2;
            int cost = 0;
            for (int j = i - k / 2; j <= i + (k - 1) / 2; j++) {
                cost += Math.abs(median - idx.get(j));
            }
            ans = Math.min(ans, cost);
        }
        return ans;
    }
}

class Solution {
    public int kthLargest(int[] nums, int k) {
        Arrays.sort(nums);
        int n = nums.length;
        int lo = -n * 1000000000;
        int hi = n * 1000000000;
        while (lo < hi) {
            int mid = lo + (hi - lo) / 2;
            long count = 0;
            long total = 0;
            int left = 0;
            for (int right = 0; right < n; right++) {
                total += nums[right];
                while (total - (long) nums[left] > mid) {
                    total -= nums[left];
                    left++;
                }
                count += right - left + 1;
            }
            if (count >= k) {
                hi = mid;
            } else {
                lo = mid + 1;
            }
        }
        return lo;
    }
    
    public int getKth(int[] nums, int k) {
        if (nums == null || nums.length == 0) return 0;
        int n = nums.length;
        int positiveCount = 0;
        int negativeCount = 0;
        int zeroCount = 0;
        long product = 1;
        boolean hasZero = false;
        int maxNegative = Integer.MIN_VALUE;
        for (int num : nums) {
            if (num > 0) {
                positiveCount++;
                product *= num;
            } else if (num < 0) {
                negativeCount++;
                maxNegative = Math.max(maxNegative, num);
                product *= -num;
            } else {
                zeroCount++;
                hasZero = true;
            }
        }
        if (k <= product) {
            int lo = 1;
            int hi = Integer.MAX_VALUE;
            while (lo < hi) {
                int mid = lo + (hi - lo) / 2;
                long count = 0;
                if (mid > 0) {
                    count += positiveCount * (long) Math.pow(mid, positiveCount);
                }
                if (mid < 0) {
                    if (negativeCount % 2 == 1) {
                        count += Math.pow(mid, negativeCount);
                    }
                    if (maxNegative * mid > 0) {
                        count += negativeCount * (long) Math.pow(-mid, negativeCount - 1);
                    }
                }
                if (hasZero && mid >= 0) {
                    count += Math.pow(zeroCount, mid == 0 ? 1 : 0);
                }
                if (count >= k) {
                    hi = mid;
                } else {
                    lo = mid + 1;
                }
            }
            return lo;
        } else {
            return kthLargest(nums, n - k + 1);
        }
    }
    
    public int getKth(int lo, int hi, int k) {
        int[] nums = new int[hi - lo + 1];
        for (int i = lo; i <= hi; i++) {
            nums[i - lo] = i;
        }
        return getKth(nums, k);
    }
}

class Solution {
    public int minMinutes(TreeNode root, int start) {
        if (root == null) {
            return 0;
        }
        Queue<TreeNode> queue = new LinkedList<>();
        Map<TreeNode, TreeNode> parentMap = new HashMap<>();
        queue.offer(root);
        parentMap.put(root, null);
        while (!queue.isEmpty()) {
            TreeNode curr = queue.poll();
            if (curr.val == start) {
                break;
            }
            if (curr.left != null) {
                queue.offer(curr.left);
                parentMap.put(curr.left, curr);
            }
            if (curr.right != null) {
                queue.offer(curr.right);
                parentMap.put(curr.right, curr);
            }
        }
        int time = 0;
        Set<TreeNode> infected = new HashSet<>();
        queue.offer(root);
        infected.add(root);
        while (!queue.isEmpty()) {
            int size = queue.size();
            boolean allInfected = true;
            for (int i = 0; i < size; i++) {
                TreeNode curr = queue.poll();
                if (!infected.contains(curr)) {
                    allInfected = false;
                    if (curr.left != null && infected.contains(curr.left)
                            || curr.right != null && infected.contains(curr.right)
                            || parentMap.get(curr) != null && infected.contains(parentMap.get(curr))) {
                        infected.add(curr);
                    } else {
                        queue.offer(curr);
                    }
                }
            }
            if (allInfected) {
                return time;
            }
            time++;
        }
        return -1;
    }
}

class Solution {
    public int minimumEffort(int[] initialEnergy, int[] initialExperience, int[] energy, int[] experience) {
        int n = energy.length;
        int[] dp = new int[101];
        Arrays.fill(dp, Integer.MAX_VALUE);
        dp[initialEnergy[0]] = initialExperience[0];
        for (int i = 1; i < n; i++) {
            for (int j = 100; j >= energy[i]; j--) {
                if (dp[j-energy[i]] != Integer.MAX_VALUE && dp[j-energy[i]] >= initialExperience[i])
                    dp[j] = Math.min(dp[j], dp[j-energy[i]] + experience[i]);
            }
        }
        for (int i = 0; i <= 100; i++) {
            if (dp[i] != Integer.MAX_VALUE) return i;
        }
        return -1;
    }
}

