        }
        return res;
    }
}

class Solution {
    public String constructSmallestNumber(String pattern) {
        int n = pattern.length();
        int[] nums = new int[n+1];
        for (int i = 0; i <= n; i++) {
            nums[i] = i+1;
        }
        StringBuilder res = new StringBuilder();
        for (int i = 0; i < n; i++) {
            if (pattern.charAt(i) == 'I') {
                res.append(nums[i]);
                nums = reverse(nums, i, nums[i]);
            } else {
                nums = reverse(nums, i, nums[i]);
            }
        }
        res.append(nums[n]);
        return res.toString();
    }
    
    private int[] reverse(int[] nums, int start, int end) {
        while (start < end) {
            int temp = nums[start];
            nums[start] = nums[end];
            nums[end] = temp;
            start++;
            end--;
        }
        return nums;
    }
}

class Solution {
    public int findHighestScore(int[] edges) {
        int n = edges.length;
        int[] inDegree = new int[n];
        int[] score = new int[n];
        for (int i = 0; i < n; i++) {
            inDegree[edges[i]]++;
            score[edges[i]] += i;
        }
        int maxScore = Integer.MIN_VALUE;
        int maxNode = -1;
        for (int i = 0; i < n; i++) {
            if (inDegree[i] == 0) continue;
            if (score[i] > maxScore) {
                maxScore = score[i];
                maxNode = i;
            }
        }
        return maxNode;
    }
}

class Solution {
