    }
}

class Solution {
    public int minOperations(int[] nums) {
        int n = nums.length;
        int[] dp = new int[n + 1];
        int len = 0;
        for (int i = 0; i < n; i++) {
            int l = 0, r = len;
            while (l < r) {
                int mid = (l + r + 1) >>> 1;
                if (dp[mid] < nums[i]) {
                    l = mid;
                } else {
                    r = mid - 1;
                }
            }
            len = Math.max(len, l + 1);
            dp[l + 1] = nums[i];
        }
        return n - len;
    }
}

class Solution {
    public int maxConsecutive(int[] chargeTimes, int[] runningCosts, long budget) {
        int n = chargeTimes.length;
        int left = 0, right = n;
        while (left < right) {
            int mid = left + (right - left + 1) / 2;
            if (check(chargeTimes, runningCosts, mid, budget)) {
                left = mid;
            } else {
                right = mid - 1;
            }
        }
        return left;
    }
    
    private boolean check(int[] chargeTimes, int[] runningCosts, int k, long budget) {
        long sum = 0, maxCharge = 0, totalCost = 0;
        int i = 0, j = 0;
        while (j < chargeTimes.length) {
            if (j - i + 1 > k) {
                sum -= runningCosts[i];
                maxCharge = Math.max(maxCharge, chargeTimes[i]);
                i++;
            }
            sum += runningCosts[j];
            maxCharge = Math.max(maxCharge, chargeTimes[j]);
            totalCost = maxCharge + sum * k;
            if (totalCost > budget) return false;
            j++;
        }
        return true;
    }
}

class Solution {
    public int countPairs(int[] nums) {
        int n = nums.length;
        Map<Integer, Integer> cnt = new HashMap<>();
        int ans = 0;
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                int diff = nums[j] - nums[i];
                if (diff > n) {
                    continue;
                }
                int pair = (i << 16) | j;
                int c = cnt.getOrDefault(pair, 0);
                ans += c;
                cnt.put(pair, c + 1 + cnt.getOrDefault(diff * 65536 + j, 0));
            }
        }
        return ans;
    }
}

class Solution {
    public int[][] mergeArrays(int[][] items1, int[][] items2) {
        Map<Integer, Integer> map = new HashMap<>();
        for (int[] item : items1) {
            map.put(item[0], map.getOrDefault(item[0], 0) + item[1]);
        }
        for (int[] item : items2) {
            map.put(item[0], map.getOrDefault(item[0], 0) + item[1]);
        }
        List<int[]> list = new ArrayList<>();
        for (int key : map.keySet()) {
            list.add(new int[]{key, map.get(key)});
        }
        Collections.sort(list, (a, b) -> a[0] - b[0]);
        int[][] ret = new int[list.size()][2];
        for (int i = 0; i < list.size(); i++) {
            ret[i] = list.get(i);
        }
        return ret;
    }
}

class Solution {
    public int reachableNodes(int[][] edges, int maxMoves, int n) {
        int[][] graph = new int[n][n];
        for (int i = 0; i < n; i++) {
            Arrays.fill(graph[i], -1);
        }
        for (int[] edge : edges) {
            graph[edge[0]][edge[1]] = graph[edge[1]][edge[0]] = edge[2]+1;
        }
        int[] dist = new int[n];
        Arrays.fill(dist, Integer.MAX_VALUE);
        dist[0] = 0;
        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b)->dist[a]-dist[b]);
        pq.offer(0);
        while (!pq.isEmpty()) {
            int u = pq.poll();
            for (int v = 0; v < n; v++) {
                if (graph[u][v] != -1) {
                    int d = dist[u] + graph[u][v];
                    if (d < dist[v]) {
                        pq.remove(v);
                        dist[v] = d;
                        pq.offer(v);
                    }
                }
            }
        }
        int res = 0;
        for (int i = 0; i < n; i++) {
            if (dist[i] <= maxMoves) {
                res++;
            }
        }
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1], distU = maxMoves - dist[u], distV = maxMoves - dist[v];
            if (distU >= 0) {
                res += Math.min(edge[2], distV+distU);
            } else if (distV >= 0) {
                res += Math.min(edge[2], distU+distV);
            }
        }
        return res;
    }
}

class Solution {
    public int longestSubsequence(String s, int k) {
        int n = s.length();
        int[] dp = new int[n];
        Arrays.fill(dp, 1);
        int res = 1;
        for (int i = 1; i < n; i++) {
            for (int j = 0; j < i; j++) {
                if (Math.abs(s.charAt(j) - s.charAt(i)) <= k) {
                    dp[i] = Math.max(dp[i], dp[j] + 1);
                }
            }
            res = Math.max(res, dp[i]);
        }
        return res;
    }
}

class Solution {
    public boolean canThreePartsEqualSum(int[] A) {
        int sum = 0;
        for (int num : A) {
            sum += num;
        }
        if (sum % 3 != 0) {
            return false;
        }
        int partSum = 0, count = 0;
        for (int num : A) {
            partSum += num;
            if (partSum == sum / 3) {
                count++;
                partSum = 0;
            }
            if (count == 3) {
                return true;
            }
        }
        return false;
    }
}

class Solution {
    public int numberOfArithmeticSlices(int[] nums, int diff) {
        Map<Integer, Integer>[] dp = new HashMap[nums.length];
        int res = 0;
        for (int i = 0; i < nums.length; i++) {
            dp[i] = new HashMap<>();
            for (int j = 0; j < i; j++) {
                long diff_curr = (long)nums[i] - (long)nums[j];
                if (diff_curr <= Integer.MIN_VALUE || diff_curr > Integer.MAX_VALUE) continue;
                int d = (int)diff_curr;
                int cnt = dp[j].getOrDefault(d, 0);
                res += cnt;
                dp[i].put(d, dp[i].getOrDefault(d, 0) + cnt + 1);
            }
        }
        return res;
    }
}

class Solution {
    public int longestPath(int[] edges) {
        int n = edges.length;
        int max = -1;
        boolean[] visited = new boolean[n];
        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                Set<Integer> set = new HashSet<>();
                set.add(i);
                int curr = i;
                while (edges[curr] != -1 && !visited[edges[curr]]) {
                    curr = edges[curr];
                    if (set.contains(curr)) {
                        max = Math.max(max, set.size() - set.indexOf(curr));
                        break;
                    }
                    set.add(curr);
                }
                visited[i] = true;
            }
        }
        return max;
    }
}

class Solution {
    public int findClosest(int[] edges, int node1, int node2) {
        int n = edges.length;
        int[] dist1 = new int[n], dist2 = new int[n];
        Arrays.fill(dist1, n);
        Arrays.fill(dist2, n);
        int u = node1, v = node2;
        while (u != -1 || v != -1) {
            if (u != -1) {
                dist1[u] = 0;
                u = edges[u];
            }
            if (v != -1) {
                dist2[v] = 0;
                v = edges[v];
            }
        }
        int ans = -1, minMaxDist = n;
        for (int i = 0; i < n; i++) {
            if (dist1[i] == 0 && dist2[i] == 0) {
                ans = i;
                break;
            }
            if (dist1[i] < n && dist2[i] < n) {
                int maxDist = Math.max(dist1[i], dist2[i]);
                if (maxDist < minMaxDist) {
                    ans = i;
                    minMaxDist = maxDist;
                }
            }
        }
        return ans;
    }
}

class Solution {
    public int maxNumberOfGroups(int[] grades) {
        Arrays.sort(grades);
        int groups = 0;
        int currentSum = 0;
        int currentCount = 0;
        for (int i = grades.length - 1; i >= 0; i--) {
            currentSum += grades[i];
            currentCount++;
            if (currentSum < currentCount * (currentCount + 1) / 2) {
                currentSum -= grades[i];
                currentCount--;
                groups++;
            }
        }
        if (currentCount > 0) {
            groups++;
        }
        return groups;
    }
}

class Solution {
    public int minOperations(int[] nums) {
        int res = 0;
        while (true) {
            int min = Integer.MAX_VALUE, cnt = 0;
            for (int num : nums) {
                if (num == 0) continue;
                min = Math.min(min, num);
            }
            if (min == Integer.MAX_VALUE) break;
            for (int i = 0; i < nums.length; i++) {
                if (nums[i] == 0) continue;
                if (nums[i] < min) {
                    res += nums[i];
                    nums[i] = 0;
                } else {
                    res += min;
                    nums[i] -= min;
                    if (nums[i] == 0) cnt++;
                }
            }
            if (cnt == nums.length) break;
        }
        return res;
    }
}

class Solution {
    public int shortestPath(int[] rolls, int k) {
        int n = rolls.length;
        int[][] dp = new int[n+1][k+1];
        int max = Integer.MIN_VALUE;
        for(int i=1;i<=n;i++){
            int sum = 0;
            for(int j=1;j<=k;j++){
                dp[i][j] = dp[i-1][j] + 1;
                if(sum>0) dp[i][j] = Math.min(dp[i][j], dp[i-1][sum]);
                if(rolls[i-1] == j) sum = j;
                max = Math.max(max, dp[i][j]);
            }
        }
        return max>n?-1:max;
    }
}

