class Solution {
    public String pokerHand(int[] ranks, char[] suits) {
        Arrays.sort(ranks);
        int[] count = new int[14];
        for (int rank : ranks) {
            count[rank]++;
        }
        boolean flush = true;
        char suit = suits[0];
        for (int i = 1; i < 5; i++) {
            if (suits[i] != suit) {
                flush = false;
                break;
            }
        }
        if (flush) {
            return "Flush";
        }
        int maxCount = 0;
        int secondCount = 0;
        for (int i = 1; i < count.length; i++) {
            int currentCount = count[i];
            if (currentCount > maxCount) {
                secondCount = maxCount;
                maxCount = currentCount;
            } else if (currentCount > secondCount) {
                secondCount = currentCount;
            }
        }
        if (maxCount == 4) {
            return "Four of a Kind";
        }
        if (maxCount == 3) {
            if (secondCount == 2) {
                return "Full House";
            } else {
                return "Three of a Kind";
            }
        }
        if (maxCount == 2) {
            if (secondCount == 2) {
                return "Two Pair";
            } else {
                return "Pair";
            }
        }
        return "High Card";
    }
}

class Solution {
    public int numSubarraysWithSum(int[] nums, int goal) {
