class Solution {
    public int countPairs(int[] nums, int k) {
        Map<Integer,Integer> map = new HashMap<>();
        int res = 0;
        for(int i=0;i<nums.length;i++){
            for(int j=0;j<=30;j++){
                if(((nums[i]>>j)&1)>0){
                    int cnt = map.getOrDefault((1<<j), 0);
                    res += cnt;
                    map.put((1<<j), cnt+1);
                } 
            }
            int cnt = map.getOrDefault(nums[i], 0);
            res += cnt;
            map.put(nums[i], cnt+1);
        }
        return res;
    }
}

class FoodRatings {
    Map<String, Integer> map;
    Map<String, PriorityQueue<String>> cuisineMap;
    public FoodRatings(String[] foods, String[] cuisines, int[] ratings) {
        map = new HashMap<>();
        cuisineMap = new HashMap<>();
        for (int i = 0; i < foods.length; i++) {
            map.put(foods[i], ratings[i]);
            if (!cuisineMap.containsKey(cuisines[i])) {
                cuisineMap.put(cuisines[i], new PriorityQueue<>((a, b) -> map.get(b) == map.get(a) ? a.compareTo(b) : map.get(b) - map.get(a)));
            }
            cuisineMap.get(cuisines[i]).add(foods[i]);
        }
    }
    
    public void changeRating(String food, int newRating) {
        int oldRating = map.get(food);
        map.put(food, newRating);
        String cuisine = null;
        for (Map.Entry<String, PriorityQueue<String>> entry : cuisineMap.entrySet()) {
            if (entry.getValue().contains(food)) {
                cuisine = entry.getKey();
                break;
            }
        }
        cuisineMap.get(cuisine).remove(food);
        cuisineMap.get(cuisine).add(food);
    }
    
    public String highestRated(String cuisine) {
        return cuisineMap.get(cuisine).peek();
    }
}

