class Solution {
    public int minDeletions(int[] nums, int[] numsDivide) {
        Map<Integer, Integer> freq = new HashMap<>();
        for (int num : nums) freq.put(num, freq.getOrDefault(num, 0) + 1);
        int min = Integer.MAX_VALUE;
        for (int numDivide : numsDivide) {
            boolean found = false;
            for (int i = numDivide; i <= 1e9; i += numDivide) {
                if (freq.containsKey(i)) {
                    found = true;
                    int deletions = nums.length - freq.get(i);
                    min = Math.min(min, deletions);
                    break;
                }
            }
            if (!found) return -1;
        }
        return min;
    }
}

