class Solution {
    public int maxNonNegativeSubArray(int[] nums, int threshold) {
        int n = nums.length;
        int k = n;
        while (k > 0) {
            for (int i = 0; i <= n - k; i++) {
                int total = 0;
                boolean valid = true;
                for (int j = i; j < i + k; j++) {
                    total += nums[j];
                    if (total > threshold) {
                        valid = false;
                        break;
                    }
                }
                if (valid) {
                    return k;
                }
            }
            k--;
        }
        return -1;
    }
}

class Solution {
    public int minAbsoluteSumDiff(int[] nums1, int[] nums2) {
        int n = nums1.length;
        int[] sorted = Arrays.copyOf(nums1, n);
        Arrays.sort(sorted);
        long sum = 0, maxDiff = 0;
        for (int i = 0; i < n; i++) {
            int diff = Math.abs(nums1[i] - nums2[i]);
            sum += diff;
            int j = Arrays.binarySearch(sorted, nums2[i]);
            if (j < 0) j = -(j + 1);
            if (j < n) maxDiff = Math.max(maxDiff, diff - Math.abs(sorted[j] - nums2[i]));
            if (j > 0) maxDiff = Math.max(maxDiff, diff - Math.abs(sorted[j - 1] - nums2[i]));
        }
        return (int)((sum - maxDiff) % 1000000007);
    }
}

class Solution {
    public int latestBus(int[] buses, int[] passengers, int capacity) {
        int n = buses.length;
        int m = passengers.length;
        Arrays.sort(buses);
        Arrays.sort(passengers);
        int b = 0, p = 0;
        int ans = -1;
        while (b < n && p < m) {
            if (buses[b] >= passengers[p] && p + capacity <= b) {
                ans = passengers[p++] - 1;
            } else {
                b++;
            }
        }
        if (p < m && ans < passengers[p]) {
            ans = passengers[p];
        }
        return ans;
    }
}

