class Solution {
    private final int MOD = 1000000007;
    
    public int countArrangement(int n, int maxVal) {
        long[][] dp = new long[n+1][maxVal+1];
        for (int i = 1; i <= maxVal; i++) {
            dp[1][i] = 1;
        }
        for (int i = 2; i <= n; i++) {
            for (int j = 1; j <= maxVal; j++) {
                for (int k = j; k <= maxVal; k += j) {
                    dp[i][j] += dp[i-1][k];
                    dp[i][j] %= MOD;
                }
            }
        }
        long ans = 0;
        for (int i = 1; i <= maxVal; i++) {
            ans += dp[n][i];
            ans %= MOD;
        }
        return (int) ans;
    }
}

class Solution {
    public boolean canTransform(String start, String target) {
        int n = start.length();
        int i = 0, j = 0;
        while (i < n && j < n) {
            while (i < n && start.charAt(i) == 'X') i++;
            while (j < n && target.charAt(j) == 'X') j++;
            if (i == n && j == n) return true;
            if (i == n || j == n || start.charAt(i) != target.charAt(j)) return false;
            if (start.charAt(i) == 'R' && i > j) return false;
            if (start.charAt(i) == 'L' && i < j) return false;
            i++;
            j++;
        }
        return true;
    }
}

