class Solution {
    public int[][] printLinkedListInSpiral(int m, int n, ListNode head) {
        int[][] matrix = new int[m][n];
        ListNode curr = head;
        int r1 = 0, r2 = m - 1, c1 = 0, c2 = n - 1;
        while (curr != null) {
            for (int c = c1; c <= c2 && curr != null; c++)
                matrix[r1][c] = curr.val;
            for (int r = r1 + 1; r <= r2 && curr != null; r++)
                matrix[r][c2] = curr.val;
            for (int c = c2 - 1; c >= c1 && curr != null; c--)
                matrix[r2][c] = curr.val;
            for (int r = r2 - 1; r > r1 && curr != null; r--)
                matrix[r][c1] = curr.val;
            curr = curr.next;
            r1++;
            r2--;
            c1++;
            c2--;
        }
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (matrix[i][j] == 0)
                    matrix[i][j] = -1;
            }
        }
        return matrix;
    }
}

class Solution {
    private static final int MOD = 1000000007;

    public int countPaths(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        long[][] dp = new long[m][n];
        dp[0][0] = 1;

        for (int i = 1; i < m; i++) {
            if (grid[i][0] > grid[i - 1][0]) {
                dp[i][0] = dp[i - 1][0];
            }
        }
        for (int j = 1; j < n; j++) {
            if (grid[0][j] > grid[0][j - 1]) {
                dp[0][j] = dp[0][j - 1];
            }
        }

        for (int i = 1; i < m; i++) {
            for (int j = 1; j < n; j++) {
                if (grid[i][j] > grid[i - 1][j]) {
                    dp[i][j] += dp[i - 1][j];
                }
                if (grid[i][j] > grid[i][j - 1]) {
                    dp[i][j] += dp[i][j - 1];
                }
                dp[i][j] %= MOD;
            }
        }

        return (int) dp[m - 1][n - 1];
    }
}

class Solution {
    public int numWays(int n, int delay, int forget) {
        final int MOD = 1000000007;
        int[] dp = new int[n+1];
        dp[0] = 1;
        dp[1] = 1;
        int prev = 1;
        int sum = 1;
        for (int i = 2; i <= n; i++) {
            sum = (sum + prev) % MOD;
            if (i > delay) {
                sum = (sum - dp[i-delay-1] + MOD) % MOD;
            }
            if (i > forget) {
                prev = (prev - dp[i-forget-1] + MOD) % MOD;
            }
            dp[i] = sum;
            prev = (prev + dp[i-1]) % MOD;
        }
        return dp[n];
    }
}

class Solution {
    public String substitute(String key, String message) {
        Map<Character, Character> map = new HashMap<>();
        int idx = 0;
        for (int i = 0; i < key.length(); i++) {
            char c = key.charAt(i);
            if (c == ' ') continue;
            if (!map.containsKey(c)) {
                map.put(c, (char) ('a' + idx));
                idx++;
            }
        }
        for (char c = 'a'; c <= 'z'; c++) {
            if (!map.containsKey(c)) {
                map.put(c, (char) ('a' + idx));
                idx++;
            }
        }
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < message.length(); i++) {
            char c = message.charAt(i);
            if (c == ' ') {
                sb.append(' ');
            } else {
                sb.append(map.get(c));
            }
        }
        return sb.toString();
    }
}

class Solution {
    private int MOD = 1000000007;
    private int[][] dp;
    private int[][] gcd;

    public int countArrangement(int n) {
        dp = new int[n + 1][129];
        gcd = new int[7][7];
        for (int i = 1; i <= 6; i++) {
            for (int j = 1; j <= 6; j++) {
                gcd[i][j] = gcd(j, i % j);
            }
        }
        Arrays.stream(dp).forEach(a -> Arrays.fill(a, -1));
        return dfs(1, 0, n);
    }

    private int dfs(int cur, int used, int n) {
        if (cur == n + 1)
            return 1;
        if (dp[cur][used] != -1)
            return dp[cur][used];
        int ans = 0;
        for (int i = 1; i <= 6; i++) {
            int pos = 1 << (i - 1);
            if (((used & pos) == 0) && (cur == 1 || gcd[digit(used, cur - 2)][i] == 1)
                    && (cur == 2 || (gcd[digit(used, cur - 2)][digit(used, cur - 3)] == 1 && digit(used, cur - 2) != digit(used, cur - 3))))
                ans += dfs(cur + 1, used | pos, n);
            if (ans > MOD)
                ans -= MOD;
        }
        dp[cur][used] = ans;
        return ans;
    }

    private int digit(int mask, int i) {
        return (mask >> (i * 3)) & 7;
    }

    private int gcd(int a, int b) {
        if (b == 0)
            return a;
        return gcd(b, a % b);
    }
}

class Solution {
    public int countUnreachable(int n, int[][] edges) {
        List<Integer>[] adjList = new List[n];
        for (int i = 0; i < n; i++) {
            adjList[i] = new ArrayList<>();
        }
        for (int[] edge : edges) {
            adjList[edge[0]].add(edge[1]);
            adjList[edge[1]].add(edge[0]);
        }
        boolean[] visited = new boolean[n];
        int count = 0;
        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                count += dfs(i, visited, adjList);
            }
        }
        return n * (n - 1) / 2 - count;
    }
    
    private int dfs(int node, boolean[] visited, List<Integer>[] adjList) {
        visited[node] = true;
        int count = 1;
        for (int neighbor : adjList[node]) {
            if (!visited[neighbor]) {
                count += dfs(neighbor, visited, adjList);
            }
        }
        return count;
    }
}

class Solution {
    public int findMaximumXOR(int[] nums) {
        int max = 0, mask = 0;
        for (int i = 31; i >= 0; i--) {
            mask |= (1 << i);
            Set<Integer> set = new HashSet<>();
            for (int num : nums) {
                set.add(num & mask);
            }
            int temp = max | (1 << i);
            for (int prefix : set) {
                if (set.contains(temp ^ prefix)) {
                    max = temp;
                    break;
                }
            }
        }
        return max;
    }
}

