class Solution {
    public int minDifference(int[] nums, int[][] edges) {
        int n = nums.length;
        List<Integer>[] graph = new List[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1];
            graph[u].add(v);
            graph[v].add(u);
        }
        int[] subTreeXor = new int[n], parentXor = new int[n];
        dfs1(graph, nums, subTreeXor, parentXor, 0, -1);
        int[] size = new int[n];
        dfs2(graph, size, 0, -1);
        int[] leftSubtreeSize = new int[n], rightSubtreeSize = new int[n];
        int currentXor = subTreeXor[0];
        for (int v : graph[0]) {
            int l = dfs3(graph, size, leftSubtreeSize, subTreeXor, parentXor, v, 0);
            int r = n - l;
            int lxor = leftXor(leftSubtreeSize, subTreeXor, parentXor, v, r, l), rxor = rightXor(rightSubtreeSize, subTreeXor, parentXor, v, r, l);
            currentXor ^= lxor;
            currentXor ^= rxor;
            if (lxor < rxor) {
                int temp = lxor; lxor = rxor; rxor = temp;
                temp = l; l = r; r = temp;
            }
            int score = lxor - rxor;
            updateAnswer(score);
            updateAnswer(lxor - rxor - 2 * r * (currentXor ^ rxor));
            updateAnswer(lxor - rxor - 2 * l * (currentXor ^ lxor));
            currentXor ^= rxor;
            currentXor ^= lxor;
        }
        return answer;
    }

    private static void dfs1(List<Integer>[] graph, int[] nums, int[] subTreeXor, int[] parentXor, int u, int p) {
        subTreeXor[u] = nums[u];
        for (int v : graph[u]) {
            if (v != p) {
                dfs1(graph, nums, subTreeXor, parentXor, v, u);
                subTreeXor[u] ^= subTreeXor[v];
            }
        }
        parentXor[u] = p == -1 ? 0 : parentXor[p] ^ subTreeXor[p] ^ subTreeXor[u];
    }

    private static void dfs2(List<Integer>[] graph, int[] size, int u, int p) {
        size[u] = 1;
        for (int v : graph[u]) {
            if (v != p) {
                dfs2(graph, size, v, u);
                size[u] += size[v];
            }
        }
    }

    private static int dfs3(List<Integer>[] graph, int[] size, int[] leftSubtreeSize, int[] subTreeXor, int[] parentXor, int u, int p) {
        leftSubtreeSize[u] = size[u];
        int lxor = subTreeXor[u];
        for (int v : graph[u]) {
            if (v != p) {
                int l = dfs3(graph, size, leftSubtreeSize, subTreeXor, parentXor, v, u);
                int r = size[u] - l;
                int rxor = parentXor[u] ^ parentXor[v] ^ subTreeXor[u];
                if (lxor < rxor) {
                    int temp = lxor; lxor = rxor; rxor = temp;
                    temp = l; l = r; r = temp;
                }
                int score = lxor - rxor;
                updateAnswer(score);
                updateAnswer(lxor - rxor - 2 * r * (parentXor[u] ^ rxor));
                updateAnswer(lxor - rxor - 2 * l * (parentXor[u] ^ lxor));
                leftSubtreeSize[u] = l;
                lxor ^= rxor;
            }
        }
        return leftSubtreeSize[u];
    }

    private static int ans = Integer.MAX_VALUE;

    private static void updateAnswer(int score) {
        ans = Math.min(ans, Math.abs(score));
    }

    private static int leftXor(int[] leftSubtreeSize, int[] subTreeXor, int[] parentXor, int v, int r, int l) {
        int rxor = parentXor[0] ^ parentXor[v] ^ subTreeXor[0] ^ subTreeXor[v];
        return rxor ^ subTreeXor[v] ^ (l == 0 ? 0 : parentXor[v] ^ parentXor[0] ^ subTreeXor[v]) ^ (l == r ? 0 : parentXor[0] ^ parentXor[v] ^ subTreeXor[v] ^ subTreeXor[0]);
    }

    private static int rightXor(int[] rightSubtreeSize, int[] subTreeXor, int[] parentXor, int v, int r, int l) {
        int lxor = parentXor[0] ^ parentXor[v] ^ subTreeXor[0] ^ subTreeXor[v];
        if (r == 0) {
            return 0;
        }
        int xor = 0;
        if (r == 1 || leftSubtreeSize[v] + 1 == r) {
            xor ^= subTreeXor[0] ^ subTreeXor[v] ^ subTreeXor[v];
        } else {
            xor ^= parentXor[v];
        }
        xor ^= l == 0 ? 0 : parentXor[0] ^ parentXor[v + 1] ^ subTreeXor[v];
        xor ^= l == r ? 0 : parentXor[0] ^ parentXor[v] ^ subTreeXor[0] ^ subTreeXor[v];
        return lxor ^ xor;
    }
    private static int[] leftSubtreeSize = new int[1001];
}

