class Solution {
    public int solve(String s, int k) {
        int n = s.length();
        int[][] dp = new int[n+1][k+1];
        for (int j = 0; j <= k; j++) dp[0][j] = -1;
        for (int i = 1; i <= n; i++) {
            for (int j = 0; j <= k; j++) {
                dp[i][j] = dp[i-1][j];
                if (s.charAt(i-1) == '1' && j > 0 && dp[i-1][j-1] != -1) {
                    dp[i][j] = Math.max(dp[i][j], dp[i-1][j-1] + 1);
                }
                if (s.charAt(i-1) == '0' && dp[i-1][j] != -1) {
                    dp[i][j] = Math.max(dp[i][j], dp[i-1][j] + 1);
                }
            }
        }
        int res = 0;
        for (int j = 0; j <= k; j++) {
            res = Math.max(res, dp[n][j]);
        }
        return res;
    }
}

class Solution {
    public int numSubarrayProductLessThanK(int[] nums, int k) {
        int n = nums.length;
        long prod = 1;
        int count = 0;
        for (int i = 0, j = 0; j < n; j++) {
            prod *= nums[j];
            while (i <= j && prod >= k) {
                prod /= nums[i];
                i++;
            }
            count += j - i + 1;
        }
        return count;
    }
}

class Solution {
    public boolean isSubStr(String s, String sub, List<List<String>> mappings) {
        int n = s.length();
        int m = sub.length();
        int i = 0, j = 0;
        while (i < n && j < m) {
            if (s.charAt(i) == sub.charAt(j)) {
                i++;
                j++;
            } else {
                boolean found = false;
                for (List<String> mapping : mappings) {
                    if (mapping.get(0).charAt(0) == sub.charAt(j)) {
                        sub = sub.substring(0, j) + mapping.get(1) + sub.substring(j+1);
                        found = true;
                        break;
                    }
                }
                if (!found) {
                    return false;
                }
            }
        }
        return j == m;
    }
}

