            while (left <= right) {
                int mid = left + (right - left) / 2;
                if ((long)spell * potions[mid] >= success) {
                    right = mid - 1;
                } else {
                    left = mid + 1;
                }
            }
            pairs[i] = potions.length - left;
        }
        return pairs;
    }
}

class Solution {
    public boolean isStrongPassword(String password) {
        int n = password.length(), lower = 0, upper = 0, digit = 0, special = 0, repeats = 0;
        for (int i = 0; i < n; ) {
            char c = password.charAt(i);
            if (Character.isLowerCase(c)) {
                lower = 1;
            } else if (Character.isUpperCase(c)) {
                upper = 1;
            } else if (Character.isDigit(c)) {
                digit = 1;
            } else {
                special = 1;
            }
            int j = i;
            while (j < n && password.charAt(j) == c) {
                j++;
            }
            repeats += (j - i) / 3;
            i = j;
        }
        int total = lower + upper + digit + special;
        if (n < 6) {
            return Math.max(0, 6 - n) == total - Math.max(0, 6 - n) && repeats <= Math.max(0, 6 - n);
        } else if (n <= 20) {
            return total == 4 && repeats <= n / 3;
        } else {
            return total == 4 && repeats <= n / 3 && n - repeats > 20;
        }
    }
}

class Solution {
    public int numSimilarGroups(String[] words) {
        int n = words.length;
        int[] parent = new int[n];
        for (int i = 0; i < n; i++) {
            parent[i] = i;
        }
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                if (similar(words[i], words[j])) {
                    int p1 = find(parent, i);
                    int p2 = find(parent, j);
                    if (p1 != p2) {
                        parent[p1] = p2;
                    }
                }
            }
        }
        int count = 0;
        for (int i = 0; i < n; i++) {
            if (parent[i] == i) {
                count++;
            }
        }
        return count;
    }
    private boolean similar(String word1, String word2) {
        int diff = 0;
        for (int i = 0; i < word1.length(); i++) {
            if (word1.charAt(i) != word2.charAt(i)) {
                diff++;
                if (diff > 2) {
                    return false;
                }
            }
        }
        return true;
    }
    private int find(int[] parent, int i) {
        if (parent[i] != i) {
            parent[i] = find(parent, parent[i]);
        }
        return parent[i];
    }
}

ProblemDescription:
Can you solve this real interview question? Design a Text Editor - Design a text editor with a cursor that can do the following:

 * Add text to where the cursor is.
 * Delete text from where the cursor is (simulating the backspace key).
 * Move the cursor either left or right.

When deleting text, only characters to the left of the cursor will be deleted. The cursor will also remain within the actual text and cannot be moved beyond it. More formally, we have that 0 <= cursor.position <= currentText.length always holds.

Implement the TextEditor class:

 * TextEditor() Initializes the object with empty text.
 * void addText(string text) Appends text to where the cursor is. The cursor ends to the right of text.
 * int deleteText(int k) Deletes k characters to the left of the cursor. Returns the number of characters actually deleted.
 * string cursorLeft(int k) Moves the cursor to the left k times. Returns the last min(10, len) characters to the left of the cursor, where len is the number of characters to the left of the cursor.
 * string cursorRight(int k) Moves the cursor to the right k times. Returns the last min(10, len) characters to the left of the cursor, where len is the number of characters to the left of the cursor.

 

Example 1:


Input
["TextEditor", "addText", "deleteText", "addText", "cursorRight", "cursorLeft", "deleteText", "cursorLeft", "cursorRight"]
[[], ["leetcode"], [4], ["practice"], [3], [8], [10], [2], [6]]
Output
[null, null, 4, null, "etpractice", "leet", 4, "", "practi"]

Explanation
TextEditor textEditor = new TextEditor(); // The current text is "|". (The '|' character represents the cursor)
textEditor.addText("leetcode"); // The current text is "leetcode|".
textEditor.deleteText(4); // return 4
                          // The current text is "leet|". 
                          // 4 characters were deleted.
textEditor.addText("practice"); // The current text is "leetpractice|". 
textEditor.cursorRight(3); // return "etpractice"
                           // The current text is "leetpractice|". 
                           // The cursor cannot be moved beyond the actual text and thus did not move.
                           // "etpractice" is the last 10 characters to the left of the cursor.
textEditor.cursorLeft(8); // return "leet"
                          // The current text is "leet|practice".
                          // "leet" is the last min(10, 4) = 4 characters to the left of the cursor.
textEditor.deleteText(10); // return 4
                           // The current text is "|practice".
                           // Only 4 characters were deleted.
textEditor.cursorLeft(2); // return ""
                          // The current text is "|practice".
                          // The cursor cannot be moved beyond the actual text and thus did not move. 
                          // "" is the last min(10, 0) = 0 characters to the left of the cursor.
textEditor.cursorRight(6); // return "practi"
                           // The current text is "practi|ce".
                           // "practi" is the last min(10, 6) = 6 characters to the left of the cursor.


 

Constraints:

 * 1 <= text.length, k <= 40
 * text consists of lowercase English letters.
 * At most 2 * 104 calls in total will be made to addText, deleteText, cursorLeft and cursorRight.

 

Follow-up: Could you find a solution with time complexity of O(k) per call?

Answer_Java:
class TextEditor {
    StringBuilder sb;
    int cursor;
    Deque<Integer> stack;
    public TextEditor() {
        sb = new StringBuilder();
        cursor = 0;
        stack = new ArrayDeque<>();
    }
    public void addText(String text) {
        sb.insert(cursor, text);
        cursor += text.length();
        stack.push(1);
    }
    public int deleteText(int k) {
        k = Math.min(k, cursor);
        sb.delete(cursor-k, cursor);
        cursor -= k;
        stack.push(-k);
        return k;
    }
    public String cursorLeft(int k) {
        k = Math.min(k, cursor);
        cursor -= k;
        stack.push(k);
        return sb.substring(cursor-Math.min(cursor, 10), cursor);
    }
    public String cursorRight(int k) {
        k = Math.min(k, sb.length()-cursor);
        cursor += k;
        stack.push(-k);
        return sb.substring(cursor-Math.min(sb.length()-cursor, 10), cursor);
    }
}

class Solution {
    public int[] processQueries(int[] nums, int[][] queries) {
        Map<Integer, Integer> map = new HashMap<>();
        for (int i = 0; i < nums.length; i++) {
            map.put(nums[i], i);
        }
        int[] res = new int[queries.length];
        int idx = 0;
        for (int[] query : queries) {
            int num = query[0];
            int pos = map.get(num);
            res[idx++] = pos;
            map.remove(num);
            map.put(query[1], pos);
            nums[pos] = query[1];
        }
        return res;
    }
}

class Solution {
    public int partitionDisjoint(int[] nums) {
        int n = nums.length;
        int[] leftMax = new int[n];
        int[] rightMin = new int[n];
        leftMax[0] = nums[0];
        for (int i = 1; i < n; i++) {
            leftMax[i] = Math.max(leftMax[i-1], nums[i]);
        }
        rightMin[n-1] = nums[n-1];
        for (int i = n-2; i >= 0; i--) {
            rightMin[i] = Math.min(rightMin[i+1], nums[i]);
        }
        for (int i = 0; i < n-1; i++) {
            if (leftMax[i] <= rightMin[i+1]) {
                return i+1;
            }
        }
        return -1;
    }
}

class Solution {
    public int minMax(int[] nums) {
        while (nums.length > 1) {
            int[] newNums = new int[nums.length / 2];
            for (int i = 0; i < nums.length / 2; i++) {
                if (i % 2 == 0) {
                    newNums[i] = Math.min(nums[2*i], nums[2*i+1]);
                } else {
                    newNums[i] = Math.max(nums[2*i], nums[2*i+1]);
                }
            }
            nums = newNums;
        }
        return nums[0];
    }
}

