class BookMyShow {
    TreeSet<Integer> availableSeats;
    TreeMap<Integer, TreeSet<Integer>> availableRows;
    int numRows, numSeats;

    public BookMyShow(int n, int m) {
        availableSeats = new TreeSet<>();
        availableRows = new TreeMap<>();
        for (int i = 0; i < n; i++) {
            availableRows.put(i, new TreeSet<>());
            for (int j = 0; j < m; j++) {
                availableSeats.add((i * m) + j);
                availableRows.get(i).add(j);
            }
        }
        numRows = n;
        numSeats = m;
    }

    public int[] gather(int k, int maxRow) {
        Integer row = availableRows.ceilingKey(0);
        while (row != null && row <= maxRow) {
            TreeSet<Integer> seatsInRow = availableRows.get(row);
            Integer firstSeat = seatsInRow.ceiling(0);
            while (firstSeat != null && firstSeat + k <= numSeats) {
                if (availableSeats.subSet((row * numSeats) + firstSeat, (row * numSeats) + firstSeat + k).size() == k) {
                    int[] result = new int[]{row, firstSeat};
                    for (int i = firstSeat; i < firstSeat + k; i++) {
                        availableSeats.remove((row * numSeats) + i);
                        availableRows.get(row).remove(i);
                    }
                    return result;
                }
                firstSeat = seatsInRow.ceiling(firstSeat + 1);
            }
            row = availableRows.ceilingKey(row + 1);
        }
        return new int[]{};
    }

    public boolean scatter(int k, int maxRow) {
        int remaining = k;
        Integer row = availableRows.ceilingKey(0);
        while (row != null && row <= maxRow && remaining > 0) {
            TreeSet<Integer> seatsInRow = availableRows.get(row);
            List<Integer> seatsToAlloc = new ArrayList<>();
            for (int seat : seatsInRow) {
                availableSeats.remove((row * numSeats) + seat);
                seatsToAlloc.add(seat);
                remaining--;
                if (remaining == 0) {
                    break;
                }
            }
            for (int seat : seatsToAlloc) {
                availableRows.get(row).remove(seat);
            }
            row = availableRows.ceilingKey(row + 1);
        }
        return remaining == 0;
    }
}

class Solution {
    public int maximalRoadsImportance(int n, int[][] roads) {
        int[] degree = new int[n];
        for (int[] road : roads) {
            degree[road[0]]++;
            degree[road[1]]++;
        }

        PriorityQueue<Integer> pq = new PriorityQueue<>(Comparator.reverseOrder());
        for (int d : degree) {
            pq.offer(d);
        }

        Map<Integer, Integer> map = new HashMap<>();
        int cur = n;
        while (!pq.isEmpty()) {
            int d = pq.poll();
            map.put(d, cur--);
        }

        int res = 0;
        for (int[] road : roads) {
            res += map.get(degree[road[0]]) + map.get(degree[road[1]]);
        }
        return res;
    }
}

class Solution {
    public String highestWordCount(String[] messages, String[] senders) {
        Map<String, Integer> wordCounts = new HashMap<>();
        for (int i = 0; i < messages.length; i++) {
            String sender = senders[i];
            String[] words = messages[i].split(" ");
            int count = wordCounts.getOrDefault(sender, 0);
            count += words.length;
            wordCounts.put(sender, count);
        }
        String maxSender = "";
        int maxCount = Integer.MIN_VALUE;
        for (String sender : wordCounts.keySet()) {
            int count = wordCounts.get(sender);
            if (count > maxCount || (count == maxCount && sender.compareTo(maxSender) > 0)) {
                maxCount = count;
                maxSender = sender;
            }
        }
        return maxSender;
    }
}

