class Solution {
    public int minimumObstacles(int[][] grid) {
        int n = grid.length;
        int m = grid[0].length;
        int[][] dist = new int[n][m];
        for(int i=0; i<n; i++) {
            Arrays.fill(dist[i], Integer.MAX_VALUE);
        }
        dist[0][0] = 0;
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{0,0});
        int[] dirs = new int[]{0,-1,0,1,0};
        while(!queue.isEmpty()) {
            int[] curr = queue.poll();
            int x = curr[0];
            int y = curr[1];
            for(int i=0; i<4; i++) {
                int newX = x + dirs[i];
                int newY = y + dirs[i+1];
                if(newX < 0 || newX >= n || newY < 0 || newY >= m) continue;
                int newDist = dist[x][y] + (grid[newX][newY] == 1 ? 1 : 0);
                if(newDist < dist[newX][newY]) {
                    dist[newX][newY] = newDist;
                    queue.offer(new int[]{newX, newY});
                }
            }
        }
        return dist[n-1][m-1] == Integer.MAX_VALUE ? -1 : dist[n-1][m-1];
    }
}

class Solution {
    public int removeSteps(int[] nums) {
        int steps = 0;
        for (int i = 1; i < nums.length; i++) {
            if (nums[i] < nums[i-1]) {
                steps++;
                if (i >= 2 && nums[i-2] > nums[i]) {
                    nums[i] = nums[i-1];
                } else {
                    nums[i-1] = nums[i];
                }
            }
        }
        return steps;
    }
}

class Solution {
    public String applyDiscount(String sentence, int discount) {
        String[] words = sentence.split(" ");
        for (int i = 0; i < words.length; i++) {
            if (words[i].startsWith("$") && isPrice(words[i].substring(1))) {
                double price = Double.parseDouble(words[i].substring(1));
                double discountPrice = price * (100 - discount) / 100;
                words[i] = String.format("$%.2f", discountPrice);
            }
        }
        return String.join(" ", words);
    }
    
    private boolean isPrice(String s) {
        if (!s.matches("\\d+")) {
            return false;
        }
        long price = Long.parseLong(s);
        return price >= 0 && price <= 10000000000L;
    }
}

class Solution {
    public int maxNumOfSubstrings(String s, String t) {
        int[] left = new int[26], right = new int[26], count = new int[s.length()];
        Arrays.fill(left, s.length());
        for (int i = 0; i < s.length(); ++i) {
            int ch = s.charAt(i) - 'a';
            left[ch] = Math.min(left[ch], i);
            right[ch] = i;
        }
        int res = 0, l = -1;
        for (int i = 0; i < s.length(); ++i) {
            int ch = s.charAt(i) - 'a';
            if (left[ch] != i) continue;
            int r = canGetSubstring(s, left, right, i);
            if (r == -1) continue;
            if (i > l) ++res;
            l = r;
        }
        return res;
    }

    int canGetSubstring(String s, int[] left, int[] right, int l) {
        int r = right[s.charAt(l) - 'a'];
        for (int i = l; i <= r; ++i) {
            if (left[s.charAt(i) - 'a'] < l) return -1;
            r = Math.max(r, right[s.charAt(i) - 'a']);
        }
        return r;
    }
}

class Solution {
    public int maxSumDivThree(int[] nums) {
        int[] dp = {0, Integer.MIN_VALUE, Integer.MIN_VALUE};
        for (int num : nums) {
            int[] ndp = new int[3];
            for (int i = 0; i < 3; i++) {
                ndp[(i + num) % 3] = Math.max(dp[(i + num) % 3], dp[i] + num);
            }
            dp = ndp;
        }
        return dp[0];
    }
}

class Solution {
    public int minLines(int[][] stockPrices) {
        int n = stockPrices.length;
        if (n <= 2) return n;
        int[][] dp = new int[n][n];
        for (int i = 0; i < n; i++) {
            Arrays.fill(dp[i], n);
            dp[i][i] = 1;
        }
        for (int i = n - 2; i >= 0; i--) {
            for (int j = i+1; j < n; j++) {
                if (stockPrices[i][1] == stockPrices[j][1]) {
                    dp[i][j] = dp[i+1][j-1];
                }
                for (int k = i; k < j; k++) {
                    dp[i][j] = Math.min(dp[i][j], dp[i][k] + dp[k+1][j]);
                }
            }
        }
        return dp[0][n-1];
    }
}

class Solution {
    public int maximumBags(int[] capacity, int[] rocks, int additionalRocks) {
        int n = capacity.length;
        long sum = 0, max = 0;
        for (int i = 0; i < n; i++) {
            sum += rocks[i];
            max = Math.max(max, capacity[i]);
        }
        long diff = (long) additionalRocks - (max - sum);
        if (diff <= 0) {
            return (int) sum;
        }
        return (int) (Math.min(sum + diff/n, max) + (diff % n == 0 ? 0 : 1));
    }
}

