class Solution {
    private int ans = 0;
    private List<Integer>[] graph;
    private char[] s;

    public int longestPathDifferentChar(int[] parent, String ss) {
        int n = parent.length;
        graph = new List[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int i = 1; i < n; i++) {
            graph[parent[i]].add(i);
        }
        s = ss.toCharArray();
        dfs(0, '\0', '\0');
        return ans;
    }

    private void dfs(int u, char last, char lastLast) {
        int d1 = last != s[u] ? 1 : 0, d2 = lastLast != s[u] ? 1 : 0;
        int res = Math.max(d1, d2);
        for (int v : graph[u]) {
            dfs(v, s[u], last);
            res = Math.max(res, ans + (last != s[u] ? 1 : 0));
        }
        ans = Math.max(ans, res);
    }
}

class Solution {
    public int getMaxTrailingZeros(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        int maxZeros = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                for (int k = 0; k < 2; k++) {
                    int product = 1, zeros = 0;
                    int x = i, y = j;
                    while (x >= 0 && x < m && y >= 0 && y < n) {
                        product *= grid[x][y];
                        while (product % 10 == 0) {
                            zeros++;
                            product /= 10;
                        }
                        if (k == 0) {
                            if (y > j) break;
                            if (y < j) y--;
                            else x++;
                        } else {
                            if (x > i) break;
                            if (x < i) x--;
                            else y++;
                        }
                    }
                    maxZeros = Math.max(maxZeros, zeros);
                }
            }
        }
        return maxZeros;
    }
}

class Solution {
    public int minRounds(int[] tasks) {
        Map<Integer, Integer> map = new HashMap<>();
        for (int task : tasks) {
            map.put(task, map.getOrDefault(task, 0) + 1);
        }
        PriorityQueue<Integer> queue = new PriorityQueue<>((a, b) -> b - a);
        for (int count : map.values()) {
            queue.offer(count);
        }
        int rounds = 0;
        while (!queue.isEmpty()) {
            if (queue.size() == 1) {
                int count = queue.poll();
                if (count > 2) {
                    rounds += (count - 1) / 2;
                }
                rounds++;
            } else {
                int count1 = queue.poll();
                int count2 = queue.poll();
                if (count2 > 2) {
                    queue.offer(count2);
                }
                if (count1 > 2) {
                    queue.offer(count1 - 2);
                }
                rounds++;
            }
        }
        return rounds;
    }
}

class Solution {
    public String getSum(String s) {
        int sum = 0;
        for (char c : s.toCharArray()) {
            sum += c - '0';
        }
        return sum + "";
    }
    
    public String getRound(String s, int k) {
        StringBuilder sb = new StringBuilder();
        int i = 0;
        while (i < s.length()) {
            int j = i + k;
            if (j > s.length()) {
                j = s.length();
            }
            sb.append(getSum(s.substring(i, j)));
            i = j;
        }
        return sb.toString();
    }
    
    public String getDigitsSum(String s, int k) {
        while (s.length() > k) {
            s = getRound(s, k);
        }
        return s;
    }
}

class Solution {
    public int maxVariance(String s) {
        int n = s.length();
        int maxVariance = 0;
        for (int i = 0; i < n; i++) {
            int[] freq = new int[26];
            int distinctChars = 0;
            int maxFreq = 0;
            for (int j = i; j < n; j++) {
                int idx = s.charAt(j) - 'a';
                freq[idx]++;
                if (freq[idx] == 1)
                    distinctChars++;
                maxFreq = Math.max(maxFreq, freq[idx]);
                maxVariance = Math.max(maxVariance, distinctChars > 1 ? maxFreq - (distinctChars - 1) : 0);
            }
        }
        return maxVariance;
    }
}

class Solution {
    public int maximumWhiteTilesCoveredByACarpet(int[][] tiles, int carpetLen) {
        Arrays.sort(tiles, (a, b) -> a[0] - b[0]);
        int maxCount = 0;
        for (int[] tile : tiles) {
            int l = tile[0], r = tile[1];
            if (r - l + 1 < carpetLen) continue;
            int count = (r - l + 1) / carpetLen;
            if ((r - l + 1) % carpetLen == 0) count -= 1;
            maxCount = Math.max(maxCount, count);
        }
        return maxCount * carpetLen;
    }
}

class Solution {
    public int waysToSplit(int[] nums) {
        long[] preSum = new long[nums.length];
        preSum[0] = nums[0];
        for (int i = 1; i < nums.length; i++) {
            preSum[i] = preSum[i - 1] + nums[i];
        }
        int mod = (int)1e9 + 7;
        int res = 0;
        int left = 0, right = 0;
        for (int i = 0; i < nums.length - 2; i++) {
            left += nums[i];
            right = Math.max(right, left);
            int l = i + 1, r = nums.length - 2;
            while (l < r) {
                int mid = l + (r - l) / 2;
                if (preSum[mid] - preSum[i] >= left && preSum[nums.length - 1] - preSum[mid] >= preSum[mid] - preSum[i]) {
                    r = mid;
                } else {
                    l = mid + 1;
                }
            }
            if (preSum[l] - preSum[i] >= left && preSum[nums.length - 1] - preSum[l] >= preSum[l] - preSum[i]) {
                res = (res + l - i) % mod;
            }
            if (preSum[r] - preSum[i] >= left && preSum[nums.length - 1] - preSum[r] >= preSum[r] - preSum[i]) {
                res = (res + r - i) % mod;
            }
        }
        return res;
    }
}

class CountIntervals {
    TreeMap<Integer, Integer> intervals;

    public CountIntervals() {
        intervals = new TreeMap<>();
    }

    public void add(int left, int right) {
        Integer floor = intervals.floorKey(left); 
        Integer ceil = intervals.ceilingKey(left); 
        
        if (floor != null && intervals.get(floor) >= left) {
            left = floor;
            right = Math.max(right, intervals.get(floor));
            intervals.remove(floor);
        }
        if (ceil != null && ceil <= right) {
            right = Math.max(right, intervals.get(ceil));
            intervals.remove(ceil);
        }
        intervals.put(left, right);
    }

    public int count() {
        int count = 0;
        for (int interval : intervals.keySet()) {
            count += intervals.get(interval) - interval + 1;
        }
        return count;
    }
}

class Solution {
    public int countMaxOrSubsets(int[] nums) {
        int max = 0, count = 0;
        for (int i = 0; i < (1 << nums.length); i++) {
            int val = 0;
            for (int j = 0; j < nums.length; j++) {
                if ((i & (1 << j)) > 0) {
                    val |= nums[j];
                }
            }
            if (val > max) {
                max = val;
                count = 1;
            } else if (val == max) {
                count++;
            }
        }
        return count;
    }
}

class Solution {
    public int maxConsecutive(int bottom, int top, int[] special) {
        Arrays.sort(special);
        int max = 0, prev = bottom - 1;
        for (int i = 0; i <= special.length; i++) {
            int curr = i == special.length ? top + 1 : special[i];
            max = Math.max(max, curr - prev - 1);
            prev = curr;
        }
        return max;
    }
}

class Solution {
    public int maximumScore(int[] scores, int[][] edges) {
        int n = scores.length;
        int[] degree = new int[n];
        int[][] graph = new int[n][n];
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1];
            degree[u]++;
            degree[v]++;
            graph[u][v] = scores[u] + scores[v];
            graph[v][u] = graph[u][v];
        }
        int res = -1;
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                if (degree[i] == 0 || degree[j] == 0 || graph[i][j] == 0) continue;
                for (int k = j + 1; k < n; k++) {
                    if (degree[k] == 0 || graph[i][k] == 0 || graph[j][k] == 0) continue;
                    for (int l = k + 1; l < n; l++) {
                        if (degree[l] == 0 || graph[i][l] == 0 || graph[j][l] == 0 || graph[k][l] == 0) continue;
                        res = Math.max(res, scores[i] + scores[j] + scores[k] + scores[l]);
                    }
                }
            }
        }
        return res;
    }
}

class ATM {
    private int[] banknotes;
    public ATM() {
        banknotes = new int[5];
    }
    public void deposit(int[] banknotesCount) {
        for (int i = 0; i < 5; i++) {
            banknotes[i] += banknotesCount[i];
        }
    }
    public int[] withdraw(int amount) {
        int[] res = new int[5];
        int[] values = {20, 50, 100, 200, 500};
        int remaining = amount;
        for (int i = 4; i >= 0; i--) {
            int cnt = Math.min(banknotes[i], remaining / values[i]);
            res[i] = cnt;
            remaining -= cnt * values[i];
        }
        if (remaining != 0) {
            return new int[]{-1};
        }
        for (int i = 0; i < 5; i++) {
            banknotes[i] -= res[i];
        }
        return res;
    }
}

class Solution {
