class Solution {
    public boolean checkValidString(String s) {
        int lo = 0, hi = 0;
        for (char c : s.toCharArray()) {
            lo += c == '(' ? 1 : -1;
            hi += c != ')' ? 1 : -1;
            if (hi < 0) break;
            lo = Math.max(lo, 0);
        }
        return lo == 0;
    }

    public boolean checkValidStringPath(char[][] grid, int i, int j, int[] memo) {
        int n = grid.length, m = grid[0].length, k = i * m + j;
        if (i == n - 1 && j == m - 1) return checkValidString("" + grid[i][j]);
        if (memo[k] != 0) return memo[k] == 1;
        boolean ans = false;
        if (i < n - 1 && checkValidStringPath(grid, i + 1, j, memo)) ans = true;
        if (j < m - 1 && checkValidStringPath(grid, i, j + 1, memo)) ans = true;
        if (ans) {
            if (grid[i][j] == '(') memo[k] = 1;
            else if (grid[i][j] == ')') memo[k] = -1;
            else memo[k] = checkValidString("" + grid[i][j]) ? 1 : -1;
        }
        return ans;
    }

    public boolean hasValidPath(char[][] grid) {
        int n = grid.length, m = grid[0].length;
        int[] memo = new int[n * m];
        return checkValidStringPath(grid, 0, 0, memo);
    }
}

class Solution {
    private static final int MOD = 1000000007;
    private static final String[] letters = {"abc", "def", "ghi", "jkl", "mno", "pqrs", "tuv", "wxyz"};
    
    public int getTiming(int digit, char ch) {
        return letters[digit - 2].indexOf(ch) + 1;
    }
    
    public int numKeypadSolutions(String pressedKeys) {
        int n = pressedKeys.length();
        int[][] dp = new int[n + 1][26];
        Arrays.fill(dp[0], 1);
        for (int i = 1; i <= n; i++) {
            char ch = pressedKeys.charAt(i - 1);
            int digit = ch - '0';
            for (int j = 0; j < 26; j++) {
                int timing = getTiming(digit, (char) (j + 'a'));
                if (timing > 0 && dp[i - 1][j] > 0) {
                    dp[i][j] = dp[i - 1][j];
                    if (timing > 1 && j >= 3) {
                        dp[i][j] += dp[i][j - 3] * (timing - 1);
                        dp[i][j] %= MOD;
                    } else if (timing > 1 && j == 2) {
                        dp[i][j] += dp[i][j - 2] * (timing - 1);
                        dp[i][j] %= MOD;
                    } else {
                        dp[i][j] += dp[i - 1][j] * (timing - 1);
                        dp[i][j] %= MOD;
                    }
                }
            }
        }
        int ans = 0;
        for (int i = 0; i < 26; i++) {
            ans += dp[n][i];
            ans %= MOD;
        }
        return ans;
    }
}

class Solution {
    public int countSubtrees(TreeNode root) {
        if (root == null) return 0;
        dfs(root);
        return count;
    }
    
    private int count = 0;
    
    private int[] dfs(TreeNode node) {
        if (node == null) return new int[] {0, 0};
        int sum = node.val, nodes = 1;
        int[] left = dfs(node.left), right = dfs(node.right);
        sum += left[0] + right[0];
        nodes += left[1] + right[1];
        if (sum * nodes == nodes * node.val) count++;
        return new int[] {sum, nodes};
    }
}

class Solution {
    public String largestThreeNumber(String num) {
        if (num.length() < 3) return "";
        int[] count = new int[10];
        for (int i = 0; i < num.length(); i++) {
            count[num.charAt(i) - '0']++;
        }
        for (int i = 9; i >= 0; i--) {
            if (count[i] >= 3) return "" + i + i + i;
        }
        for (int i = 9; i >= 0; i--) {
            if (count[i] >= 1) {
                for (int j = 9; j >= 0; j--) {
                    if (j != i && count[j] >= 2) {
                        return "" + i + j + j;
                    }
                }
            }
        }
        return "";
    }
}

class Solution {
    public int numberOfOperations(String current, String correct) {
        int cur = Integer.parseInt(current.substring(0, 2)) * 60 + Integer.parseInt(current.substring(3));
        int cor = Integer.parseInt(correct.substring(0, 2)) * 60 + Integer.parseInt(correct.substring(3));
        int diff = (cor - cur + 1440) % 1440;
        int[] ops = {60, 15, 5, 1};
        int res = 0;
        for (int op : ops) {
            res += diff / op;
            diff %= op;
        }
        return res;
    }
}

class Solution {
    public int escapeMaze(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        int[] dirs = {0, 1, 0, -1, 0};
        Queue<int[]> q = new LinkedList<>();
        q.offer(new int[]{0, 0, 0});
        boolean[][][] visited = new boolean[m][n][2];
        visited[0][0][0] = true;
        int minutes = 0;
        while (!q.isEmpty()) {
            int size = q.size();
            while (size-- > 0) {
                int[] curr = q.poll();
                int r = curr[0], c = curr[1], hasMoved = curr[2];
                if (r == m - 1 && c == n - 1) return minutes;
                for (int i = 0; i < 4; i++) {
                    int nr = r + dirs[i], nc = c + dirs[i + 1];
                    if (nr < 0 || nr >= m || nc < 0 || nc >= n) continue;
                    int nhm = hasMoved;
                    if (grid[nr][nc] == 1) continue;
                    if (grid[nr][nc] == 2) {
                        if (hasMoved == 1 || visited[nr][nc][1]) continue;
                        nhm = 1;
                    } else {
                        if (visited[nr][nc][hasMoved]) continue;
                    }
                    visited[nr][nc][nhm] = true;
                    q.offer(new int[]{nr, nc, nhm});
                }
            }
            minutes++;
            propagateFire(grid, visited, q);
        }
        return -1;
    }
    
    private void propagateFire(int[][] grid, boolean[][][] visited, Queue<int[]> q) {
        int m = grid.length, n = grid[0].length;
        int[] dirs = {0, 1, 0, -1, 0};
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] != 1) continue;
                for (int k = 0; k < 4; k++) {
                    int ni = i + dirs[k], nj = j + dirs[k + 1];
                    if (ni < 0 || ni >= m || nj < 0 || nj >= n || grid[ni][nj] == 2 || visited[ni][nj][1]) continue;
                    grid[ni][nj] = 1;
                    visited[ni][nj][0] = true;
                    q.offer(new int[]{ni, nj, 0});
                }
            }
        }
    }
}

class Solution {
    public int canSeePersonsCount(int m, int n, int[][] guards, int[][] walls) {
        int[][] grid = new int[m][n];
        for (int[] wall : walls) {
            grid[wall[0]][wall[1]] = -1;
        }
        for (int[] guard : guards) {
            int r = guard[0], c = guard[1];
            for (int i = r + 1; i < m && grid[i][c] != -1; i++) {
                grid[i][c]++;
            }
            for (int i = r - 1; i >= 0 && grid[i][c] != -1; i--) {
                grid[i][c]++;
            }
            for (int j = c + 1; j < n && grid[r][j] != -1; j++) {
                grid[r][j]++;
            }
            for (int j = c - 1; j >= 0 && grid[r][j] != -1; j--) {
                grid[r][j]++;
            }
        }
        int count = 0;
        for (int[] row : grid) {
            for (int cell : row) {
                if (cell == 0) {
                    count++;
                }
            }
        }
        return count;
    }
}

class Solution {
    public int minAverageDifference(int[] nums) {
        int n = nums.length;
        int[] prefixSum = new int[n];
        prefixSum[0] = nums[0];
        for (int i = 1; i < n; i++) {
            prefixSum[i] = prefixSum[i-1] + nums[i];
        }
        int[] suffixSum = new int[n];
        suffixSum[n-1] = nums[n-1];
        for (int i = n-2; i >= 0; i--) {
            suffixSum[i] = suffixSum[i+1] + nums[i];
        }
        int minDiff = Integer.MAX_VALUE, minIndex = 0;
        for (int i = 0; i < n; i++) {
            int leftSum = prefixSum[i], rightSum = suffixSum[i];
            int leftCount = i+1, rightCount = n-i-1;
            int leftAvg = leftSum / leftCount, rightAvg = rightSum / rightCount;
            int diff = Math.abs(leftAvg - rightAvg);
            if (diff < minDiff) {
                minDiff = diff;
                minIndex = i;
            }
        }
        return minIndex;
    }
}

