        for (int len = 1; len <= n; len++) {
            Arrays.fill(cnt, 0);
            for (int i = 0; i < n - len + 1; i++) {
                int j = i + len - 1;
                for (int k = i; k <= j; k++) {
                    cnt[s.charAt(k) - 'a']++;
                }
                int sum = 0;
                for (int k = 0; k < 26; k++) {
