class Solution {
    public int numSubarraysWithKDivisibleElements(int[] nums, int k, int p) {
        int[] modCount = new int[p];
        int count = 0, ans = 0;
        modCount[0] = 1;
        for (int num : nums) {
            count += num % p == 0 ? 1 : 0;
            if (count > k) {
                count--;
            }
            ans += modCount[count];
            modCount[count]++;
        }
        return ans;
    }
}

class Solution {
    public int minNumberOfCards(int[] cards) {
        int n = cards.length;
        int ans = Integer.MAX_VALUE;
        Map<Integer, Integer> map = new HashMap<>();
        for (int i = 0, j = 0; i < n; i++) {
            map.put(cards[i], map.getOrDefault(cards[i], 0) + 1);
            while (map.get(cards[i]) == 2) {
                ans = Math.min(ans, i - j + 1);
                map.put(cards[j], map.get(cards[j]) - 1);
                j++;
            }
        }
        return ans == Integer.MAX_VALUE ? -1 : ans;
    }
}

