class Solution {
    public int[] getFlowerNum(int[][] flowers, int[] people) {
        int n = people.length;
        int[][] blooms = new int[flowers.length][2];
        for (int i = 0; i < flowers.length; i++) {
            blooms[i][0] = flowers[i][0];
            blooms[i][1] = flowers[i][1];
        }
        Arrays.sort(blooms, (a, b) -> a[0] - b[0]);
        int index = 0;
        int[] res = new int[n];
        Arrays.fill(res, -1);
        for (int i = 0; i < n; i++) {
            while (index < flowers.length && people[i] >= blooms[index][0]) {
                index++;
            }
            while (index > 0 && res[i] == -1) {
                index--;
                if (people[i] >= blooms[index][0] && people[i] <= blooms[index][1]) {
                    res[i] = 1;
                }
            }
        }
        for (int i = 0; i < blooms.length; i++) {
            int num = 0;
            for (int j = 0; j < n; j++) {
                if (res[j] == -1 && people[j] >= blooms[i][0] && people[j] <= blooms[i][1]) {
                    num++;
                }
            }
            for (int j = 0; j < n; j++) {
                if (res[j] == -1 && people[j] >= blooms[i][0] && people[j] <= blooms[i][1]) {
                    res[j] = num;
                }
            }
        }
        return res;
    }
}

