        for(int i=0;i<n;i++){
            for(int j=0;j<nums[i].length;j++){
                if(i==0){
                    map.put(nums[i][j],1);
                }else{
                    if(map.containsKey(nums[i][j]) && map.get(nums[i][j])==i){
                        map.put(nums[i][j],i+1);
