                    }
                }
            }
        }
        return result;
    }
}

class Solution {
    public int maximumBeauty(int[] flowers, int newFlowers, int target, int full, int partial) {
        int[] counts = new int[flowers.length];
        long totalBeauty = 0;
        for (int i = 0; i < flowers.length; i++) {
            if (flowers[i] >= target) {
                counts[i] = 1;
                totalBeauty += full * flowers[i];
            } else {
                counts[i] = 0;
            }
        }
        Arrays.sort(flowers);
        int minIncomplete = flowers[0];
        for (int i = 0; i < counts.length; i++) {
            if (counts[i] == 0 && flowers[i] == minIncomplete && newFlowers > 0) {
                counts[i] = 1;
                newFlowers--;
                totalBeauty += partial * flowers[i];
            }
        }
        while (newFlowers > 0) {
            boolean added = false;
            for (int i = 0; i < counts.length; i++) {
                if (counts[i] == 0) {
                    counts[i] = 1;
                    newFlowers--;
                    totalBeauty += partial * flowers[i];
                    added = true;
                    break;
                }
            }
            if (!added) {
                break;
            }
        }
        return (int)totalBeauty;
    }
}

class Solution {
    public static final int MOD = 1000000007;

    public int maxProduct(int[] nums, int k) {
        PriorityQueue<Integer> pq = new PriorityQueue<>(Collections.reverseOrder());
        for (int num : nums) {
            pq.offer(num);
        }
        while (k > 0) {
            int max = pq.poll();
            if (max == 0) {
                break;
            }
            pq.offer(max + 1);
            k--;
        }
        long product = 1;
        while (!pq.isEmpty()) {
            product = (product * pq.poll()) % MOD;
        }
        return (int)product;
    }
}

class Solution {
    public String minOperationsToFlip(String expression) {
        Stack<Character> stack = new Stack<>();
        Set<Character> set = new HashSet<>();
        set.add('+');
        set.add('-');
        set.add('*');
        set.add('/');
        for (char c : expression.toCharArray()) {
            if (c == '(' || set.contains(c)) {
                stack.push(c);
            } else if (c == ')') {
                List<Character> list = new ArrayList<>();
                while (stack.peek() != '(') {
                    list.add(stack.pop());
                }
                stack.pop();
                if (!stack.isEmpty() && (stack.peek() == '*' || stack.peek() == '/')) {
                    list.add(stack.pop());
                    while (!stack.isEmpty() && (stack.peek() == '+' || stack.peek() == '-')) {
                        list.add(stack.pop());
                    }
                }
                stack.push('T');
                if (list.size() == 2) {
                    char op = list.get(0);
                    if (op == '-') {
                        stack.push('-');
                    } else {
                        stack.push('T');
                    }
                    continue;
                }
                int count = 0;
                for (char op : list) {
                    if (op == '-') {
                        count++;
                    } else if (op == '*' || op == '/') {
                        count += 2;
                    }
                }
                if (count % 2 == 1) {
                    stack.push('-');
                } else {
                    stack.push('T');
                }
            } else {
                stack.push('T');
            }
        }
        List<Character> list = new ArrayList<>();
        while (!stack.isEmpty()) {
            list.add(stack.pop());
        }
        Collections.reverse(list);
        StringBuilder sb = new StringBuilder();
        for (char c : list) {
            sb.append(c);
        }
        return sb.toString();
    }
}

class Solution {
    public int maximumSwap(int num) {
        char[] digits = Integer.toString(num).toCharArray();
        int[] last = new int[10];
        for (int i = 0; i < digits.length; i++) {
            last[digits[i] - '0'] = i;
        }
        for (int i = 0; i < digits.length; i++) {
            for (int j = 9; j > digits[i] - '0'; j--) {
                if (last[j] > i) {
                    char tmp = digits[i];
                    digits[i] = digits[last[j]];
                    digits[last[j]] = tmp;
                    return Integer.parseInt(new String(digits));
                }
            }
        }
        return num;
    }
}

class Solution {
    public int sumOfDistancesInTree(int N, int[][] edges) {
        List<List<Integer>> graph = new ArrayList<>();
        int[] count = new int[N];
        int[] res = new int[N];
        Arrays.fill(count, 1);
        for (int i = 0; i < N; i++) {
            graph.add(new ArrayList<Integer>());
        }
        for (int[] edge : edges) {
            graph.get(edge[0]).add(edge[1]);
            graph.get(edge[1]).add(edge[0]);
        }
        dfs1(0, -1, graph, count, res);
        dfs2(0, -1, graph, count, res);
        return Arrays.stream(res).sum();
    }
    
    private void dfs1(int node, int parent, List<List<Integer>> graph, int[] count, int[] res) {
        for (int nei : graph.get(node)) {
            if (nei != parent) {
                dfs1(nei, node, graph, count, res);
                count[node] += count[nei];
                res[node] += res[nei] + count[nei];
            }
        }
    }
    
    private void dfs2(int node, int parent, List<List<Integer>> graph, int[] count, int[] res) {
        for (int nei : graph.get(node)) {
            if (nei != parent) {
                res[nei] = res[node] - count[nei] + count.length - count[nei];
                dfs2(nei, node, graph, count, res);
            }
        }
    }
}

class Solution {
    public int numWays(String s) {
        int n = s.length();
        int cnt1 = 0, cnt0 = 0;
        for (int i = 0; i < n; i++) {
            if (s.charAt(i) == '0') cnt0++;
            else cnt1++;
        }
        if (cnt1 == 0 || cnt0 == 0) return 0;
        int ans = 0;
        for (int i = 1; i < n - 1; i++) {
            if (s.charAt(i) != s.charAt(i - 1) && s.charAt(i) != s.charAt(i + 1) && s.charAt(i - 1) != s.charAt(i + 1)) ans++;
        }
        return ans * cnt0 * cnt1;
    }
}

class Solution {
    public int triangularSum(int[] nums) {
        while (nums.length > 1) {
            int[] newNums = new int[nums.length - 1];
            for (int i = 0; i < nums.length - 1; i++) {
                newNums[i] = (nums[i] + nums[i+1]) % 10;
            }
            nums = newNums;
        }
        return nums[0];
    }
}

class Solution {
    public int minFlips(int a, int b, int c) {
        int count = 0;
        for(int i=0;i<32;i++){
            int x = (c>>i)&1,y = (b>>i)&1,z = (a>>i)&1;
            if(z==1&&y==1&&x==0) count+=2;
            else if(z==1&&(y|x)==0) count+=1;
            else if(z==0&&(y|x)==1) count+=1;
        }
        return count;
    }
}

class Solution {
    public int findCheapestPrice(int n, int[][] flights, int src, int dst, int k) {
        int[][] dp = new int[n][k + 2];
        for (int i = 0; i < n; ++i) Arrays.fill(dp[i], Integer.MAX_VALUE);
        for (int i = 0; i <= k + 1; ++i) dp[src][i] = 0;
        for (int t = 1; t <= k + 1; ++t) {
            for (int[] flight : flights) {
                int j = flight[0], i = flight[1], cost = flight[2];
                if (dp[j][t - 1] != Integer.MAX_VALUE)
                    dp[i][t] = Math.min(dp[i][t], dp[j][t - 1] + cost);
            }
        }
        return dp[dst][k + 1] == Integer.MAX_VALUE ? -1 : dp[dst][k + 1];
    }
}

class Solution {
    public int[] findClosestElements(int[] nums, int k, int x) {
        int n = nums.length;
        int lo = 0, hi = n - k;
        while (lo < hi) {
            int mid = lo + (hi - lo) / 2;
            if (x - nums[mid] > nums[mid + k] - x)
                lo = mid + 1;
            else
                hi = mid;
        }
        int[] result = new int[k];
        for (int i = 0; i < k; i++) {
            result[i] = nums[lo + i];
        }
        return result;
    }
}

class Solution {
    public int[] maxDepthAfterSplit(String seq) {
        int[] res = new int[seq.length()];
        int depth = 0;
        for (int i = 0; i < seq.length(); i++) {
            char c = seq.charAt(i);
            if (c == '(') {
                depth++;
                res[i] = depth % 2;
            } else {
                res[i] = depth % 2;
                depth--;
            }
        }
        return res;
    }
}

class Solution {
    public int[] getMaxPoints(int numArrows, int[] aliceArrows) {
        int[] bobArrows = new int[12];
        int remainingArrows = numArrows;
        for (int score = 10; score >= 0; score--) {
            if (aliceArrows[score] > remainingArrows / 2) {
                bobArrows[score] = remainingArrows - aliceArrows[score];
                remainingArrows = aliceArrows[score];
            } else {
                bobArrows[score] = remainingArrows / 2 - aliceArrows[score];
                remainingArrows -= 2 * bobArrows[score];
            }
        }
        bobArrows[11] = remainingArrows;
        return bobArrows;
    }
}

class Solution {
    public int getCollisionTimes(int[] cars) {
        int n = cars.length;
        int[] stack = new int[n];
        int top = -1;
        int[] times = new int[n];
        Arrays.fill(times, Integer.MAX_VALUE);
        for (int i = n - 1; i >= 0; i--) {
            int p = cars[i];
            while (top >= 0 && p <= cars[stack[top]] && (times[stack[top]] == Integer.MAX_VALUE || (times[stack[top]] > 0 && (cars[stack[top]] - p) / (double)(p - cars[i]) >= times[stack[top]]))) {
                times[i] = times[stack[top]];
                stack[top] = -1;
                top--;
            }
            if (top >= 0) {
                times[i] = (cars[stack[top]] - p) / (double)(p - cars[i]);
            }
            stack[++top] = i;
        }
        int count = 0;
        for (int i = 0, j = 0; i < n; i++) {
            while (j < n && times[j] <= cars[i] / (double)j) {
                j++;
            }
            if (times[i] < Integer.MAX_VALUE && times[i] <= cars[i] / (double)j) {
                count++;
            }
        }
        return count;
    }
    
    public int countCollisions(String directions) {
        int n = directions.length();
        int[] cars = new int[n];
        for (int i = 0; i < n; i++) {
            if (directions.charAt(i) == 'R') {
                cars[i] = n;
            } else if (directions.charAt(i) == 'L') {
                cars[i] = 0;
            } else {
                cars[i] = -1;
            }
        }
        return getCollisionTimes(cars);
    }
}

class Solution {
    public int solve(int[] nums) {
        int count = 0;
        for (int i = 1; i < nums.length - 1; i++) {
            if ((nums[i] > nums[i-1] && nums[i] > nums[i+1]) || (nums[i] < nums[i-1] && nums[i] < nums[i+1])) {
                count++;
                while (i < nums.length - 1 && nums[i] == nums[i+1]) {
                    i++;
                }
            }
        }
        return count;
    }
}

class Solution {
    public int maxFrequency(int[] nums, int key) {
        Map<Integer, Integer> map = new HashMap<>();
        int maxCount = 0, maxTarget = 0;
        for (int i = 0; i < nums.length - 1; i++) {
            if (nums[i] == key) {
                int target = nums[i + 1];
                int count = map.getOrDefault(target, 0) + 1;
                map.put(target, count);
                if (count > maxCount || (count == maxCount && target > maxTarget)) {
                    maxCount = count;
                    maxTarget = target;
                }
            }
        }
        return maxTarget;
    }
}

class Solution {
    public int minWhiteTiles(String floor, int numCarpets, int carpetLen) {
        int n = floor.length();
        int[] whiteCount = new int[n+1];
        for (int i = 0; i < n; i++) {
            whiteCount[i+1] = whiteCount[i] + (floor.charAt(i) == '1' ? 1 : 0);
        }
        int minWhite = n;
        for (int i = 0; i + carpetLen <= n; i++) {
            int j = i + carpetLen;
            int coveredWhite = whiteCount[j] - whiteCount[i];
            int visibleWhite = whiteCount[i] + whiteCount[n] - whiteCount[j];
            for (int k = 1; k < numCarpets; k++) {
                int start = i + k*carpetLen;
                if (start >= n) {
                    break;
                }
                int end = Math.min(start + carpetLen, n);
                int covered = whiteCount[end] - whiteCount[start];
                coveredWhite += covered;
                visibleWhite -= covered;
            }
            minWhite = Math.min(minWhite, visibleWhite);            
        }
        return minWhite;
    }
}

class Solution {
    public int minOperations(int[] nums) {
        PriorityQueue<Integer> pq = new PriorityQueue<>(Collections.reverseOrder());
        int sum = 0;
        for (int num : nums) {
            sum += num;
            pq.offer(num);
        }
        int count = 0;
        while (sum >= (sum + 1) / 2) {
            int max = pq.poll();
            sum -= max;
            pq.offer(max / 2);
            sum += max / 2;
            count++;
        }
        return count;
    }
}

class Solution {
    public int maxSubsequence(String text, String pattern) {
        int a = 0, b = 0, c = 0, d = 0;
        for (char ch : text.toCharArray()) {
            if (ch == pattern.charAt(0)) {
                a++;
            } else if (ch == pattern.charAt(1)) {
                if (a > 0) {
                    c++;
                    a--;
                } else {
                    b++;
                }
            }
        }
        d = Math.min(a, b);
        return c + d;
    }
}

