}

class Solution {
    public int[] solve(int[] nums) {
        List<Integer> list = new ArrayList<>();
        for (int num : nums) {
            list.add(num);
        }
        boolean flag = true;
        while (flag) {
            flag = false;
            for (int i = 1; i < list.size(); i++) {
                if (gcd(list.get(i), list.get(i-1)) > 1) {
                    int lcm = lcm(list.get(i), list.get(i-1));
                    list.remove(i);
                    list.set(i-1, lcm);
                    flag = true;
                    break;
                }
            }
        }
        int[] res = new int[list.size()];
        for (int i = 0; i < list.size(); i++) {
            res[i] = list.get(i);
        }
        return res;
    }
    
    private int gcd(int a, int b) {
        if (a < b) {
            return gcd(b, a);
        }
        while (b > 0) {
            int temp = a % b;
            a = b;
            b = temp;
        }
        return a;
    }
    
    private int lcm(int a, int b) {
        return a * b / gcd(a, b);
    }
}

class Solution {
    public TreeNode createTree(int[][] descriptions) {
        Map<Integer, TreeNode> map = new HashMap<>();
        for (int[] desc : descriptions) {
            TreeNode parent = map.computeIfAbsent(desc[0], k -> new TreeNode(k));
            TreeNode child = map.computeIfAbsent(desc[1], k -> new TreeNode(k));
            if (desc[2] == 1) {
                parent.left = child;
            } else {
                parent.right = child;
            }
        }
        TreeNode root = map.get(descriptions[0][0]);
        while (root.parent != null) {
            root = root.parent;
        }
        return root;
    }
}

class Solution {
    public int getMinimumDifference(int[] nums, int k) {
        Arrays.sort(nums);
        int minDiff = Integer.MAX_VALUE;
        for (int i = k - 1; i < nums.length; i++) {
            int diff = nums[i] - nums[i - k + 1];
            minDiff = Math.min(minDiff, diff);
        }
        return minDiff + 1;
    }
}

class Solution {
    public List<String> cellsInRange(String s) {
        String[] range = s.split(":");
        String start = range[0];
        String end = range[1];
        int rowStart = Integer.parseInt(start.substring(1));
        int rowEnd = Integer.parseInt(end.substring(1));
        char colStart = start.charAt(0);
        char colEnd = end.charAt(0);
        List<String> result = new ArrayList<>();
        for (char c = colStart; c <= colEnd; c++) {
            for (int r = rowStart; r <= rowEnd; r++) {
                result.add("" + c + r);
            }
        }
        return result;
    }
}

class Solution {
    public int countKDifference(int[] nums, int k) {
        int count = 0;
        for (int i = 0; i < nums.length; i++) {
            for (int j = i + 1; j < nums.length; j++) {
                if (Math.abs(nums[i] - nums[j]) == k) {
                    count++;
                }
            }
        }
        return count;
    }
}

class Solution {
    public String maxSubString(String s, int k) {
        StringBuilder sb = new StringBuilder(s);
        char[] arr = sb.toString().toCharArray(); 
        char ans[] = new char[arr.length];
        int freq[] = new int[26];
        int i = 0;
        PriorityQueue<int[]> pq = new PriorityQueue<int[]>((a,b)->b[1]-a[1]);
        while (i < arr.length) {
            int j = i;
            while (j < arr.length && arr[j] == arr[i]) j++;
            freq[arr[i]-'a'] += (j-i)%k;
            if (freq[arr[i]-'a'] > k) return "";
            pq.add(new int[]{arr[i]-'a', freq[arr[i]-'a']}); 
            for (int x=0; x<k && !pq.isEmpty(); x++) { 
                ans[i+x] = (char)(pq.peek()[0] + 'a');
                if (--pq.peek()[1] == 0) pq.poll(); 
            }
            i = j;
        }
        return new String(ans);
    }
}

class Solution {
    public ListNode mergeZeroNodes(ListNode head) {
        ListNode dummy = new ListNode(0);
        dummy.next = head;
        ListNode prev = dummy;
        while (prev.next != null) {
            ListNode zero = prev.next;
            while (zero != null && zero.next != null && zero.val != 0) {
                zero = zero.next;
            }
            if (zero == null || zero.next == null) {
                break;
            }
            ListNode nonZero = zero.next;
            while (nonZero != null && nonZero.val == 0) {
                nonZero = nonZero.next;
            }
            int sum = 0;
            ListNode curr = prev.next;
            while (curr != nonZero) {
                sum += curr.val;
                curr = curr.next;
            }
            ListNode merged = new ListNode(sum);
            prev.next = merged;
            merged.next = nonZero;
        }
        ListNode newHead = dummy.next;
        dummy.next = null;
        return newHead;
    }
}

class Solution {
    public int countDigitSum(int n) {
        int sum = 0;
        while (n > 0) {
            sum += n % 10;
            n /= 10;
        }
        return sum;
    }
    
    public int countNumbersWithEvenDigitSum(int num) {
        int count = 0;
        for (int i = 1; i <= num; i++) {
            if (countDigitSum(i) % 2 == 0) {
                count++;
            }
        }
        return count;
    }
}

class Solution {
    public int racecar(int target) {
        if (target == 0) {
            return 0;
        }
        int[] dp = new int[target+1];
        for (int i = 1; i <= target; i++) {
            dp[i] = Integer.MAX_VALUE;
            int k = 1, pos = 1;
            while (pos < i * 2) {
                int j = 0, q = 0;
                while (q < pos) {
                    q += (1 << j);
                    j++;
                }
                if (q == pos) {
                    dp[i] = Math.min(dp[i], k + j + (i-pos));
                }
                for (int p = 0; p < j-1; p++) {
                    int r = (1 << p);
                    int x = q - r;
                    dp[i] = Math.min(dp[i], k+j-1+p+2+r-x+i-pos);
                }
                pos = q - pos;
                k++;
            }
        }
        return dp[target];
    }
}

class Solution {
    public int minTime(int[] time, int totalTrips) {
        int n = time.length;
        long left = 1, right = (long)1e18;
        while (left < right) {
            long mid = (left + right) / 2;
            long trips = 0;
            for (int t : time) {
                trips += mid / t;
                if (trips >= totalTrips) break;
            }
            if (trips >= totalTrips) right = mid;
            else left = mid + 1;
        }
        return (int)left;
    }
}

class Solution {
    public int minSteps(String s, String t) {
        int[] freq = new int[26];
        for (char c : s.toCharArray()) {
            freq[c - 'a']++;
        }
        int count = 0;
        for (char c : t.toCharArray()) {
            if (freq[c - 'a'] == 0) {
                count++;
            } else {
                freq[c - 'a']--;
            }
        }
        return count;
    }
}

class Solution {
    public int countLargestGroup(int n) {
        Map<Integer, Integer> map = new HashMap<>();
        int maxCount = 0;
        for (int i = 1; i <= n; i++) {
            int sum = getDigitSum(i);
            map.put(sum, map.getOrDefault(sum, 0) + 1);
            maxCount = Math.max(maxCount, map.get(sum));
        }
        int count = 0;
        for (int key : map.keySet()) {
            if (map.get(key) == maxCount) {
                count++;
            }
        }
        return count;
    }
    
    private int getDigitSum(int num) {
        int sum = 0;
        while (num > 0) {
            sum += num % 10;
            num /= 10;
        }
        return sum;
    }
}

class Solution {
    public int getMaxAndSum(int[] nums, int numSlots) {
        Arrays.sort(nums);
        int n = nums.length;
        int[][] dp = new int[n + 1][numSlots + 1];
        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= numSlots && j * 2 <= i + 1; j++) {
                dp[i][j] = dp[i - 2][j - 1] + (nums[i - 1] & j);
                if (j * 2 == i + 1) {
                    dp[i][j] = Math.max(dp[i][j], dp[i - 1][j]);
                } else {
                    dp[i][j] = Math.max(dp[i][j], dp[i - 1][j]);
                    dp[i][j] = Math.max(dp[i][j], dp[i - 2][j]);
                }
            }
        }
        return dp[n][numSlots];
    }
}

class Solution {
    public int removeBeans(int[] beans) {
        int n = beans.length;
        int sum = Arrays.stream(beans).sum();
        if (sum % n != 0) return -1;
        int avg = sum / n, ans = 0, cur = 0;
        for (int bean : beans) {
            cur += bean - avg;
            ans = Math.max(ans, Math.abs(cur));
        }
        return ans;
    }
}

class Solution {
    public int minOperations(int[] nums) {
        int n = nums.length;
        int even = 0, odd = 0;
        for (int i = 0; i < n; i++) {
            if (i % 2 == 0 && nums[i] % 2 != 0) {
                even++;
            } else if (i % 2 != 0 && nums[i] % 2 == 0) {
                odd++;
            }
        }
        if (even != odd) {
            return -1;
        }
        return even;
    }
}

class Solution {
    public int minOperations(int num1, int num2) {
        int steps = 0;
        while (num1 > 0 || num2 > 0) {
            if (num1 < num2) {
                int temp = num1;
                num1 = num2;
                num2 = temp;
            }
            if (num1 - num2 >= num2) {
                num1 -= num2;
            } else {
                num2 = num1 - num2;
            }
            steps++;
        }
        return steps;
    }
}

class Solution {
    public int minimumTime(String s) {
        int left = 0, right = s.length() - 1;
        while (left < right && s.charAt(left) == '0') left++;
        while (left < right && s.charAt(right) == '0') right--;
        int count = 0;
        for (int i = left; i <= right; ) {
            if (s.charAt(i) == '1') {
                count++;
                i += 2;
            } else {
                i++;
            }
        }
        if (count == 0) return 0;
        return count + Math.min(right - left + 1 - count, count) + left;
    }
}

class Bitset {
    
    int[] bits;
    int count;
    int size;
    
    public Bitset(int size) {
        this.size = size;
        this.bits = new int[(size + 31) >> 5];
    }
    
    public void fix(int idx) {
        int bucket = idx >> 5;
        int mask = 1 << (idx & 31);
        if ((bits[bucket] & mask) == 0) {
            bits[bucket] |= mask;
            count++;
        }
    }
    
    public void unfix(int idx) {
        int bucket = idx >> 5;
        int mask = 1 << (idx & 31);
        if ((bits[bucket] & mask) != 0) {
            bits[bucket] &= ~mask;
            count--;
        }
    }
    
    public void flip() {
        for (int i = 0; i < bits.length; i++) {
            bits[i] = ~bits[i];
        }
        count = size - count;
    }
    
    public boolean all() {
        return count == size;
    }
    
    public boolean one() {
        return count > 0;
    }
    
    public int count() {
        return count;
    }
    
    public String toString() {
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < size; i++) {
            sb.append((bits[i >> 5] & (1 << (i & 31))) != 0 ? "1" : "0");
        }
        return sb.toString();
    }
}

class Solution {
    public int rearrange(int num) {
        String str = String.valueOf(num);
        char[] nums = str.toCharArray();
        Arrays.sort(nums);
        StringBuilder sb = new StringBuilder();
        int i = 0;
        while (i < nums.length && nums[i] == '0') {
            i++;
        }
        if (i > 0 && i < nums.length) {
            char temp = nums[0];
            nums[0] = nums[i];
            nums[i] = temp;
        }
        for (char c : nums) {
            sb.append(c);
        }
        return Integer.parseInt(sb.toString());
    }
    
    public int smallestValue(int num) {
        if (num == 0) {
            return 0;
        } else if (num > 0) {
            return rearrange(num);
        } else {
            num = -num;
            int reversed = rearrange(num);
            return -reversed;
        }
    }
}

class Solution {
    public int[] sortArrayByParityII(int[] nums) {
        int even = 0, odd = 1, n = nums.length;
        while (even < n && odd < n) {
            while (even < n && nums[even] % 2 == 0) {
                even += 2;
            }
            while (odd < n && nums[odd] % 2 == 1) {
                odd += 2;
            }
            if (even < n && odd < n) {
                int temp = nums[even];
                nums[even] = nums[odd];
                nums[odd] = temp;
            }
        }
        return nums;
    }
}

class Solution {
    public int countTriplets(int[] nums1, int[] nums2) {
        int n = nums1.length;
        int[] cnt = new int[n];
        for (int i = 0; i < n; i++) {
            for (int j = i+1; j < n; j++) {
                if (nums1[i] < nums1[j] && nums2[i] < nums2[j]) {
                    cnt[j]++;
                }
            }
        }
        int ans = 0;
        for (int i = 0; i < n; i++) {
            for (int j = i+1; j < n; j++) {
                if (nums1[i] < nums1[j] && nums2[i] < nums2[j]) {
                    ans += cnt[j];
                }
            }
        }
        return ans;
    }
}

class Solution {
    public List<Integer> splitIntoUniqueEvenIntegers(int finalSum) {
        List<Integer> result = new ArrayList<>();
        dfs(finalSum, 2, result);
        return result;
    }
    
    private boolean dfs(int target, int start, List<Integer> curr) {
        if (target == 0) {
            return true;
        }
        for (int i = start; i <= target; i += 2) {
            curr.add(i);
            if (dfs(target-i, i+2, curr)) {
                return true;
            }
            curr.remove(curr.size()-1);
        }
        return false;
    }
}

class Solution {
    public int[] findConsecutiveThree(int num) {
        for (int i = 1; i <= num/3; i++) {
            int sum = 0;
            for (int j = 0; j <= 2; j++) {
                sum += (i+j);
            }
            if (sum == num) {
                return new int[] {i, i+1, i+2};
            }
        }
        return new int[] {};
    }
}

class Solution {
