class Solution {
    public int[] numSmallerByFrequency(String[] queries, String[] words) {
        int[] freq = new int[11];
        for (String word : words) {
            int f = getFrequency(word);
            freq[f]++;
        }
        int[] preSum = new int[11];
        for (int i = 1; i <= 10; i++) {
            preSum[i] = preSum[i-1] + freq[i];
        }
        int[] ans = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int f = getFrequency(queries[i]);
            ans[i] = preSum[10] - preSum[f];
        }
        return ans;
    }
    
    private int getFrequency(String s) {
        int[] count = new int[26];
        for (char c : s.toCharArray()) {
            count[c - 'a']++;
        }
        for (int i = 0; i < 26; i++) {
            if (count[i] != 0) {
                return count[i];
            }
        }
        return 0;
    }
}

class Solution {
    public String findSubstring(String s, int power, int modulo, int k, int hashValue) {
        long p = power;
        long m = modulo;
        long hash = 0;
        for (int i = 0; i < k; i++) {
            hash = (hash * p + (s.charAt(i) - 'a' + 1)) % m;
        }
        if (hash == hashValue) {
            return s.substring(0, k);
        }
        long pk = 1;
        for (int i = 0; i < k; i++) {
            pk = (pk * p) % m;
        }
        for (int i = k; i < s.length(); i++) {
            hash = ((hash - pk * (s.charAt(i - k) - 'a' + 1)) % m + m) % m;
            hash = (hash * p + (s.charAt(i) - 'a' + 1)) % m;
            if (hash == hashValue) {
                return s.substring(i - k + 1, i + 1);
            }
        }
        return "";
    }
}

class Solution {
