            }
        }
    }
}

class Solution {
    public int maximumPeople(int[][] statements) {
        int n = statements.length;
        int ans = 0;
        for (int key = 0; key < (1 << n); key++) {
            boolean[] isGood = new boolean[n];
            boolean isValid = true;
            int countGood = 0;
            for (int i = 0; i < n; i++) {
                if ((key & (1 << i)) != 0) {
                    isGood[i] = true;
                    countGood++;
                }
            }
            for (int i = 0; i < n; i++) {
                if (!isGood[i]) continue;
                for (int j = 0; j < n; j++) {
                    if (i == j || statements[i][j] == 2) continue;
                    if ((isGood[j] && statements[i][j] == 0) || (!isGood[j] && statements[i][j] == 1)) {
                        isValid = false;
                        break;
                    }
                }
                if (!isValid) break;
            }
            if (isValid) ans = Math.max(ans, countGood);
        }
        return ans;
    }
}

class Solution {
    public int[] rearrangeArray(int[] nums) {
        Arrays.sort(nums);
        int n = nums.length;
        int[] res = new int[n];
        int i = 0, j = n/2, k = 0;
        while (k < n) {
            if (k % 2 == 0) {
                res[k] = nums[j];
                j++;
            } else {
                res[k] = nums[i];
                i++;
            }
            k++;
        }
        return res;
    }
}

class Solution {
    public List<Integer> findLonelyNumbers(int[] nums) {
        Map<Integer, Integer> countMap = new HashMap<>();
        Set<Integer> adjacentSet = new HashSet<>();
        for (int num : nums) {
            countMap.put(num, countMap.getOrDefault(num, 0) + 1);
        }
        for (int num : nums) {
            if (countMap.get(num) == 1) {
                if (!adjacentSet.contains(num - 1) && !adjacentSet.contains(num + 1)) {
                    adjacentSet.add(num);
                }
            }
        }
        return new ArrayList<>(adjacentSet);
    }
}

class Solution {
    public int numElements(int[] nums) {
        int count = 0;
        for (int i = 0; i < nums.length; i++) {
            boolean smaller = false;
            boolean greater = false;
            for (int j = 0; j < nums.length; j++) {
                if (i != j) {
                    if (nums[j] < nums[i]) {
                        smaller = true;
                    } else if (nums[j] > nums[i]) {
                        greater = true;
                    }
                }
                if (smaller && greater) {
                    count++;
                    break;
                }
            }
        }
        return count;
    }
}

class Solution {
    public int minimumDifference(int[] nums) {
        Arrays.sort(nums);
        int n = nums.length / 3;
        int sum = 0;
        for (int i = 0; i < n; i++) {
            sum += nums[i+n*2] - nums[i];
        }
        int res = Math.abs(sum);
        sum = 0;
        for (int i = n; i < n*2; i++) {
            sum += nums[i+n*2] - nums[i];
        }
        res = Math.min(res, Math.abs(sum));
        return res;
    }
}

class Solution {
    public int cookTime(int minutes, int seconds) {
        return minutes * 60 + seconds;
    }
    
    public int digitCost(int digit, int target) {
        if (digit == target) return 0;
        int diff = Math.abs(digit - target);
        return Math.min(diff, 10 - diff);
    }
    
    public int getCost(int[] digits, int startAt, int moveCost, int pushCost, int targetSeconds) {
        int cost = 0;
        int minutes = digits[0] * 10 + digits[1];
        int seconds = digits[2] * 10 + digits[3];
        int currentSeconds = cookTime(minutes, seconds);
        if (currentSeconds == targetSeconds) return cost;
        cost += pushCost;
        cost += digitCost(startAt, digits[0]) * moveCost;
        cost += pushCost;
        cost += digitCost(startAt, digits[1]) * moveCost;
        cost += pushCost;
        cost += digitCost(startAt, digits[2]) * moveCost;
        cost += pushCost;
        cost += digitCost(startAt, digits[3]) * moveCost;
        int nextMinutes = minutes;
        int nextSeconds = seconds;
        int nextSecondsCost = Math.abs(targetSeconds - currentSeconds);
        for (int m = 0; m <= 99; m++) {
            for (int s = 0; s <= 59; s++) {
                int totalSeconds = cookTime(m, s);
                int secondsCost = Math.abs(totalSeconds - targetSeconds);
                if (secondsCost < nextSecondsCost) {
                    nextMinutes = m;
                    nextSeconds = s;
                    nextSecondsCost = secondsCost;
                }
            }
        }
        cost += digitCost(digits[0], nextMinutes / 10) * moveCost;
        cost += digitCost(digits[1], nextMinutes % 10) * moveCost;
        cost += digitCost(digits[2], nextSeconds / 10) * moveCost;
        cost += digitCost(digits[3], nextSeconds % 10) * moveCost;
        return cost;
    }
    
    public int getMinCost(int startAt, int moveCost, int pushCost, int targetSeconds) {
        int minCost = Integer.MAX_VALUE;
        for (int d1 = 0; d1 <= 9; d1++) {
            for (int d2 = 0; d2 <= 9; d2++) {
                for (int d3 = 0; d3 <= 9; d3++) {
                    for (int d4 = 0; d4 <= 9; d4++) {
                        int[] digits = {d1, d2, d3, d4};
                        int cost = getCost(digits, startAt, moveCost, pushCost, targetSeconds);
                        minCost = Math.min(minCost, cost);
                    }
                }
            }
        }
        return minCost;
    }
    
    public int minCost(int startAt, int moveCost, int pushCost, int targetSeconds) {
        return getMinCost(startAt, moveCost, pushCost, targetSeconds);
    }
}

class Solution {
    public int[] partition(int[] nums, int pivot) {
        int n = nums.length;
        int i = 0, j = n - 1;
        for (int k = 0; k <= j; k++) {
            if (nums[k] < pivot) {
                swap(nums, i, k);
                i++;
            } else if (nums[k] > pivot) {
                swap(nums, j, k);
                j--;
                k--;
            }
        }
        return nums;
    }
    
    private void swap(int[] nums, int i, int j) {
        int temp = nums[i];
        nums[i] = nums[j];
        nums[j] = temp;
    }
}

