class Solution {
    public int maxPoints(int[][] questions) {
        int n = questions.length;
        int[] dp = new int[n+1];
        for (int i = 1; i <= n; i++) {
            int points = questions[i-1][0], brainpower = questions[i-1][1];
            int j = i - 1;
            while (j > 0 && j >= i - brainpower) {
                dp[i] = Math.max(dp[i], dp[j--] + points);
            }
            dp[i] = Math.max(dp[i], dp[i-1]);
        }
        return dp[n];
    }
}

class Solution {
    public int[] maxSubArray(int[] nums) {
        int n = nums.length;
        int maxSum = nums[0];
        int currSum = nums[0];
        int start = 0;
        int end = 0;
        int currStart = 0;
        for (int i = 1; i < n; i++) {
            if (currSum < 0) {
                currSum = nums[i];
                currStart = i;
            } else {
                currSum += nums[i];
            }
            if (currSum > maxSum) {
                maxSum = currSum;
                start = currStart;
                end = i;
            }
        }
        return Arrays.copyOfRange(nums, start, end+1);
    }
}

class Solution {
    public String[] divideString(String s, int k, char fill) {
        int n = s.length();
        int numGroups = n / k + ((n % k == 0) ? 0 : 1);
        String[] groups = new String[numGroups];
        int index = 0;
        for (int i = 0; i < n; i += k) {
            if (i + k <= n) {
                groups[index++] = s.substring(i, i+k);
            } else {
                StringBuilder sb = new StringBuilder(s.substring(i));
                while (sb.length() < k) {
                    sb.append(fill);
                }
                groups[index++] = sb.toString();
            }
        }
        return groups;
    }
}

class Solution {
    public int earliestAcq(int[][] logs, int n) {
        Arrays.sort(logs, (a, b) -> a[0] - b[0]);
        int[] parent = new int[n];
        for (int i = 0; i < n; i++) {
            parent[i] = i;
        }
        int count = n;
        for (int[] log : logs) {
            int p1 = find(parent, log[1]);
            int p2 = find(parent, log[2]);
            if (p1 != p2) {
                count--;
                parent[p2] = p1;
                if (count == 1) {
                    return log[0];
                }
            }
        }
        return -1;
    }
    
    private int find(int[] parent, int x) {
        if (parent[x] != x) {
            parent[x] = find(parent, parent[x]);
        }
        return parent[x];
    }
}

class Solution {
