                for (char c : start.toCharArray()) freq[c - 'a']++;
                for (char c : target.toCharArray())
                    if (--freq[c - 'a'] < 0) goto outer;
                res++;
                outer: continue;
            }
        }
        return res;
    }
}

class Solution {
    public int minSwaps(int[] nums) {
        int n = nums.length;
        int ones = 0;
        for (int num : nums) {
            if (num == 1) {
                ones++;
            }
        }
        if (ones == 0 || ones == n) {
            return 0;
        }
        int maxOnes = 0;
        int countOnes = 0;
        int left = 0;
        int right = 0;
        while (right < n) {
            while (countOnes < ones && right - left < n) {
                if (nums[right % n] == 1) {
                    countOnes++;
                }
                right++;
            }
            maxOnes = Math.max(maxOnes, countOnes);
            if (nums[left % n] == 1) {
                countOnes--;
            }
            left++;
        }
        return ones - maxOnes;
    }
}

class Solution {
    public boolean isValidSudoku(char[][] board) {
        boolean[][] rows = new boolean[9][9];
        boolean[][] cols = new boolean[9][9];
        boolean[][] boxes = new boolean[9][9];

        for (int i = 0; i < 9; i++) {
            for (int j = 0; j < 9; j++) {
                if (board[i][j] != '.') {
                    int num = board[i][j] - '1';
                    int boxIndex = (i / 3) * 3 + j / 3;
                    if (rows[i][num] || cols[j][num] || boxes[boxIndex][num]) {
                        return false;
                    }
                    rows[i][num] = true;
                    cols[j][num] = true;
                    boxes[boxIndex][num] = true;
                }
            }
        }
        return true;
    }
}

class Solution {
    public int waysToSplit(String corridor) {
        int n = corridor.length();
        int[] preSum = new int[n];
        for (int i = 0; i < n; i++) {
            preSum[i] = (corridor.charAt(i) == 'S') ? 1 : 0;
            if (i > 0) preSum[i] += preSum[i-1];
        }
        long res = 0;
        int mod = 1000000007;
        for (int i = 1; i < n-1; i++) {
            if (preSum[i-1] > preSum[n-1] - preSum[i-1]) break;
            int left = findLeft(preSum, i);
            int right = findRight(preSum, i);
            res += (long)(right - left);
            res %= mod;
        }
        return (int)res;
    }
    
    private int findLeft(int[] preSum, int idx) {
        int left = idx;
        int n = preSum.length;
        int total = preSum[n-1];
        int i = 0, j = idx-1;
        while (i <= j) {
            int mid = i + (j-i)/2;
            int sum = preSum[mid];
            if (sum <= total/3) {
                left = mid;
                i = mid+1;
            } else {
                j = mid-1;
            }
        }
        return left;
    }
    
    private int findRight(int[] preSum, int idx) {
        int right = idx;
        int n = preSum.length;
        int total = preSum[n-1];
        int i = idx, j = n-2;
        while (i <= j) {
            int mid = i + (j-i)/2;
            int sum1 = preSum[mid] - preSum[idx-1];
            int sum2 = preSum[n-1] - preSum[mid];
            if (sum1 <= total/3 && sum2 >= sum1) {
                right = mid;
                i = mid+1;
            } else if (sum1 > total/3) {
                j = mid-1;
            } else {
                i = mid+1;
            }
        }
        return right;
    }
}

class Solution {
    public int[][] getNumberOfBacklogOrders(int[][] orders) {
        PriorityQueue<int[]> buy = new PriorityQueue<>((a, b) -> b[0] - a[0]);
        PriorityQueue<int[]> sell = new PriorityQueue<>((a, b) -> a[0] - b[0]);
        for (int[] order : orders) {
            if (order[2] == 0) {
                while (!sell.isEmpty() && sell.peek()[0] <= order[0] && order[1] > 0) {
                    int[] curr = sell.poll();
                    if (curr[1] > order[1]) {
                        curr[1] -= order[1];
                        order[1] = 0;
                        sell.offer(curr);
                    } else {
                        order[1] -= curr[1];
                    }
                }
                if (order[1] > 0) {
                    buy.offer(order);
                }
            } else {
                while (!buy.isEmpty() && buy.peek()[0] >= order[0] && order[1] > 0) {
                    int[] curr = buy.poll();
                    if (curr[1] > order[1]) {
                        curr[1] -= order[1];
                        order[1] = 0;
                        buy.offer(curr);
                    } else {
                        order[1] -= curr[1];
                    }
                }
                if (order[1] > 0) {
                    sell.offer(order);
                }
            }
        }
        int n = buy.size() + sell.size();
        int[][] res = new int[n][2];
        int i = 0;
        while (!buy.isEmpty()) {
            res[i++] = buy.poll();
        }
        while (!sell.isEmpty()) {
            int[] curr = sell.poll();
            res[i++] = new int[]{curr[0], curr[1]};
        }
        return res;
    }
}

class Solution {
    public int countSubsequences(int[] differences, int lower, int upper) {
        int n = differences.length;
        long[] preSum = new long[n+1];
        for (int i = 0; i < n; i++) {
            preSum[i+1] = preSum[i] + differences[i];
        }
        return mergeSort(preSum, 0, n+1, lower, upper);
    }
    
    private int mergeSort(long[] preSum, int left, int right, int lower, int upper) {
        if (right - left <= 1) {
            return 0;
        }
        int mid = (left + right) / 2;
        int cnt = mergeSort(preSum, left, mid, lower, upper) + mergeSort(preSum, mid, right, lower, upper);
        int i = left;
        int j = mid;
        int k = mid;
        int p = mid;
        long[] sorted = new long[right - left];
        for (int s = 0; s < sorted.length; s++) {
            if (i < mid && preSum[i] < preSum[j] - upper) {
                i++;
            } else if (j < right && preSum[j] - lower <= preSum[i]) {
                j++;
            } else {
                while (k < right && preSum[k] < preSum[p]) {
                    sorted[s++] = preSum[k++];
                }
                sorted[s] = preSum[p++];
                cnt += k - mid;
            }
        }
        System.arraycopy(sorted, 0, preSum, left, sorted.length);
        return cnt;
    }
}

