class Solution {
    public int maxHappyGroups(int batchSize, int[] groups) {
        int[] cnt = new int[batchSize];
        int res = 0;
        for (int i : groups) {
            if (i % batchSize == 0) {
                res++;
            } else {
                if (cnt[batchSize - i % batchSize] > 0) {
                    cnt[batchSize - i % batchSize]--;
                    res++;
                } else {
                    cnt[i % batchSize]++;
                }
            }
        }
        int[] dp = new int[1 << batchSize];
        for (int i = 1; i < dp.length; i++) {
            int sum = 0;
            for (int j = 0; j < batchSize; j++) {
                if (((i >> j) & 1) == 1) {
                    sum += cnt[j];
                }
            }
            for (int j = 0; j < batchSize; j++) {
                if (((i >> j) & 1) == 1 && sum % batchSize == j) {
                    dp[i] = Math.max(dp[i], dp[i ^ (1 << j)] + 1);
                }
            }
        }
        return res + dp[(1 << batchSize) - 1];
    }
}

