class Solution {
    public int numberOfLaserBeams(String[] bank) {
        int m = bank.length, n = bank[0].length();
        int[][] prefix = new int[m][n];
        for (int i = 0; i < n; i++) {
            prefix[0][i] = bank[0].charAt(i) - '0';
        }
        for (int i = 1; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (bank[i].charAt(j) == '1') {
                    prefix[i][j] = prefix[i-1][j] + 1;
                } else {
                    prefix[i][j] = prefix[i-1][j];
                }
            }
        }
        int ans = 0;
        for (int i = 0; i < m; i++) {
            for (int j = i+1; j < m; j++) {
                boolean valid = true;
                for (int k = 0; k < n; k++) {
                    if (bank[i].charAt(k) == '1' && bank[j].charAt(k) == '1') {
                        if (prefix[j-1][k] - prefix[i][k] > 0) {
                            valid = false;
                            break;
                        }
                    }
                }
                if (valid) ans++;
            }
        }
        return ans;
    }
}

