class Solution {
    public int[] recoverArray(int n, int[] nums) {
        Arrays.sort(nums);
        Set<Integer> set = new HashSet<>();
        for (int num : nums) {
            set.add(num);
        }
        int[] res = new int[n];
        int idx = 0;
        while (!set.isEmpty()) {
            int k = Math.abs(nums[1] - nums[0]);
            int cur = nums[0], cnt = 0, i = 0;
            while (i < nums.length) {
                if (nums[i] == cur) {
                    cnt++;
                    i++;
                } else if (set.contains(nums[i] - k)) {
                    set.remove(nums[i] - k);
                    cur = nums[i] - k;
                    cnt++;
                } else if (set.contains(nums[i] + k)) {
                    set.remove(nums[i] + k);
                    cur = nums[i] + k;
                    cnt++;
                } else {
                    break;
                }
            }
            if (cnt == n) {
                if (res[0] == 0) {
                    for (int j = 0; j < n; j++) {
                        res[j] = nums[0];
                        nums[0] = cur;
                    }
                } else {
                    Arrays.sort(res);
                    for (int j = 0; j < n; j++) {
                        res[j] = res[j] == 0 ? cur : res[j];
                    }
                }
            }
        }
        return res;
    }
}

class Solution {
    public int[] getSumAbsoluteDifferences(int[] nums) {
        int n = nums.length;
        int[] prefixSum = new int[n];
        prefixSum[0] = nums[0];
        for (int i = 1; i < n; i++) {
            prefixSum[i] = prefixSum[i-1] + nums[i];
        }
        int[] ans = new int[n];
        for (int i = 0; i < n; i++) {
            int leftSum = i * nums[i] - (i == 0 ? 0 : prefixSum[i-1]);
            int rightSum = (prefixSum[n-1] - prefixSum[i]) - (n-i-1) * nums[i];
            ans[i] = leftSum + rightSum;
        }
        return ans;
    }
}

class Solution {
    public int[] executeInstructions(int n, int[] startPos, String s) {
        int[] ans = new int[s.length()];
        for (int i = 0; i < s.length(); i++) {
            int row = startPos[0], col = startPos[1], cnt = 0;
            for (int j = i; j < s.length(); j++) {
                char ch = s.charAt(j);
                if (ch == 'L' && col > 0) col--;
                else if (ch == 'R' && col < n - 1) col++;
                else if (ch == 'U' && row > 0) row--;
                else if (ch == 'D' && row < n - 1) row++;
                else break;
                cnt++;
            }
            ans[i] = cnt;
        }
        return ans;
    }
}

class Solution {
    public boolean isPalindrome(int num) {
        int reversed1 = reverse(num);
        int reversed2 = reverse(reversed1);
        return reversed2 == num;
    }
    
    private int reverse(int num) {
        int result = 0;
        while (num != 0) {
            int digit = num % 10;
            result = result * 10 + digit;
            num /= 10;
        }
        return result;
    }
}

class Solution {
    public int longestPalindrome(String[] words) {
        Map<String, Integer> map = new HashMap<>();
        int oddCount = 0;
        int result = 0;
        for (String word : words) {
            if (isPalindrome(word)) {
                result += word.length();
                continue;
            }
            String rev = new StringBuilder(word).reverse().toString();
            if (map.containsKey(rev)) {
                int count = map.get(rev);
                if (count == 1) {
                    oddCount--;
                }
                result += word.length() + rev.length();
                map.put(rev, count - 1);
            } else {
                map.put(word, map.getOrDefault(word, 0) + 1);
                oddCount += map.get(word) % 2 == 0 ? -1 : 1;
            }
        }
        return oddCount > 0 ? result + 1 : result;
    }
    
    private boolean isPalindrome(String word) {
        int left = 0, right = word.length() - 1;
        while (left < right) {
            if (word.charAt(left) != word.charAt(right)) {
                return false;
            }
            left++;
            right--;
        }
        return true;
    }
}

class Solution {
    public int maxTwinSum(ListNode head) {
        int[] nodes = new int[100001];
        ListNode curr = head;
        while (curr != null) {
            nodes[curr.val]++;
            curr = curr.next;
        }
        int maxSum = 0;
        curr = head;
        while (curr != null) {
            int twinVal = 100000 - curr.val;
            if (nodes[twinVal] > 0) {
                maxSum = Math.max(maxSum, curr.val + twinVal);
            }
            curr = curr.next;
        }
        return maxSum;
    }
}

class Solution {
