    }
}

class Solution {
    public int minOperations(int[] arr, int k) {
        List<Integer> diffs = new ArrayList<>();
        int n = arr.length;
        for (int i = 0, j = k; j < n; i++, j++) {
            diffs.add(arr[j] - arr[i]);
        }
        Collections.sort(diffs);
        int target = diffs.get(diffs.size() / 2);
        int res = 0;
        for (int diff : diffs) {
            res += Math.abs(diff - target);
        }
        return res;
    }
}

class Solution {
    public int numberOfSubarrays(int[] nums, int k) {
        int res = 0, i = 0, n = nums.length, oddCnt = 0;
        int[] dp = new int[n + 1];
        for (int j = 0; j < n; j++) {
            if (nums[j] % 2 == 1) {
                oddCnt++;
                dp[oddCnt] = j;
            }
            if (oddCnt >= k) {
                res += dp[oddCnt - k + 1] - dp[oddCnt - k] + 1;
            }
        }
        return res;
    }
}

class Solution {
    public String reorderSpaces(String text) {
        int spaces = 0;
        for (char c : text.toCharArray()) {
            if (c == ' ') {
                spaces++;
            }
        }
        String[] words = text.trim().split("\\s+");
        StringBuilder sb = new StringBuilder();
        if (words.length == 1) {
            sb.append(words[0]);
            for (int i = 0; i < spaces; i++) {
                sb.append(' ');
            }
            return sb.toString();
        }
        int gaps = words.length - 1;
        int spacesBetweenWords = gaps == 0 ? 0 : spaces / gaps;
        int remainingSpaces = gaps == 0 ? spaces : spaces % gaps;
        for (int i = 0; i < words.length; i++) {
            sb.append(words[i]);
            if (i < gaps) {
                for (int j = 0; j < spacesBetweenWords; j++) {
                    sb.append(' ');
                }
                if (i == gaps - 1) {
                    for (int j = 0; j < remainingSpaces; j++) {
                        sb.append(' ');
                    }
                }
            }
        }
        for (int i = 0; i < remainingSpaces; i++) {
            sb.append(' ');
        }
        return sb.toString();
    }
}

class Solution {
    public String findFirstPalindromicString(String[] words) {
        for (String word : words) {
            if (isPalindromic(word)) {
                return word;
            }
        }
        return "";
    }
    
    private boolean isPalindromic(String s) {
        int left = 0;
        int right = s.length() - 1;
        while (left < right) {
            if (s.charAt(left) != s.charAt(right)) {
                return false;
            }
            left++;
            right--;
        }
        return true;
    }
}

class Solution {
    public int maxFruits(int[][] fruits, int startPos, int k) {
        int left = startPos - 1, right = startPos + 1;
        int maxFruits = fruits[startPos][1];
        for (int i = 0; i <= k; i++) {
            int leftFruits = getFruits(fruits, left);
            int rightFruits = getFruits(fruits, right);
            if (leftFruits == 0 && rightFruits == 0) break;
            if (leftFruits > rightFruits) {
                maxFruits += leftFruits;
                left--;
            } else {
                maxFruits += rightFruits;
                right++;
            }
        }
        return maxFruits;
    }
    
    private int getFruits(int[][] fruits, int pos) {
        if (pos < 0 || pos >= fruits.length || fruits[pos][1] == 0) return 0;
        int amount = fruits[pos][1];
        fruits[pos][1] = 0;
        return amount;
    }
}

class Solution {
    public int numRefills(int[] plants, int capacityA, int capacityB) {
        int n = plants.length;
        int refillsA = 0, refillsB = 0;
        int waterA = capacityA, waterB = capacityB;
        int left = 0, right = n - 1;
        while (left <= right) {
            int minWater = Math.min(waterA, waterB);
            if (plants[left] <= minWater) {
                waterA -= plants[left];
                left++;
            } else {
                waterA = capacityA;
                refillsA++;
            }
            if (plants[right] <= minWater) {
                waterB -= plants[right];
                right--;
            } else {
                waterB = capacityB;
                refillsB++;
            }
        }
        return refillsA + refillsB + (waterA + waterB > 0 ? 1 : 0);
    }
}

class Solution {
    public int sumSubarrayMins(int[] arr) {
        int MOD = 1000000007;
        int n = arr.length;
        int[] left = new int[n];
        int[] right = new int[n];
        Stack<int[]> s1 = new Stack<>();
        Stack<int[]> s2 = new Stack<>();
        for (int i = 0; i < n; i++) {
            int count = 1;
            while (!s1.isEmpty() && s1.peek()[0] > arr[i]) {
                count += s1.pop()[1];
            }
            s1.push(new int[]{arr[i], count});
            left[i] = count;
        }
        for (int i = n-1; i >= 0; i--) {
            int count = 1;
            while (!s2.isEmpty() && s2.peek()[0] >= arr[i]) {
                count += s2.pop()[1];
            }
            s2.push(new int[]{arr[i], count});
            right[i] = count;
        }
        long res = 0;
        for (int i = 0; i < n; i++) {
            res = (res + (long) arr[i] * left[i] * right[i]) % MOD;
        }
        return (int) res;
    }
}

class Solution {
    public int countRods(String rings) {
        int n = rings.length() / 2;
        int[][] rods = new int[10][3];
        for (int i = 0; i < n; i++) {
            char color = rings.charAt(i * 2);
            int rod = rings.charAt(i * 2 + 1) - '0';
            switch (color) {
                case 'R':
                    rods[rod][0]++;
                    break;
                case 'G':
                    rods[rod][1]++;
                    break;
                case 'B':
                    rods[rod][2]++;
                    break;
            }
        }
        int count = 0;
        for (int[] rod : rods) {
            if (rod[0] > 0 && rod[1] > 0 && rod[2] > 0) {
                count++;
            }
        }
        return count;
    }
}

class Solution {
    public String abbreviatedWord(int numDigits, String prefix, String suffix, int exponent) {
        if (numDigits > 10) {
            return prefix.substring(0, 5) + "..." + suffix.substring(suffix.length() - 5) + "e" + exponent;
        } else {
            return prefix + suffix + "e" + exponent;
        }
    }
    
    public String abbreviatedProduct(int left, int right) {
        int numZeros = 0;
        long product = 1L;
        for (int i = left; i <= right; i++) {
            product *= i;
            while (product % 10 == 0) {
                numZeros++;
                product /= 10;
            }
        }
        String productString = Long.toString(product);
        int numDigits = productString.length() + numZeros;
        int endIndex = productString.length() - 1;
        while (productString.charAt(endIndex) == '0') {
            endIndex--;
        }
        return abbreviatedWord(numDigits, productString.substring(0, endIndex + 1), productString.substring(endIndex + 1), numZeros);
    }
}

class Solution {
    public boolean checkValidString(String s, String locked) {
        int balance = 0, star = 0;
        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) == '(') balance++;
            else balance--;
            if (balance < 0) {
                if (star == 0) return false;
                balance += 2;
                star--;
            }
            if (locked.charAt(i) == '0') star++;
        }
        balance = 0;
        star = 0;
        for (int i = s.length()-1; i >= 0; i--) {
            if (s.charAt(i) == ')') balance++;
            else balance--;
            if (balance < 0) {
                if (star == 0) return false;
                balance += 2;
                star--;
            }
            if (locked.charAt(i) == '0') star++;
        }
        return true;
    }
}

class Solution {
    public List<String> getRecipes(String[] recipes, String[][] ingredients, String[] supplies) {
        List<String> res = new ArrayList<>();
        Map<String, List<String>> graph = new HashMap<>();
        Map<String, Integer> inDegrees = new HashMap<>();

        for (String supply : supplies) {
            inDegrees.put(supply, 0);
            graph.put(supply, new ArrayList<>());
        }

        for (String[] ingreds : ingredients) {
            String recipe = ingreds[0];
            for (int i = 1; i < ingreds.length; i++) {
                String ingred = ingreds[i];
                graph.get(ingred).add(recipe);
                inDegrees.put(recipe, inDegrees.getOrDefault(recipe, 0) + 1);
            }
        }

        Queue<String> queue = new LinkedList<>();
        for (Map.Entry<String, Integer> entry : inDegrees.entrySet()) {
            if (entry.getValue() == 0) {
                queue.offer(entry.getKey());
            }
        }

        while (!queue.isEmpty()) {
            String curr = queue.poll();
            if (!graph.containsKey(curr)) {
                continue;
            }
            for (String recipe : graph.get(curr)) {
                inDegrees.put(recipe, inDegrees.get(recipe) - 1);
                if (inDegrees.get(recipe) == 0) {
                    queue.offer(recipe);
                }
            }
        }

        for (int i = 0; i < recipes.length; i++) {
            if (inDegrees.getOrDefault(recipes[i], 1) == 0) {
                res.add(recipes[i]);
            }
        }

        return res;
    }
}

