class Solution {
    public String findPath(TreeNode root, int startValue, int destValue) {
        Map<Integer, TreeNode> parent = new HashMap<>();
        dfs(root, null, parent);
        TreeNode startNode = parent.get(startValue), destNode = parent.get(destValue);
        Set<TreeNode> visited = new HashSet<>();
        Queue<TreeNode> queue = new LinkedList<>();
        Map<TreeNode, TreeNode> directions = new HashMap<>();
        queue.add(startNode);
        visited.add(startNode);
        while (!queue.isEmpty()) {
            TreeNode curr = queue.poll();
            if (curr == destNode) {
                StringBuilder sb = new StringBuilder();
                while (curr != startNode) {
                    TreeNode prev = directions.get(curr);
                    if (prev.left == curr) sb.append('L');
                    else sb.append('R');
                    curr = prev;
                }
                return sb.reverse().toString();
            }
            if (curr.left != null && !visited.contains(curr.left)) {
                visited.add(curr.left);
                queue.add(curr.left);
                directions.put(curr.left, curr);
            }
            if (curr.right != null && !visited.contains(curr.right)) {
                visited.add(curr.right);
                queue.add(curr.right);
                directions.put(curr.right, curr);
            }
            if (parent.containsKey(curr.val) && !visited.contains(parent.get(curr.val))) {
                visited.add(parent.get(curr.val));
                queue.add(parent.get(curr.val));
                directions.put(parent.get(curr.val), curr);
            }
        }
        return "";
    }
    
    private void dfs(TreeNode node, TreeNode par, Map<Integer, TreeNode> parent) {
        if (node != null) {
            parent.put(node.val, par);
            dfs(node.left, node, parent);
            dfs(node.right, node, parent);
        }
    }
}

class Solution {
    public ListNode deleteMiddleNode(ListNode head) {
        if (head == null || head.next == null) return null;
        ListNode slow = head, fast = head.next.next;
        while (fast != null && fast.next != null) {
            slow = slow.next;
            fast = fast.next.next;
        }
        slow.next = slow.next.next;
        return head;
    }
}

class Solution {
    public int[] getConcatenation(int[] nums) {
        int n = nums.length;
        int[] ans = new int[n*2];
        for (int i = 0; i < n; i++) {
            ans[i] = nums[i];
            ans[i+n] = nums[i];
        }
        return ans;
    }
}

class Solution {
    public List<Integer> findSecretHolder(int n, int[][] meetings, int firstPerson) {
        int[] secrets = new int[n];
        secrets[firstPerson] = 1;
        boolean updated = true;
        while (updated) {
            updated = false;
            for (int[] meeting : meetings) {
                int p1 = meeting[0];
                int p2 = meeting[1];
                int time = meeting[2];
                if (secrets[p1] == 1 && secrets[p2] == 0) {
                    secrets[p2] = time+1;
                    updated = true;
                } else if (secrets[p2] == 1 && secrets[p1] == 0) {
                    secrets[p1] = time+1;
                    updated = true;
                }
            }
        }
        List<Integer> res = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            if (secrets[i] > 0) {
                res.add(i);
            }
        }
        return res;
    }
}

class Solution {
    public int minOperations(int[] nums) {
        Arrays.sort(nums);
        int n = nums.length;
        int min = nums[0], max = nums[n-1];
        int minIdx = 0, maxIdx = 0;
        for (int i = 0; i < n; i++) {
            if (nums[i] == min) minIdx = i;
            if (nums[i] == max) maxIdx = i;
        }
        return n - (maxIdx - minIdx + 1);
    }
}

class Solution {
    public int[] findKRadiusAverage(int[] nums, int k) {
        int n = nums.length;
        int[] avgs = new int[n];
        for (int i = 0; i < n; i++) {
            int sum = 0, count = 0;
            for (int j = i - k; j <= i + k; j++) {
                if (j >= 0 && j < n) {
                    sum += nums[j];
                    count++;
                }
            }
            avgs[i] = count < 2 * k + 1 ? -1 : sum / (2 * k + 1);
        }
        return avgs;
    }
}

class Solution {
    public int[] getTargetIndices(int[] nums, int target) {
        int n = nums.length;
        Integer[] indices = new Integer[n];
        for (int i = 0; i < n; i++) {
            indices[i] = i;
        }
        Arrays.sort(indices, (a, b) -> Integer.compare(nums[a], nums[b]));
        int[] res = new int[n];
        int count = 0;
        for (int i : indices) {
            if (nums[i] == target) {
                res[count++] = i;
            }
        }
        return Arrays.copyOf(res, count);
    }
}

class SORTracker {
    private Map<String, Integer> locs;
    private PriorityQueue<String> pq;

    public SORTracker() {
        locs = new HashMap<>();
        pq = new PriorityQueue<>((a, b) -> {
            int scoreDiff = locs.get(b) - locs.get(a);
            if (scoreDiff == 0) {
                return a.compareTo(b);
            }
            return scoreDiff;
        });
    }

    public void add(String name, int score) {
        locs.put(name, score);
        pq.offer(name);
    }

    public String get() {
        int i = pq.size();
        while (true) {
            String loc = pq.poll();
            if (i == 1) {
                pq.offer(loc);
                return loc;
            }
            i--;
        }
    }
}

class Solution {
    public int maxDetonations(int[][] bombs) {
        int n = bombs.length;
        int maxDetonations = 1;
        for (int i = 0; i < n; i++) {
            int curDetonations = 1;
            for (int j = 0; j < n; j++) {
                if (i == j) continue;
                int d = (bombs[i][0] - bombs[j][0]) * (bombs[i][0] - bombs[j][0]) +
                        (bombs[i][1] - bombs[j][1]) * (bombs[i][1] - bombs[j][1]);
                if (d <= bombs[i][2] * bombs[i][2]) curDetonations++;
            }
            maxDetonations = Math.max(maxDetonations, curDetonations);
        }
        return maxDetonations;
    }
}

class Solution {
    public List<Integer> findGoodDays(int[] security, int time) {
        List<Integer> goodDays = new ArrayList<>();
        for (int i = 0; i < security.length; i++) {
            int start = Math.max(0, i - time);
            int end = Math.min(security.length - 1, i + time);

            boolean decreasing = true;
            for (int j = i - 1; j >= start; j--) {
                if (security[j] > security[j + 1]) {
                    decreasing = false;
                    break;
                }
            }

            boolean increasing = true;
            for (int j = i + 1; j <= end; j++) {
                if (security[j] < security[j - 1]) {
                    increasing = false;
                    break;
                }
            }

            if (decreasing && increasing) {
                goodDays.add(i);
            }
        }
        return goodDays;
    }
}

class Solution {
    public int[] maxSumOfKSubarrays(int[] nums, int k) {
        int[] res = new int[k];
        int n = nums.length, start = n - k;
        int[] suffixSum = new int[n];
        suffixSum[n-1] = nums[n-1];
        for(int i = n-2;i>=0;i--){
            suffixSum[i] = suffixSum[i+1]+nums[i];
        }
        int maxIndex = start;
        for(int i = start-1;i>=0;i--){
            if(suffixSum[i]-suffixSum[i+k] > suffixSum[maxIndex]-suffixSum[maxIndex+k]){
                maxIndex = i;
            }
        }
        for(int i = 0;i<k;i++){
            res[i] = nums[maxIndex+i];
        }
        return res;
    }
}

class Solution {
    public int sumMirrorNumbers(int k, int n) {
        List<Integer> list = new ArrayList<>();
        for (int i = 1; i <= Integer.MAX_VALUE && list.size() < n; i++) {
            String base10 = Integer.toString(i);
            String baseK = Integer.toString(i, k);
            if (isMirror(base10) && isMirror(baseK)) {
                list.add(i);
            }
        }
        int sum = 0;
        for (int num : list) {
            sum += num;
        }
        return sum;
    }
    
    private boolean isMirror(String s) {
        int n = s.length();
        for (int i = 0; i < n / 2; i++) {
            if (s.charAt(i) != s.charAt(n - i - 1)) {
                return false;
            }
        }
        return true;
    }
}

class Solution {
    public int[][] reconstructQueue(int[][] people) {
