        List<int[]> res = new ArrayList<>();
        for (int[] p : people) {
            res.add(p[1], p);
        }
        return res.toArray(new int[0][0]);
    }
}

class Solution {
    public boolean canStamp(int[][] grid, int stampHeight, int stampWidth) {
        int rows = grid.length, cols = grid[0].length;
        boolean[][] visited = new boolean[rows][cols];
        int totalEmpty = countEmptyCells(grid);
        while (totalEmpty > 0) {
            boolean foundStamp = false;
            for (int r = 0; r <= rows - stampHeight; r++) {
                for (int c = 0; c <= cols - stampWidth; c++) {
                    if (canApplyStamp(grid, visited, r, c, stampHeight, stampWidth)) {
                        applyStamp(grid, visited, r, c, stampHeight, stampWidth);
                        totalEmpty -= stampHeight * stampWidth;
                        foundStamp = true;
                    }
                }
            }
            if (!foundStamp) {
                return false;
            }
        }
        return true;
    }
    
    private int countEmptyCells(int[][] grid) {
        int count = 0;
        for (int[] row : grid) {
            for (int cell : row) {
                if (cell == 0) {
                    count++;
                }
            }
        }
        return count;
    }
    
    private boolean canApplyStamp(int[][] grid, boolean[][] visited, int r, int c, int stampHeight, int stampWidth) {
        for (int i = r; i < r + stampHeight; i++) {
            for (int j = c; j < c + stampWidth; j++) {
                if (grid[i][j] == 1 || visited[i][j]) {
                    return false;
                }
            }
        }
        return true;
    }
    
    private void applyStamp(int[][] grid, boolean[][] visited, int r, int c, int stampHeight, int stampWidth) {
        for (int i = r; i < r + stampHeight; i++) {
            for (int j = c; j < c + stampWidth; j++) {
                visited[i][j] = true;
                if (grid[i][j] == 0) {
                    grid[i][j] = 1;
                }
            }
        }
    }
}

