class Solution {
    public boolean[] canBeFriends(int n, int[][] restrictions, int[][] requests) {
        boolean[] result = new boolean[requests.length];
        Set<Integer>[] graph = new Set[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new HashSet<>();
        }
        for (int[] restriction : restrictions) {
            graph[restriction[0]].add(restriction[1]);
            graph[restriction[1]].add(restriction[0]);
        }
        Set<Integer> friends = new HashSet<>();
        for (int i = 0; i < requests.length; i++) {
            int[] request = requests[i];
            if (canBefriend(graph, friends, request[0], request[1])) {
                result[i] = true;
                friends.add(request[0]);
                friends.add(request[1]);
                graph[request[0]].add(request[1]);
                graph[request[1]].add(request[0]);
            }
        }
        return result;
    }
    
    private boolean canBefriend(Set<Integer>[] graph, Set<Integer> friends, int u, int v) {
        if (friends.contains(u) && friends.contains(v)) {
            return true;
        }
        Set<Integer> visited = new HashSet<>();
        Queue<Integer> queue = new LinkedList<>();
        queue.add(u);
        visited.add(u);
        while (!queue.isEmpty()) {
            int curr = queue.poll();
            if (friends.contains(curr)) {
                return false;
            }
            if (curr == v) {
                return true;
            }
            for (int neighbor : graph[curr]) {
                if (!visited.contains(neighbor)) {
                    visited.add(neighbor);
                    queue.add(neighbor);
                }
            }
        }
        return false;
    }
}

class Solution {
