        }
        int idx = 0, n = s.length();
        while (idx < n) {
            for (int i = 0; i < numRows && idx < n; i++) {
                rows[i].append(s.charAt(idx++));
            }
            for (int i = numRows - 2; i > 0 && idx < n; i--) {
                rows[i].append(s.charAt(idx++));
            }
        }
        StringBuilder res = new StringBuilder();
        for (int i = 0; i < numRows; i++) {
            res.append(rows[i]);
        }
        return res.toString();
    }
}

class Solution {
    public ListNode reverseEvenGroup(ListNode head) {
        ListNode sentinel = new ListNode(0);
        sentinel.next = head;
        ListNode prev = sentinel, curr = head;
        while (curr != null) {
            int len = 0;
            ListNode temp = curr;
            while (temp != null && len < 2) {
                temp = temp.next;
                len++;
            }
            if (len == 2) {
                ListNode first = curr, second = curr.next, third = temp;
                ListNode tail = third.next;
                second.next = third.next;
                first.next = third;
                third.next = second;
                prev.next = first;
                prev = second;
                curr = tail;
            } else {
                prev = curr;
                curr = temp;
            }
        }
        return sentinel.next;
    }
}

class Solution {
    public int buyTicket(int[] tickets, int k) {
        PriorityQueue<Integer> pq = new PriorityQueue<>(Collections.reverseOrder());
        int n = tickets.length;
        int[] sorted = tickets.clone();
        Arrays.sort(sorted);
        int i = 0;
        int time = 0;
        while (i < n && tickets[k] > sorted[n-i-1]) {
            pq.offer(i);
            i++;
        }
        while (!pq.isEmpty()) {
            int j = pq.poll();
            time += tickets[j];
            if (j == k) {
                return time;
            }
            tickets[j]--;
            if (tickets[j] > 0) {
                pq.offer(j);
            }
        }
        return time;
    }
}

class Solution {
    public int countPyramids(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        int res = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 0) continue;
                int h = 1;
                while (i + h < m && j - h >= 0 && j + h < n
                       && grid[i + h][j - h] == 1 && grid[i + h][j] == 1 && grid[i + h][j + h] == 1) {
                    res++;
                    h++;
                }
            }
        }
        for (int i = m - 1; i >= 0; i--) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 0) continue;
                int h = 1;
                while (i - h >= 0 && j - h >= 0 && j + h < n
                       && grid[i - h][j - h] == 1 && grid[i - h][j] == 1 && grid[i - h][j + h] == 1) {
                    res++;
                    h++;
                }
            }
        }
        return res;
    }
}

class Solution {
    public int minimumCost(int[] startPos, int[] homePos, int[] rowCosts, int[] colCosts) {
        int m = rowCosts.length, n = colCosts.length;
        int[][] dist = new int[m][n];
        for (int[] arr : dist) Arrays.fill(arr, Integer.MAX_VALUE / 2);
        dist[startPos[0]][startPos[1]] = 0;
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[2] - b[2]);
        pq.offer(new int[]{startPos[0], startPos[1], 0});
        while (!pq.isEmpty()) {
            int[] curr = pq.poll();
            if (curr[0] == homePos[0] && curr[1] == homePos[1]) return curr[2];
            if (dist[curr[0]][curr[1]] < curr[2]) continue;
            int[] dr = {-1, 1, 0, 0}, dc = {0, 0, -1, 1};
            for (int k = 0; k < 4; ++k) {
                int nr = curr[0] + dr[k], nc = curr[1] + dc[k];
                if (nr >= 0 && nr < m && nc >= 0 && nc < n) {
                    int ndist = curr[2] + (k < 2 ? rowCosts[curr[0]] : colCosts[curr[1]]);
                    if (ndist < dist[nr][nc]) {
                        dist[nr][nc] = ndist;
                        pq.offer(new int[]{nr, nc, ndist});
                    }
                }
            }
        }
        return -1;
    }
}

class Solution {
    public int minBuckets(String hamsters) {
        int n = hamsters.length();
        int minBuckets = 0;
        for (int i = 0; i < n; i++) {
            if (hamsters.charAt(i) == 'H') {
                int j = i + 1;
                while (j < n && hamsters.charAt(j) == '.') {
                    j++;
                }
                if (i != 0 && (j == n || j - i > 2)) {
                    minBuckets++;
                }
                i = j - 1;
            }
        }
        return minBuckets == 0 ? -1 : minBuckets;
    }
}

