                count++;
            }
        }
        return count;
    }
}

class Solution {
    public int maxPath(int[] values, int[][] edges, int maxTime) {
        int n = values.length;
        int[][] dist = new int[n][n];
        int[][] graph = new int[n][n];
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1], w = edge[2];
            graph[u][v] = graph[v][u] = w;
        }
        for (int i = 0; i < n; i++) {
            Arrays.fill(dist[i], Integer.MAX_VALUE);
            dist[i][i] = 0;
        }
        for (int k = 0; k < n; k++) {
            for (int i = 0; i < n; i++) {
                for (int j = 0; j < n; j++) {
                    if (graph[i][k] > 0 && graph[k][j] > 0) {
                        int d = graph[i][k] + graph[k][j];
                        if (dist[i][k] != Integer.MAX_VALUE && dist[k][j] != Integer.MAX_VALUE && dist[i][k] + dist[k][j] + d <= maxTime) {
                            dist[i][j] = Math.min(dist[i][j], dist[i][k] + dist[k][j] - graph[i][k] + values[k]);
                        }
                    }
                }
            }
        }
        int maxQuality = 0;
        for (int i = 1; i < n; i++) {
            if (graph[0][i] > 0 && graph[0][i] <= maxTime) {
                maxQuality = Math.max(maxQuality, values[0] + values[i]);
            }
            for (int j = i + 1; j < n; j++) {
                if (graph[0][i] + graph[i][j] + graph[j][0] <= maxTime) {
                    maxQuality = Math.max(maxQuality, values[0] + values[i] + values[j]);
                }
                if (dist[0][i] + dist[i][j] + dist[j][0] <= maxTime) {
                    maxQuality = Math.max(maxQuality, values[0] + values[i] + values[j] - values[findMiddle(values, dist, i, j)]);
                }
            }
        }
        return maxQuality;
    }
    
    private int findMiddle(int[] values, int[][] dist, int i, int j) {
        int k = 1, n = values.length;
        int ans = -1;
        while (k < n) {
            if (dist[i][k] + dist[k][j] == dist[i][j]) {
                if (ans == -1 || values[k] > values[ans]) {
                    ans = k;
                }
            }
            k++;
        }
        return ans;
    }
}

class Solution {
    public int getMinimizedMaximum(int n, int[] quantities) {
        int left = 1, right = 100005;
        while (left < right) {
            int mid = (left + right) / 2;
            int count = 0;
            for (int quantity : quantities) {
                count += (quantity + mid - 1) / mid;
            }
            if (count > n) {
                left = mid + 1;
            } else {
                right = mid;
            }
        }
        return left;
    }
}

