class Solution {
    public boolean canBeEqual(String s1, String s2) {
        return helper(s1).equals(helper(s2));
    }
    
    private String helper(String s) {
        StringBuilder sb = new StringBuilder();
        int i = 0;
        while (i < s.length()) {
            if (Character.isDigit(s.charAt(i))) {
                int j = i;
                while (j < s.length() && Character.isDigit(s.charAt(j))) {
                    j++;
                }
                int len = Integer.parseInt(s.substring(i,j));
                i = j + len;
            } else {
                sb.append(s.charAt(i));
                i++;
            }
        }
        return sb.toString();
    }
}

class Solution {
    public int minimumOperations(int[] nums, int start, int goal) {
        Queue<Integer> queue = new LinkedList<>();
        Set<Integer> visited = new HashSet<>();
        queue.offer(start);
        visited.add(start);
        int level = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            while (size-- > 0) {
                int curr = queue.poll();
                if (curr == goal) return level;
                for (int num : nums) {
                    int next1 = curr + num;
                    int next2 = curr - num;
                    int next3 = curr ^ num;
                    if (next1 <= 1000 && visited.add(next1)) queue.offer(next1);
                    if (next2 >= 0 && visited.add(next2)) queue.offer(next2);
                    if (visited.add(next3)) queue.offer(next3);
                }
            }
            level++;
        }
        return -1;
    }
}

class Solution {
    public int[] criticalPointIndices(ListNode head) {
        List<Integer> criticalPoints = new ArrayList<>();
        ListNode cur = head;
        int i = 0;
        while (cur != null && cur.next != null) {
            if ((cur.next.val > cur.val && cur.val < cur.prev.val) || 
                (cur.next.val < cur.val && cur.val > cur.prev.val)) {
                criticalPoints.add(i);
            }
            cur = cur.next;
            i++;
        }
        if (criticalPoints.size() < 2) {
            return new int[]{-1, -1};
        }
        int minDist = Integer.MAX_VALUE;
        int maxDist = Integer.MIN_VALUE;
        for (int j = 0; j < criticalPoints.size() - 1; j++) {
            int dist = criticalPoints.get(j+1) - criticalPoints.get(j);
            minDist = Math.min(minDist, dist);
            maxDist = Math.max(maxDist, dist);
        }
        return new int[]{minDist, maxDist};
    }
}

