class Solution {
    public int maxTasks(int[] tasks, int[] workers, int pills, int strength) {
        int n = tasks.length, m = workers.length;
        Integer[] taskIdx = new Integer[n];
        for (int i = 0; i < n; i++) {
            taskIdx[i] = i;
        }
        Arrays.sort(taskIdx, Comparator.comparingInt(i -> tasks[i]));
        int ans = 0;
        boolean[] used = new boolean[m];
        for (int i = 0; i < n; i++) {
            int task = taskIdx[i];
            int worker = findWorker(workers, tasks[task]);
            if (worker != -1) {
                ans++;
                used[worker] = true;
            } else if (pills > 0) {
                worker = findWorker(workers, tasks[task] - strength);
                if (worker != -1) {
                    ans++;
                    used[worker] = true;
                    pills--;
                }
            }
        }
        return ans;
    }
    
    private int findWorker(int[] workers, int strength) {
        int l = 0, r = workers.length - 1;
        while (l <= r) {
            int mid = l + (r - l) / 2;
            if (workers[mid] >= strength) {
                if (mid == 0 || workers[mid - 1] < strength) {
                    return mid;
                } else {
                    r = mid - 1;
                }
            } else {
                l = mid + 1;
            }
        }
        return -1;
    }
}

