class Solution {
    public int minimumTime(int n, int[][] relations, int[] time) {
        List<List<Integer>> graph = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            graph.add(new ArrayList<>());
        }
        int[] inDegree = new int[n];
        for (int[] rel : relations) {
            graph.get(rel[0] - 1).add(rel[1] - 1);
            inDegree[rel[1] - 1]++;
        }
        int[] minTime = new int[n];
        Queue<Integer> queue = new LinkedList<>();
        for (int i = 0; i < n; i++) {
            if (inDegree[i] == 0) {
                minTime[i] = time[i];
                queue.offer(i);
            }
        }
        int totalTime = 0;
        while (!queue.isEmpty()) {
            int curr = queue.poll();
            for (int neighbor : graph.get(curr)) {
                inDegree[neighbor]--;
                minTime[neighbor] = Math.max(minTime[neighbor], minTime[curr] + time[neighbor]);
                if (inDegree[neighbor] == 0) {
                    queue.offer(neighbor);
                }
            }
            totalTime = Math.max(totalTime, minTime[curr]);
        }
        return totalTime;
    }
}

class Solution {
    public int countHighestScoreNodes(int[] parents) {
        int n = parents.length;
        List<Integer>[] graph = new List[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int i = 1; i < n; i++) {
            graph[parents[i]].add(i);
        }
        int[] ans = new int[n];
        int[] subtreeSize = new int[n];
        dfs(0, graph, ans, subtreeSize);
        int maxScore = 0;
        for (int i = 0; i < n; i++) {
            maxScore = Math.max(maxScore, ans[i]);
        }
        int count = 0;
        for (int i = 0; i < n; i++) {
            if (ans[i] == maxScore) {
                count++;
            }
        }
        return count;
    }
    
    private void dfs(int u, List<Integer>[] graph, int[] ans, int[] subtreeSize) {
        ans[u] = 1;
        subtreeSize[u] = 1;
        for (int v : graph[u]) {
            dfs(v, graph, ans, subtreeSize);
            ans[u] *= subtreeSize[v];
            subtreeSize[u] += subtreeSize[v];
        }
        ans[u] *= (graph[u].isEmpty() ? 1 : (subtreeSize[u] - 1 - subtreeSize[graph[u].get(0)]));
    }
}

class Solution {
