            num++;
        }
        return num;
    }
    
    private boolean isBeautiful(int num, int[] count) {
        int[] newCount = new int[10];
        String str = Integer.toString(num);
        for(char c: str.toCharArray()) {
            newCount[c-'0']++;
        }
