        }
        return true;
    }
}

class Solution {
    public int countValidWords(String sentence) {
        String[] tokens = sentence.split("\\s+");
        int count = 0;
        for (String token : tokens) {
            if (isValidWord(token)) {
                count++;
            }
        }
        return count;
    }
    
    private boolean isValidWord(String word) {
        int len = word.length();
        if (len == 0 || !Character.isLowerCase(word.charAt(0))) {
            return false;
        }
        int hyphenCount = 0;
        int punctuationCount = 0;
        for (int i = 0; i < len; i++) {
            char c = word.charAt(i);
            if (!Character.isLowerCase(c) && c != '-' && c != '.' && c != ',') {
                return false;
            }
            if (c == '-') {
                hyphenCount++;
                if (hyphenCount > 1 || i == 0 || i == len - 1 || !Character.isLowerCase(word.charAt(i-1)) || !Character.isLowerCase(word.charAt(i+1))) {
                    return false;
                }
            } else if (c == '.' || c == ',') {
                punctuationCount++;
                if (punctuationCount > 1 || i != len - 1) {
                    return false;
                }
            }
        }
        return true;
    }
}

class Solution {
    public int secondMinimum(int n, int[][] edges, int time, int change) {
        List<List<Integer>> graph = new ArrayList<>();
        for (int i = 0; i <= n; i++) {
            graph.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1];
            graph.get(u).add(v);
            graph.get(v).add(u);
        }
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[1] - b[1]);
        pq.offer(new int[]{1, 0});
        int[] dist = new int[n+1];
        Arrays.fill(dist, Integer.MAX_VALUE);
        dist[1] = 0;
        while (!pq.isEmpty()) {
            int[] cur = pq.poll();
            int u = cur[0], d = cur[1];
            if (dist[u] < d) continue;
            for (int v : graph.get(u)) {
                int wait = (d / change + 1) * change - d;
                int timeToV = d + wait + (v == n ? 0 : time);
                if (dist[v] > timeToV) {
                    dist[v] = timeToV;
                    pq.offer(new int[]{v, timeToV});
                }
            }
        }
        return dist[n];
    }
}

class Solution {
    public int countMaxOrSubsets(int[] nums) {
        int maxOr = 0;
        for (int num : nums) {
            maxOr |= num;
        }
        int count = 0;
        for (int i = 0; i < (1 << nums.length); i++) {
            int curOr = 0;
            for (int j = 0; j < nums.length; j++) {
                if ((i & (1 << j)) != 0) {
                    curOr |= nums[j];
                }
            }
            if (curOr == maxOr) {
                count++;
            }
        }
        return count;
    }
}

class Bank {

    long[] balance;

    public Bank(long[] balance) {
        this.balance = balance;
    }

    public boolean transfer(int account1, int account2, long money) {
        if (account1 < 1 || account1 > balance.length || account2 < 1 || account2 > balance.length) {
            return false;
        }
        if (balance[account1-1] < money) {
            return false;
        }
        balance[account1-1] -= money;
        balance[account2-1] += money;
        return true;
    }
    
    public boolean deposit(int account, long money) {
        if (account < 1 || account > balance.length) {
            return false;
        }
        balance[account-1] += money;
        return true;
    }
    
    public boolean withdraw(int account, long money) {
        if (account < 1 || account > balance.length || balance[account-1] < money) {
            return false;
        }
        balance[account-1] -= money;
        return true;
    }
}

class Solution {
    public boolean areNumbersAscending(String s) {
        int prev = -1;
        String[] tokens = s.split(" ");
        for (String token : tokens) {
            if (Character.isDigit(token.charAt(0))) {
                int num = Integer.parseInt(token);
                if (num <= prev) {
