                }
                prev = num;
            }
        }
        return true;
    }
}

class Solution {
    int ans = 0;
    public int numMoves(String[] pieces, int[][] positions) {
        int n = pieces.length;
        int[][] des = new int[n][2];
        for (int i = 0; i < n; i++) {
            des[i][0] = positions[i][0] - 1;
            des[i][1] = positions[i][1] - 1;
        }
        dfs(0, des, pieces);
        return ans;
    }
    private void dfs(int idx, int[][] des, String[] pieces) {
        if (idx == des.length) {
            if (isValid(des, pieces)) ans++;
            return;
        }
        for (int i = 0; i < 8; i++) {
            for (int j = 0; j < 8; j++) {
                des[idx][0] = i;
                des[idx][1] = j;
                dfs(idx + 1, des, pieces);
            }
        }
    }
    private boolean isValid(int[][] des, String[] pieces) {
        boolean[][] grid = new boolean[8][8];
        for (int i = 0; i < des.length; i++) {
            int x = des[i][0];
            int y = des[i][1];
            if (grid[x][y]) return false;
            grid[x][y] = true;
            if (pieces[i].equals("rook")) {
                for (int k = 0; k < 4; k++) {
                    int nx = x;
                    int ny = y;
                    while (true) {
                        nx += dx[k];
                        ny += dy[k];
                        if (nx < 0 || nx >= 8 || ny < 0 || ny >= 8 || grid[nx][ny]) break;
                        grid[nx][ny] = true;
                    }
                }
            } else if (pieces[i].equals("queen")) {
                for (int k = 0; k < 8; k++) {
                    int nx = x;
                    int ny = y;
                    while (true) {
                        nx += dx[k];
                        ny += dy[k];
                        if (nx < 0 || nx >= 8 || ny < 0 || ny >= 8 || grid[nx][ny]) break;
                        grid[nx][ny] = true;
                    }
                }
            } else if (pieces[i].equals("bishop")) {
                for (int k = 0; k < 4; k++) {
                    int nx = x;
                    int ny = y;
                    while (true) {
                        nx += bx[k];
                        ny += by[k];
                        if (nx < 0 || nx >= 8 || ny < 0 || ny >= 8 || grid[nx][ny]) break;
                        grid[nx][ny] = true;
                    }
                }
            }
        }
        return true;
    }
    int[] dx = {1, -1, 0, 0};
    int[] dy = {0, 0, 1, -1};
    int[] bx = {1, 1, -1, -1};
    int[] by = {1, -1, 1, -1};
}

class Solution {
    public int[] platesBetweenCandles(String s, int[][] queries) {
        int[] ans = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int left = queries[i][0], right = queries[i][1];
            int count = 0;
            for (int j = left + 1; j < right; j++) {
                if (s.charAt(j) == '*') {
                    boolean leftCandle = false, rightCandle = false;
                    for (int k = left; k < j; k++) {
                        if (s.charAt(k) == '|') {
                            leftCandle = true;
                            break;
                        }
                    }
                    for (int k = j + 1; k <= right; k++) {
                        if (s.charAt(k) == '|') {
                            rightCandle = true;
                            break;
                        }
                    }
                    if (leftCandle && rightCandle) {
                        count++;
                    }
                }
            }
            ans[i] = count;
        }
        return ans;
    }
}

class Solution {
    public int maxValue(int[][] events) {
        Arrays.sort(events, (a, b) -> a[1] - b[1]);
        int n = events.length, ans = 0;
        int[][] dp = new int[n][3];
        dp[0][0] = 0;
        dp[0][1] = events[0][2];
        dp[0][2] = -1;
        for (int i = 1; i < n; ++i) {
            dp[i][0] = Math.max(dp[i - 1][0], dp[i - 1][1]);
            if (events[i][0] > events[dp[i - 1][2]][1]) {
                dp[i][1] = Math.max(dp[i - 1][0], dp[i - 1][1]) + events[i][2];
            } else {
                dp[i][1] = dp[i - 1][1] + events[i][2];
            }
            if (dp[i - 1][1] > dp[i - 1][0] && events[i][0] > events[dp[i - 1][1]][1]) {
                dp[i][0] = dp[i - 1][1];
                dp[i][2] = i - 1;
            }
            ans = Math.max(ans, Math.max(dp[i][0], dp[i][1]));
        }
        return ans;
    }
}

