class Solution {
    public int minimumDifference(int[] nums) {
        int n = nums.length;
        int sum = 0;
        for (int num : nums) sum += num;
        int[][] dp = new int[n / 2 + 1][sum / 2 + 1];
        for (int i = 1; i <= n / 2; i++) {
            for (int j = 1; j <= sum / 2; j++) {
                dp[i][j] = dp[i][j - 1] + Math.abs(nums[j + (i - 1) * 2 - 1] - j);
                if (j >= 2) dp[i][j] = Math.min(dp[i][j], dp[i - 1][j - 2] + Math.abs(nums[j + (i - 1) * 2 - 1] + nums[j + (i - 2) * 2] - j * 2 + 2));
            }
        }
        return dp[n / 2][sum / 2];
    }
}

class StockPrice {
    
    private int currentTimestamp;
    private int currentPrice;
    private TreeMap<Integer, Integer> prices;
    private TreeMap<Integer, Integer> maxPrices;
    private TreeMap<Integer, Integer> minPrices;
    
    public StockPrice() {
        currentTimestamp = 0;
        currentPrice = 0;
        prices = new TreeMap<>();
        maxPrices = new TreeMap<>(Collections.reverseOrder());
        minPrices = new TreeMap<>();
    }
    
    public void update(int timestamp, int price) {
        if (prices.containsKey(timestamp)) {
            int prevPrice = prices.get(timestamp);
            maxPrices.put(prevPrice, maxPrices.get(prevPrice) - 1);
            if (maxPrices.get(prevPrice) == 0) {
                maxPrices.remove(prevPrice);
            }
            minPrices.put(prevPrice, minPrices.get(prevPrice) - 1); 
            if (minPrices.get(prevPrice) == 0) {
                minPrices.remove(prevPrice);
            }
        }
        prices.put(timestamp, price);
        maxPrices.put(price, maxPrices.getOrDefault(price, 0) + 1);
        minPrices.put(price, minPrices.getOrDefault(price, 0) + 1);
        currentTimestamp = Math.max(currentTimestamp, timestamp);
        currentPrice = price;
    }
    
    public int current() {
        return currentPrice;
    }
    
    public int maximum() {
        return maxPrices.firstKey();
    }
    
    public int minimum() {
        return minPrices.firstKey();
    }
}

class Solution {
    public int minOperations(int[][] grid, int x) {
        int m = grid.length, n = grid[0].length;
        int[] arr = new int[m * n];
        int idx = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                arr[idx++] = grid[i][j];
            }
        }
        Arrays.sort(arr);
        int mid = m * n / 2;
        int val = arr[mid];
        int ans = 0;
        for (int i = 0; i < m * n; i++) {
            int diff = Math.abs(arr[i] - val);
            if (diff % x != 0) return -1;
            ans += diff / x;
        }
        return ans;
    }
}

class Solution {
    public List<Integer> twoOutOfThree(int[] nums1, int[] nums2, int[] nums3) {
        Set<Integer> set1 = new HashSet<>();
        Set<Integer> set2 = new HashSet<>();
        Set<Integer> set3 = new HashSet<>();
        for (int num : nums1) set1.add(num);
        for (int num : nums2) set2.add(num);
        for (int num : nums3) set3.add(num);
        Set<Integer> res = new HashSet<>();
        for (int num : set1) {
            if (set2.contains(num) || set3.contains(num)) {
                res.add(num);
            }
        }
        for (int num : set2) {
            if (set1.contains(num) || set3.contains(num)) {
                res.add(num);
            }
        }
        for (int num : set3) {
            if (set1.contains(num) || set2.contains(num)) {
                res.add(num);
            }
        }
        return new ArrayList<>(res);
    }
}

class Solution {
    public String smallestSubsequence(String s, int k, char letter, int repetition) {
        int n = s.length();
        int[] freq = new int[n];
        int[] prefix = new int[n + 1];
        int last = -1;
        for (int i = n - 1; i >= 0; i--) {
            freq[i] = (s.charAt(i) == letter) ? 1 : 0;
            prefix[i] = prefix[i + 1] + freq[i];
            if (prefix[i] >= repetition && (last == -1 || s.charAt(last) >= s.charAt(i))) {
                last = i;
            }
        }
        StringBuilder sb = new StringBuilder();
        int added = 0;
        sb.append(s.charAt(last));
        added++;
        for (int i = last + 1; i < n; i++) {
            if (s.charAt(i) < s.charAt(last) && added + prefix[i] <= k) {
                sb.setLength(0);
                sb.append(s.charAt(i));
                last = i;
                added = prefix[i];
            } else if (s.charAt(i) == letter) {
                int len = sb.length() - 1;
                while (len >= 0 && sb.charAt(len) > letter && (n - i > k - added || sb.charAt(len) != letter || prefix[i] >= repetition)) {
                    char c = sb.charAt(len);
                    sb.setLength(len);
                    if (c == letter) {
                        added--;
                    }
                    len--;
                }
                sb.append(letter);
                added++;
                if (sb.length() == k) {
                    break;
                }
            } else if (added < k) {
                sb.append(s.charAt(i));
                added++;
            }
        }
        return sb.toString();
    }
}

class Solution {
