class Solution {
    public int[] missingRolls(int[] rolls, int mean, int n) {
        int m = rolls.length;
        int sum = mean * (n + m) - Arrays.stream(rolls).sum();
        if (sum < n || sum > 6 * n) return new int[0];
        int[] res = new int[n];
        Arrays.fill(res, sum / n);
        for (int i = 0; i < sum % n; i++) {
            res[i]++;
        }
        return res;
    }
}

