class Solution {
    public int networkBecomesIdle(int[][] edges, int[] patience) {
        int n = patience.length;
        Map<Integer, Set<Integer>> graph = new HashMap<>();
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1];
            graph.putIfAbsent(u, new HashSet<>());
            graph.putIfAbsent(v, new HashSet<>());
            graph.get(u).add(v);
            graph.get(v).add(u);
        }
        int[] dist = new int[n];
        Arrays.fill(dist, Integer.MAX_VALUE);
        Queue<Integer> queue = new LinkedList<>();
        queue.offer(0);
        dist[0] = 0;
        while (!queue.isEmpty()) {
            int u = queue.poll();
            for (int v : graph.get(u)) {
                if (dist[v] == Integer.MAX_VALUE) {
                    dist[v] = dist[u] + 1;
                    queue.offer(v);
                }
            }
        }
        int res = 0;
        for (int i = 1; i < n; i++) {
            int distToMaster = dist[i] * 2;
            int numResends = (distToMaster - 1) / patience[i] + 1;
            int lastTime = numResends * patience[i];
            int totalTime = distToMaster + lastTime;
            res = Math.max(res, totalTime);
        }
        return res + 1;
    }
}

class Solution {
    public int kthSmallest(int[] nums1, int[] nums2, int k) {
        int n1 = nums1.length, n2 = nums2.length;
        int left = -1e5, right = 1e5;
        while (left < right) {
            int mid = left + (right - left) / 2;
            int cnt = 0, j = n2 - 1;
            for (int i = 0; i < n1; i++) {
                while (j >= 0 && nums1[i] * nums2[j] > mid) j--;
                cnt += j + 1;
            }
            if (cnt < k) left = mid + 1;
            else right = mid;
        }
        return left;
    }
}

