class Solution {
    public int scoreOfStudents(String s, int[] answers) {
        int correct = evaluate(s);
        Set<Integer>[] dp = new Set[s.length()];
        for (int i = 0; i < dp.length; i++) {
            dp[i] = new HashSet<>();
        }
        for (int i = 0; i < dp.length; i += 2) {
            dp[i].add(s.charAt(i) - '0');
        }
        for (int i = 2; i < s.length(); i += 2) {
            for (int j = 0; j < i; j += 2) {
                if (s.charAt(j + 1) == '*') {
                    for (int x : dp[j]) {
                        for (int y : dp[i]) {
                            if (x * y <= 1000) {
                                dp[i].add(x * y);
                            }
                        }
                    }
                }
            }
        }
        int res = 0;
        for (int ans : answers) {
            if (ans == correct) {
                res += 5;
            } else if (dp[s.length() - 1].contains(ans)) {
                res += 2;
            }
        }
        return res;
    }

    private int evaluate(String s) {
        Deque<Integer> stack = new ArrayDeque<>();
        char op = '+';
        for (int i = 0; i < s.length(); i++) {
            if (Character.isDigit(s.charAt(i))) {
                int num = s.charAt(i) - '0';
                if (op == '+') {
                    stack.push(num);
                } else {
                    stack.push(stack.pop() * num);
                }
            } else {
                op = s.charAt(i);
            }
        }
        int res = 0;
        while (!stack.isEmpty()) {
            res += stack.pop();
        }
        return res;
    }
}

class Solution {
    public boolean placeWordInCrossword(char[][] board, String word) {
        int m = board.length, n = board[0].length;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (board[i][j] == ' ' || board[i][j] == word.charAt(0)) {
                    boolean canPlace = true;
                    if (j + word.length() <= n && (j == 0 || board[i][j - 1] == '#') && (j + word.length() == n || board[i][j + word.length()] == '#')) {
                        for (int k = 0; k < word.length(); k++) {
                            if (board[i][j + k] != ' ' && board[i][j + k] != word.charAt(k)) {
                                canPlace = false;
                                break;
                            }
                        }
                        if (canPlace) return true;
                    }
                    canPlace = true;
                    if (i + word.length() <= m && (i == 0 || board[i - 1][j] == '#') && (i + word.length() == m || board[i + word.length()][j] == '#')) {
                        for (int k = 0; k < word.length(); k++) {
                            if (board[i + k][j] != ' ' && board[i + k][j] != word.charAt(k)) {
                                canPlace = false;
                                break;
                            }
                        }
                        if (canPlace) return true;
                    }
                }
            }
        }
        return false;
    }
}

class Solution {
    public int gridGame(int[][] grid) {
        int n = grid[0].length;
        long topSum = 0, bottomSum = 0;
        for (int i = 1; i < n; i++) {
            topSum += grid[0][i];
        }
        long ans = topSum;
        for (int i = 0; i < n; i++) {
            topSum -= grid[0][i];
            ans = Math.min(ans, Math.max(topSum, bottomSum));
            bottomSum += grid[1][i];
        }
        return (int) ans;
    }
}

class Solution {
    public int maximumDifference(int[] nums) {
        int n = nums.length;
        int maxDiff = -1, minNum = nums[0];
        for (int i = 1; i < n; i++) {
            maxDiff = Math.max(maxDiff, nums[i] - minNum);
            minNum = Math.min(minNum, nums[i]);
        }
        return maxDiff > 0 ? maxDiff : -1;
    }
}

class Solution {
    public String longestSubsequenceRepeatedK(String s, int k) {
        int n = s.length();
        int[][][] dp = new int[n+1][k+1][26];
        for (int i = n-1; i >= 0; i--) {
            for (int j = 1; j <= k; j++) {
                for (int p = 0; p < 26; p++) {
                    int max = 0;
                    for (int nxt = i+1; nxt <= n; nxt++) {
                        if (s.charAt(nxt-1) == 'a' + p) {
                            max = Math.max(max, dp[nxt][j-1][0] + 1);
                        }
                        max = Math.max(max, dp[nxt][j][p]);
                    }
                    dp[i][j][p] = max;
                }
            }
        }
        StringBuilder sb = new StringBuilder();
        int cur = 0;
        for (int p = 0; p < 26; p++) {
            if (dp[0][k][p] > cur) {
                cur = dp[0][k][p];
                sb = new StringBuilder();
                for (int i = 0, j = 0; i < cur && j < n; ) {
                    if (s.charAt(j) == 'a' + p && dp[j+1][k-1][0] == cur-1) {
                        sb.append(s.charAt(j));
                        i++;
                        k--;
                    }
                    j++;
                }
            }
        }
        return sb.toString();
    }
}

class DetectSquares {
    private Map<Integer, Set<Integer>> pointsByX;
    private Map<Integer, Set<Integer>> pointsByY;
    private Map<String, Integer> squareCount;
    
    public DetectSquares() {
        pointsByX = new HashMap<>();
        pointsByY = new HashMap<>();
        squareCount = new HashMap<>();
    }
    
    public void add(int[] point) {
        int x = point[0], y = point[1];
        pointsByX.computeIfAbsent(x, k -> new HashSet<>()).add(y);
        pointsByY.computeIfAbsent(y, k -> new HashSet<>()).add(x);
    }
    
    public int count(int[] point) {
        int x = point[0], y = point[1];
        if (!pointsByX.containsKey(x) || !pointsByY.containsKey(y)) {
            return 0;
        }
        int count = 0;
        for (int y2 : pointsByX.get(x)) {
            if (y2 == y) {
                continue;
            }
            int side = Math.abs(y2 - y);
            count += squareCount.getOrDefault(getKey(x, y2, side), 0);
            count += squareCount.getOrDefault(getKey(x + side, y2, side), 0);
            count += squareCount.getOrDefault(getKey(x - side, y2, side), 0);
        }
        return count;
    }
    
    private String getKey(int x, int y, int side) {
        return x + "," + y + "," + side;
    }
    
    private void incrementCount(String key) {
        squareCount.put(key, squareCount.getOrDefault(key, 0) + 1);
    }
    
    private void decrementCount(String key) {
        squareCount.put(key, squareCount.getOrDefault(key, 0) - 1);
    }
}

class Solution {
    public int sumOfBeauties(int[] nums) {
        int n = nums.length;
        int[] maxLeft = new int[n], minRight = new int[n];
        maxLeft[0] = nums[0];
        for (int i = 1; i < n; i++) {
            maxLeft[i] = Math.max(maxLeft[i - 1], nums[i]);
        }
        minRight[n - 1] = nums[n - 1];
        for (int i = n - 2; i >= 0; i--) {
            minRight[i] = Math.min(minRight[i + 1], nums[i]);
        }
        int ans = 0;
        for (int i = 1; i < n - 1; i++) {
            if (maxLeft[i - 1] < nums[i] && nums[i] < minRight[i + 1]) {
                ans += 2;
            } else if (nums[i - 1] < nums[i] && nums[i] < nums[i + 1]) {
                ans += 1;
            }
        }
        return ans;
    }
}

