class Solution {
    public int waysToPartition(int[] nums, int k) {
        int n = nums.length;
        long[] prefSum = new long[n];
        prefSum[0] = nums[0];
        for (int i = 1; i < n; i++) {
            prefSum[i] = prefSum[i-1] + nums[i];
        }
        Map<Long, Integer> left = new HashMap<>();
        Map<Long, Integer> right = new HashMap<>();
        for (int i = 0; i < n-1; i++) {
            long leftSum = prefSum[i];
            long rightSum = prefSum[n-1] - prefSum[i];
            left.put(leftSum-rightSum, left.getOrDefault(leftSum-rightSum, 0)+1);
            right.put(rightSum-leftSum, right.getOrDefault(rightSum-leftSum, 0)+1);
        }
        int res = left.containsKey(0L) ? left.get(0L) : 0;
        for (int i = 0; i < n; i++) {
            long leftSum = i == 0 ? 0 : prefSum[i-1];
            long rightSum = i == n-1 ? 0 : (prefSum[n-1]-prefSum[i]);
            long diff = k-nums[i];
            if (left.containsKey(rightSum-leftSum+diff)) {
                res = Math.max(res, left.get(rightSum-leftSum+diff));
            }
            if (right.containsKey(leftSum-rightSum+diff)) {
                res = Math.max(res, right.get(leftSum-rightSum+diff));
            }
        }
        return res;
    }
}

class Solution {
    public int maxConsecutiveAnswers(String answerKey, int k) {
        int[] freq = new int[2];
        int left = 0, maxCount = 0;
        for (int right = 0; right < answerKey.length(); right++) {
            freq[answerKey.charAt(right) - 'T']++;
            while (Math.min(freq[0], freq[1]) > k) {
                freq[answerKey.charAt(left) - 'T']--;
                left++;
            }
            maxCount = Math.max(maxCount, right - left + 1);
        }
        return maxCount;
    }
}

class Solution {
    public int numOfPairs(String[] nums, String target) {
        int n = nums.length;
        int res = 0;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (i != j && (nums[i] + nums[j]).equals(target)) {
                    res++;
                }
            }
        }
        return res;
    }
}

class Solution {
    public int[][] construct2DArray(int[] original, int m, int n) {
        if (original.length != m*n) {
            return new int[0][0];
        }
        int[][] res = new int[m][n];
        for (int i = 0; i < original.length; i++) {
            res[i/n][i%n] = original[i];
        }
        return res;
    }
}

class Solution {
    public int[] smallestMissingValueSubtree(int[] parents, int[] nums) {
        int n = parents.length;
        Map<Integer, List<Integer>> graph = new HashMap<>();
        for (int i = 0; i < n; i++) {
            graph.put(i, new ArrayList<>());
        }
        for (int i = 1; i < n; i++) {
            graph.get(parents[i]).add(i);
        }
        int[] ans = new int[n];
        Arrays.fill(ans, 1);
        Set<Integer> missing = new HashSet<>();
        for (int num : nums) {
            missing.add(num);
        }
        dfs(0, ans, missing, graph);
        return ans;
    }
    
    private int dfs(int node, int[] ans, Set<Integer> missing, Map<Integer, List<Integer>> graph) {
        int min = 1;
        if (missing.contains(min)) {
            min = Collections.max(missing) + 1;
        }
        for (int child : graph.get(node)) {
            int res = dfs(child, ans, missing, graph);
            min = Math.min(min, res);
        }
        while (missing.contains(min)) {
            min++;
        }
        ans[node] = min;
        missing.add(min);
        return min;
    }
}

class Solution {
    public int maxProduct(String s) {
        int n = s.length();
        int[] masks = new int[n];
        int ans = 0;
        for (int mask = 1; mask < (1<<n) - 1; mask++) {
            int len = 0;
            for (int i = 0; i < n; i++) {
                if ((1<<i & mask) != 0) {
                    masks[len++] = s.charAt(i) - 'a';
                }
            }
            if (isPalindrome(masks, len)) {
                ans = Math.max(ans, getLength(mask, n) * (n - getLength(mask, n)));
            }
        }
        return ans;
    }
    
    private boolean isPalindrome(int[] masks, int len) {
        int[] freq = new int[26];
        for (int i = 0; i < len; i++) {
            freq[masks[i]]++;
        }
        int oddCount = 0;
        for (int i = 0; i < 26; i++) {
            if (freq[i] % 2 != 0) {
                oddCount++;
            }
            if (oddCount > 1) {
                return false;
            }
        }
        return true;
    }
    
    private int getLength(int mask, int n) {
        int len = 0;
        while (mask != 0) {
            if (mask % 2 != 0) {
                len++;
            }
            mask >>= 1;
        }
        return len;
    }
}

class Solution {
    public long interchangeableRectangles(int[][] rectangles) {
        Map<Double, Long> map = new HashMap<>();
        long count = 0;
        for (int[] rec : rectangles) {
            double ratio = (double) rec[0] / (double) rec[1];
            if (map.containsKey(ratio)) {
                count += map.get(ratio);
            }
            map.put(ratio, map.getOrDefault(ratio, 0L) + 1L);
        }
        return count;
    }
}

class Solution {
    public String reversePrefix(String word, char ch) {
        int index = word.indexOf(ch);
        if (index == -1)
            return word;
        StringBuilder sb = new StringBuilder(word.substring(0, index+1));
        sb.reverse();
        sb.append(word.substring(index+1));
        return sb.toString();
    }
}

class Solution {
    public boolean gcdSort(int[] nums) {
        int maxNum = Arrays.stream(nums).max().getAsInt();
        UnionFind uf = new UnionFind(maxNum + 1);
        for (int num : nums) {
            int sqrt = (int) Math.sqrt(num);
            for (int i = 2; i <= sqrt; i++) {
                if (num % i == 0) {
                    uf.union(num, i);
                    uf.union(num, num / i);
                }
            }
        }
        int[] sorted = nums.clone();
        Arrays.sort(sorted);
        for (int i = 0; i < nums.length; i++) {
            if (uf.find(nums[i]) != uf.find(sorted[i])) {
                return false;
            }
        }
        return true;
    }
}

class UnionFind {
    int[] parent;
    public UnionFind(int n) {
        parent = new int[n];
        for (int i = 0; i < n; i++) {
            parent[i] = i;
        }
    }
    public int find(int x) {
        return x == parent[x] ? x : (parent[x] = find(parent[x]));
    }
    public void union(int x, int y) {
        parent[find(x)] = find(y);
    }
}

class Solution {
    public int firstDayBeenInAllRooms(int[] nextVisit) {
        int n = nextVisit.length, mod = 1000000007;
        long[] dp = new long[n];
        for (int i = 1; i < n; i++) {
            dp[i] = 2 * dp[i - 1] - dp[nextVisit[i - 1]] + 2;
            dp[i] = (dp[i] % mod + mod) % mod;
        }
        return (int) dp[n - 1];
    }
}

class Solution {
    public int numberOfWeakCharacters(int[][] properties) {
        Arrays.sort(properties, (a, b) -> {
            if (a[0] == b[0]) {
                return b[1] - a[1];
            }
            return a[0] - b[0];
        });
        int count = 0;
        int maxDefense = 0;
        for (int i = properties.length - 1; i >= 0; i--) {
            if (properties[i][1] < maxDefense) {
                count++;
            } else {
                maxDefense = properties[i][1];
            }
        }
        return count;
    }
}

class Solution {
    public int countQuadruplets(int[] nums) {
        int n = nums.length, ans = 0;
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                for (int k = j + 1; k < n; k++) {
                    for (int l = k + 1; l < n; l++) {
                        if (nums[i] + nums[j] + nums[k] == nums[l]) {
                            ans++;
                        }
                    }
                }
            }
        }
        return ans;
    }
}

class Solution {
    public boolean validPath(int n, int[][] edges, int source, int destination) {
        List<Integer>[] graph = new List[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int[] edge : edges) {
            graph[edge[0]].add(edge[1]);
            graph[edge[1]].add(edge[0]);
        }
        boolean[] visited = new boolean[n];
        Queue<Integer> queue = new LinkedList<>();
        queue.offer(source);
        visited[source] = true;
        while (!queue.isEmpty()) {
            int curr = queue.poll();
            if (curr == destination) {
                return true;
            }
            for (int nei : graph[curr]) {
                if (!visited[nei]) {
                    visited[nei] = true;
                    queue.offer(nei);
                }
            }
        }
        return false;
    }
}

class Solution {
    public int minOperations(int[] nums) {
        Arrays.sort(nums);
        int n = nums.length;
        int maxLen = 1;
        for (int i = 0; i < n; i++) {
            int j = i + 1;
            int len = 1;
            while (j < n && nums[j] - nums[j-1] <= n) {
                if (nums[j] != nums[j-1]) {
                    len++;
                }
                j++;
            }
            maxLen = Math.max(maxLen, len);
        }
        return n - maxLen;
    }
}

class Solution {
    public long maxTaxiEarnings(int n, int[][] rides) {
        Arrays.sort(rides, (a,b) -> a[1]-b[1]);
        long[] dp = new long[n+1];
        int j = 0;
        for(int i=1; i<=n; i++) {
            dp[i] = dp[i-1];
            while(j < rides.length && rides[j][1] == i) {
                dp[i] = Math.max(dp[i], dp[rides[j][0]] + rides[j][1] - rides[j][0] + rides[j][2]);
                j++;
            }
        }
        return dp[n];
    }
}

class Solution {
    public int[] findOriginalArray(int[] changed) {
        if (changed.length % 2 != 0) {
            return new int[0];
        }
        Map<Integer, Integer> map = new HashMap<>();
        for (int num : changed) {
            map.put(num, map.getOrDefault(num, 0) + 1);
        }
        Arrays.sort(changed);
        int[] res = new int[changed.length / 2];
        int idx = 0;
        for (int num : changed) {
            if (map.containsKey(num) && map.containsKey(num * 2)) {
                res[idx++] = num;
                map.put(num, map.get(num) - 1);
                if (map.get(num) == 0) {
                    map.remove(num);
                }
                map.put(num * 2, map.get(num * 2) - 1);
                if (map.get(num * 2) == 0) {
                    map.remove(num * 2);
                }
            }
        }
        if (idx != res.length) {
            return new int[0];
        }
        return res;
    }
}

class Solution {
    public int countKDifference(int[] nums, int k) {
        int count = 0;
        for (int i = 0; i < nums.length; i++) {
            for (int j = i + 1; j < nums.length; j++) {
                if (Math.abs(nums[i] - nums[j]) == k) {
                    count++;
                }
            }
        }
        return count;
    }
}

class Solution {
    public int numberOfUniqueGoodSubsequences(String binary) {
        int mod = 1000000007;
        int n = binary.length();
        int[] dp = new int[2];
        dp[0] = 1;
        dp[1] = 0;
        for (int i = 0; i < n; i++) {
            int digit = binary.charAt(i) - '0';
            int newDp = (dp[0] + dp[1] + digit) % mod;
            dp[digit] = newDp;
        }
        return (dp[0] + dp[1] + (dp[0] == 0 ? 1 : 0)) % mod;
    }
}

class Solution {
    public int minSessions(int[] tasks, int sessionTime) {
        int n = tasks.length;
        int maxMask = 1 << n;
        int[] dp = new int[maxMask];
        Arrays.fill(dp, Integer.MAX_VALUE / 2);
        dp[0] = 0;
        for (int mask = 0; mask < maxMask; mask++) {
            int sum = 0;
            for (int i = 0; i < n; i++) {
                if (((1 << i) & mask) == 0) {
                    sum += tasks[i];
                }
            }
            if (sum <= sessionTime) {
                dp[mask ^ maxMask - 1] = 1;
                continue;
            }
            for (int subMask = mask; subMask > 0; subMask = (subMask - 1) & mask) {
                int subSum = 0;
                for (int i = 0; i < n; i++) {
                    if (((1 << i) & mask) != 0 && ((1 << i) & subMask) == 0) {
                        subSum += tasks[i];
                    }
                }
                if (subSum <= sessionTime) {
                    dp[mask] = Math.min(dp[mask], dp[subMask] + 1);
                }
            }
        }
        return dp[maxMask - 1];
    }
}

class Solution {
    public String kthLargestNumber(String[] nums, int k) {
        PriorityQueue<String> pq = new PriorityQueue<>((a,b) -> { 
            if (a.length() == b.length()) {
                return a.compareTo(b);
            }
            return a.length() - b.length(); 
        });
        for (String num : nums) {
            pq.offer(num);
            if (pq.size() > k) {
                pq.poll();
            }
        }
        return pq.peek();
    }
}

class Solution {
    public int minimumDifference(int[] nums, int k) {
        Arrays.sort(nums);
        int res = Integer.MAX_VALUE;
        for (int i = k - 1; i < nums.length; i++) {
            res = Math.min(res, nums[i] - nums[i - k + 1]);
        }
        return res;
    }
}

class Solution {
    public int[] recoverArray(int n, int[] sums) {
        Arrays.sort(sums);
        Set<Integer> set = new HashSet<>();
        for (int i : sums) set.add(i);
        int[] ans = new int[n];
        int pos = 0;
        while (pos < n) {
            List<Integer> delete = new ArrayList<>();
            for (int i : set) {
                if (set.contains(i - ans[pos])) {
                    delete.add(i);
                }
            }
            for (int i : delete) set.remove(i);
            ans[pos++] = delete.get(0) - ans[pos];
        }
        return ans;
    }
}

class Solution {
    public int minimizeTheDifference(int[][] mat, int target) {
        int m = mat.length, n = mat[0].length;
        boolean[][] dp = new boolean[m][target+1];
        dp[0][0] = true;
        for (int j = 0; j < n; j++) {
            boolean[] next = new boolean[target+1];
            for (int i = 0; i < m; i++) {
                for (int k = 0; k <= target; k++) {
                    if (dp[i][k]) {
                        for (int x = 0; x < n; x++) {
                            int val = k + mat[i][x];
                            if (val <= target) {
                                next[val] = true;
                            }
                        }
                    }
                }
            }
            dp = next;
        }
        int ans = Integer.MAX_VALUE;
        for (int k = 0; k <= target; k++) {
            if (dp[m-1][k]) {
                ans = Math.min(ans, target - k);
            }
        }
        return ans;
    }
}

class Solution {
    public String findDifferentBinaryString(String[] nums) {
        int n = nums.length;
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < n; i++) {
            if (nums[i].charAt(i) == '0') {
                sb.append('1');
            } else {
                sb.append('0');
            }
        }
        return sb.toString();
    }
}

class Solution {
    public int findGCD(int[] nums) {
        int min = nums[0], max = nums[0];
        for (int num : nums) {
            min = Math.min(min, num);
            max = Math.max(max, num);
        }
        return gcd(min, max);
    }
    
    private int gcd(int a, int b) {
        if (a == 0) return b;
        return gcd(b % a, a);
    }
}

class Solution {
    public int numberOfGoodSubsets(int[] nums) {
        int M = 1000000007;
        int n = nums.length;
        int[] dp = new int[1 << 18];
        dp[0] = 1;
        int[] cnt = new int[31];
        for (int i = 0; i < n; i++) cnt[nums[i]]++;
        for (int i = 2; i <= 29; i++) {
            if (isPrime(i)) {
                int mask = 0;
                for (int j = 1; j <= 30; j++) if (isDivisible(i, j)) mask |= (1 << (j - 1));
                int[] cur = new int[1 << 18];
                for (int j = 0; j < 1 << 18; j++) cur[j] = dp[j];
                for (int j = 0; j < 1 << 18; j++) {
                    int prod = 1;
                    for (int k = 1; k <= 18; k++) {
                        if ((j >> (k - 1) & 1) == 1) {
                            prod *= k;
                            prod %= M;
                        }
                    }
                    if (prod % i == 0) continue;
                    int nj = mask | j;
                    cur[nj] += dp[j] * cnt[i];
                    cur[nj] %= M;
                }
                for (int j = 0; j < 1 << 18; j++) dp[j] = cur[j];
            }
        }
        int ans = 0;
        for (int i = 1; i < 1 << 18; i++) {
            boolean ok = true;
            for (int j = 2; j <= 30 && ok; j++) {
                if (isPrime(j) && isDivisible(j, i)) ok = false;
            }
            if (ok) {
                ans += dp[i];
                ans %= M;
            }
        }
        ans *= fastPow(2, cnt[1], M);
        ans %= M;
        return ans;
    }
    public boolean isDivisible(int p, int q) {
        for (int i = 2; i <= Math.min(p, q); i++) {
            if (p % i == 0 && q % i == 0) return false;
        }
        return true;
    }
    public boolean isPrime(int x) {
        for (int i = 2; i * i <= x; i++) {
            if (x % i == 0) return false;
        }
        return x > 1;
    }
    public int fastPow(int x, int y, int mod) {
        int res = 1;
        while (y > 0) {
            if ((y & 1) == 1) {
                res = res * x % mod;
            }
            x = x * x % mod;
            y >>= 1;
        }
        return res;
    }
}

class LockingTree {
    private int[] parent;
    private Map<Integer, Integer> locks;
    private Map<Integer, List<Integer>> children;
    
    public LockingTree(int[] parent) {
        this.parent = parent;
        this.locks = new HashMap<>();
        this.children = new HashMap<>();
        for (int i = 0; i < parent.length; i++) {
            if (!children.containsKey(parent[i])) {
                children.put(parent[i], new ArrayList<>());
            }
            children.get(parent[i]).add(i);
        }
    }
    
    public boolean lock(int num, int user) {
        if (locks.containsKey(num) && locks.get(num) != -1) {
            return false;
        }
        locks.put(num, user);
        return true;
    }
    
    public boolean unlock(int num, int user) {
        if (!locks.containsKey(num) || locks.get(num) != user) {
            return false;
        }
        locks.put(num, -1);
        return true;
    }
    
    public boolean upgrade(int num, int user) {
        if (locks.containsKey(num) && locks.get(num) != -1) {
            return false;
        }
        if (!hasLockedDescendant(num) || hasLockedAncestor(num)) {
            return false;
        }
        unlockDescendants(num);
        locks.put(num, user);
        return true;
    }
    
    private boolean hasLockedDescendant(int num) {
        for (int child : children.getOrDefault(num, new ArrayList<>())) {
            if (locks.containsKey(child) && locks.get(child) != -1) {
                return true;
            }
            if (hasLockedDescendant(child)) {
                return true;
            }
        }
        return false;
    }
    
    private boolean hasLockedAncestor(int num) {
        while (num != -1) {
            if (locks.containsKey(num) && locks.get(num) != -1) {
                return true;
            }
            num = parent[num];
        }
        return false;
    }
    
    private void unlockDescendants(int num) {
        locks.put(num, -1);
        for (int child : children.getOrDefault(num, new ArrayList<>())) {
            unlockDescendants(child);
        }
    }
}

class Solution {
    public int[][] findFarmland(int[][] land) {
        List<int[]> groups = new ArrayList<>();
        int m = land.length, n = land[0].length;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (land[i][j] == 1 && (i == 0 || land[i-1][j] == 0) && (j == 0 || land[i][j-1] == 0)) {
                    int r2 = i, c2 = j;
                    while (r2 < m && land[r2][j] == 1) r2++;
                    while (c2 < n && land[i][c2] == 1) c2++;
                    groups.add(new int[]{i, j, r2-1, c2-1});
                }
            }
        }
        return groups.toArray(new int[0][]);
    }
}

class Solution {
    public int findMiddleIndex(int[] nums) {
        int leftSum = 0;
        int rightSum = 0;
        for (int num : nums) {
            rightSum += num;
        }
        for (int i = 0; i < nums.length; i++) {
            rightSum -= nums[i];
            if (leftSum == rightSum) {
                return i;
            }
            leftSum += nums[i];
        }
        return -1;
    }
}

class Solution {
    public int latestDayToCross(int row, int col, int[][] cells) {
        int[][] grid = new int[row][col];
        int left = 0, right = cells.length - 1;
        while (left <= right) {
            int mid = left + (right - left) / 2;
            for (int i = 0; i <= mid; i++) {
                grid[cells[i][0] - 1][cells[i][1] - 1] = 1;
            }
            if (canCross(grid)) {
                left = mid + 1;
            } else {
                right = mid - 1;
            }
        }
        return left - 1;
    }

    private boolean canCross(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        boolean[][] visited = new boolean[m][n];
        Queue<int[]> queue = new LinkedList<>();
        for (int j = 0; j < n; j++) {
            if (grid[0][j] == 0) {
                visited[0][j] = true;
                queue.add(new int[]{0, j});
            }            
        }
        int[][] dirs = new int[][]{{1, 0}, {-1, 0}, {0, 1}, {0, -1}};
        while (!queue.isEmpty()) {
            int[] curr = queue.poll();
            int x = curr[0], y = curr[1];
            if (x == m - 1) {
                return true;
            }
            for (int[] dir : dirs) {
                int nx = x + dir[0], ny = y + dir[1];
                if (nx >= 0 && nx < m && ny >= 0 && ny < n && !visited[nx][ny] && grid[nx][ny] == 0) {
                    visited[nx][ny] = true;
                    queue.add(new int[]{nx, ny});
                }
            }
        }
        return false;
    }
}

class Solution {
    public int minNonZeroProduct(int p) {
        long m = 1000000007L;
        long n = (1L<<p)-1;
        long x = (n-1)/2;
        return (int)(modPow(n-1, x, m)*(n%m)%m);
    }
    
    public long modPow(long x, long y, long m) {
        if (y == 0) return 1;
        long p = modPow(x, y/2, m);
        p = (p*p)%m;
        return (y%2==0)?p:(p*x)%m;
    }
}

class Solution {
    public int numOfStrings(String[] patterns, String word) {
        int count = 0;
        for (String p : patterns) {
            if (word.indexOf(p) != -1) {
                count++;
            }
        }
        return count;
    }
}

class Solution {
    public int[] longestObstacleCourseAtEachPosition(int[] obstacles) {
        int n = obstacles.length;
        int[] ans = new int[n];
        List<Integer> lis = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            int idx = binarySearch(lis, obstacles[i]);
            ans[i] = idx + 1;
            if (idx == lis.size()) {
                lis.add(obstacles[i]);
            } else {
                lis.set(idx, obstacles[i]);
            }
        }
        return ans;
    }
    
    private int binarySearch(List<Integer> list, int target) {
        int left = 0, right = list.size() - 1;
        while (left <= right) {
            int mid = (left + right) / 2;
            if (list.get(mid) <= target) {
                left = mid + 1;
            } else {
                right = mid - 1;
            }
        }
        return left;
    }
}

class Solution {
    public int minSwaps(String s) {
        int open = 0, close = 0, swaps = 0;
        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) == '[') {
                open++;
            } else {
                close++;
            }
            if (close > open) {
                swaps++;
                close--;
                open++;
            }
        }
        return swaps;
    }
}

class Solution {
    public int minStoneSum(int[] piles, int k) {
        PriorityQueue<Integer> pq = new PriorityQueue<>(Collections.reverseOrder());
        for (int pile : piles) {
            pq.offer(pile);
        }
        while (k > 0) {
            int maxPile = pq.poll();
            int newPile = maxPile - maxPile / 2;
            pq.offer(newPile);
            k--;
        }
        int sum = 0;
        while (!pq.isEmpty()) {
            sum += pq.poll();
        }
        return sum;
    }
}

class Solution {
    public boolean isPrefixString(String s, String[] words) {
        int n = words.length;
        StringBuilder sb = new StringBuilder();
        for(int i = 0; i < n; i++) {
            sb.append(words[i]);
            if(sb.length() == s.length())
                return sb.toString().equals(s);
            if(sb.length() > s.length())
                return false;
        }
        return false;
    }
}

class Solution {
    private static final int MOD = 1000000007;
    
    public int numberOfCombinations(String num) {
        int n = num.length();
        long[] dp = new long[n+1];
        dp[0] = 1;
        for (int i = 1; i <= n; i++) {
            if (num.charAt(i-1) == '0') {
                if (i == 1 || num.charAt(i-2) > '2' || num.charAt(i-2) == '0') {
                    return 0;
                } else {
                    dp[i] = dp[i-2];
                }
            } else {
                dp[i] = dp[i-1];
                if (i >= 2 && num.charAt(i-2) == '1' || (num.charAt(i-2) == '2' && num.charAt(i-1) <= '6')) {
                    dp[i] = (dp[i] + dp[i-2]) % MOD;
                }
            }
        }
        return (int) dp[n];
    }
}

class Solution {
    public int countPaths(int n, int[][] roads) {
        int mod = 1000000007;
        long[] dist = new long[n];
        long[] ways = new long[n];
        ways[0] = 1;
        List<int[]>[] graph = new List[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int[] road : roads) {
            graph[road[0]].add(new int[]{road[1], road[2]});
            graph[road[1]].add(new int[]{road[0], road[2]});
        }
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[1] - b[1]);
        pq.offer(new int[]{0, 0});
        Arrays.fill(dist, Long.MAX_VALUE);
        dist[0] = 0;
        while (!pq.isEmpty()) {
            int[] cur = pq.poll();
            int node = cur[0], time = cur[1];
            if (time > dist[node]) {
                continue;
            }
            for (int[] next : graph[node]) {
                int nei = next[0], d = next[1];
                if (dist[nei] > dist[node] + d) {
                    dist[nei] = dist[node] + d;
                    ways[nei] = ways[node];
                    pq.offer(new int[]{nei, (int)dist[nei]});
                } else if (dist[nei] == dist[node] + d) {
                    ways[nei] = (ways[nei] + ways[node]) % mod;
                }
            }
        }
        return (int)ways[n - 1];
    }
}

class Solution {
    public long maxMatrixSum(int[][] matrix) {
        long cnt = 0, min = Integer.MAX_VALUE;
        boolean flag = false;
        for (int[] row : matrix) {
            for (int num : row) {
                if (num < 0) {
                    cnt++;
                    num = -num;
                }
                min = Math.min(num, min);
                cnt = cnt % 2 == 0 ? cnt : cnt - 1;
                flag |= num == 0;
            }
        }
        return flag ? Arrays.stream(matrix).flatMapToInt(Arrays::stream).map(Math::abs).asLongStream().sum() : Arrays.stream(matrix).flatMapToInt(Arrays::stream).map(Math::abs).asLongStream().sum() - 2 * min * (cnt % 2);
    }
}

class Solution {
    public int minTimeToType(String word) {
        int prev = 'a';
        int time = 0;
        for(char c: word.toCharArray()){
            int diff = Math.abs(c - prev);
            time += Math.min(diff, 26 - diff) + 1;
            prev = c;
        }
        return time;
    }
}

class Solution {
    public int countSpecialSubsequences(int[] nums) {
        int MOD = 1000000007;
        long[] dp = new long[3];
        for (int num : nums) {
            dp[num] = (dp[num] * 2 % MOD + (num == 0 ? 1 : dp[num - 1])) % MOD;
        }
        return (int)dp[2];
    }
}

class Solution {
    public int[] rearrangeArray(int[] nums) {
        Arrays.sort(nums);
        int[] res = new int[nums.length];
        int evenIndex = 0, oddIndex = 1;
        for (int num : nums) {
            if (num % 2 == 0) {
                res[evenIndex] = num;
                evenIndex += 2;
            } else {
                res[oddIndex] = num;
                oddIndex += 2;
            }
        }
        return res;
    }
}

class Solution {
    public long numberOfWeeks(int[] milestones) {
        long sum = 0, max = 0;
        for (int milestone : milestones) {
            sum += milestone;
            max = Math.max(max, milestone);
        }
        long rest = sum - max;
        if (max > rest + 1) {
            return rest * 2 + 1;
        } else {
            return sum;
        }
    }
}

class Solution {
    public boolean isThree(int n) {
        int count = 0;
        for (int i = 1; i <= n; i++) {
            if (n % i == 0) {
                count++;
            }
        }
        return count == 3;
    }
}

class Solution {
    public int minSpaceWastedKResizing(int[] nums, int k) {
        int n = nums.length;
        int[][] dp = new int[n][k+1];
        int max = 0, sum = 0;
        for (int i = 0; i < n; i++) {
            max = Math.max(max, nums[i]);
            sum += nums[i];
            dp[i][0] = max * (i+1) - sum;
        }
        for (int j = 1; j <= k; j++) {
            for (int i = j; i < n; i++) {
                int curMax = nums[i], curSum = nums[i];
                dp[i][j] = Integer.MAX_VALUE;
                for (int p = i-1; p >= j-1; p--) {
                    curMax = Math.max(curMax, nums[p]);
                    curSum += nums[p];
                    dp[i][j] = Math.min(dp[i][j], dp[p][j-1] + curMax * (i-p) - curSum);
                }
            }
        }
        return dp[n-1][k];
    }
}

class Solution {
    public boolean checkMove(char[][] board, int rMove, int cMove, char color) {
        int[] x = {-1, -1, 0, 1, 1, 1, 0, -1};
        int[] y = {0, 1, 1, 1, 0, -1, -1, -1};
        char oppo = color == 'W' ? 'B' : 'W';
        for (int i = 0; i < 8; i++) {
            int r = rMove + x[i];
            int c = cMove + y[i];
            int count = 0;
            while (r >= 0 && r < 8 && c >= 0 && c < 8 && board[r][c] == oppo) {
                count++;
                r += x[i];
                c += y[i];
            }
            if (count > 0 && r >= 0 && r < 8 && c >= 0 && c < 8 && board[r][c] == color && count < 2) {
                return true;
            }
        }
        return false;
    }
}

class Solution {
    public List<List<String>> deleteDuplicateFolder(List<List<String>> paths) {
        TrieNode root = new TrieNode();
        buildTrie(paths, root);
        Map<String, Integer> subtreeCount = new HashMap<>();
        markDuplicates(root, subtreeCount);
        List<List<String>> ans = new ArrayList<>();
        collectNonDuplicates(root, new ArrayList<>(), ans, subtreeCount);
        return ans;
    }
    
    private void buildTrie(List<List<String>> paths, TrieNode root) {
        for (List<String> path : paths) {
            TrieNode curr = root;
            for (String folder : path) {
                TrieNode next = curr.children.computeIfAbsent(folder, k -> new TrieNode());
                curr = next;
            }
        }
    }
    
    private void markDuplicates(TrieNode node, Map<String, Integer> subtreeCount) {
        for (TrieNode child : node.children.values()) {
            markDuplicates(child, subtreeCount);
            node.subtrees.put(child.path, node.subtrees.getOrDefault(child.path, 0) + 1);
        }
        for (Map.Entry<String, Integer> entry : node.subtrees.entrySet()) {
            String path = entry.getKey();
            int count = entry.getValue();
            if (count > 1) {
                subtreeCount.put(path, subtreeCount.getOrDefault(path, 0) + count);
                node.subtrees.remove(path);
            }
        }
    }
    
    private void collectNonDuplicates(TrieNode node, List<String> path, List<List<String>> ans, Map<String, Integer> subtreeCount) {
        if (node == null) return;
        if (subtreeCount.getOrDefault(node.path, 0) > 0) return;
        if (!node.path.equals("")) ans.add(new ArrayList<>(path));
        for (Map.Entry<String, TrieNode> entry : node.children.entrySet()) {
            String folder = entry.getKey();
            TrieNode child = entry.getValue();
            path.add(folder);
            collectNonDuplicates(child, path, ans, subtreeCount);
            path.remove(path.size() - 1);
        }
    }
}

class TrieNode {
    String path;
    Map<String, TrieNode> children;
    Map<String, Integer> subtrees;
    
    public TrieNode() {
        path = "";
        children = new HashMap<>();
        subtrees = new HashMap<>();
    }
    
    public TrieNode(String path) {
        this.path = path;
        children = new HashMap<>();
        subtrees = new HashMap<>();
    }
}

class Solution {
    public int maxCompatibilitySum(int[][] students, int[][] mentors) {
        int m = students.length, n = students[0].length;
        int[] match = new int[m];
        for (int i = 0; i < m; i++) match[i] = i;
        return dfs(0, m, n, students, mentors, match);
    }
    
    private int dfs(int idx, int m, int n, int[][] students, int[][] mentors, int[] match) {
        if (idx == m) {
            int sum = 0;
            for (int i = 0; i < m; i++) {
                for (int j = 0; j < n; j++) {
                    sum += students[i][j] == mentors[match[i]][j] ? 1 : 0;
                }
            }
            return sum;
        }
        int maxScore = 0;
        for (int i = idx; i < m; i++) {
            swap(match, idx, i);
            maxScore = Math.max(maxScore, dfs(idx+1, m, n, students, mentors, match));
            swap(match, idx, i);
        }
        return maxScore;
    }
    
    private void swap(int[] arr, int i, int j) {
        int temp = arr[i];
        arr[i] = arr[j];
        arr[j] = temp;
    }
}

class Solution {
    public String maximumNumber(String num, int[] change) {
        char[] arr = num.toCharArray();
        boolean flag = false;
        for (int i = 0; i < arr.length; i++) {
            int val = arr[i] - '0';
            if (change[val] > val) {
                arr[i] = (char)(change[val] + '0');
                flag = true;
            } else if (flag && change[val] == val) {
                break;
            }
        }
        return new String(arr);
    }
}

class Solution {
    public int getLucky(String s, int k) {
        StringBuilder sb = new StringBuilder();
        for (char c : s.toCharArray()) {
            sb.append(getValue(c));
        }
        String num = sb.toString();
        int res = 0;
        for (int i = 0; i < k; i++) {
            res = 0;
            for (char c : num.toCharArray()) {
                res += c - '0';
            }
            num = Integer.toString(res);
        }
        return res;
    }
    
    private int getValue(char c) {
        return c - 'a' + 1;
    }
}

class Solution {
    public int[] maxGeneticDifference(int[] parents, int[][] queries) {
        int n = parents.length;
        Map<Integer, List<int[]>> queryMap = new HashMap<>();
        int[][] children = new int[n][];
        int[] depth = new int[n], trieNodeCnt = new int[n], trieNodeVal = new int[2 * n + 1];
        for (int i = 0; i < n; ++i) if (parents[i] >= 0) {
            if (children[parents[i]] == null) children[parents[i]] = new int[1];
            else children[parents[i]] = Arrays.copyOf(children[parents[i]], children[parents[i]].length + 1);
            children[parents[i]][children[parents[i]].length - 1] = i;
        }
        for (int i = 0; i < queries.length; ++i)
            queryMap.computeIfAbsent(queries[i][0], x -> new ArrayList<>()).add(new int[] {i, queries[i][1]});
        Trie trie = new Trie();
        int[] ans = new int[queries.length];
        dfs(0, -1, 0, children, queryMap, trie, depth, trieNodeCnt, trieNodeVal, ans);
        return ans;
    }

    void dfs(int node, int parent, int d, int[][] children, Map<Integer, List<int[]>> queryMap,
             Trie trie, int[] depth, int[] trieNodeCnt, int[] trieNodeVal, int[] ans) {
        depth[node] = d;
        trieNodeCnt[trie.addNode(trieNodeVal, depth[node])] = 1;
        if (queryMap.containsKey(node))
            for (int[] q : queryMap.get(node))
                ans[q[0]] = trie.getMaxXor(trieNodeVal, depth[node], q[1]);
        if (children[node] != null)
            for (int child : children[node]) {
                dfs(child, node, d + 1, children, queryMap, trie, depth, trieNodeCnt, trieNodeVal, ans);
                trieNodeCnt[trie.getNode(trieNodeVal, depth[child])] += trieNodeCnt[trie.getNode(trieNodeVal, depth[child]) ^ 1];
                trie.removeNode(trieNodeVal, depth[child]);
            }
    }

    static class Trie {
        static final int MAX_BIT = 18;
        int[][] child = new int[2][1 << MAX_BIT];
        int[] cnt = {1}, val = {0};

        int addNode(int[] v, int d) {
            int node = 0;
            for (int i = MAX_BIT - 1; i >= 0; --i) {
                boolean bit = (v[d] & (1 << i)) != 0;
                if (child[bit].length <= node) {
                    int[][] tmp = new int[2][node * 2];
                    System.arraycopy(child[0], 0, tmp[0], 0, node + 1);
                    System.arraycopy(child[1], 0, tmp[1], 0, node + 1);
                    child = tmp;
                }
                if (child[bit][node] == 0) child[bit][node] = cnt[0]++;
                node = child[bit][node];
            }
            val[node] = v[d];
            return node;
        }

        int getNode(int[] v, int d) {
            int node = 0;
            for (int i = MAX_BIT - 1; i >= 0; --i) {
                boolean bit = (v[d] & (1 << i)) != 0;
                if (child[bit].length <= node) return -1;
                node = child[bit][node];
            }
            return node;
        }

        void removeNode(int[] v, int d) {
            int node = 0;
            for (int i = MAX_BIT - 1; i >= 0; --i) {
                boolean bit = (v[d] & (1 << i)) != 0;
                if (child[bit].length <= node) return;
                cnt[node]--;
                if (cnt[child[bit][node]] == 1) child[bit][node] = 0;
                node = child[bit][node];
            }
        }

        int getMaxXor(int[] v, int d, int x) {
            int node = 0, ans = 0;
            for (int i = MAX_BIT - 1; i >= 0; --i) {
                boolean bit = (x & (1 << i)) == 0;
                if (child[bit ^ 1].length > node && cnt[child[bit ^ 1][node]] != 0) {
                    node = child[bit ^ 1][node];
                    ans |= 1 << i;
                } else {
                    node = child[bit][node];
                }
            }
            return ans;
        }
    }
}

class Solution {
    public long maxPoints(int[][] points) {
        int m = points.length, n = points[0].length;
        long[] dp = new long[n];
        for (int i = 0; i < n; i++) dp[i] = points[0][i];
        for (int i = 1; i < m; i++) {
            long[] ndp = new long[n];
            long mx = Long.MIN_VALUE;
            for (int j = 0; j < n; j++) {
                mx = Math.max(mx, dp[j] - j);
                ndp[j] = mx + points[i][j] + j;
            }
            mx = Long.MIN_VALUE;
            for (int j = n - 1; j >= 0; j--) {
                mx = Math.max(mx, dp[j] + j);
                ndp[j] = Math.max(ndp[j], mx + points[i][j] - j);
            }
            dp = ndp;
        }
        long res = Long.MIN_VALUE;
        for (long x : dp) res = Math.max(res, x);
        return res;
    }
}

class Solution {
    public int addRungs(int[] rungs, int dist) {
        int cur = 0, count = 0;
        for (int i = 0; i < rungs.length; i++) {
            if (rungs[i] - cur > dist) {
                count += (rungs[i] - cur - 1) / dist;
            }
            cur = rungs[i];
        }
        return count;
    }
}

class Solution {
    public int colorTheGrid(int m, int n) {
        int mod = 1000000007;
        int[][] dp = new int[n][1 << 3];
        for (int state = 0; state < (1 << 3); state++) {
            if (valid(state)) {
                dp[0][state] = 1;
            }
        }
        for (int i = 1; i < n; i++) {
            for (int state1 = 0; state1 < (1 << 3); state1++) {
                if (!valid(state1)) {
                    continue;
                }
                for (int state2 = 0; state2 < (1 << 3); state2++) {
                    if (!valid(state2) || intersect(state1, state2)) {
                        continue;
                    }
                    dp[i][state1] = (dp[i][state1] + dp[i - 1][state2]) % mod;
                }
            }
        }
        int ans = 0;
        for (int state = 0; state < (1 << 3); state++) {
            ans = (ans + dp[n - 1][state]) % mod;
        }
        return ans;
    }
    
    private boolean valid(int state) {
        for (int i = 0; i < 2; i++) {
            if (((state >> i) & 1) == ((state >> (i + 1)) & 1)) {
                return false;
            }
        }
        return true;
    }
    
    private boolean intersect(int state1, int state2) {
        for (int i = 0; i < 3; i++) {
            if (((state1 >> i) & 1) == ((state2 >> i) & 1)) {
                return true;
            }
        }
        return false;
    }
}

class Solution {
    public TreeNode canMerge(List<TreeNode> trees) {
        Map<Integer, TreeNode> map = new HashMap<>();
        Set<Integer> roots = new HashSet<>();
        for (TreeNode tree : trees) {
            map.put(tree.val, tree);
            roots.add(tree.val);
            if (tree.left != null) roots.remove(tree.left.val);
            if (tree.right != null) roots.remove(tree.right.val);
        }
        if (roots.size() != 1) return null;
        TreeNode root = map.get(roots.iterator().next());
        for (TreeNode tree : trees) {
            if (!isValidBST(tree)) return null;
        }
        mergeTrees(map, root);
        return isValidBST(root) ? root : null;
    }
    
    private void mergeTrees(Map<Integer, TreeNode> map, TreeNode node) {
        if (node == null) return;
        if (node.left != null) {
            mergeTrees(map, node.left);
            if (map.containsKey(node.left.val)) {
                node.left = map.get(node.left.val);
                map.remove(node.left.val);
                mergeTrees(map, node);
            }
        }
        if (node.right != null) {
            mergeTrees(map, node.right);
            if (map.containsKey(node.right.val)) {
                node.right = map.get(node.right.val);
                map.remove(node.right.val);
                mergeTrees(map, node);
            }
        }
    }
    
    private boolean isValidBST(TreeNode node) {
        return isValidHelper(node, null, null);
    }
    
    private boolean isValidHelper(TreeNode node, Integer min, Integer max) {
        if (node == null) return true;
        if ((min != null && node.val <= min) || (max != null && node.val >= max)) return false;
        return isValidHelper(node.left, min, node.val) && isValidHelper(node.right, node.val, max);
    }
}

class Solution {
    public int countPalindromicSubsequence(String s) {
        int n = s.length();
        int[][] pos = new int[26][2];
        for (int i = 0; i < 26; i++) {
            Arrays.fill(pos[i], -1);
        }
        for (int i = 0; i < n; i++) {
            int c = s.charAt(i) - 'a';
            if (pos[c][0] == -1) {
                pos[c][0] = i;
            } else if (pos[c][1] == -1) {
                pos[c][1] = i;
            }
        }
        int cnt = 0;
        for (int i = 0; i < 26; i++) {
            if (pos[i][1] > pos[i][0]) {
                boolean[] seen = new boolean[26];
                for (int j = pos[i][0] + 1; j < pos[i][1]; j++) {
                    int c = s.charAt(j) - 'a';
                    if (!seen[c]) {
                        seen[c] = true;
                        cnt++;
                    }
                }
            }
        }
        return cnt;
    }
}

class Solution {
    public int[] getConcatenation(int[] nums) {
        int n = nums.length;
        int[] ans = new int[2*n];
        for (int i = 0; i < n; i++) {
            ans[i] = nums[i];
            ans[i+n] = nums[i];
        }
        return ans;
    }
}

class Solution {
    public int[][] splitPainting(int[][] segments) {
        Map<Integer, Long> map = new TreeMap<>();        
        for (int[] seg : segments) {
            map.put(seg[0], map.getOrDefault(seg[0], 0L) + seg[2]);
            map.put(seg[1], map.getOrDefault(seg[1], 0L) - seg[2]);
        }        
        int n = map.size();
        int[][] ans = new int[n][3];
        int i = 0;
        long sum = 0;
        for (Map.Entry<Integer, Long> entry : map.entrySet()) {
            if (sum > 0) ans[i][1] = entry.getKey();
            ans[i][0] = entry.getKey();
            sum += entry.getValue();
            ans[i][2] = (int)sum;
            if (sum == 0) i++;
        }
        return Arrays.copyOf(ans, i);
    }
}

class Solution {
    public int smallestChair(int[][] times, int targetFriend) {
        PriorityQueue<int[]> arrivals = new PriorityQueue<>((a, b) -> Integer.compare(a[0], b[0]));
        PriorityQueue<Integer> chairs = new PriorityQueue<>();
        for (int i = 0; i < times.length; i++) {
            arrivals.offer(new int[]{times[i][0], times[i][1], i});
        }
        int[] target = new int[2];
        for (int i = 0; i < times.length; i++) {
            if (arrivals.peek()[2] == targetFriend) {
                target[0] = arrivals.peek()[0];
                target[1] = arrivals.peek()[1];
            }
            int[] arrival = arrivals.poll();
            if (chairs.isEmpty()) {
                chairs.offer(0);
            } else {
                while (!chairs.isEmpty() && chairs.peek() <= arrival[0]) {
                    chairs.poll();
                }
                if (!chairs.isEmpty()) {
                    target[i != targetFriend ? 0 : 1] = chairs.poll();
                } else {
                    target[i != targetFriend ? 0 : 1] = chairs.size();
                }
            }
            if (arrival != arrivals.peek()) {
                chairs.offer(target[i != targetFriend ? 0 : 1]);
            }
        }
        return target[1];
    }
}

