class Solution {
    public int longestCommonSubpath(int n, int[][] paths) {
        int m = paths.length;
        int minLen = Integer.MAX_VALUE;
        for (int i = 0; i < m; i++) {
            minLen = Math.min(minLen, paths[i].length);
        }
        int l = 0, r = minLen - 1;
        while (l <= r) {
            int mid = (l + r) / 2;
            if (isCommonSubpath(mid, paths, n)) {
                l = mid + 1;
            } else {
                r = mid - 1;
            }
        }
        return r;
    }
    
    private boolean isCommonSubpath(int len, int[][] paths, int n) {
        int m = paths.length;
        Set<Long> set = new HashSet<>();
        long mod = Long.MAX_VALUE / n;
        for (int i = 0; i < m; i++) {
            long hash = 0;
            for (int j = 0; j < len; j++) {
                hash = (hash * n + paths[i][j]) % mod;
            }
            set.add(hash);
            for (int j = len; j < paths[i].length; j++) {
                hash = ((hash - paths[i][j - len] * pw(n, len - 1, mod)) % mod + mod) % mod;
                hash = (hash * n + paths[i][j]) % mod;
                set.add(hash);
            }
        }
        return set.size() == pw(n, len, mod);
    }
    
    private long pw(int a, int b, long mod) {
        long ans = 1, base = a;
        while (b > 0) {
            if (b % 2 == 1) {
                ans = (ans * base) % mod;
            }
            base = (base * base) % mod;
            b /= 2;
        }
        return ans;
    }
}

class Solution {
    public int countGoodNumbers(long n) {
        int mod = 1000000007;
        long evens = (n+1)/2;
        long odds = n/2;
        long ans1 = pow(5, evens, mod);
        long ans2 = pow(4, odds, mod);
        return (int)((ans1*ans2)%mod);
    }

    public long pow(long a, long b, int mod){
        if(b == 0) return 1;
        long ans = pow(a,b/2,mod);
        ans = (ans*ans) % mod;
        if(b%2 != 0) ans = (ans*a) % mod;
        return ans;
    }
}

