class Solution {
    public int[] findPeakGrid(int[][] mat) {
        int m = mat.length, n = mat[0].length;
        int left = 0, right = n - 1;
        while (left < right) {
            int mid = (left + right) / 2;
            int maxRow = 0;
            for (int i = 0; i < m; i++) {
                if (mat[i][mid] > mat[maxRow][mid]) {
                    maxRow = i;
                }
            }
            if (mat[maxRow][mid + 1] > mat[maxRow][mid]) {
                left = mid + 1;
            } else if (mat[maxRow][mid - 1] > mat[maxRow][mid]) {
                right = mid - 1;
            } else {
                return new int[]{maxRow, mid};
            }
        }
        int maxRow = 0;
        for (int i = 0; i < m; i++) {
            if (mat[i][left] > mat[maxRow][left]) {
                maxRow = i;
            }
        }
        return new int[]{maxRow, left};
    }
}

class Solution {
    public long wonderfulSubstrings(String word) {
        int[] count = new int[1024];
        count[0] = 1;
        int mask = 0;
        long res = 0;
        for (char c : word.toCharArray()) {
            mask ^= 1 << (c - 'a');
            res += count[mask];
            for (int i = 0; i < 10; i++) {
                res += count[mask ^ (1 << i)];
            }
            count[mask]++;
        }
        return res;
    }
}

class Solution {
    public int[][] rotateGrid(int[][] grid, int k) {
        int m = grid.length, n = grid[0].length;
        for (int l = 0; l < Math.min(m, n) / 2; l++) {
            int layerRow = m - 2 * l, layerCol = n - 2 * l;
            int[] layerValues = new int[2 * layerRow + 2 * layerCol - 4];
            int idx = 0;
            for (int j = l; j < n - l - 1; j++) layerValues[idx++] = grid[l][j];
            for (int i = l; i < m - l - 1; i++) layerValues[idx++] = grid[i][n - l - 1];
            for (int j = n - l - 1; j > l; j--) layerValues[idx++] = grid[m - l - 1][j];
            for (int i = m - l - 1; i > l; i--) layerValues[idx++] = grid[i][l];
            int rot = k % layerValues.length;
            int[] rotatedLayerValues = new int[layerValues.length];
            for (int i = 0; i < layerValues.length; i++) {
                int j = (i + layerValues.length - rot) % layerValues.length;
                rotatedLayerValues[j] = layerValues[i];
            }
            idx = 0;
            for (int j = l; j < n - l - 1; j++) grid[l][j] = rotatedLayerValues[idx++];
            for (int i = l; i < m - l - 1; i++) grid[i][n - l - 1] = rotatedLayerValues[idx++];
            for (int j = n - l - 1; j > l; j--) grid[m - l - 1][j] = rotatedLayerValues[idx++];
            for (int i = m - l - 1; i > l; i--) grid[i][l] = rotatedLayerValues[idx++];
        }
        return grid;
    }
}

