class Solution {
    public int minCost(int maxTime, int[][] edges, int[] passingFees) {
        int n = passingFees.length;
        int[][] dp = new int[n][maxTime + 1];
        for (int i = 0; i < n; i++) {
            Arrays.fill(dp[i], Integer.MAX_VALUE);
        }
        dp[0][0] = passingFees[0];
        for (int t = 1; t <= maxTime; t++) {
            for (int[] e : edges) {
                int u = e[0], v = e[1], w = e[2];
                if (t >= w) {
                    dp[u][t] = Math.min(dp[u][t], dp[v][t - w] + passingFees[u]);
                    dp[v][t] = Math.min(dp[v][t], dp[u][t - w] + passingFees[v]);
                }
            }
        }
        int ans = Integer.MAX_VALUE;
        for (int t = 0; t <= maxTime; t++) {
            ans = Math.min(ans, dp[n - 1][t]);
        }
        return ans == Integer.MAX_VALUE ? -1 : ans;
    }
}

class Solution {
    public boolean sumGame(String num) {
        int n = num.length();
        int sumLeft = 0, sumRight = 0, qLeft = 0, qRight = 0;
        for (int i = 0; i < n / 2; i++) {
            if (num.charAt(i) == '?') qLeft++;
            else sumLeft += num.charAt(i) - '0';
        }
        for (int i = n / 2; i < n; i++) {
            if (num.charAt(i) == '?') qRight++;
            else sumRight += num.charAt(i) - '0';
        }
        if (qLeft == qRight) {
            return sumLeft != sumRight;
        } else if (qLeft > qRight) {
            int qDiff = qLeft - qRight;
            int sumDiff = sumLeft - sumRight;
            if (sumDiff > 0) return true;
            if (sumDiff < 0) sumDiff = -sumDiff;
            if (sumDiff == 9 * qDiff / 2) return false;
            if (sumDiff < 9 * qDiff / 2) return true;
            return (sumDiff - 9 * qDiff / 2) % 2 != 0;
        } else {
            int qDiff = qRight - qLeft;
            int sumDiff = sumRight - sumLeft;
            if (sumDiff > 0) sumDiff = -sumDiff;
            if (sumDiff == 9 * qDiff / 2) return false;
            if (sumDiff > 9 * qDiff / 2) return true;
            return (sumDiff + 9 * qDiff / 2) % 2 != 0;
        }
    }
}

class Solution {
    public int nearestExit(char[][] maze, int[] entrance) {
        int m = maze.length, n = maze[0].length;
        int[][] dirs = {{0,1}, {0,-1}, {1,0}, {-1,0}};
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(entrance);
        maze[entrance[0]][entrance[1]] = '+';
        int steps = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            while (size-- > 0) {
                int[] curr = queue.poll();
                if ((curr[0] == 0 || curr[0] == m - 1 || curr[1] == 0 || curr[1] == n - 1) && !(curr[0] == entrance[0] && curr[1] == entrance[1])) {
                    return steps;
                }
                for (int[] dir : dirs) {
                    int x = curr[0] + dir[0], y = curr[1] + dir[1];
                    if (x >= 0 && x < m && y >= 0 && y < n && maze[x][y] == '.') {
                        maze[x][y] = '+';
                        queue.offer(new int[]{x, y});
                    }
                }
            }
            steps++;
        }
        return -1;
    }
}

class Solution {
    public int countTriples(int n) {
        int count = 0;
        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= n; j++) {
                int squareSum = i*i + j*j;
                int c = (int) Math.sqrt(squareSum);
                if (c*c == squareSum && c <= n) {
                    count++;
                }
            }
        }
        return count;
    }
}

class Solution {
    public int countSubIslands(int[][] grid1, int[][] grid2) {
        int cnt = 0;
        int m = grid1.length;
        int n = grid1[0].length;
        for(int i=0; i<m; i++){
            for(int j=0; j<n; j++){
                if(grid2[i][j]==1){
                    if(dfs(i, j, grid1, grid2)) cnt++;
                }
            }
        }
        return cnt;
    }
    
    public boolean dfs(int i, int j, int[][] grid1, int[][] grid2){
        int m = grid1.length;
        int n = grid1[0].length;
        if(i<0||j<0||i>=m||j>=n||grid2[i][j]==0) return true;
        if(grid1[i][j]==0) return false;
        grid2[i][j] = 0;
        return dfs(i-1,j,grid1,grid2) && dfs(i+1,j,grid1,grid2) && dfs(i,j-1,grid1,grid2) && dfs(i,j+1,grid1,grid2);
    }
}

class Solution {
    public int[] minDifference(int[] nums, int[][] queries) {
        int n = nums.length;
        int[][] dp = new int[n][101];
        for (int i = 0; i < n; i++) {
            Arrays.fill(dp[i], -1);
            dp[i][nums[i]] = i;
        }
        for (int i = 0; i < n; i++) {
            for (int j = 1; j <= 100; j++) {
                if (i > 0 && dp[i - 1][j] != -1)
                    dp[i][j] = dp[i - 1][j];
            }
            dp[i][nums[i]] = i;
        }
        int m = queries.length;
        int[] ans = new int[m];
        for (int i = 0; i < m; i++) {
            int l = queries[i][0], r = queries[i][1];
            int curMin = Integer.MAX_VALUE, prev = -1;
            for (int j = 1; j <= 100; j++) {
                if (dp[r][j] != -1) {
                    if (prev != -1 && j - prev < curMin)
                        curMin = j - prev;
                    prev = j;
                    if (j == nums[l])
                        break;
                }
            }
            ans[i] = (curMin == Integer.MAX_VALUE) ? -1 : curMin;
        }
        return ans;
    }
}

class Solution {
    public int numberOfRounds(String startTime, String finishTime) {
        int startMinutes = Integer.parseInt(startTime.substring(0, 2)) * 60 + Integer.parseInt(startTime.substring(3));
        int finishMinutes = Integer.parseInt(finishTime.substring(0, 2)) * 60 + Integer.parseInt(finishTime.substring(3));
        if (startMinutes > finishMinutes) {
            finishMinutes += 24 * 60;
        }
        int start = (startMinutes + 14) / 15;
        int finish = finishMinutes / 15;
        return Math.max(0, finish - start);
    }
}

