class Solution {
    public int[] earliestAndLatest(int n, int firstPlayer, int secondPlayer) {
        int[][][] dp = new int[n + 1][n + 1][n + 1];
        return dfs(dp, 1, n, firstPlayer, secondPlayer);
    }
    
    private int[] dfs(int[][][] dp, int left, int right, int p1, int p2) {
        if (left == right)
            return new int[]{1, p1 == left ? p2 == left ? 1 : 2 : 1};
        if (p1 > p2) return dfs(dp, left, right, p2, p1);
        if (dp[left][right][p1] != 0 && dp[left][right][p1] == dp[left][right][p2])
            return new int[]{dp[left][right][p1], dp[left][right][p2]};
        int[] res = new int[]{n, 1};
        for (int l = 1; l <= (right - left + 1) / 2; l++) {
            int r = right - left + 1 - l;
            for (int i = 0; i <= 1; i++)
                for (int j = 0; j <= 1; j++) {
                    int np1 = p1, np2 = p2;
                    if (i == 1) np1 = right - p1 + left;
                    if (j == 1) np2 = right - p2 + left;
                    if (np1 <= left + l - 1 || np2 >= right - r + 1)
                        continue;
                    int[] t = dfs(dp, left + l, right - r, np1, np2);
                    res[0] = Math.min(res[0], t[0] + 1);
                    res[1] = Math.max(res[1], t[1] + 1);
                }
        }
        dp[left][right][p1] = res[0];
        dp[left][right][p2] = res[1];
        return res;
    }
}

class Solution {
    public int maximumRemovals(String s, String p, int[] removable) {
        char[] arr = s.toCharArray();
        int len = removable.length;
        int l = 0, r = len;
        while (l < r) {
            int mid = (l + r + 1) / 2;
            for (int i = 0; i < mid; i++) {
                arr[removable[i]] = '/';
            }
            if (isSubsequence(s, p, arr)) {
                l = mid;
            } else {
                for (int i = 0; i < mid; i++) {
                    arr[removable[i]] = s.charAt(removable[i]);
                }
                r = mid - 1;
            }
        }
        return l;
    }

    private boolean isSubsequence(String s, String p, char[] arr) {
        int i = 0, m = p.length();
        for (char ch : arr) {
            if (i == m) {
                return true;
            }
            if (ch == p.charAt(i)) {
                i++;
            }
        }
        return i == m;
    }
}

class Solution {
    public boolean mergeTriplets(int[][] triplets, int[] target) {
