class Solution {
    public boolean canBeIncreasing(int[] nums) {
        int n = nums.length, count = 0;
        for (int i = 1; i < n && count <= 1; i++) {
            if (nums[i] <= nums[i - 1]) {
                count++;
                if (i > 1 && nums[i] <= nums[i - 2]) {
                    nums[i] = nums[i - 1];
                }
            }
        }
        return count <= 1;
    }
}

class Solution {
    public int minWastedSpace(int[] packages, int[][] boxes) {
        int mod = (int)1e9 + 7;
        Arrays.sort(packages);
        long res = Long.MAX_VALUE;
        for (int[] b : boxes) {
            Arrays.sort(b);
            if (b[b.length - 1] < packages[packages.length - 1])
                continue;
            long cur = 0, i = 0;
            for (int box : b) {
                int j = Arrays.binarySearch(packages, i, packages.length, box);
                if (j < 0) j = -j - 1;
                cur += (long)box * (j - i);
                i = j;
                if (i == packages.length) break;
            }
            if (i == packages.length)
                res = Math.min(res, cur);
        }
        return res == Long.MAX_VALUE ? -1 : (int)(res - Arrays.stream(packages).asLongStream().sum()) % mod;
    }
}

class Solution {
    public int minFlips(String s) {
        int n = s.length();
        int count1 = 0, count2 = 0;
        for (int i = 0; i < n; i++) {
            if (i % 2 == 0 && s.charAt(i) == '1') {
                count1++;
            } else if (i % 2 == 1 && s.charAt(i) == '0') {
                count1++;
            }
        }
        for (int i = 0; i < n; i++) {
            if (i % 2 == 0 && s.charAt(i) == '0') {
                count2++;
            } else if (i % 2 == 1 && s.charAt(i) == '1') {
                count2++;
            }
        }
        return Math.min(count1, count2);
    }
}

