    }
}

class Solution {
    public boolean findRotation(int[][] mat, int[][] target) {
        int n = mat.length;
        for (int k = 0; k < 4; k++) {
            for (int i = 0; i < n; i++) {
                for (int j = i; j < n; j++) {
                    int temp = mat[i][j];
                    mat[i][j] = mat[j][i];
                    mat[j][i] = temp;
                }
            }
            for (int i = 0; i < n; i++) {
                for (int j = 0; j < n / 2; j++) {
                    int temp = mat[i][j];
                    mat[i][j] = mat[i][n - j - 1];
                    mat[i][n - j - 1] = temp;
                }
            }
            if (isEqual(mat, target)) {
                return true;
            }
        }
        return false;
    }
    
    private boolean isEqual(int[][] mat, int[][] target) {
        int n = mat.length;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (mat[i][j] != target[i][j]) {
                    return false;
                }
            }
        }
        return true;
    }
}

class Solution {
    public int minSkips(int[] dist, int speed, int hoursBefore) {
        int n = dist.length;
        int[][] dp = new int[n+1][n+1];
        for (int i = 0; i <= n; i++) {
            Arrays.fill(dp[i], (int) 1e9);
        }
        dp[0][0] = 0;
        for (int i = 1; i <= n; i++) {
            for (int j = 0; j <= i; j++) {
                if (j > 0) {
                    dp[i][j] = Math.min(dp[i][j], dp[i-1][j-1] + (dist[i-1]+speed-1)/speed);
                }
                if (j < i) {
                    dp[i][j] = Math.min(dp[i][j], dp[i-1][j] + dist[i-1]/speed);
                }
                if (i == n && dp[i][j] <= (long)hoursBefore*speed) {
                    return j;
                }
            }
        }
        return -1;
    }
}

class Solution {
    public int[] assignTasks(int[] servers, int[] tasks) {
        PriorityQueue<int[]> free = new PriorityQueue<>((a, b) -> a[0] == b[0] ? a[1] - b[1] : a[0] - b[0]);
        PriorityQueue<int[]> busy = new PriorityQueue<>((a, b) -> a[2] - b[2]);
        int n = servers.length, m = tasks.length;
        int[] ans = new int[m];
        for (int i = 0; i < n; i++) {
            free.offer(new int[]{servers[i], i});
        }
        long time = 0;
        for (int i = 0; i < m; i++) {
            time = Math.max(time, (long)i);
            if (free.isEmpty()) {
                time = busy.peek()[2];
            }
            while (!busy.isEmpty() && busy.peek()[2] <= time) {
                int[] server = busy.poll();
                free.offer(new int[]{server[0], server[1]});
            }
            int[] server = free.poll();
            ans[i] = server[1];
            busy.offer(new int[]{server[0], server[1], time + tasks[i]});
        }
        return ans;
    }
}

class Solution {
    public String maxValue(String n, int x) {
        StringBuilder sb = new StringBuilder(n);
        if(n.charAt(0) == '-') {
            int i = 1;
            while(i < n.length() && n.charAt(i) - '0' <= x) {
                i++;
            }
            sb.insert(i, x);
        } else {
            int i = 0;
            while(i < n.length() && n.charAt(i) - '0' >= x) {
                i++;
            }
            sb.insert(i, x);
        }
        return sb.toString();
    }
}

class Solution {
