    }
}

class Solution {
    public int minOperationsToFlip(String expression) {
        int n = expression.length();
        char[] exp = new char[n + 1];
        int[] signs = new int[n + 1];
        int top = -1, id = 0;
        for (char c : expression.toCharArray()) {
            if (c == ')') signs[top] = 0;
            else if (c == '&' || c == '|') signs[++top] = c;
            else if (c == '0' || c == '1') exp[++id] = c;
        }
        return dfs(exp, signs, 1, id, 1) / 2;
    }

    private int dfs(char[] exp, int[] signs, int start, int end, int desired) {
        if (start == end) return exp[start] == desired ? 0 : 1;
        int cnt = 0, minFlips = Integer.MAX_VALUE;
        for (int i = start; i <= end; i++) {
            if (exp[i] == '|' || exp[i] == '&') {
                int leftTrue = dfs(exp, signs, start, i - 1, 1);
                int leftFalse = dfs(exp, signs, start, i - 1, 0);
                int rightTrue = dfs(exp, signs, i + 1, end, 1);
                int rightFalse = dfs(exp, signs, i + 1, end, 0);
                int totalOps = (exp[i] == '|' ? leftFalse * rightFalse : leftTrue * rightTrue) +
                        (exp[i] == '|' ? leftFalse * rightTrue : leftTrue * rightFalse);
                cnt += 1;
                minFlips = Math.min(minFlips, totalOps);
            }
        }
        return cnt == 0 ? (exp[start] == desired ? 0 : 1) :
                (signs[start] == '|' ? Math.min(minFlips + dfs(exp, signs, start + 1, end, 0),
                        cnt + dfs(exp, signs, start + 1, end, 1)) :
                        Math.min(minFlips + dfs(exp, signs, start + 1, end, 1),
                                cnt + dfs(exp, signs, start + 1, end, 0)));
    }
}

class Solution {
    public int chalkReplacer(int[] chalk, int k) {
        long total = 0;
        for (int c : chalk) {
            total += c;
        }
        k %= total;
        int i = 0;
        while (k >= chalk[i]) {
            k -= chalk[i];
            i++;
        }
        return i;
    }
}

