class Solution {
    public int stoneGameVIII(int[] stones) {
        int n = stones.length;
        for (int i = 1; i < n; i++) {
            stones[i] += stones[i-1];
        }
        int ans = stones[n-1];
        for (int i = n-2; i > 0; i--) {
            ans = Math.max(ans, stones[i]-ans);
        }
        return ans;
    }
}

class Solution {
    public boolean canReach(String s, int minJump, int maxJump) {
        int len = s.length();
        boolean[] dp = new boolean[len];
        dp[0] = true;
        int count = 0;
        for (int i = 1; i < len; i++) {
            if (i >= minJump && dp[i - minJump]) {
                count--;
            }
            if (i > maxJump && dp[i - maxJump - 1]) {
                count++;
            }
            if (count > 0 || s.charAt(i) == '1') {
                dp[i] = false;
            } else {
                dp[i] = dp[i - 1];
            }
        }
        return dp[len - 1];
    }
}

class Solution {
    public int minSpeedOnTime(int[] dist, double hour) {
        int n = dist.length;
        if (hour <= n - 1) return -1;
        int left = 1, right = (int)1e7;
        while (left < right) {
            int mid = (left + right) / 2;
            double total = 0.0;
            for (int i = 0; i < n - 1; i++) {
                total += Math.ceil((double)dist[i] / mid);
            }
            total += (double)dist[n-1] / mid;
            if (total > hour) left = mid + 1;
            else right = mid;
        }
        return left;
    }
}

class Solution {
    public boolean checkZeroOnes(String s) {
        int maxOnes = 0, maxZeros = 0, ones = 0, zeros = 0;
        for (char c : s.toCharArray()) {
            if (c == '1') {
                ones++;
                maxOnes = Math.max(maxOnes, ones);
                zeros = 0;
            } else {
                zeros++;
                maxZeros = Math.max(maxZeros, zeros);
                ones = 0;
            }
        }
        return maxOnes > maxZeros;
    }
}

class Solution {
    private static final int MOD = 1000000007;
    public int rearrangeSticks(int n, int k) {
        long[][] dp = new long[n+1][k+1];
        dp[0][0] = 1;
        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= k; j++) {
                dp[i][j] = (dp[i-1][j-1] + (i-1) * dp[i-1][j]) % MOD;
            }
        }
        return (int)dp[n][k];
    }
}

class FindSumPairs {
    Map<Integer, Integer> freq;
    int[] nums1, nums2;

    public FindSumPairs(int[] nums1, int[] nums2) {
        freq = new HashMap<>();
        this.nums1 = nums1;
        this.nums2 = nums2;
        for (int num : nums2) {
            freq.put(num, freq.getOrDefault(num, 0) + 1);
        }
    }

    public void add(int index, int val) {
        int num = nums2[index];
        freq.put(num, freq.get(num) - 1);
        nums2[index] += val;
        freq.put(nums2[index], freq.getOrDefault(nums2[index], 0) + 1);
    }

    public int count(int tot) {
        int res = 0;
        for (int num : nums1) {
            res += freq.getOrDefault(tot - num, 0);
        }
        return res;
    }
}

class Solution {
    public int minSwaps(String s) {
        int ones = 0, zeros = 0;
        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) == '1') {
                ones++;
            } else {
                zeros++;
            }
        }
        if (Math.abs(ones - zeros) > 1) {
            return -1;
        }
        int countOnes = 0, countZeros = 0;
        for (int i = 0; i < s.length(); i++) {
            if (i % 2 == 0) {
                if (s.charAt(i) == '1') {
                    countZeros++;
                } else {
                    countOnes++;
                }
            } else {
                if (s.charAt(i) == '1') {
                    countOnes++;
                } else {
                    countZeros++;
                }
            }
        }
        if (ones == zeros) {
            return Math.min(countOnes, countZeros) / 2;
        } else if (ones > zeros) {
            return countOnes / 2;
        } else {
            return countZeros / 2;
        }
    }
}

class Solution {
    public int subsetXORSum(int[] nums) {
        int n = nums.length;
        int res = 0;
        for (int i = 0; i < (1 << n); i++) {
            int xor = 0;
            for (int j = 0; j < n; j++) {
                if ((i & (1 << j)) != 0) {
                    xor ^= nums[j];
                }
            }
            res += xor;
        }
        return res;
    }
}

class Solution {
    public int[] getBiggestThree(int[][] grid) {
        Set<Integer> set = new HashSet<>();
        int m = grid.length, n = grid[0].length;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                set.add(grid[i][j]);
                for (int k = 1; i+k < m && i-k >= 0 && j+2*k < n; k++) {
                    int sum = 0;
                    for (int l = 0; l < k; l++) {
                        sum += grid[i+l][j+l] + grid[i+l][j+2*k-l] + grid[i+2*k-l][j+l] + grid[i+2*k-l][j+2*k-l];
                    }
                    if (!set.contains(sum)) {
                        set.add(sum);
                    }
                }
            }
        }
        int[] res = new int[Math.min(3, set.size())];
        int i = 0;
        for (int num : set) {
            res[i++] = num;
            if (i == 3) {
                break;
            }
        }
        Arrays.sort(res);
        reverse(res);
        return res;
    }
    
    private void reverse(int[] nums) {
        int left = 0, right = nums.length-1;
        while (left < right) {
            int tmp = nums[left];
            nums[left] = nums[right];
            nums[right] = tmp;
            left++;
            right--;
        }
    }
}

class Solution {
    public int minimumXORSum(int[] nums1, int[] nums2) {
        int n = nums1.length;
        int[][] dp = new int[1<<n][n];
        for (int[] row : dp) {
            Arrays.fill(row, Integer.MAX_VALUE / 2);
        }
        dp[1][0] = nums1[0] ^ nums2[0];
        for (int mask = 1; mask < (1 << n); mask++) {
            for (int i = 0; i < n; i++) {
                if ((mask & (1 << i)) != 0) {
                    for (int j = 0; j < n; j++) {
                        if ((mask & (1 << j)) == 0) {
                            dp[mask | (1 << j)][j] = Math.min(dp[mask | (1 << j)][j], dp[mask][i] + (nums1[j] ^ nums2[i]));
                        }
                    }
                }
            }
        }
        int ans = Integer.MAX_VALUE / 2;
        for (int i = 0; i < n; i++) {
            ans = Math.min(ans, dp[(1<<n)-1][i]);
        }
        return ans;
    }
}

