class Solution {
    public int largestPathValue(String colors, int[][] edges) {
        int n = colors.length();
        int m = edges.length;
        int[][] graph = new int[n][26];
        List<List<Integer>> outgoings = new ArrayList<>();
        int[] degrees = new int[n];
        for (int i = 0; i < n; i++) {
            outgoings.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1];
            outgoings.get(u).add(v);
            degrees[v]++;
        }
        Queue<Integer> queue = new LinkedList<>();
        for (int i = 0; i < n; i++) {
            if (degrees[i] == 0) {
                queue.offer(i);
            }
        }
        int steps = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                int u = queue.poll();
                graph[u][colors.charAt(u) - 'a']++;
                for (int v : outgoings.get(u)) {
                    for (int j = 0; j < 26; j++) {
                        graph[v][j] = Math.max(graph[v][j], graph[u][j]);
                    }
                    if (--degrees[v] == 0) {
                        queue.offer(v);
                    }
                }
            }
            steps++;
        }
        if (steps != n) {
            return -1;
        }
        int max = 0;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < 26; j++) {
                max = Math.max(max, graph[i][j]);
            }
        }
        return max;
    }
}

class Solution {
    public int maxSumMinProduct(int[] nums) {
        int n = nums.length;
        long[] prefixSum = new long[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + nums[i];
        }
        long[] leftLess = new long[n];
        Stack<Integer> stack = new Stack<>();
        for (int i = 0; i < n; i++) {
            while (!stack.isEmpty() && nums[stack.peek()] >= nums[i]) {
                stack.pop();
            }
            leftLess[i] = stack.isEmpty() ? -1 : stack.peek();
            stack.push(i);
        }
        stack.clear();
        long[] rightLess = new long[n];
        for (int i = n - 1; i >= 0; i--) {
            while (!stack.isEmpty() && nums[stack.peek()] >= nums[i]) {
                stack.pop();
            }
            rightLess[i] = stack.isEmpty() ? n : stack.peek();
            stack.push(i);
        }
        long maxProduct = 0;
        for (int i = 0; i < n; i++) {
            long product = nums[i] * (prefixSum[(int) (rightLess[i])] - prefixSum[(int) leftLess[i] + 1]);
            maxProduct = Math.max(maxProduct, product);
        }
        return (int) (maxProduct % 1000000007);
    }
}

