    }
}

class Solution {
    public int maximumPopulation(int[][] logs) {
        int[] years = new int[101];
        for (int[] log: logs) {
            years[log[0] - 1950]++;
            years[log[1] - 1950]--;
        }
        int maxPop = 0, currPop = 0, maxYear = 0;
        for (int i = 0; i < 101; i++) {
            currPop += years[i];
            if (currPop > maxPop) {
                maxPop = currPop;
                maxYear = i;
            }
        }
        return maxYear + 1950;
    }
}

class Solution {
    public int getMinSwaps(String num, int k) {
        char[] curr = num.toCharArray();
        char[] target = Arrays.copyOf(curr, curr.length);
        while (k-- > 0) nextPermutation(target);
        return countSwaps(curr, target);
    }
    
    private void nextPermutation(char[] nums) {
        int i = nums.length - 2;
        while (i >= 0 && nums[i] >= nums[i+1]) i--;
        int j = nums.length - 1;
        while (j >= 0 && nums[j] <= nums[i]) j--;
        swap(nums, i, j);
        reverse(nums, i+1, nums.length-1);
    }
    
    private int countSwaps(char[] nums1, char[] nums2) {
        int res = 0;
        for (int i = 0; i < nums1.length; i++) {
            if (nums1[i] != nums2[i]) {
                int j = i+1;
                while (j < nums1.length && nums1[j] != nums2[i]) j++;
                while (j > i) {
                    swap(nums1, j, j-1);
                    j--;
                    res++;
                }
            }
        }
        return res;
    }
    
    private void swap(char[] nums, int i, int j) {
        char tmp = nums[i];
        nums[i] = nums[j];
        nums[j] = tmp;
    }
    
    private void reverse(char[] nums, int i, int j) {
        while (i < j) {
            swap(nums, i, j);
            i++;
            j--;
        }
    }
}

class Solution {
    public int[] minInterval(int[][] intervals, int[] queries) {
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> Integer.compare(a[1] - a[0] + 1, b[1] - b[0] + 1));
        for (int[] interval : intervals) {
            pq.offer(interval);
        }
        int[] res = new int[queries.length];
        Arrays.fill(res, -1);
        for (int i = 0; i < queries.length; i++) {
            int query = queries[i];
            PriorityQueue<int[]> temp = new PriorityQueue<>((a, b) -> Integer.compare(a[1], b[1]));
            while (!pq.isEmpty() && pq.peek()[0] <= query) {
                int[] interval = pq.poll();
                temp.offer(interval);
            }
            while (!temp.isEmpty()) {
                int[] interval = temp.poll();
                if (interval[1] >= query) {
                    res[i] = interval[1] - interval[0] + 1;
                    break;
                }
            }
            while (!pq.isEmpty() && pq.peek()[1] < query) {
                pq.poll();
            }
        }
        return res;
    }
}

class Solution {
    public boolean splitString(String s) {
        return backtrack(s, 0, -1, 0);
    }
    
    private boolean backtrack(String s, int index, long prev, int count) {
        if (index == s.length()) {
            return count > 1;
        }
        long curr = 0;
        for (int i = index; i < s.length(); i++) {
            curr = curr * 10 + (s.charAt(i) - '0');
            if (prev == -1 || curr == prev - 1) {
                if (backtrack(s, i + 1, curr, count + 1)) {
                    return true;
                }
            }
            if (prev == -1 || curr < prev - 1) {
                continue;
            }
            break;
        }
        return false;
    }
}

