                minDist = Math.min(minDist, Math.abs(i - start));
            }
        }
        return minDist;
    }
}

class Solution {
    public char[][] rotateTheBox(char[][] box) {
        int m = box.length, n = box[0].length;
        for (int i = 0; i < m; i++) {
            int j = n - 2, k = n - 1;
            while (j >= 0) {
                if (box[i][j] == '#') {
                    while (k > j && box[i][k] != '.') k--;
                    if (k <= j) break;
                    box[i][j] = '.';
                    box[i][k] = '#';
                } else if (box[i][j] == '*') {
                    k = j - 1;
                } else {
                    k = Math.min(k, j - 1);
                }
                j--;
            }
        }
        char[][] res = new char[n][m];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                res[j][m - i - 1] = box[i][j];
            }
        }
        return res;
    }
}

class Solution {
    public int[] memLeak(int memory1, int memory2) {
        int i = 1;
        while(memory1 >= i || memory2 >= i) {
            if(memory1 >= memory2) {
                memory1 -= i;
            } else {
                memory2 -= i;
            }
            i++;
        }
        return new int[]{i, memory1, memory2};
    }
}

