}

class Solution {
    public int maxBuilding(int n, int[][] restrictions) {
        Arrays.sort(restrictions, (a, b) -> a[0] - b[0]);
        restrictions = ArrayUtils.addAll(new int[][]{{1, 0}, {n, n-1}}, restrictions);
        int m = restrictions.length;
        for (int i = 1; i < m; i++) {
            restrictions[i][1] = Math.min(restrictions[i][1], restrictions[i-1][1] + restrictions[i][0] - restrictions[i-1][0]);
        }
        for (int i = m-2; i >= 0; i--) {
            restrictions[i][1] = Math.min(restrictions[i][1], restrictions[i+1][1] + restrictions[i+1][0] - restrictions[i][0]);
        }
        int maxHeight = 0;
        for (int i = 1; i < m; i++) {
            int left = restrictions[i-1][0], right = restrictions[i][0];
            int h1 = restrictions[i-1][1], h2 = restrictions[i][1];
            maxHeight = Math.max(maxHeight, (h1 + h2 + right - left) / 2);
        }
        return maxHeight;
    }
}

class Solution {
    public int longestBeautifulSubstring(String word) {
        int maxLen = 0, count = 0;
        char prev = 'a';
        for (int i = 0; i < word.length();) {
            char curr = word.charAt(i);
            int j = i;
            while (j < word.length() && word.charAt(j) >= word.charAt(j - 1)) {
                if (word.charAt(j) == curr) {
                    count++;
                }
                j++;
            }
            if (count == 5) {
                maxLen = Math.max(maxLen, j - i);
            }
            count = 0;
            prev = curr;
            i = j;
            while (i < word.length() && word.charAt(i) < prev) {
                i++;
            }
        }
        return maxLen;
    }
}

class Solution {
    public int maxFrequency(int[] nums, int k) {
        Arrays.sort(nums);
        int left = 0, right;
        long total = 0;
        int res = 1;
        for (right = 1; right < nums.length; right++) {
            total += (long) (nums[right] - nums[right-1]) * (right - left);
            while (total > k) {
                total -= nums[right] - nums[left];
                left++;
            }
            res = Math.max(res, right - left + 1);
        }
        return res;
    }
}

