class Solution {
    public int[] getOrder(int[][] tasks) {
        int n = tasks.length;
        int[][] newTasks = new int[n][3];
        for (int i = 0; i < n; i++) {
            newTasks[i][0] = tasks[i][0];
            newTasks[i][1] = tasks[i][1];
            newTasks[i][2] = i;
        }
        Arrays.sort(newTasks, (a, b) -> a[0] - b[0]);
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[1] == b[1] ? a[2] - b[2] : a[1] - b[1]);
        int[] res = new int[n];
        int i = 0, time = 0;
        for (int[] t : newTasks) {
            while (i < n && t[0] >= time) {
                pq.offer(new int[]{tasks[i][1], tasks[i][0], i});
                i++;
            }
            pq.offer(new int[]{t[1], t[0], t[2]});
            time = pq.peek()[1];
            res[pq.poll()[2]] = time;
        }
        while (!pq.isEmpty()) {
            time += pq.poll()[1];
            res[pq.poll()[2]] = time;
        }
        return res;
    }
}

class Solution {
