class Solution {
    public int[] closestRoom(int[][] rooms, int[][] queries) {
        Arrays.sort(rooms, (a, b) -> Integer.compare(b[1], a[1]));
        int n = queries.length;
        for (int i = 0; i < n; i++) {
            queries[i] = new int[]{queries[i][0], queries[i][1], i};
        }
        Arrays.sort(queries, (a, b) -> Integer.compare(b[1], a[1]));
        TreeSet<Integer> set = new TreeSet<>();
        int[] ans = new int[n];
        int idx = 0;
        for (int[] q : queries) {
            while (idx < rooms.length && rooms[idx][1] >= q[1]) {
                set.add(rooms[idx++][0]);
            }
            Integer floor = set.floor(q[0]);
            Integer ceiling = set.ceiling(q[0]);
            if (floor == null && ceiling == null) {
                ans[q[2]] = -1;
            } else if (floor == null) {
                ans[q[2]] = ceiling;
            } else if (ceiling == null) {
                ans[q[2]] = floor;
            } else {
                ans[q[2]] = q[0] - floor <= ceiling - q[0] ? floor : ceiling;
            }
        }
        return ans;
    }
}

