class MKAverage {
    Deque<Integer> stream;
    PriorityQueue<Integer> minHeap, maxHeap;
    int m, k;
    long sum;

    public MKAverage(int m, int k) {
        this.stream = new LinkedList<>();
        this.minHeap = new PriorityQueue<>();
        this.maxHeap = new PriorityQueue<>(Collections.reverseOrder());
        this.m = m;
        this.k = k;
        this.sum = 0;
    }

    public void addElement(int num) {
        stream.offer(num);
        if (stream.size() > m) {
            int removed = stream.poll();
            if (minHeap.contains(removed)) {
                minHeap.remove(removed);
                sum -= removed;
            } else if (maxHeap.contains(removed)) {
                maxHeap.remove(removed);
                sum -= removed;
            }
        }
        if (minHeap.size() < k || num <= minHeap.peek()) {
            minHeap.offer(num);
            sum += num;
        } else {
            maxHeap.offer(num);
            sum += num;
        }
        balance();
    }

    public int calculateMKAverage() {
        if (stream.size() < m) {
            return -1;
        }
        return (int) (sum / (m - k * 2));
    }

    private void balance() {
        while (minHeap.size() > k) {
            int moved = minHeap.poll();
            sum -= moved;
            maxHeap.offer(moved);
        }
        while (maxHeap.size() > k) {
            int moved = maxHeap.poll();
            sum -= moved;
            minHeap.offer(moved);
        }
    }
}

class Solution {
    public int minSideJumps(int[] obstacles) {
        int n = obstacles.length;
        int[] dp = new int[]{1, 0, 1};

        for (int i = 1; i < n - 1; i++) {
            if (obstacles[i] != 0) {
                dp[obstacles[i] - 1] = 200000;
            }
            for (int j = 0; j < 3; j++) {
                if (obstacles[i] != j + 1) {
                    dp[j] = Math.min(dp[j], Math.min(dp[(j + 1) % 3], dp[(j + 2) % 3]) + 1);
                }
            }
        }

        return Math.min(dp[0], Math.min(dp[1], dp[2]));
    }
}

