class Solution {
    public int countDifferentSubsequenceGCDs(int[] nums) {
        int maxVal = 0;
        for (int num : nums) {
            maxVal = Math.max(maxVal, num);
        }
        boolean[] exist = new boolean[maxVal + 1];
        for (int num : nums) {
            exist[num] = true;
        }
        int res = 0;
        for (int i = 1; i <= maxVal; i++) {
            int gcd = 0;
            for (int j = i; j <= maxVal; j += i) {
                if (exist[j]) {
                    gcd = (gcd == 0 ? j : gcd(gcd, j));
                }
            }
            if (gcd == i) {
                res++;
            }
        }
        return res;
    }
    
    private int gcd(int a, int b) {
        return b == 0 ? a : gcd(b, a % b);
    }
}

class Solution {
    public int minAbsoluteSumDiff(int[] nums1, int[] nums2) {
        int n = nums1.length;
        int[] sorted = Arrays.copyOf(nums1, n);
        Arrays.sort(sorted);
        long res = 0, maxDiff = 0;
        for (int i = 0; i < n; i++) {
            int diff = Math.abs(nums1[i] - nums2[i]);
            res += diff;
            int j = Arrays.binarySearch(sorted, nums2[i]);
            if (j < 0) j = ~j;
            if (j < n) maxDiff = Math.max(maxDiff, diff - Math.abs(sorted[j] - nums2[i]));
            if (j > 0) maxDiff = Math.max(maxDiff, diff - Math.abs(sorted[j - 1] - nums2[i]));
        }
        return (int)((res - maxDiff) % 1000000007);
    }
}

