class Solution {
    int MOD = 1000000007;
    public int makeStringSorted(String s) {
        int n = s.length(), ans = 0;
        int[] fact = new int[n+1];
        fact[0] = 1;
        for (int i = 1; i <= n; i++) {
            fact[i] = (int) ((long) fact[i-1] * i % MOD);
        }
        int[] cnt = new int[26];
        for (int i = n-1; i >= 0; i--) {
            int idx = s.charAt(i) - 'a';
            cnt[idx]++;
            int sufCount = 0;
            for (int j = idx+1; j < 26; j++) {
                sufCount += cnt[j];
            }
            int cur = 0;
            for (int j = 0; j < 26; j++) {
                if (cnt[j] == 0) continue;
                if (j > idx) {
                    cur += cnt[j];
                    cur %= MOD;
                    continue;
                }
                int leftCount = cnt[j] - (j == idx ? 1 : 0);
                cur = (cur + (long) leftCount * fact[n-i-1] % MOD * inv(fact[leftCount])) % MOD;
            }
            ans += (int) ((long) sufCount * fact[n-i-1] % MOD * cur % MOD);
            ans %= MOD;
        }
        return ans;
    }
    private int inv(int n) {
        return pow(n, MOD-2);
    }
    private int pow(int x, int p) {
        if (p == 0) return 1;
        int t = pow(x, p/2);
        t = (int) ((long) t * t % MOD);
        if (p % 2 != 0) t = (int) ((long) t * x % MOD);
        return t;
    }
}

class Solution {
    public int[] getMaximumXor(int[] nums, int maximumBit) {
        int n = nums.length;
        int[] ans = new int[n];
        int mask = (1 << maximumBit) - 1;
        int xor = 0;
        for (int num : nums) {
            xor ^= num;
        }
        for (int i = 0; i < n; i++) {
            ans[i] = mask ^ xor;
            xor ^= nums[n - 1 - i];
        }
        return ans;
    }
}

class Solution {
    public int[] countPoints(int[][] points, int[][] queries) {
        int[] answer = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int count = 0;
            for (int j = 0; j < points.length; j++) {
                if (isInside(points[j], queries[i])) {
                    count++;
                }
            }
            answer[i] = count;
        }
        return answer;
    }
    
    private boolean isInside(int[] point, int[] query) {
        int dist = (point[0] - query[0]) * (point[0] - query[0]) + (point[1] - query[1]) * (point[1] - query[1]);
        return dist <= query[2] * query[2];
    }
}

