class Solution {
    public int maxValue(int n, int index, int maxSum) {
        long left = 1, right = maxSum, mid;
        while (left < right) {
            mid = (left + right + 1) / 2;
            long sum = mid;
            long l = Math.max(mid - 1 - index, 0);
            long r = Math.max(mid - 1 - (n - index - 1), 0);
            sum += (mid - 1 + mid - l) * l / 2 + (mid - 1 + mid - r) * r / 2;
            if (sum <= maxSum) left = mid;
            else right = mid - 1;
        }
        return (int) left;
    }
}

class Solution {
    public int getNumberOfBacklogOrders(int[][] orders) {
        PriorityQueue<int[]> buyOrders = new PriorityQueue<>((a, b) -> Integer.compare(b[0], a[0]));
        PriorityQueue<int[]> sellOrders = new PriorityQueue<>((a, b) -> Integer.compare(a[0], b[0]));
        long backlogAmount = 0;
        int mod = 1000000007;
        for (int[] order : orders) {
            if (order[2] == 0) {
                while (!sellOrders.isEmpty() && sellOrders.peek()[0] <= order[0] && order[1] > 0) {
                    int[] sellOrder = sellOrders.poll();
                    int filledAmount = Math.min(order[1], sellOrder[1]);
                    backlogAmount = (backlogAmount - filledAmount + mod) % mod;
                    order[1] -= filledAmount;
                    sellOrder[1] -= filledAmount;
                    if (sellOrder[1] > 0) {
                        sellOrders.offer(sellOrder);
                    }
                }
                if (order[1] > 0) {
                    buyOrders.offer(order);
                    backlogAmount = (backlogAmount + order[1]) % mod;
                }
            } else {
                while (!buyOrders.isEmpty() && buyOrders.peek()[0] >= order[0] && order[1] > 0) {
                    int[] buyOrder = buyOrders.poll();
                    int filledAmount = Math.min(order[1], buyOrder[1]);
                    backlogAmount = (backlogAmount - filledAmount + mod) % mod;
                    order[1] -= filledAmount;
                    buyOrder[1] -= filledAmount;
                    if (buyOrder[1] > 0) {
                        buyOrders.offer(buyOrder);
                    }
                }
                if (order[1] > 0) {
                    sellOrders.offer(order);
                    backlogAmount = (backlogAmount + order[1]) % mod;
                }
            }
        }
        return (int) backlogAmount;
    }
}

class Solution {
    public int maxAscendingSum(int[] nums) {
        int maxSum = nums[0];
        int currSum = nums[0];
        for (int i = 1; i < nums.length; i++) {
            if (nums[i] > nums[i-1]) {
                currSum += nums[i];
            } else {
                maxSum = Math.max(maxSum, currSum);
                currSum = nums[i];
            }
        }
        return Math.max(maxSum, currSum);
    }
}

class Solution {
    public int countNicePairs(int[] nums) {
        Map<Integer, Integer> map = new HashMap<>();
        long ans = 0, mod = (long) 1e9 + 7;
        for (int num : nums) {
            int rev = reverse(num);
            int diff = num - rev;
            if (map.containsKey(diff)) {
                ans += map.get(diff);
                ans %= mod;
            }
            map.put(diff, map.getOrDefault(diff, 0) + 1);
        }
        return (int) ans;
    }
    
    private int reverse(int num) {
        int rev = 0;
        while (num > 0) {
            rev = 10 * rev + num % 10;
            num /= 10;
        }
        return rev;
    }
}

class Solution {
    public int maxHappyGroups(int batchSize, int[] groups) {
        int[] count = new int[batchSize];
        int res = 0;
        for (int i : groups) {
            int mod = i % batchSize;
            if (mod == 0) {
                res++;
            } else if (count[batchSize - mod] > 0) {
                count[batchSize - mod]--;
                res++;
            } else {
                count[mod]++;
            }
        }
        int sum = 0;
        for (int i = 1; i < batchSize; i++) {
            sum += Math.min(count[i], count[batchSize - i]);
        }
        res += sum;
        if (count[0] > 0) {
            res++;
        }
        return res;
    }
}

