class Solution {
    public int maximumScore(int[] nums, int k) {
        int res = nums[k], mn = nums[k], i = k, j = k, n = nums.length;
        while (i > 0 || j < n - 1) {
            if ((i > 0 ? nums[i - 1] : 0) < (j < n - 1 ? nums[j + 1] : 0))
                mn = Math.min(mn, nums[++j]);
            else
                mn = Math.min(mn, nums[--i]);
            res = Math.max(res, mn * (j - i + 1));
        }
        return res;
    }
}

class Solution {
    public double maxAverageRatio(int[][] classes, int extraStudents) {
        PriorityQueue<double[]> queue = new PriorityQueue<>((a, b) -> Double.compare(b[0], a[0]));
        double res = 0;
        for (int[] c : classes) {
            double pass = c[0], total = c[1];
            double ratio = pass / total;
            res += ratio;
            if (total > pass) {
                queue.offer(new double[]{(pass + 1) / (total + 1) - ratio, pass, total});
            }
        }
        while (extraStudents > 0 && !queue.isEmpty()) {
            double[] cur = queue.poll();
            double improvement = cur[0], pass = cur[1], total = cur[2];
            res += improvement;
            pass++;
            total++;
            double newRatio = pass / total;
            if (total > pass) {
                queue.offer(new double[]{(pass + 1) / (total + 1) - newRatio, pass, total});
            }
            extraStudents--;
        }
        return res / classes.length;
    }
}

