class Solution {
    public int countPairs(int[] nums, int low, int high) {
        TrieNode root = new TrieNode();
        int count = 0;
        for(int num : nums) {
            count += getCount(root, num, high+1) - getCount(root, num, low);
            insert(root, num);
        }
        return count;
    }
    
    private void insert(TrieNode root, int num) {
        TrieNode curr = root;
        for(int i=15;i>=0;i--) {
            int bit = (num>>i)&1;
            if(curr.children[bit]==null) {
                curr.children[bit] = new TrieNode();
            }
            curr = curr.children[bit];
            curr.count++;
        }
    }
    
    private int getCount(TrieNode root, int num, int limit) {
        if(root==null) return 0;
        TrieNode curr = root;
        int count = 0;
        for(int i=15;i>=0;i--) {
            if(curr==null) break;
            int bitNum = (num>>i)&1;
            int bitLimit = (limit>>i)&1;
            if(bitLimit==1) {
                count += curr.children[bitNum]!=null ? curr.children[bitNum].count : 0;
                curr = curr.children[1-bitNum];
            } else {
                curr = curr.children[bitNum];
            }
        }
        return count;
    }
}

