class Solution {
    public int maxScore(int[] nums) {
        return dfs(nums, new int[nums.length/2], 0);
    }
    
    private int dfs(int[] nums, int[] selected, int idx) {
        if (idx == nums.length/2) {
            int score = 0;
            for (int i = 1; i <= idx; i++) {
                int gcd = getGCD(selected[i-1], selected[i-2]);
                score += i * gcd;
            }
            return score;
        }
        int maxScore = 0;
        for (int i = 0; i < nums.length; i++) {
            if (selectedContains(selected, nums[i])) continue;
            selected[idx] = nums[i];
            maxScore = Math.max(maxScore, dfs(nums, selected, idx+1));
            selected[idx] = 0;
        }
        return maxScore;
    }
    
    private int getGCD(int a, int b) {
        if (a == 0) return b;
        return getGCD(b%a, a);
    }
    
    private boolean selectedContains(int[] selected, int num) {
        for (int i = 0; i < selected.length; i++) {
            if (selected[i] == num) return true;
        }
        return false;
    }
}

class AuthenticationManager {

    int timeToLive;
    Map<String, Integer> tokens;

    public AuthenticationManager(int timeToLive) {
        this.timeToLive = timeToLive;
        tokens = new HashMap<>();
    }

    public void generate(String tokenId, int currentTime) {
        tokens.put(tokenId, currentTime);
    }

    public void renew(String tokenId, int currentTime) {
        if (tokens.containsKey(tokenId)) {
            int tokenTime = tokens.get(tokenId);
            if (tokenTime + timeToLive > currentTime) {
                tokens.put(tokenId, currentTime);
            }
        }
    }

    public int countUnexpiredTokens(int currentTime) {
        int count = 0;
        for (int time : tokens.values()) {
            if (time + timeToLive > currentTime) {
                count++;
            }
        }
        return count;
    }
}

