class Solution {
    public int secondHighest(String s) {
        int firstMax = -1, secondMax = -1;
        for (char c : s.toCharArray()) {
            if (Character.isDigit(c)) {
                int digit = c - '0';
                if (digit > firstMax) {
                    secondMax = firstMax;
                    firstMax = digit;
                } else if (digit < firstMax && digit > secondMax) {
                    secondMax = digit;
                }
            }
        }
        return secondMax;
    }
}

class Solution {
    public double[] getCollisionTimes(int[][] cars) {
        int n = cars.length;
        double[] ans = new double[n];
        Stack<Integer> stack = new Stack<>();
        for (int i = n - 1; i >= 0; i--) {
            while (!stack.isEmpty()) {
                int j = stack.peek();
                if (cars[i][1] <= cars[j][1] || ((double)(cars[j][0] - cars[i][0]) / (cars[i][1] - cars[j][1])) >= ans[j] && ans[j] > 0) {
                    stack.pop();
                } else {
                    break;
                }
            }
            ans[i] = stack.isEmpty() ? -1 : (double)(cars[stack.peek()][0] - cars[i][0]) / (cars[i][1] - cars[stack.peek()][1]);
            stack.push(i);
        }
        return ans;
    }
}

class Solution {
    public int minOperations(int[] nums1, int[] nums2) {
        int sum1 = Arrays.stream(nums1).sum();
        int sum2 = Arrays.stream(nums2).sum();
        if (sum1 == sum2) return 0;
        if (sum1 > sum2) return minOperations(nums2, nums1);
        int diff = sum2 - sum1;
        int[] freq = new int[6];
        for (int num : nums1) freq[num - 1]++;
        for (int num : nums2) freq[6 - num]++;
        int count = 0;
        for (int i = 5; i >= 1 && diff > 0; i--) {
            int use = Math.min(freq[i], (diff + i - 1) / i);
            if (use == 0) break;
            diff -= use * i;
            count += use;
        }
        return diff > 0 ? -1 : count;
    }
}

class Solution {
    public int closestCost(int[] baseCosts, int[] toppingCosts, int target) {
        int closest = Integer.MAX_VALUE;
        for (int base : baseCosts) {
            dfs(base, 0, closest, toppingCosts, target);
        }
        return closest;
    }
    
    private void dfs(int currentCost, int index, int closest, int[] toppingCosts, int target) {
        if (Math.abs(currentCost - target) < Math.abs(closest - target) || (Math.abs(currentCost - target) == Math.abs(closest - target) && currentCost < closest)) {
            closest = currentCost;
        }
        if (currentCost >= target) {
            return;
        }
        if (index == toppingCosts.length) {
            return;
        }
        dfs(currentCost, index + 1, closest, toppingCosts, target);
        dfs(currentCost + toppingCosts[index], index + 1, closest, toppingCosts, target);
        dfs(currentCost + 2 * toppingCosts[index], index + 1, closest, toppingCosts, target);
    }
}

