class Solution {
    public int[] countPairs(int n, int[][] edges, int[] queries) {
        int[] res = new int[queries.length];
        int[] degrees = new int[n+1];
        Map<Integer, Integer> cntMap = new HashMap<>();
        for(int[] edge:edges){
            degrees[edge[0]]++; degrees[edge[1]]++;
            cntMap.put(Math.min(edge[0],edge[1])*n+Math.max(edge[0],edge[1]),
                    cntMap.getOrDefault(Math.min(edge[0],edge[1])*n+Math.max(edge[0],edge[1]),0)+1);
        }
        int[] sortedDegrees = degrees.clone();
        Arrays.sort(sortedDegrees);
        for(int i=0;i<queries.length;i++){
            int left = 1, right = n, cnt = 0;
            while(left<right){
                if(sortedDegrees[left]+sortedDegrees[right]>queries[i]) {
                    cnt += right-left;
                    right--;
                } else left++;
            }
            for(int j=1;j<=n;j++){
                for(int k=j+1;k<=n;k++){
                    int tmp = degrees[j]+degrees[k];
                    if(cntMap.containsKey(Math.min(j,k)*n+Math.max(j,k))) tmp--;
                    if(tmp>queries[i]) res[i]++;
                }
            }
            res[i] >>= 1;
            res[i] -= cnt;
        }
        return res;
    }
}

class Solution {
    public int beautySum(String s) {
        int res = 0;
        for (int i = 0; i < s.length(); i++) {
            int[] freq = new int[26];
            for (int j = i; j < s.length(); j++) {
                freq[s.charAt(j) - 'a']++;
                int max = 0, min = Integer.MAX_VALUE;
                for (int k = 0; k < 26; k++) {
                    if (freq[k] > 0) {
                        max = Math.max(max, freq[k]);
                        min = Math.min(min, freq[k]);
                    }
                }
                res += max - min;
            }
        }
        return res;
    }
}

