class Solution {
    public int closestSubsequenceSum(int[] nums, int goal) {
        int n = nums.length, m = n / 2;
        List<Integer> l = new ArrayList<>(), r = new ArrayList<>();
        dfs(nums, 0, m, 0, l);
        dfs(nums, m, n, 0, r);
        Collections.sort(l);
        Collections.sort(r);
        int ans = Math.abs(goal);
        for (int x : l)
            ans = Math.min(ans, Math.abs(goal - x - find(r, goal - x)));
        return ans;
    }

    void dfs(int[] nums, int i, int j, int s, List<Integer> ans) {
        if (i == j) {
            ans.add(s);
            return;
        }
        dfs(nums, i + 1, j, s + nums[i], ans);
        dfs(nums, i + 1, j, s, ans);
    }

    int find(List<Integer> a, int x) {
        int l = 0, r = a.size() - 1, m = (l + r) / 2;
        while (l <= r) {
            if (a.get(m) == x)
                return x;
            if (a.get(m) < x)
                l = m + 1;
            else
                r = m - 1;
            m = (l + r) / 2;
        }
        if (r >= 0) {
            if (l < a.size())
                return Math.abs(x - a.get(l)) < Math.abs(x - a.get(r)) ? a.get(l) : a.get(r);
            else
                return a.get(r);
        } else if (l < a.size())
            return a.get(l);
        return 0;
    }
}

