class Solution {
    public int[][] highestPeak(int[][] isWater) {
        int m = isWater.length, n = isWater[0].length;
        int[][] heights = new int[m][n];
        Queue<int[]> queue = new LinkedList<>();
        for (int i = 0; i < m; i++) {
            Arrays.fill(heights[i], -1);
            for (int j = 0; j < n; j++) {
                if (isWater[i][j] == 1) {
                    heights[i][j] = 0;
                    queue.offer(new int[]{i, j});
                }
            }
        }
        int[][] dirs = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
        while (!queue.isEmpty()) {
            int[] cell = queue.poll();
            int x = cell[0], y = cell[1];
            for (int[] dir : dirs) {
                int nx = x + dir[0], ny = y + dir[1];
                if (nx < 0 || nx >= m || ny < 0 || ny >= n || heights[nx][ny] != -1) continue;
                heights[nx][ny] = heights[x][y] + 1;
                queue.offer(new int[]{nx, ny});
            }
        }
        return heights;
    }
}

class Solution {
    public int[] getCoprimes(int[] nums, int[][] edges) {
        Map<Integer, List<Integer>> tree = new HashMap<>();
        for (int[] e : edges) {
            tree.computeIfAbsent(e[0], k -> new ArrayList<>()).add(e[1]);
            tree.computeIfAbsent(e[1], k -> new ArrayList<>()).add(e[0]);
        }
        Map<Integer, List<Integer>> factors = new HashMap<>();
        for (int i = 1; i <= 50; i++) {
            factors.computeIfAbsent(i, k -> new ArrayList<>());
            for (int j = 1; j <= 50; j++) {
                if (gcd(i, j) == 1) factors.get(i).add(j);
            }
        }
        int[] ans = new int[nums.length];
        Arrays.fill(ans, -1);
        dfs(tree, factors, ans, nums, new boolean[nums.length], 0, new ArrayList<>());
        return ans;
    }
    
    private void dfs(Map<Integer, List<Integer>> tree, Map<Integer, List<Integer>> factors, int[] ans,
                     int[] nums, boolean[] visited, int node, List<Integer> path) {
        visited[node] = true;
        for (int factor : factors.get(nums[node])) {
            int closestAncestor = -1;
            for (int p : path) {
                if (gcd(factor, nums[p]) == 1) {
                    closestAncestor = p;
                    break;
                }
            }
            ans[node] = closestAncestor;
        }
        path.add(node);
        for (int neighbor : tree.get(node)) {
            if (!visited[neighbor]) {
                dfs(tree, factors, ans, nums, visited, neighbor, path);
            }
        }
        path.remove(path.size()-1);
    }
    
    private int gcd(int a, int b) {
        return b == 0 ? a : gcd(b, a % b);
    }
}

class Solution {
    public boolean canChoose(int[][] groups, int[] nums) {
        int n = groups.length;
        int m = nums.length;
        int i = 0;
        for (int j = 0; i < n && j < m; j++) {
            if (match(groups[i], nums, j)) {
                j += groups[i].length - 1;
                i++;
            }
        }
        return i == n;
    }
    
    public boolean match(int[] group, int[] nums, int start) {
        int m = nums.length;
        int n = group.length;
        if (start + n > m) return false;
        for (int i = 0; i < n; i++) {
            if (group[i] != nums[start + i]) return false;
        }
        return true;
    }
}

