            }
        }
        return true;
    }
}

class Solution {
    public boolean[] canEat(int[] candiesCount, int[][] queries) {
        int n = candiesCount.length;
        long[] sum = new long[n];
        sum[0] = candiesCount[0];
        for (int i = 1; i < n; i++) {
            sum[i] = sum[i - 1] + candiesCount[i];
        }
        int m = queries.length;
        boolean[] ans = new boolean[m];
        for (int i = 0; i < m; i++) {
            int type = queries[i][0], day = queries[i][1], cap = queries[i][2];
            long x1 = day + 1, y1 = x1 * cap;
            long x2 = type == 0 ? 1 : sum[type - 1] + 1, y2 = sum[type];
            ans[i] = !(y1 < x2 || x1 > y2);
        }
        return ans;
    }
}

class Solution {
    public boolean checkPartitioning(String s) {
        int n = s.length();
        boolean[][] dp = new boolean[n][n];
        for (int i = n - 1; i >= 0; i--) {
            for (int j = i; j < n; j++) {
                dp[i][j] = s.charAt(i) == s.charAt(j) && (j - i <= 1 || dp[i + 1][j - 1]);
            }
        }
        for (int i = 1; i < n - 1; i++) {
            for (int j = i; j < n - 1; j++) {
                if (dp[0][i - 1] && dp[i][j] && dp[j + 1][n - 1]) {
                    return true;
                }
            }
        }
        return false;
    }
}

class Solution {
    public int[] restoreArray(int[][] adjacentPairs) {
        Map<Integer, List<Integer>> map = new HashMap<>();
        for (int[] pair : adjacentPairs) {
            map.putIfAbsent(pair[0], new ArrayList<>());
            map.putIfAbsent(pair[1], new ArrayList<>());
            map.get(pair[0]).add(pair[1]);
            map.get(pair[1]).add(pair[0]);
        }
        int n = adjacentPairs.length + 1;
        int[] ans = new int[n];
        for (Map.Entry<Integer, List<Integer>> entry : map.entrySet()) {
            int key = entry.getKey();
            List<Integer> value = entry.getValue();
            if (value.size() == 1) {
                ans[0] = key;
                ans[1] = value.get(0);
                break;
            }
        }
        for (int i = 2; i < n; i++) {
            List<Integer> list = map.get(ans[i - 1]);
            ans[i] = ans[i - 2] == list.get(0) ? list.get(1) : list.get(0);
        }
        return ans;
    }
}

class Solution {
    public int minimumBoxes(int n) {
        int level = 1;
        int sum = 0;
        while (sum + level * (level+1) / 2 <= n) {
            sum += level * (level+1) / 2;
            level++;
        }
        level--;
        int remaining = n - sum;
        int width = remaining / level;
        remaining -= width * level;
        int height = remaining;
        if (remaining == level - 1) {
            height++;
            remaining -= height;
            width += remaining / (height+1);
        }
        return level*(level+1)/2 + width*(height+1) + height;
    }
}

class Solution {
    public int kthLargestValue(int[][] matrix, int k) {
        int m = matrix.length, n = matrix[0].length;
        int[][] xorMatrix = new int[m+1][n+1];
        PriorityQueue<Integer> pq = new PriorityQueue<>();
        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                xorMatrix[i][j] = xorMatrix[i-1][j] ^ xorMatrix[i][j-1] ^ xorMatrix[i-1][j-1] ^ matrix[i-1][j-1];
                pq.offer(xorMatrix[i][j]);
                if (pq.size() > k) pq.poll();
            }
        }
        return pq.peek();
    }
}

class Solution {
    public int minCharacters(String a, String b) {
        int[] freqA = new int[26];
        int[] freqB = new int[26];
        int lenA = a.length();
        int lenB = b.length();
        int maxFreqA = 0, maxFreqB = 0;
        for (int i = 0; i < lenA; i++) {
            int idx = a.charAt(i) - 'a';
            freqA[idx]++;
            maxFreqA = Math.max(maxFreqA, freqA[idx]);
        }
        for (int i = 0; i < lenB; i++) {
            int idx = b.charAt(i) - 'a';
            freqB[idx]++;
            maxFreqB = Math.max(maxFreqB, freqB[idx]);
        }
        int ans = lenA + lenB - maxFreqA - maxFreqB;
        for (int i = 0; i < 25; i++) {
            freqA[i+1] += freqA[i];
            freqB[i+1] += freqB[i];
            ans = Math.min(ans, lenA - freqA[i] + freqB[i] + lenB - freqB[i] + freqA[i]);
            ans = Math.min(ans, lenB - freqB[i] + freqA[i] + lenA - freqA[i] + freqB[i]);
        }
        ans = Math.min(ans, lenA + lenB - freqA[25] - freqB[25]);
        return ans;
    }
}

