class Solution {
    public int maxValue(int[][] events, int k) {
        int n = events.length;
        Arrays.sort(events, (a, b) -> Integer.compare(a[0], b[0]));
        int[][] dp = new int[n + 1][k + 1];
        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= k; j++) {
                int include = events[i - 1][2];
                int start = 0;
                int end = i - 1;
                int prev = -1;
                while (start <= end) {
                    int mid = (start + end) / 2;
                    if (events[mid][1] < events[i - 1][0]) {
                        prev = mid;
                        start = mid + 1;
                    } else {
                        end = mid - 1;
                    }
                }
                if (prev != -1) {
                    include += dp[prev + 1][j - 1];
                }
                int exclude = dp[i - 1][j];
                dp[i][j] = Math.max(include, exclude);
            }
        }
        return dp[n][k];
    }
}

class Solution {
    public int minimumLength(String s) {
        int left = 0, right = s.length() - 1;
        while (left < right && s.charAt(left) == s.charAt(right)) {
            char ch = s.charAt(left);
            while (left <= right && s.charAt(left) == ch) left++;
            while (left <= right && s.charAt(right) == ch) right--;
        }
        return right - left + 1;
    }
}

class Solution {
    public int maxAbsoluteSum(int[] nums) {
        int maxSum = 0, minSum = 0, curMax = 0, curMin = 0;
        for (int num : nums) {
            curMax += num;
            curMin += num;
            maxSum = Math.max(maxSum, curMax);
            minSum = Math.min(minSum, curMin);
            curMax = Math.max(curMax, 0);
            curMin = Math.min(curMin, 0);
        }
        return Math.max(Math.abs(maxSum), Math.abs(minSum));
    }
}

