class Solution {
    public int minimumHammingDistance(int[] source, int[] target, int[][] allowedSwaps) {
        int n = source.length;
        int[] parent = new int[n];
        Arrays.fill(parent, -1);
        for(int[] swap : allowedSwaps) {
            union(swap[0], swap[1], parent);
        }
        Map<Integer, Map<Integer, Integer>> groups = new HashMap<>();
        for(int i = 0; i < n; i++) {
            int p = find(i, parent);
            groups.putIfAbsent(p, new HashMap<>());
            Map<Integer, Integer> counts = groups.get(p);
            counts.put(source[i], counts.getOrDefault(source[i], 0) + 1);
            counts.put(target[i], counts.getOrDefault(target[i], 0) - 1);
        }
        int ans = 0;
        for(Map.Entry<Integer, Map<Integer, Integer>> entry : groups.entrySet()) {
            Map<Integer, Integer> counts = entry.getValue();
            for(int v : counts.values()) {
                ans += Math.abs(v);
            }
        }
        return ans / 2;
    }
    
    public int find(int x, int[] parent) {
        if(parent[x] == -1) return x;
        return parent[x] = find(parent[x], parent);
    }
    
    public void union(int x, int y, int[] parent) {
        int px = find(x, parent);
        int py = find(y, parent);
        if(px != py) {
            parent[px] = py;
        }
    }
}

