class Solution {
    private static final int MOD = 1000000007;
    
    public int[] waysToFillArray(int[][] queries) {
        int n = queries.length;
        int[] ans = new int[n];
        for (int i = 0; i < n; i++) {
            int num = queries[i][0], target = queries[i][1];
            ans[i] = factorize(num, target);
        }
        return ans;
    }
    
    private static int factorize(int n, int k) {
        int count = 0;
        for (int i = 2; i * i <= k; i++) {
            if (k % i == 0) {
                int freq = 0;
                while (k % i == 0) {
                    freq++;
                    k /= i;
                }
                count = (count + choose(n+freq-1, freq)) % MOD;
            }
        }
        if (k > 1) {
            count = (count + n) % MOD;
        }
        return count;
    }
    
    private static int choose(int n, int k) {
        if (k == 0 || k == n) {
            return 1;
        }
        int[][] dp = new int[n+1][k+1];
        dp[0][0] = 1;
        for (int i = 1; i <= n; i++) {
            dp[i][0] = 1;
            for (int j = 1; j <= k; j++) {
                dp[i][j] = (dp[i-1][j] + dp[i-1][j-1]) % MOD;
            }
        }
        return dp[n][k];
    }
}

class Solution {
    public int[] decode(int[] encoded) {
        int n = encoded.length + 1;
        int[] perm = new int[n];
        int xor = 0;
        for (int i = 1; i <= n; i++) {
            xor ^= i;
        }
        for (int i = 1; i < n - 1; i += 2) {
            xor ^= encoded[i];
        }
        perm[0] = xor;
        for (int i = 1; i < n; i++) {
            perm[i] = perm[i - 1] ^ encoded[i - 1];
        }
        return perm;
    }
}

class Solution {
    public int minimumTeachings(int n, int[][] languages, int[][] friendships) {
        int m = languages.length;
        Set<Integer>[] langSet = new Set[m];
        for (int i = 0; i < m; i++) {
            langSet[i] = new HashSet<>();
            for (int lang : languages[i]) {
                langSet[i].add(lang);
            }
        }
        Set<Integer> cannotCommunicate = new HashSet<>();
        for (int[] f : friendships) {
            int u = f[0] - 1, v = f[1] - 1;
            boolean canCommunicate = false;
            for (int lang : languages[u]) {
                if (langSet[v].contains(lang)) {
                    canCommunicate = true;
                    break;
                }
            }
            if (!canCommunicate) {
                cannotCommunicate.add(u);
                cannotCommunicate.add(v);
            }
        }
        int[] langCount = new int[n + 1];
        for (int p : cannotCommunicate) {
            for (int lang : languages[p]) {
                langCount[lang]++;
            }
        }
        int mostCommonLang = 0;
        for (int i = 1; i <= n; i++) {
            if (langCount[i] > langCount[mostCommonLang]) {
                mostCommonLang = i;
            }
        }
        return cannotCommunicate.size() - langCount[mostCommonLang];
    }
}

