class Solution {
    public int minOperations(int[] target, int[] arr) {
        Map<Integer, Integer> map = new HashMap<>();
        for (int i = 0; i < target.length; i++) {
            map.put(target[i], i);
        }
        List<Integer> list = new ArrayList<>();
        for (int num : arr) {
            if (map.containsKey(num)) {
                list.add(map.get(num));
            }
        }
        int[] dp = new int[list.size()];
        int res = 0;
        for (int i = 0; i < dp.length; i++) {
            int index = Collections.binarySearch(dp, list.get(i));
            if (index < 0) {
                index = -index - 1;
                if (index == dp.length) {
                    res++;
                }
                dp[index] = list.get(i);
            }
        }
        return target.length - res;
    }
}

class Solution {
    private final int MOD = 1_000_000_007;
    public int waysToSplit(int[] nums) {
        int n = nums.length;
        int[] prefix = new int[n];
        prefix[0] = nums[0];
        for (int i = 1; i < n; i++) {
            prefix[i] = prefix[i-1] + nums[i];
        }
        int res = 0;
        for (int i = 1; i < n-1; i++) {
            int leftSum = prefix[i-1];
            int rightSum = prefix[n-1] - prefix[i-1];
            int l = findLeft(prefix, i, leftSum);
            int r = findRight(prefix, i, rightSum);
            if (l == -1 || r == -1) continue;
            res = (res + r - l + 1) % MOD;
        }
        return res;
    }
    
    private int findLeft(int[] prefix, int index, int leftSum) {
        int n = prefix.length;
        int low = index;
        int high = n-2;
        int res = -1;
        while (low <= high) {
            int mid = low + (high - low) / 2;
            int midSum = prefix[mid] - prefix[index-1];
            int rightSum = prefix[n-1] - prefix[mid];
            if (leftSum <= midSum && midSum <= rightSum) {
                res = mid;
                high = mid - 1;
            } else if (midSum < leftSum) {
                low = mid + 1;
            } else {
                high = mid - 1;
            }
        }
        return res;
    }
    
    private int findRight(int[] prefix, int index, int rightSum) {
        int n = prefix.length;
        int low = index;
        int high = n-2;
        int res = -1;
        while (low <= high) {
            int mid = low + (high - low) / 2;
            int midSum = prefix[mid] - prefix[index-1];
            int leftSum = prefix[mid-1];
            if (leftSum <= midSum && midSum <= rightSum) {
                res = mid;
                low = mid + 1;
            } else if (rightSum < midSum) {
                high = mid - 1;
            } else {
                low = mid + 1;
            }
        }
        return res;
    }
}

class Solution {
