class Solution {
    public int[] maximizeXor(int[] nums, int[][] queries) {
        int n = nums.length, q = queries.length;
        int[][] newQ = new int[q][3];
        for (int i = 0; i < q; i++) {
            newQ[i][0] = queries[i][0];
            newQ[i][1] = queries[i][1];
            newQ[i][2] = i;
        }
        Arrays.sort(nums);
        Arrays.sort(newQ, (a, b) -> a[1] - b[1]);
        int[] ans = new int[q];
        int idx = 0, max = 0;
        Trie trie = new Trie();
        for (int i = 0; i < q; i++) {
            int x = newQ[i][0], m = newQ[i][1], qi = newQ[i][2];
            while (idx < n && nums[idx] <= m) {
                trie.add(nums[idx]);
                idx++;
            }
            if (trie.root == null) {
                ans[qi] = -1;
                continue;
            }
            int res = 0;
            for (int j = 31; j >= 0; j--) {
                int bit = (x >> j) & 1;
                if (bit == 0) {
                    if (trie.child[1] != null) {
                        res |= 1 << j;
                        trie = trie.child[1];
                    } else {
                        trie = trie.child[0];
                    }
                } else {
                    if (trie.child[0] != null) {
                        res |= 1 << j;
                        trie = trie.child[0];
                    } else {
                        trie = trie.child[1];
                    }
                }
            }
            ans[qi] = res;
        }
        return ans;
    }
}

class Trie {
    Trie[] child;
    Trie root;
    Trie() {
        child = new Trie[2];
        root = this;
    }
    void add(int x) {
        Trie cur = root;
        for (int i = 31; i >= 0; i--) {
            int bit = (x >> i) & 1;
            if (cur.child[bit] == null) {
                cur.child[bit] = new Trie();
            }
            cur = cur.child[bit];
        }
    }
}

class Solution {
    public int minimumTimeRequired(int[] jobs, int k) {
        int[] workers = new int[k];
        Arrays.sort(jobs);
        reverse(jobs);
        dfs(jobs, workers, 0, 0);
        return ans;
    }
    
    int ans = Integer.MAX_VALUE;
    
    void dfs(int[] jobs, int[] workers, int i, int curMax) {
        if (curMax >= ans) return;
        if (i == jobs.length) {
            ans = curMax;
            return;
        }
        Set<Integer> set = new HashSet<>();
        for (int j = 0; j < workers.length; j++) {
            if (!set.add(workers[j])) continue;
            workers[j] += jobs[i];
            dfs(jobs, workers, i+1, Math.max(curMax, workers[j]));
            workers[j] -= jobs[i];
        }
    }
    
    void reverse(int[] arr) {
        int i = 0, j = arr.length-1;
        while (i < j) {
            int temp = arr[i];
            arr[i] = arr[j];
            arr[j] = temp;
            i++;
            j--;
        }
    }
}

class Solution {
    public int eatenApples(int[] apples, int[] days) {
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[1] - b[1]);
        int n = apples.length;
        int eaten = 0;
        for (int i = 0; i < n || !pq.isEmpty(); i++) {
            if (i < n && apples[i] > 0) {
                pq.offer(new int[] {apples[i], i + days[i]});
            }
            while (!pq.isEmpty() && (pq.peek()[1] <= i || pq.peek()[0] == 0)) {
                pq.poll();
            }
            if (!pq.isEmpty()) {
                pq.peek()[0]--;
                eaten++;
            }
        }
        return eaten;
    }
}

class Solution {
    public boolean halvesAreAlike(String s) {
        int mid = s.length() / 2;
        int count = 0;
        for (int i = 0; i < mid; i++) {
            if (isVowel(s.charAt(i))) {
                count++;
            }
        }
        for (int i = mid; i < s.length(); i++) {
            if (isVowel(s.charAt(i))) {
                count--;
            }
        }
        return count == 0;
    }
    
    private boolean isVowel(char c) {
        return c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u' || c == 'A' || c == 'E' || c == 'I' || c == 'O' || c == 'U';
    }
}

class Solution {
    public int checkWays(int[][] pairs) {
        int n = pairs.length;
        Map<Integer, Set<Integer>> map = new HashMap<>();
        for (int[] pair : pairs) {
            map.computeIfAbsent(pair[0], k -> new HashSet<>()).add(pair[1]);
            map.computeIfAbsent(pair[1], k -> new HashSet<>()).add(pair[0]);
        }
        List<Integer> list = new ArrayList<>(map.keySet());
        int count2 = 0, count1 = 0;
        for (int i = 0; i < list.size(); i++) {
            int x = list.get(i);
            int cnt = map.get(x).size();
            if (cnt >= 3) {
                return 0;
            } else if (cnt == 2) {
                count2++;
                int y = list.get((i + 1) % list.size());
                if (!map.get(x).contains(y) || !map.get(y).contains(x)) {
                    return 0;
                }
                int z = map.get(x).iterator().next();
                if (!map.get(y).contains(z)) {
                    return 0;
                }
                count1 += map.get(z).size() == 3 ? 2 : 1;
            }
        }
        if (count2 == 0) {
            return 1;
        } else if (count2 == 1) {
            return count1;
        } else {
            return 2 * count2 == list.size() ? 2 : 0;
        }
    }
}

class Solution {
    public int[] constructDistancedSequence(int n) {
        int[] ans = new int[n * 2 - 1];
        boolean[] used = new boolean[n + 1];
        backtrack(ans, used, 0);
        return ans;
    }
    
    private boolean backtrack(int[] ans, boolean[] used, int index) {
        if (index == ans.length) {
            return true;
        }
        if (ans[index] != 0) {
            return backtrack(ans, used, index + 1);
        }
        for (int i = used.length - 1; i >= 1; i--) {
            if (used[i]) {
                continue;
            }
            int nextIndex = index + i;
            if (i != 1 && (nextIndex >= ans.length || ans[nextIndex] != 0)) {
                continue;
            }
            ans[index] = i;
            used[i] = true;
            if (i != 1) {
                ans[nextIndex] = i;
            }
            if (backtrack(ans, used, index + 1)) {
                return true;
            }
            used[i] = false;
            ans[index] = 0;
            if (i != 1) {
                ans[nextIndex] = 0;
            }
        }
        return false;
    }
}

class Solution {
    public int maximumGain(String s, int x, int y) {
        int res = 0;
        int a = 0, b = 0;
        for (char ch : s.toCharArray()) {
            if (ch == 'a') {
                a++;
                if (b > 0) {
                    res += y;
                    b--;
                }
            } else if (ch == 'b') {
                b++;
                if (a > 0) {
                    res += x;
                    a--;
                }
            } else {
                res += Math.min(a, b) * Math.max(x, y);
                a = b = 0;
            }
        }
        res += Math.min(a, b) * Math.max(x, y);
        return res;
    }
}

class Solution {
    public int totalMoney(int n) {
        int weeks = n / 7;
        int days = n % 7;
        int sum = 0;
        for (int i = 1; i <= weeks; i++) {
            int start = (i - 1) * 7 + 1;
            int end = start + 6;
            sum += (start + end) * 7 / 2;
        }
        int start = weeks * 7 + 1;
        for (int i = 0; i < days; i++) {
            sum += start + i;
        }
        return sum;
    }
}

class Solution {
    public List<Boolean> distanceLimitedPathsExist(int n, int[][] edgeList, int[][] queries) {
        UnionFind uf = new UnionFind(n);
        List<int[]> newQueries = new ArrayList<>();
        for (int i = 0; i < queries.length; i++) {
            newQueries.add(new int[]{queries[i][2], queries[i][0], queries[i][1], i});
        }
        Arrays.sort(edgeList, (a,b) -> a[2] - b[2]);
        Collections.sort(newQueries, (a,b) -> a[0] - b[0]);
        List<Boolean> res = new ArrayList<>();
        int j = 0;
        for (int[] q : newQueries) {
            int limit = q[0], start = q[1], end = q[2], index = q[3];
            while (j < edgeList.length && edgeList[j][2] < limit) {
                uf.union(edgeList[j][0], edgeList[j][1]);
                j++;
            }
            res.add(uf.find(start) == uf.find(end));
        }
        return res;
    }
    
    class UnionFind {
        int[] parent;
        
        public UnionFind(int n) {
            parent = new int[n];
            for (int i = 0; i < n; i++) {
                parent[i] = i;
            }
        }
        
        public int find(int x) {
            if (x != parent[x]) {
                parent[x] = find(parent[x]);
            }
            return parent[x];
        }
        
        public void union(int x, int y) {
            int px = find(x), py = find(y);
            if (px != py) {
                parent[px] = py;
            }
        }
    }
}

class Solution {
    public int maxResult(int[] nums, int k) {
        int n = nums.length;
        int[] dp = new int[n];
        dp[0] = nums[0];
        Deque<Integer> dq = new LinkedList<>();
        dq.offerLast(0);
        for (int i = 1; i < n; i++) {
            while (dq.peekFirst() < i - k) dq.pollFirst();
            dp[i] = nums[i] + dp[dq.peekFirst()];
            while (!dq.isEmpty() && dp[i] >= dp[dq.peekLast()]) dq.pollLast();
            dq.offerLast(i);
        }
        return dp[n-1];
    }
}

class Solution {
    public int maximumUniqueSubarray(int[] nums) {
        int[] freq = new int[10001];
        int left = 0, right = 0, sum = 0, maxSum = 0;
        while (right < nums.length) {
            if (freq[nums[right]] == 0) {
                freq[nums[right]]++;
                sum += nums[right];
                right++;
                maxSum = Math.max(maxSum, sum);
            } else {
                freq[nums[left]]--;
                sum -= nums[left];
                left++;
            }
        }
        return maxSum;
    }
}

class Solution {
    public String reformatNumber(String number) {
        StringBuilder sb = new StringBuilder();
        for (char c : number.toCharArray()) {
            if (c >= '0' && c <= '9') {
                sb.append(c);
            }
        }
        int n = sb.length();
        int i = 0;
        StringBuilder res = new StringBuilder();
        while (i < n - 4) {
            res.append(sb.substring(i, i + 3)).append("-");
            i += 3;
        }
        if (n - i == 4) {
            res.append(sb.substring(i, i + 2)).append("-").append(sb.substring(i + 2, i + 4));
        } else {
            res.append(sb.substring(i));
        }
        return res.toString();
    }
}

