class Solution {
    public int minMoves(int[] nums, int k) {
        List<Integer> idx = new ArrayList<>();
        for (int i = 0; i < nums.length; i++) {
            if (nums[i] == 1) {
                idx.add(i - idx.size());
            }
        }
        int n = idx.size();
        int[][] pre = new int[n + 1][n + 1];
        for (int i = 0; i < n; i++) {
            int sum = 0, cnt = 0;
            for (int j = i; j < n; j++) {
                pre[i][j] = sum;
                sum += idx.get(j);
                cnt += 1;
                if (cnt > k / 2) {
                    sum -= idx.get(i + cnt - k - 1);
                    cnt -= 1;
                }
            }
        }
        int[][] dp = new int[n + 1][n + 1];
        for (int len = 2; len <= n; len += 2) {
            for (int i = 0; i + len <= n; i++) {
                int j = i + len - 1;
                int mid = (i + j) / 2;
                dp[i][j] = Integer.MAX_VALUE;
                for (int p = i; p <= mid; p++) {
                    int q = Math.min(mid + 1 + mid - p, j);
                    if (k % 2 == 0) {
                        if (p + k / 2 - 1 < q) {
                            dp[i][j] = Math.min(dp[i][j], pre[p][q - 1] - pre[i][p] - pre[q][j]);
                        }
                    } else {
                        if (p + k / 2 < q) {
                            dp[i][j] = Math.min(dp[i][j], pre[p][q - 1] - pre[i][p] - pre[q][j] - idx.get(mid));
                        }
                    }
                }
            }
        }
        return dp[0][n - 1];
    }
}

class Solution {
    public String maximumBinaryString(String binary) {
        int n = binary.length();
        int ones = 0, zeros = 0, idx = 0;
        for (int i = 0; i < n; i++) {
            if (binary.charAt(i) == '0') {
                zeros++;
                if (ones > 0) {
                    ones--;
                    idx++;
                }
            } else {
                ones++;
            }
        }
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < zeros; i++) {
            sb.append('1');
        }
        if (idx < zeros) {
            sb.setCharAt(zeros - idx - 1, '0');
        }
        for (int i = 0; i < ones; i++) {
            sb.append('1');
        }
        return sb.toString();
    }
}

class Solution {
    public double averageWaitingTime(int[][] customers) {
        int n = customers.length;
        int currTime = 0;
        long waitTime = 0;
        for (int i = 0; i < n; i++) {
            int[] customer = customers[i];
            int arrivalTime = customer[0];
            int prepareTime = customer[1];
            currTime = Math.max(currTime, arrivalTime);
            currTime += prepareTime;
            waitTime += currTime - arrivalTime;
        }
        return (double) waitTime / n;
    }
}

