class Solution {
    public int minimumIncompatibility(int[] nums, int k) {
        int n = nums.length, groupSize = n / k;
        int[] freq = new int[17];
        for (int num : nums) freq[num]++;
        for (int i = 1; i <= 16; i++) {
            if (freq[i] > k) return -1;
        }
        int[][] subsets = new int[k][groupSize];
        int subsetIndex = 0;
        for (int i = 1; i <= 16; i++) {
            if (freq[i] == 0) continue;
            for (int j = 0; j < freq[i] / groupSize; j++) {
                for (int l = 0; l < groupSize; l++) {
                    subsets[subsetIndex++][l] = i;
                }
            }
        }
        int ans = solve(subsets);
        while (nextPermutation(subsets)) {
            ans = Math.min(ans, solve(subsets));
        }
        return ans;
    }
    private int solve(int[][] subsets) {
        int k = subsets.length, groupSize = subsets[0].length;
        int[] max = new int[k], min = new int[k];
        for (int i = 0; i < k; i++) {
            Arrays.sort(subsets[i]);
            max[i] = subsets[i][groupSize - 1];
            min[i] = subsets[i][0];
        }
        int[] dp = new int[1 << k];
        Arrays.fill(dp, Integer.MAX_VALUE / 2);
        dp[0] = 0;
        for (int mask = 0; mask < (1 << k); mask++) {
            if (Integer.bitCount(mask) * groupSize > 16) continue;
            for (int j = 0; j < k; j++) {
                if ((mask & (1 << j)) != 0) continue;
                for (int i = mask; i >= 0; i--) {
                    if (Integer.bitCount(i) * groupSize > 16 - Integer.bitCount(mask)) continue;
                    dp[mask | (1 << j)] = Math.min(dp[mask | (1 << j)], dp[i] + max[j] - min[j]);
                }
                break;
            }
        }
        return dp[(1 << k) - 1];
    }
    private boolean nextPermutation(int[][] subsets) {
        int k = subsets.length, groupSize = subsets[0].length;
        for (int i = k - 2; i >= 0; i--) {
            if (compare(subsets[i], subsets[i + 1]) < 0) {
                for (int j = k - 1; j > i; j--) {
                    if (compare(subsets[i], subsets[j]) < 0) {
                        swap(subsets, i, j);
                        reverse(subsets, i + 1, k - 1);
                        return true;
                    }
                }
            }
        }
        return false;
    }
    private int compare(int[] a, int[] b) {
        for (int i = 0; i < a.length; i++) {
            if (a[i] != b[i]) return a[i] - b[i];
        }
        return 0;
    }
    private void swap(int[][] subsets, int i, int j) {
        int[] temp = subsets[i];
        subsets[i] = subsets[j];
        subsets[j] = temp;
    }
    private void reverse(int[][] subsets, int i, int j) {
        while (i < j) {
            swap(subsets, i++, j--);
        }
    }
}

class Solution {
    public int maxOperations(int[] nums, int k) {
        Map<Integer, Integer> map = new HashMap<>();
        int count = 0;
        for (int num : nums) {
            if (map.containsKey(k - num) && map.get(k - num) > 0) {
                count++;
                map.put(k - num, map.get(k - num) - 1);
            } else {
                map.put(num, map.getOrDefault(num, 0) + 1);
            }
        }
        return count;
    }
}

