class Solution {
    public int minimumDeviation(int[] nums) {
        PriorityQueue<Integer> pq = new PriorityQueue<>(Collections.reverseOrder());
        for (int num : nums) {
            if (num % 2 == 0) pq.offer(num);
            else pq.offer(num * 2);
        }
        int deviation = Integer.MAX_VALUE;
        while (true) {
            int max = pq.poll();
            deviation = Math.min(deviation, max - pq.peek());
            if (max % 2 == 0) {
                pq.offer(max / 2);
            } else break;
        }
        return deviation;
    }
}

class Solution {
    public int minMoves(int[] nums, int limit) {
        int[] delta = new int[2 * limit + 2];
        int n = nums.length, res = n, cur = 0;
        for (int i = 0; i < n / 2; i++) {
            int a = nums[i], b = nums[n - i - 1];
            delta[2] += 2;
            delta[Math.min(a, b) + 1]--;
            delta[a + b]--;
            delta[a + b + 1]++;
            delta[Math.max(a, b) + limit + 1]++;
        }
        for (int i = 2; i <= 2 * limit; i++) {
            cur += delta[i];
            res = Math.min(res, cur);
        }
        return res;
    }
}

class Solution {
    public int[] mostCompetitive(int[] nums, int k) {
        int n = nums.length;
        int[] stack = new int[k];
        int top = -1;
        for (int i = 0; i < n; i++) {
            while (top >= 0 && nums[i] < stack[top] && n - i > k - top) {
                top--;
            }
            if (top < k - 1) {
                stack[++top] = nums[i];
            }
        }
        return stack;
    }
}

