class Solution {
    public int boxDelivering(int[][] boxes, int portsCount, int maxBoxes, int maxWeight) {
        int n = boxes.length;
        int[] dp = new int[n + 1];
        int tripCount = 0;
        int curWeight = 0;
        int prevPort = 0;
        int pickedCount = 0;
        
        for (int i = 0, j = 0; i < n; i++) {
            while (j < n && (pickedCount < maxBoxes && curWeight + boxes[j][1] <= maxWeight)) {
                curWeight += boxes[j][1];
                pickedCount++;
                if (j == 0 || boxes[j][0] != boxes[j-1][0]) {
                    tripCount++;
                    prevPort = boxes[j][0];
                }
                j++;
            }
            
            dp[j] = Math.min(dp[j], dp[i] + tripCount + 1);
            
            if (j < n) {
                curWeight -= boxes[i][1];
                pickedCount--;
                if (boxes[i][0] != boxes[i+1][0]) {
                    tripCount--;
                }
            }
        }
        
        return dp[n];
    }
}

class Solution {
    public int stoneGameVI(int[] aliceValues, int[] bobValues) {
        int n = aliceValues.length;
        int[][] values = new int[n][3];
        for (int i = 0; i < n; i++) {
            values[i][0] = aliceValues[i];
            values[i][1] = bobValues[i];
            values[i][2] = aliceValues[i] + bobValues[i];
        }
        Arrays.sort(values, (a, b) -> Integer.compare(b[2], a[2]));
        int aliceScore = 0, bobScore = 0;
        for (int i = 0; i < n; i++) {
            int[] stone = values[i];
            if (i % 2 == 0) {
                aliceScore += stone[0];
            } else {
                bobScore += stone[1];
            }
        }
        if (aliceScore > bobScore) {
            return 1;
        } else if (bobScore > aliceScore) {
            return -1;
        } else {
            return 0;
        }
    }
}

class Solution {
    public int[] getSumAbsoluteDifferences(int[] nums) {
        int n = nums.length, sum = 0, prefixSum = 0;
        int[] result = new int[n];
        for (int num : nums) sum += num;
        for (int i = 0; i < n; i++) {
            int suffixSum = sum - prefixSum - nums[i];
            result[i] = (i*nums[i]-prefixSum) + (suffixSum - (n-i-1)*nums[i]);
            prefixSum += nums[i];
        }
        return result;
    }
}

