class Solution {
    public int waysToMakeFair(int[] nums) {
        int n = nums.length;
        int[] prefixOddSum = new int[n+1];
        int[] prefixEvenSum = new int[n+1];
        for (int i = 1; i <= n; i++) {
            prefixOddSum[i] = prefixOddSum[i-1];
            prefixEvenSum[i] = prefixEvenSum[i-1];
            if (i % 2 == 0) prefixEvenSum[i] += nums[i-1];
            else prefixOddSum[i] += nums[i-1];
        }
        int count = 0;
        for (int i = 0; i < n; i++) {
            int oddSum = prefixOddSum[i] + prefixEvenSum[n] - prefixEvenSum[i+1];
            int evenSum  = prefixEvenSum[i] + prefixOddSum[n] - prefixOddSum[i+1];
            if (oddSum == evenSum) count++;
        }
        return count;
    }
}

