class Solution {
    public int getMaxGridHappiness(int m, int n, int introvertsCount, int extrovertsCount) {
        int[][][] dp = new int[m * n + 1][introvertsCount + 1][extrovertsCount + 1];
        for (int i = 1; i <= m * n; i++) {
            int r = (i - 1) / n, c = (i - 1) % n;
            for (int j = 0; j <= introvertsCount; j++) {
                for (int k = 0; k <= extrovertsCount; k++) {
                    int pre = i - 1;
                    int pi = j - 1, pe = k - 1;
                    if (r == 0 && c == 0) {
                        dp[i][j][k] = 0;
                        continue;
                    }
                    if (pi < 0 && pe < 0) {
                        dp[i][j][k] = dp[pre][j][k];
                    } else {
                        int[] nei = new int[]{-1, 0, 1, 0, -1};
                        int delta = 0;
                        if (pi >= 0) {
                            delta -= 30;
                            for (int d = 0; d < 4; d++) {
                                int nr = r + nei[d], nc = c + nei[d + 1];
                                if (nr >= 0 && nr < m && nc >= 0 && nc < n) {
                                    delta += dp[pre][pi][pe] - dp[nr * n + nc + 1][pi][pe];
                                }
                            }
                            delta += 120;
                        } else {
                            delta += 20;
                            for (int d = 0; d < 4; d++) {
                                int nr = r + nei[d], nc = c + nei[d + 1];
                                if (nr >= 0 && nr < m && nc >= 0 && nc < n) {
                                    delta += dp[pre][pi][pe] - dp[nr * n + nc + 1][pi][pe];
                                }
                            }
                            delta += 40;
                        }
                        if (pe >= 0) {
                            delta += 20;
                            for (int d = 0; d < 4; d++) {
                                int nr = r + nei[d], nc = c + nei[d + 1];
                                if (nr >= 0 && nr < m && nc >= 0 && nc < n) {
                                    delta += dp[pre][j][pe] - dp[nr * n + nc + 1][j][pe];
                                }
                            }
                            delta -= 30;
                        } else {
                            delta += 120;
                            for (int d = 0; d < 4; d++) {
                                int nr = r + nei[d], nc = c + nei[d + 1];
                                if (nr >= 0 && nr < m && nc >= 0 && nc < n) {
                                    delta += dp[pre][j][pe] - dp[nr * n + nc + 1][j][pe];
                                }
                            }
                            delta += 40;
                        }
                        dp[i][j][k] = Math.max(delta + dp[pre][j][k], dp[pre][j][k]);
                    }
                }
            }
        }
        return dp[m * n][introvertsCount][extrovertsCount];
    }
}

class Solution {
    public boolean closeStrings(String word1, String word2) {
