class Solution {
    public int createSortedArray(int[] instructions) {
        int mod = (int)1e9 + 7;
        int n = instructions.length;
        int[] arr = new int[n];
        int ans = 0;
        for (int i = 0; i < n; i++) {
            int left = find(0, i, arr, instructions[i]);
            int right = i - left - get(0, i, arr, instructions[i]) - 1;
            ans = (ans + Math.min(left, right)) % mod;
            insert(0, i, arr, instructions[i]);
        }
        return ans;
    }
    private void insert(int l, int r, int[] arr, int x) {
        arr[r] = x;
        while (l < r) {
            int mid = l + r >> 1;
            if (arr[mid] == x) {
                r = mid;
            } else if (arr[mid] < x) {
                l = mid + 1;
            } else {
                r = mid;
            }
        }
        for (int i = r; i >= 1; i--) {
            arr[i] = arr[i - 1];
        }
        arr[0] = x;
    }
    private int find(int l, int r, int[] arr, int x) {
        while (l < r) {
            int mid = l + r >> 1;
            if (arr[mid] < x) {
                l = mid + 1;
            } else {
                r = mid;
            }
        }
        return l;
    }
    private int get(int l, int r, int[] arr, int x) {
        int res = 0;
        for (int i = l; i <= r; i++) {
            if (arr[i] > x) {
                res++;
            }
        }
        return res;
    }
}

class Solution {
    public int maxProfit(int[] inventory, int orders) {
        int MOD = 1000000007;
        Arrays.sort(inventory);
        int n = inventory.length;
        long ans = 0, h = 1;
        for (int i = n - 1; i >= 0 && orders > 0; i--, h++) {
            int cur = inventory[i], prev = i > 0 ? inventory[i-1] : 0;
            long sell = Math.min(orders / h, cur - prev);
            long left = orders / h - sell;
            long a = cur * sell - (sell * (sell - 1)) / 2 * h;
            long b = prev * left + (left * (left + 1)) / 2 * h;
            ans = (ans + (a + b) % MOD) % MOD;
            orders -= sell * h;
        }
        if (orders > 0) {
            long a = inventory[0] * orders;
            ans = (ans + a) % MOD;
        }
        return (int) ans;
    }
}

