        for (int i = 0; i < a; i++) {
            prevA = curr;
            curr = curr.next;
        }
        ListNode prevB = curr;
        for (int i = a; i <= b; i++) {
            prevB = curr.next;
            curr = curr.next;
        }
        prevA.next = list2;
        while (list2.next != null) {
            list2 = list2.next;
        }
        list2.next = prevB;
        return dummy.next;
    }
}

