class Solution {
    public boolean canDistribute(int[] nums, int[] quantity) {
        Map<Integer, Integer> freq = new HashMap<>();
        for (int num : nums) freq.put(num, freq.getOrDefault(num, 0) + 1);
        int[] values = new int[freq.size()];
        int[] counts = new int[freq.size()];
        int idx = 0;
        for (int key : freq.keySet()) {
            values[idx] = key;
            counts[idx] = freq.get(key);
            idx++;
        }
        return dfs(values, counts, quantity, 0);
    }
    
    private boolean dfs(int[] values, int[] counts, int[] quantity, int idx) {
        if (idx == quantity.length) return true;
        Arrays.sort(counts);
        for (int i = counts.length - 1; i >= 0; i--) {
            if (counts[i] < quantity[idx]) break;
            counts[i] -= quantity[idx];
            if (dfs(values, counts, quantity, idx + 1)) return true;
            counts[i] += quantity[idx];
        }
        return false;
    }
}

class Solution {
    public int minimumJumps(int[] forbidden, int a, int b, int x) {
        Set<Integer> f = new HashSet<>();
        for(int pos: forbidden) f.add(pos);

        Queue<int[]> q = new LinkedList<>();
        q.offer(new int[]{0,0});

        Set<String> visited = new HashSet<>();
        visited.add("0_0");

        while(!q.isEmpty()){
            int[] curr = q.poll();
            int pos = curr[0], steps = curr[1];

            if(pos == x) return steps;

            int forward = pos + a;
            if(forward <= 2000 && !f.contains(forward) && !visited.contains(forward + "_" + 0)){
                q.offer(new int[]{forward, steps + 1});
                visited.add(forward + "_" + 0);
            }

            int backward = pos - b;
            if(backward > 0 && !f.contains(backward) && !visited.contains(backward + "_" + 1)){
                q.offer(new int[]{backward, steps + 1});
                visited.add(backward + "_" + 1);
            }
        }

        return -1;
    }
}

class Solution {
    public int minimumDeletions(String s) {
        int n = s.length();
        int[] dp = new int[n+1];
        int countA = 0;
        for (int i = 0; i < n; i++) {
            if (s.charAt(i) == 'a') {
                countA++;
            }
            dp[i+1] = Math.min(dp[i]+1, countA);
        }
        int result = dp[n];
        int countB = 0;
        for (int i = n-1; i >= 0; i--) {
            if (s.charAt(i) == 'b') {
                countB++;
            }
            result = Math.min(result, dp[i]+countB);
        }
        return result;
    }
}

class Solution {
    public int[] decrypt(int[] code, int k) {
        int n = code.length;
        int[] res = new int[n];
        if (k == 0) return res;
        for (int i = 0; i < n; i++) {
            int sum = 0;
            if (k > 0) {
                for (int j = 1; j <= k; j++) {
                    sum += code[(i+j)%n];
                }
            } else {
                for (int j = -1; j >= k; j--) {
                    sum += code[(i+j+n)%n];
                }
            }
            res[i] = sum;
        }
        return res;
    }
}

class Solution {
    public int minimumEffortPath(int[][] heights) {
        int m = heights.length, n = heights[0].length;
        int[][] directions = new int[][]{{0,1},{1,0},{0,-1},{-1,0}};
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[2]-b[2]);
        int[][] efforts = new int[m][n];
        for (int[] e : efforts) Arrays.fill(e, Integer.MAX_VALUE);
        pq.offer(new int[]{0, 0, 0});
        while (!pq.isEmpty()) {
            int[] e = pq.poll();
            int r = e[0], c = e[1], effort = e[2];
            if (r == m-1 && c == n-1) return effort;
            if (effort >= efforts[r][c]) continue;
            efforts[r][c] = effort;
            for (int[] d : directions) {
                int nr = r + d[0], nc = c + d[1];
                if (nr >= 0 && nr < m && nc >= 0 && nc < n) {
                    int newEffort = Math.max(effort, Math.abs(heights[nr][nc] - heights[r][c]));
                    pq.offer(new int[]{nr, nc, newEffort});
                }
            }
        }
        return -1;
    }
}

