class Solution {
    public int bestTeamScore(int[] scores, int[] ages) {
        int n = scores.length;
        int[][] players = new int[n][2];
        for (int i = 0; i < n; i++) {
            players[i][0] = ages[i];
            players[i][1] = scores[i];
        }
        Arrays.sort(players, (a, b) -> a[0] == b[0] ? a[1] - b[1] : a[0] - b[0]);
        int[] dp = new int[n];
        for (int i = 0; i < n; i++) {
            dp[i] = players[i][1];
            for (int j = 0; j < i; j++) {
                if (players[j][1] <= players[i][1]) {
                    dp[i] = Math.max(dp[i], dp[j] + players[i][1]);
                }
            }
        }
        int maxScore = 0;
        for (int score : dp) {
            maxScore = Math.max(maxScore, score);
        }
        return maxScore;
    }
}

class Solution {
    public String findLexSmallestString(String s, int a, int b) {
        Set<String> seen = new HashSet<>();
        PriorityQueue<String> pq = new PriorityQueue<>();
        pq.offer(s);
        seen.add(s);
        while (!pq.isEmpty()) {
            String curr = pq.poll();
            String op1 = add(curr, a);
            String op2 = rotate(curr, b);
            if (seen.add(op1)) pq.offer(op1);
            if (seen.add(op2)) pq.offer(op2);
        }
        return Collections.min(seen);
    }
    
    private String add(String s, int a) {
        char[] arr = s.toCharArray();
        for (int i = 1; i < s.length(); i += 2) {
            arr[i] = (char) ((arr[i] - '0' + a) % 10 + '0');
        }
        return new String(arr);
    }
    
    private String rotate(String s, int b) {
        int n = s.length();
        b %= n;
        String s1 = s.substring(0, n - b);
        String s2 = s.substring(n - b);
        return s2 + s1;
    }
}

