class Solution {
    private static final int MOD = 1000000007;
    public int numWays(String[] words, String target) {
        int m = words[0].length(), n = target.length();
        long[][] dp = new long[m + 1][n + 1];
        for (int i = 0; i <= m; i++) dp[i][n] = 1;
        for (int j = n - 1; j >= 0; j--) {
            for (int i = m - 1; i >= j; i--) {
                long sum = 0;
                for (String word : words) {
                    sum += word.charAt(i) == target.charAt(j) ? dp[i + 1][j + 1] : 0;
                }
                dp[i][j] = sum % MOD;
            }
        }
        return (int)dp[0][0];
    }
}

class Solution {
    public int countSubstrings(String s, String t) {
        int res = 0;
        for (int i = 0; i < s.length(); i++) {
            for (int j = i; j < s.length(); j++) {
                String subS = s.substring(i, j + 1);
                for (int k = 0; k <= t.length() - subS.length(); k++) {
                    String subT = t.substring(k, k + subS.length());
                    int diffCount = 0;
                    for (int p = 0; p < subS.length(); p++) {
                        if (subS.charAt(p) != subT.charAt(p)) {
                            diffCount++;
                        }
                        if (diffCount > 1) break;
                    }
                    if (diffCount == 1) res++;
                }
            }
        }
        return res;
    }
}

