class Solution {
    public int visiblePoints(List<List<Integer>> points, int angle, List<Integer> location) {
        int n = points.size();
        double[] angles = new double[2*n];
        int j = 0, origin = 0;
        for(int i = 0; i < n; i++) {
            int x = points.get(i).get(0) - location.get(0);
            int y = points.get(i).get(1) - location.get(1);
            if(x == 0 && y == 0) {
                origin++;
                continue;
            }
            double a = Math.atan2(y,x) * (180/Math.PI);
            if(a < 0) a += 360;
            angles[j++] = a;
            angles[j++] = a + 360;
        }
        Arrays.sort(angles, 0, j);
        int ans = 0, left = 0;
        angle = (int) (angle * 2);
        for(int right = 0; right < j; right++) {
            while(angles[right] - angles[left] > angle) left++;
            ans = Math.max(ans, right - left + 1);
        }
        return ans + origin;
    }
}

