    public int specialArray(int[] nums) {
        Arrays.sort(nums);
        for (int i = 0; i <= nums.length; i++) {
            int count = 0;
            for (int j = nums.length-1; j >= 0 && nums[j] >= i; j--) {
                count++;
            }
            if (count == i) {
                return i;
            }
        }
        return -1;
    }
}

