class Solution {
    public boolean canMouseWin(String[] grid, int catJump, int mouseJump) {
        int rows = grid.length, cols = grid[0].length();
        int catPos = -1, mousePos = -1, foodPos = -1;
        for (int i = 0; i < rows; i++) {
            for (int j = 0; j < cols; j++) {
                char c = grid[i].charAt(j);
                if (c == 'C') catPos = i*cols + j;
                else if (c == 'M') mousePos = i*cols + j;
                else if (c == 'F') foodPos = i*cols + j;
            }
        }
        int[] dirs = {-1, 0, 1, 0, -1};
        Queue<State> queue = new LinkedList<>();
        Map<State, Boolean> memo = new HashMap<>();
        State initState = new State(mousePos, catPos, true);
        memo.put(initState, true);
        queue.offer(initState);
        for (int turn = 0; turn <= 200*rows*cols; turn++) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                State state = queue.poll();
                if (state.mouse == foodPos) return true;
                for (int d = 0; d < 4; d++) {
                    int nMouse = jump(state.mouse, dirs[d], dirs[d+1], mouseJump, rows, cols, grid);
                    if (nMouse == -1) continue;
                    boolean catTurn = state.cat == nMouse || !state.catTurn;
                    State nextState = new State(nMouse, state.cat, !catTurn);
                    if (memo.containsKey(nextState)) continue;
                    memo.put(nextState, true);
                    queue.offer(nextState);
                }
                if (state.cat == foodPos) continue;
                for (int d = 0; d < 4; d++) {
                    int nCat = jump(state.cat, dirs[d], dirs[d+1], catJump, rows, cols, grid);
                    if (nCat == -1) continue;
                    boolean catTurn = !state.catTurn;
                    for (int subDir = 0; subDir < 4; subDir++) {
                        int nMouse = jump(state.mouse, dirs[subDir], dirs[subDir+1], mouseJump, rows, cols, grid);
                        if (nMouse == -1) continue;
                        if (nMouse == nCat) continue;
                        State nextState = new State(nMouse, nCat, catTurn);
                        if (memo.containsKey(nextState)) continue;
                        memo.put(nextState, true);
                        queue.offer(nextState);
                    }
                }
            }
        }
        return false;
    }
    
    private int jump(int pos, int dx, int dy, int maxDist, int rows, int cols, String[] grid) {
        int x = pos / cols, y = pos % cols;
        for (int dist = 1; dist <= maxDist; dist++) {
            int nx = x + dist*dx, ny = y + dist*dy;
            if (nx < 0 || nx >= rows || ny < 0 || ny >= cols || grid[nx].charAt(ny) == '#') break;
            if (nx*cols + ny == pos) continue;
            return nx * cols + ny;
        }
        return -1;
    }
    
    class State {
        int mouse, cat;
        boolean catTurn;
        public State(int m, int c, boolean t) {
            mouse = m;
            cat = c;
            catTurn = t;
        }
        public int hashCode() {
            return Objects.hash(mouse, cat, catTurn);
        }
        public boolean equals(Object o) {
            State other = (State) o;
            return mouse == other.mouse && cat == other.cat && catTurn == other.catTurn;
        }
    }
}

class Solution {
    public int[] bestCoordinate(int[][] towers, int radius) {
        int n = towers.length;
        int[] res = {-1, -1};
        int maxQ = -1;
        for(int i = 0; i < n; i++){
            int x1 = towers[i][0], y1 = towers[i][1], q1 = towers[i][2];
            int q = 0;
            for(int j = 0; j < n; j++){
                int x2 = towers[j][0], y2 = towers[j][1], q2 = towers[j][2];
                double dist = Math.sqrt(Math.pow(x1 - x2, 2) + Math.pow(y1 - y2, 2));
                if(dist <= radius){
                    q += (int) (q2 / (1 + dist));
                }
            }
            if(q > maxQ){
                maxQ = q;
                res = new int[]{x1, y1};
            }else if(q == maxQ && (x1 < res[0] || (x1 == res[0] && y1 < res[1]))){
                res = new int[]{x1, y1};
            }
        }
        return res;
    }
}

class Solution {
    private static final int MOD = 1000000007;
    public int numberOfSets(int n, int k) {
        int[][] dp = new int[k+1][n];
        for (int i = 0; i < n; i++) {
            dp[0][i] = 1;
        }
        for (int i = 1; i <= k; i++) {
            for (int j = i; j < n; j++) {
                dp[i][j] = (dp[i][j-1] + dp[i-1][j-1]) % MOD;
                dp[i][j] = (dp[i][j] + dp[i][j-1]) % MOD;
            }
        }
        return dp[k][n-1];
    }
}

class Solution {
    public int maximumRequests(int n, int[][] requests) {
        int[] degree = new int[n];
        int m = requests.length;
        int res = 0;
        for(int i=0; i<(1<<m); i++){
            Arrays.fill(degree, 0);
            int count = 0;
            for(int j=0; j<m; j++){
                if(((i>>j)&1)!=0){
                    count++;
                    degree[requests[j][0]]--;
                    degree[requests[j][1]]++;
                }
            }
            boolean valid = true;
            for(int d: degree){
                if(d!=0){
                    valid = false;
                    break;
                }
            }
            res = valid ? Math.max(res, count) : res;
        }
        return res;
    }
}

class ThroneInheritance {
    
    Map<String, List<String>> graph;
    Set<String> dead;
    String king;

    public ThroneInheritance(String kingName) {
        graph = new HashMap<>();
        dead = new HashSet<>();
        king = kingName;
    }
    
    public void birth(String parentName, String childName) {
        graph.putIfAbsent(parentName, new ArrayList<>());
        graph.get(parentName).add(childName);
    }
    
    public void death(String name) {
        dead.add(name);
    }
    
    public List<String> getInheritanceOrder() {
        List<String> order = new ArrayList<>();
        dfs(king, order);
        return order;
    }
    
    private void dfs(String name, List<String> order) {
        if (!dead.contains(name)) {
            order.add(name);
        }
        List<String> children = graph.getOrDefault(name, new ArrayList<>());
        for (String child : children) {
            dfs(child, order);
        }
    }
}

class Solution {
    public int minOperationsMaxProfit(int[] customers, int boardingCost, int runningCost) {
        int waiting = 0, boarded = 0, rotation = 0, maxProfit = 0, currProfit = 0;
        while (waiting > 0 || boarded < customers.length) {
            if (boarded < customers.length) {
                waiting += customers[boarded++];
            }
            int boardedThisRotation = Math.min(waiting, 4);
            waiting -= boardedThisRotation;
            currProfit += boardedThisRotation * boardingCost - runningCost;
            if (currProfit > maxProfit) {
                maxProfit = currProfit;
                rotation = boarded - 1;
            }
        }
        return maxProfit == 0 ? -1 : rotation + 1;
    }
}

