class Solution {
    public int connectTwoGroups(List<List<Integer>> cost) {
        int n = cost.size(), m = cost.get(0).size();
        int[][] dp = new int[n + 1][1 << m];
        for (int[] d : dp) Arrays.fill(d, -1);
        
        int[] mask = new int[m];
        for (int j = 0; j < m; j++) {
            int bit = 0;
            for (int i = 0; i < n; i++) {
                bit = 2 * bit + (cost.get(i).get(j) == 0 ? 0 : 1);
            }
            mask[j] = bit;
        }
        return dfs(0, mask, cost, dp);
    }
    
    int dfs(int i, int[] mask, List<List<Integer>> cost, int[][] dp) {
        int n = cost.size(), m = cost.get(0).size();
        if (i == n) {
            int res = 0;
            for (int j = 0; j < m; j++) {
                int cnt = 0, minCost = Integer.MAX_VALUE;
                for (int k = 0; k < n; k++) {
                    if ((mask[j] & (1 << k)) > 0) {
                        cnt++;
                        minCost = Math.min(minCost, cost.get(k).get(j));
                    }
                }
                if (cnt > 0) res += minCost;
            }
            return res;
        }
        if (dp[i][mask[i]] >= 0) return dp[i][mask[i]];
        
        int res = Integer.MAX_VALUE;
        for (int j = 0; j < m; j++) {
            res = Math.min(res, cost.get(i).get(j) + dfs(i + 1, mask, cost, dp &~(1 << j)));
            res = Math.min(res, cost.get(i).get(j) + dfs(i + 1, mask, cost, dp | (1 << j)));
        }
        return dp[i][mask[i]] = res;
    }
}

class Solution {
    long MOD = 1000000007;
    long INF = Long.MIN_VALUE;
    int[][] DIRS = {{1, 0}, {0, 1}};
    int[][] grid;
    int m, n;
    long[][][] memo;
    public int maxProductPath(int[][] grid) {
        this.grid = grid;
        this.m = grid.length;
        this.n = grid[0].length;
        this.memo = new long[m][n][2];
        for(long[][] layer : memo) {
            for(long[] row : layer) {
                Arrays.fill(row, -1);
            }
        }
        long ans = dfs(0, 0, 1);
        return ans < 0 ? -1 : (int)(ans % MOD);
    }
    private long dfs(int r, int c, long prod) {
        if(grid[r][c] > 0) {
            prod *= grid[r][c];
        } else if(grid[r][c] < 0) {
            prod *= grid[r][c];
        }
        if(r == m - 1 && c == n - 1) {
            return prod;
        }
        if(memo[r][c][grid[r][c] >= 0 ? 0 : 1] != -1) {
            return memo[r][c][grid[r][c] >= 0 ? 0 : 1];
        }
        long curMax = INF;
        for(int[] dir : DIRS) {
            int newR = r + dir[0];
            int newC = c + dir[1];
            if(newR < m && newC < n) {
                long res = dfs(newR, newC, prod);
                curMax = Math.max(curMax, res);
            }
        }
        memo[r][c][grid[r][c] >= 0 ? 0 : 1] = curMax;
        return curMax;
    }
}

class Solution {
    public int maxUniqueSplit(String s) {
        return dfs(s, new HashSet<>());
    }
    
    private int dfs(String s, Set<String> set) {
        if (s.length() == 0) {
            return 0;
        }
        int max = 0;
        for (int i = 1; i <= s.length(); i++) {
            String substr = s.substring(0, i);
            if (!set.contains(substr)) {
                set.add(substr);
                max = Math.max(max, 1 + dfs(s.substring(i), set));
                set.remove(substr);
            }
        }
        return max;
    }
}

class Solution {
    public String reorderSpaces(String text) {
        String[] words = text.trim().split("\\s+");
        int numOfSpaces = text.length() - text.replaceAll(" ", "").length();
        int numOfGaps = words.length - 1;
        int equalSpaces = numOfGaps == 0 ? numOfSpaces : numOfSpaces / numOfGaps;
        int extraSpaces = numOfGaps == 0 ? 0 : numOfSpaces % numOfGaps;
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < words.length; i++) {
            sb.append(words[i]);
            if (i < words.length - 1) {
                for (int j = 0; j < equalSpaces; j++) {
                    sb.append(" ");
                }
                if (extraSpaces > 0) {
                    sb.append(" ");
                    extraSpaces--;
                }
            }
        }
        while (extraSpaces > 0) {
            sb.append(" ");
            extraSpaces--;
        }
        return sb.toString();
    }
}

class Solution {
    public int[][] restoreMatrix(int[] rowSum, int[] colSum) {
        int[][] res = new int[rowSum.length][colSum.length];
        int i = 0, j = 0;
        while (i < rowSum.length && j < colSum.length) {
            int val = Math.min(rowSum[i], colSum[j]);
            res[i][j] = val;
            rowSum[i] -= val;
            colSum[j] -= val;
            if (rowSum[i] == 0) i++;
            if (colSum[j] == 0) j++;
        }
        return res;
    }
}

class Solution {
    public List<Integer> busiestServers(int k, int[] arrival, int[] load) {
        int[] counts = new int[k];
        TreeSet<Integer> available = new TreeSet<>();
        for (int i = 0; i < k; i++) available.add(i);
        PriorityQueue<int[]> busy = new PriorityQueue<>(new Comparator<int[]>() {
            public int compare(int[] a, int[] b) {
                return a[0] - b[0];
            }
        });
        int n = arrival.length;
        for (int i = 0; i < n; i++) {
            int l = load[i], t = arrival[i];
            while (!busy.isEmpty() && busy.peek()[0] <= t) {
                int j = busy.poll()[1];
                available.add(j);
            }
            if (available.isEmpty()) continue;
            Integer j = available.ceiling(i % k);
            if (j == null) j = available.first();
            available.remove(j);
            counts[j]++;
            busy.offer(new int[]{t + l, j});
        }
        List<Integer> res = new ArrayList<>();
        int max = 0;
        for (int i = 0; i < k; i++) {
            if (counts[i] > max) {
                max = counts[i];
                res.clear();
                res.add(i);
            } else if (counts[i] == max) {
                res.add(i);
            }
        }
        return res;
    }
}

