           list.add(minutes);
           if (list.size() < 3) continue;
           int diff1 = list.get(list.size() - 1) - list.get(list.size() - 3);
           int diff2 = list.get(list.size() - 1) - list.get(list.size() - 2);
           if (diff1 <= 60 || diff2 <= 60) {
               res.add(keyName[i]);
           }
       }
       Collections.sort(res);
       return res;
    }
}

