class Solution {
    public boolean isTransformable(String s, String t) {
        List<Deque<Integer>> indices = new ArrayList<>(10);
        for (int i = 0; i < 10; ++i) {
            indices.add(new LinkedList<>());
        }
        for (int i = s.length() - 1; i >= 0; --i) {
            indices.get(s.charAt(i) - '0').addFirst(i);
        }
        for (int i = 0; i < t.length(); ++i) {
            int digit = t.charAt(i) - '0';
            if (indices.get(digit).isEmpty()) {
                return false;
            }
            for (int j = 0; j < digit; ++j) {
                if (!indices.get(j).isEmpty() && indices.get(j).peekFirst() < indices.get(digit).peekFirst()) {
                    return false;
                }
            }
            indices.get(digit).removeFirst();
        }
        return true;
    }
}

class Solution {
    public int minCostConnectPoints(int[][] points) {
        int n = points.length, result = 0, count = 0;
        boolean[] visited = new boolean[n];
        int[] dist = new int[n];
        Arrays.fill(dist, Integer.MAX_VALUE);
        dist[0] = 0;
        
        while (count < n) {
            int u = -1;
            for (int i = 0; i < n; i++) {
                if (!visited[i] && (u == -1 || dist[u] > dist[i])) {
                    u = i;
                }
            }
            visited[u] = true;
            result += dist[u];
            count++;
            
            for (int v = 0; v < n; v++) {
                if (!visited[v]) {
                    int newDist = Math.abs(points[u][0] - points[v][0]) + Math.abs(points[u][1] - points[v][1]);
                    dist[v] = Math.min(dist[v], newDist);
                }
            }
        }
        
        return result;
    }
}

class Solution {
    public int unhappyFriends(int n, int[][] preferences, int[][] pairs) {
        int[] match = new int[n];
        for (int[] p : pairs) {
            match[p[0]] = p[1];
            match[p[1]] = p[0];
        }
        int count = 0;
        for (int[] p : pairs) {
            int x = p[0], y = p[1];
            boolean unhappy = false;
            for (int i = 0; i < preferences[x].length; i++) {
                int u = preferences[x][i];
                if (u == y) break;
                if (match[u] == preferences[u][0]) continue;
                for (int j = 0; j < preferences[u].length; j++) {
                    int v = preferences[u][j];
                    if (v == x) break;
                    if (preferences[u][j] == match[u]) {
                        unhappy = true;
                        break;
                    }
                }
                if (unhappy) break;
            }
            if (unhappy) count++;
            else {
                for (int i = 0; i < preferences[y].length; i++) {
                    int u = preferences[y][i];
                    if (u == x) break;
                    if (match[u] == preferences[u][0]) continue;
                    for (int j = 0; j < preferences[u].length; j++) {
                        int v = preferences[u][j];
                        if (v == y) break;
                        if (preferences[u][j] == match[u]) {
                            count++;
                            break;
                        }
                    }
                }
            }
        }
        return count;
    }
}

