class Solution {
    public int maxNumEdgesToRemove(int n, int[][] edges) {
        int[] parent = new int[n+1];
        for (int i = 0; i <= n; i++) parent[i] = i;
        int count = 0, count1 = 0;
        for (int[] edge : edges) {
            if (edge[0] == 3) {
                int p1 = findParent(edge[1], parent), p2 = findParent(edge[2], parent);
                if (p1 == p2) count++;
                else {
                    parent[p1] = p2;
                    count1++;
                }
            }
        }
        int[] parent1 = parent.clone();
        for (int[] edge : edges) {
            if (edge[0] == 1) {
                int p1 = findParent(edge[1], parent), p2 = findParent(edge[2], parent);
                if (p1 != p2) {
                    parent[p1] = p2;
                    count++;
                }
            } else if (edge[0] == 2) {
                int p1 = findParent(edge[1], parent1), p2 = findParent(edge[2], parent1);
                if (p1 != p2) {
                    parent1[p1] = p2;
                    count++;
                }
            }
        }
        int root = findParent(1, parent), root1 = findParent(1, parent1);
        for (int i = 2; i <= n; i++) {
            if (findParent(i, parent) != root) return -1;
            if (findParent(i, parent1) != root1) return -1;
        }
        return count1 == n-1 ? count : -1;
    }
    
    private int findParent(int node, int[] parent) {
        if (parent[node] != node) parent[node] = findParent(parent[node], parent);
        return parent[node];
    }
}

