class Solution {
    public int numTriplets(int[] nums1, int[] nums2) {
        int res = 0;
        for (int i = 0; i < nums1.length; i++) {
            long square = (long)nums1[i] * nums1[i];
            res += count(square, nums2);
        }
        for (int i = 0; i < nums2.length; i++) {
            long square = (long)nums2[i] * nums2[i];
            res += count(square, nums1);
        }
        return res;
    }

    private int count(long target, int[] nums) {
        int count = 0;
        Map<Long, Integer> map = new HashMap<>();
        for (int num : nums) {
            if (target % num == 0) {
                count += map.getOrDefault(target / num, 0);
            }
            map.put((long)num, map.getOrDefault((long)num, 0) + 1);
        }
        return count;
    }
}

