    }
}

class Solution {
    public boolean isPrintable(int[][] targetGrid) {
        int n = targetGrid.length;
        int m = targetGrid[0].length;
        int[] l = new int[61];
        int[] r = new int[61];
        int[] u = new int[61];
        int[] d = new int[61];
        List<Integer>[] g = new List[61];
        for (int i = 1; i <= 60; ++i) g[i] = new ArrayList<>();
        for (int i = 0; i < n; ++i) for (int j = 0; j < m; ++j) {
            int c = targetGrid[i][j];
            if (l[c] == 0) l[c] = j+1;
            else l[c] = Math.min(l[c], j+1);
            if (r[c] == 0) r[c] = j+1;
            else r[c] = Math.max(r[c], j+1);
            if (u[c] == 0) u[c] = i+1;
            else u[c] = Math.min(u[c], i+1);
            if (d[c] == 0) d[c] = i+1;
            else d[c] = Math.max(d[c], i+1);
        }
        for (int c = 1; c <= 60; ++c) if (l[c] != 0) {
            for (int i = u[c]-1; i < d[c]; ++i) for (int j = l[c]-1; j < r[c]; ++j) if (targetGrid[i][j] != c) {
                g[c].add(targetGrid[i][j]);
            }
            for (int d : g[c]) if (g[d].contains(c)) return false;
        }
        return true;
    }
}

class Solution {
    public int maxSumRangeQuery(int[] nums, int[][] requests) {
        int n = nums.length;
        int[] freq = new int[n];
        for (int[] req : requests) {
            freq[req[0]]++;
            if (req[1] < n - 1) {
                freq[req[1] + 1]--;
            }
        }
        for (int i = 1; i < n; i++) {
            freq[i] += freq[i - 1];
        }
        Arrays.sort(nums);
        Arrays.sort(freq);
        long res = 0;
        int mod = 1000000007;
        for (int i = n - 1; i >= 0 && freq[i] > 0; i--) {
            res += (long) nums[i] * freq[i];
            res %= mod;
        }
        return (int) res;
    }
}

class Solution {
    public int minSubarray(int[] nums, int p) {
        int n = nums.length;
        int[] prefix = new int[n];
        prefix[0] = nums[0];
        for (int i = 1; i < n; i++) {
            prefix[i] = (prefix[i - 1] + nums[i]) % p;
        }
        int remainder = prefix[n - 1] % p;
        if (remainder == 0) {
            return 0;
        }
        int minLen = n;
        Map<Integer, Integer> map = new HashMap<>();
        map.put(0, -1);
        for (int i = 0; i < n; i++) {
            int target = (prefix[i] - remainder + p) % p;
            if (map.containsKey(target)) {
                int len = i - map.get(target);
                minLen = Math.min(minLen, len);
            }
            map.put(prefix[i], i);
        }
        return minLen == n ? -1 : minLen;
    }
}

class Solution {
