                curSum += arr[j];
                if ((j - i + 1) % 2 == 1) {
                    sum += curSum;
                }
            }
        }
        return sum;
    }
}

class Solution {
    public int numOfWays(int[] nums) {
        int n = nums.length;
        long[][] dp = new long[n][n];
        for (int i = 0; i < n; i++) {
            dp[i][i] = 1;
        }
        for (int len = 2; len <= n; len++) {
            for (int i = 0; i + len - 1 < n; i++) {
                int j = i + len - 1;
                if (nums[i] < nums[j]) {
                    for (int k = i + 1; k <= j; k++) {
                        if (nums[k] > nums[i]) {
                            dp[i][j] += dp[i + 1][k - 1] * dp[k][j];
                            dp[i][j] %= mod;
                        }
                    }
                }
            }
        }
        return (int) dp[0][n - 1] - 1;
    }
    
    private static final int mod = 1000000007;
}

class Solution {
    public int minDays(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        if(countIslands(grid) != 1) return 0;
        for(int i = 0; i < m; i++) {
            for(int j = 0; j < n; j++) {
                if(grid[i][j] == 0) continue;
                grid[i][j] = 0;
                if(countIslands(grid) != 1) return 1;
                grid[i][j] = 1;
            }
        }
        return 2;
    }
    
    private int countIslands(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        int count = 0;
        boolean[][] visited = new boolean[m][n];
        for(int i = 0; i < m; i++) {
            for(int j = 0; j < n; j++) {
                if(grid[i][j] == 1 && !visited[i][j]) {
                    count++;
                    dfs(grid, i, j, visited);
                }
            }
        }
        return count;
    }
    
    private void dfs(int[][] grid, int i, int j, boolean[][] visited) {
        int m = grid.length, n = grid[0].length;
        if(i < 0 || i >= m || j < 0 || j >= n || grid[i][j] == 0 || visited[i][j]) return;
        visited[i][j] = true;
        dfs(grid, i + 1, j, visited);
        dfs(grid, i - 1, j, visited);
        dfs(grid, i, j + 1, visited);
        dfs(grid, i, j - 1, visited);
    }
}

class Solution {
    public int getMaxLen(int[] nums) {
        int pos = 0, neg = 0, res = 0;
        for (int num : nums) {
            if (num == 0) {
                pos = 0;
                neg = 0;
            } else if (num > 0) {
                pos++;
                neg = neg > 0 ? neg + 1 : 0;
            } else {
                int temp = pos;
                pos = neg > 0 ? neg + 1 : 0;
                neg = temp + 1;
            }
            res = Math.max(res, pos);
        }
        return res;
    }
}

class Solution {
    public boolean containsPattern(int[] arr, int m, int k) {
        for (int i = 0; i <= arr.length - m * k; i++) {
            boolean patternFound = true;
            for (int j = i; j < i + m * k; j++) {
                if (arr[j] != arr[j - m * (j / m)]) {
                    patternFound = false;
                    break;
                }
            }
            if (patternFound) {
                return true;
            }
        }
        return false;
    }
}

class Solution {
    public int stoneGameV(int[] stoneValue) {
        int n = stoneValue.length;
        int[][] dp = new int[n][n];
        int[] sum = new int[n+1];
        for (int i = 0; i < n; i++) sum[i+1] = sum[i] + stoneValue[i];
        for (int len = 2; len <= n; len++) {
            for (int i = 0; i < n-len+1; i++) {
                int j = i+len-1;
                for (int k = i; k < j; k++) {
                    int leftSum = sum[k+1]-sum[i];
                    int rightSum = sum[j+1]-sum[k+1];
                    if (leftSum <= rightSum) dp[i][j] = Math.max(dp[i][j], leftSum+dp[i][k]);
                    if (leftSum >= rightSum) dp[i][j] = Math.max(dp[i][j], rightSum+dp[k+1][j]);
                }
            }
        }
        return dp[0][n-1];
    }
}

class Solution {
