            int x = arr[i], l = len[x-1], r = len[x+1];
            len[x] = len[x-l] = len[x+r] = l+r+1;
            cnt[l]--;
            cnt[r]--;
            cnt[l+r+1]++;
            if (cnt[m] > 0) res = i+1;
        }
        return res;
    }
}

