class Solution {
    int mod = 1000000007;
    public int countRoutes(int[] locations, int start, int finish, int fuel) {
        int[][] dp = new int[locations.length][fuel+1];
        for(int i=0;i<locations.length;i++){
            for(int j=0;j<=fuel;j++){
                dp[i][j]=-1;
            }
        }
        return dfs(locations,dp,start,finish,fuel);
    }
    private int dfs(int[] locations,int[][] dp,int start,int finish,int fuel){
        if(fuel < 0)return 0;
        if(dp[start][fuel]!=-1)return dp[start][fuel];
        int res = 0;
        if(start==finish)res++;
        for(int i=0;i<locations.length;i++){
            if(i!=start){
                int curFuel = fuel - Math.abs(locations[start] - locations[i]);
                res = (res + dfs(locations,dp,i,finish,curFuel))%mod;
            }
        }
        return dp[start][fuel] = res;
    }
}

class Solution {
    public int findLengthOfShortestSubarray(int[] arr) {
        int n = arr.length;
        int left = 0, right = n - 1;
        while (left < n - 1 && arr[left] <= arr[left + 1]) left++;
        if (left == n - 1) return 0;
        while (right > 0 && arr[right] >= arr[right - 1]) right--;
        int res = Math.min(n - left - 1, right);
        int i = left, j = right;
        while (i >= 0 && j < n) {
            if (arr[i] <= arr[j]) {
                res = Math.min(res, j - i - 1);
                i--;
            } else {
                j++;
            }
        }
        return res;
    }
}

class Solution {
    public int numWays(String s) {
        int MOD = 1000000007;
        int ones = 0;
        for (char c : s.toCharArray()) {
            ones += c - '0';
        }
        if (ones % 3 != 0) {
            return 0;
        }
        if (ones == 0) {
            return (int) (((long)(s.length() - 1) * (s.length() - 2) / 2) % MOD);
        }
        int third = ones / 3, currOnes = 0;
        long firstThird = 0, secondThird = 0;
        for (char c : s.toCharArray()) {
            currOnes += c - '0';
            if (currOnes == third) {
                firstThird++;
            } else if (currOnes == 2 * third) {
                secondThird++;
            }
        }
        return (int) ((firstThird * secondThird) % MOD);
    }
}

class Solution {
    public int diagonalSum(int[][] mat) {
        int sum = 0;
        int n = mat.length;
        for (int i = 0; i < n; i++) {
            sum += mat[i][i] + mat[i][n-1-i];
        }
        if (n % 2 == 1) {
            sum -= mat[n/2][n/2];
        }
        return sum;
    }
}

class Solution {
    public int minDays(int n) {
        if (n <= 1) {
            return n;
        }
        Map<Integer, Integer> memo = new HashMap<>();
        return dfs(n, memo);
    }
    
    private int dfs(int n, Map<Integer, Integer> memo) {
        if (n <= 1) {
            return n;
        }
        if (memo.containsKey(n)) {
            return memo.get(n);
        }
        int res = 1 + Math.min(n % 2 + dfs(n / 2, memo), n % 3 + dfs(n / 3 * 2, memo));
        memo.put(n, res);
        return res;
    }
}

class Solution {
    public int maxDistance(int[] position, int m) {
        Arrays.sort(position);
        int n = position.length;
        int l = 1, r = position[n-1] - position[0];
        while(l < r) {
            int mid = l + (r - l + 1) / 2;
            if(check(position, mid, m)) {
                l = mid;
            } else {
                r = mid - 1;
            }
        }
        return l;
    }
    private boolean check(int[] position, int x, int m) {
        int count = 1;
        int left = position[0];
        for(int i = 1; i < position.length; i++) {
            if(position[i] - left >= x) {
                left = position[i];
                count++;
            }
        }
        return count >= m;
    }
}

class Solution {
