class Solution {
    public int minCost(int n, int[] cuts) {
        Arrays.sort(cuts);
        int m = cuts.length;
        int[] newCuts = new int[m+2];
        newCuts[0] = 0; newCuts[m+1] = n;
        for (int i = 0; i < m; i++) {
            newCuts[i+1] = cuts[i];
        }
        int[][] dp = new int[m+2][m+2];
        for (int len = 2; len <= m+1; len++) {
            for (int i = 0; i <= m+1-len; i++) {
                int j = i + len - 1;
                dp[i][j] = Integer.MAX_VALUE;
                for (int k = i+1; k < j; k++) {
                    dp[i][j] = Math.min(dp[i][j], dp[i][k]+dp[k][j]);
                }
                dp[i][j] += newCuts[j]-newCuts[i];
            }
        }
        return dp[0][m+1];
    }
}

class Solution {
    public int longestAwesome(String s) {
        int n = s.length(), ans = 0, mask = 0, [] pos = new int [1024];
        Arrays.fill(pos, n);
        pos[0] = -1;
        for (int i = 0; i < n; ++i) {
            int bit = s.charAt(i) - '0';
            mask ^= 1 << bit;
            ans = Math.max(ans, i - pos[mask]);
            for (int k = 0; k < 10; ++k) {
                int alt = mask ^ (1 << k);
                ans = Math.max(ans, i - pos[alt]);
            }
            pos[mask] = Math.min(pos[mask], i);
        }
        return ans;
    }
}

class Solution {
    public char findKthBit(int n, int k) {
        StringBuilder sb = new StringBuilder("0");
        for (int i = 2; i <= n; i++) {
            StringBuilder reverse = new StringBuilder(sb.toString());
            reverse.reverse();
            for (int j = 0; j < reverse.length(); j++) {
                if (reverse.charAt(j) == '0') {
                    reverse.setCharAt(j, '1');
                } else {
                    reverse.setCharAt(j, '0');
                }
            }
            sb.append("1").append(reverse.toString());
        }
        return sb.charAt(k - 1);
    }
}

