class Solution {
    public boolean containsCycle(char[][] grid) {
        int m = grid.length;
        int n = grid[0].length;
        boolean[][] visited = new boolean[m][n];
        int[][] directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (!visited[i][j]) {
                    if (dfs(grid, visited, directions, i, j, -1, -1)) {
                        return true;
                    }
                }
            }
        }
        return false;
    }
    
    private boolean dfs(char[][] grid, boolean[][] visited, int[][] directions, int i, int j, int prevI, int prevJ) {
        visited[i][j] = true;
        for (int[] dir : directions) {
            int x = i + dir[0];
            int y = j + dir[1];
            if (x >= 0 && x < grid.length && y >= 0 && y < grid[0].length && grid[x][y] == grid[i][j]) {
                if (!(x == prevI && y == prevJ)) {
                    if (visited[x][y]) {
                        return true;
                    }
                    if (dfs(grid, visited, directions, x, y, i, j)) {
                        return true;
                    }
                }
            }
        }
        return false;
    }
}

class Solution {
    public int minOperations(int[] nums) {
        int res = 0, maxBit = 0;
        for (int num : nums) {
            int curBit = 0;
            while (num > 0) {
                if ((num & 1) == 1) {
                    res++;
                    if (curBit == maxBit) res--;
                }
                curBit++;
                num >>= 1;
            }
            maxBit = curBit - 1;
        }
        return res + maxBit;
    }
}

