class Solution {
    public int maxSum(int[] nums1, int[] nums2) {
        long res = 0, sum1 = 0, sum2 = 0;
        int i = 0, j = 0, n = nums1.length, m = nums2.length;
        while (i < n && j < m) {
            if (nums1[i] < nums2[j])
                sum1 += nums1[i++];
            else if (nums1[i] > nums2[j])
                sum2 += nums2[j++];
            else {
                res += Math.max(sum1, sum2) + nums1[i];
                sum1 = sum2 = 0;
                i++; j++;
            }
        }
        while (i < n) sum1 += nums1[i++];
        while (j < m) sum2 += nums2[j++];
        return (int)((res + Math.max(sum1, sum2)) % 1000000007);
    }
}

class Solution {
    public int minSwaps(int[][] grid) {
        int n = grid.length;
        int count = 0;
        List<Integer> zeros = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            int numZeros = 0;
            for (int j = n - 1; j >= 0 && grid[i][j] == 0; j--) {
                numZeros++;
            }
            zeros.add(numZeros);
        }
        for (int i = 0; i < n; i++) {
            int target = n - i - 1;
            if (zeros.get(i) < target) {
                boolean found = false;
                for (int j = i + 1; j < n && !found; j++) {
                    if (zeros.get(j) >= target) {
                        count += j - i;
                        zeros.add(i, zeros.remove(j));
                        found = true;
                    }
                }
                if (!found) {
                    return -1;
                }
            }
        }
        return count;
    }
}

class Solution {
