class Solution {
    public int maxNonOverlapping(int[] nums, int target) {
        Set<Integer> set = new HashSet<>();
        set.add(0);
        int sum = 0, count = 0;
        for (int num : nums) {
            sum += num;
            if (set.contains(sum - target)) {
                count++;
                set.clear();
                set.add(0);
                sum = 0;
            } else {
                set.add(sum);
            }
        }
        return count;
    }
}

class Solution {
    public int minInsertions(String s) {
        int n = s.length();
        int leftCount = 0;
        int insertions = 0;
        int i = 0;
        while (i < n) {
            char ch = s.charAt(i);
            if (ch == '(') {
                leftCount++;
                i++;
            } else {
                if (leftCount == 0) {
                    insertions++;
                    leftCount++;
                }
                if (i < n - 1 && s.charAt(i + 1) == ')') {
                    leftCount--;
                    i += 2;
                } else {
                    insertions++;
                    leftCount--;
                    i++;
                }
            }
        }
        insertions += leftCount * 2;
        return insertions;
    }
}

class Solution {
    public boolean canConvertString(String s, String t, int k) {
        if (s.length() != t.length()) return false;
        int n = s.length();
        int[] count = new int[26];
        for (int i = 0; i < n; i++) {
            int diff = (t.charAt(i) - s.charAt(i) + 26) % 26;
            if (diff > 0 && diff + count[diff] * 26 > k) return false;
            count[diff]++;
        }
        return true;
    }
}

class Solution {
    public int findKthPositive(int[] arr, int k) {
        int left = 0, right = arr.length-1;
        while(left <= right) {
            int mid = left + (right-left)/2;
            if(arr[mid]-mid-1 < k)
                left = mid + 1;
            else 
                right = mid - 1;
        }
        return left + k;
    }
}

class Solution {
    public int closestToTarget(int[] arr, int target) {
        int res = Math.abs(arr[0] - target);
        Set<Integer> set = new HashSet<>();
        set.add(arr[0]);
        for (int i = 1; i < arr.length; i++) {
            Set<Integer> newSet = new HashSet<>();
            newSet.add(arr[i]);
            res = Math.min(res, Math.abs(arr[i] - target));
            for (int num : set) {
                int val = num & arr[i];
                res = Math.min(res, Math.abs(val - target));
                newSet.add(val);
            }
            set = newSet;
        }
        return res;
    }
}

class Solution {
    public List<String> maxNumOfSubstrings(String s) {
        int[] left = new int[26], right = new int[26];
        Arrays.fill(left, s.length());
        List<String> res = new ArrayList<>();
        for (int i = 0; i < s.length(); ++i) {
            int c = s.charAt(i) - 'a';
            left[c] = Math.min(left[c], i);
            right[c] = i;
        }
        int l = -1, r = -1;
        for (int i = 0; i < s.length(); ++i) {
            int c = s.charAt(i) - 'a';
            if (i == left[c]) {
                if (i > r) {
                    if (l != -1) res.add(s.substring(l, r + 1));
                    l = i;
                }
                r = right[c];
            } else {
                r = Math.max(r, right[c]);
            }
        }
        if (l != -1) res.add(s.substring(l, r + 1));
        return res;
    }
}

class Solution {
    public int[] countSubTrees(int n, int[][] edges, String labels) {
        List<Integer>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int[] edge : edges) {
            graph[edge[0]].add(edge[1]);
            graph[edge[1]].add(edge[0]);
        }
        int[] ans = new int[n];
        boolean[] visited = new boolean[n];
        dfs(0, graph, visited, labels, ans);
        return ans;
    }
    
    private int[] dfs(int node, List<Integer>[] graph, boolean[] visited, String labels, int[] ans) {
        visited[node] = true;
        int[] count = new int[26];
        count[labels.charAt(node) - 'a']++;
        for (int child : graph[node]) {
            if (!visited[child]) {
                int[] subCount = dfs(child, graph, visited, labels, ans);
                for (int i = 0; i < 26; i++) {
                    count[i] += subCount[i];
                }
            }
        }
        ans[node] = count[labels.charAt(node) - 'a'];
        return count;
    }
}

