class Solution {
    public int getLengthOfOptimalCompression(String s, int k) {
        int n = s.length();
        int MAX = 105, INF = 0x3f3f3f3f;
        int[][] f = new int[MAX][MAX];

        for (int i = n; i > 0; i--) {
            for (int j = k; j > -1; j--) {
                if (i + j == n) {
                    f[i][j] = 0;
                    continue;
                }
                f[i][j] = INF;
                int del = 0;
                for (int t = i, len = 1; t < n; t++) {
                    if (s.charAt(t) != s.charAt(t - 1)) {
                        del += len - 1;
                        len = 1;
                    } else if (del < j && len > 1) {
                        len++;
                    } else if (len == 1 && del < j) {
                        del++;
                    } else {
                        continue;
                    }
                    f[i][j] = Math.min(f[i][j], f[t + 1][j - del] + 1 + (len > 1 ? lene(len) : 0));
                }
            }
        }

        return f[1][k];
    }

    private int lene(int len) {
        if (len < 10) return 1;
        if (len < 100) return 2;
        return 3;
    }
}

