class Solution {
    public String minInteger(String num, int k) {
        int n = num.length();
        int[] pos = new int[10];
        List<Integer>[] list = new List[10];
        for (int i = 0; i < 10; i++)
            list[i] = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            int digit = num.charAt(i) - '0';
            pos[digit] = i;
            list[digit].add(i);
        }
        StringBuilder sb = new StringBuilder();
        FenwickTree tree = new FenwickTree(n);
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < 10; j++) {
                if (list[j].isEmpty())
                    continue;
                int earliest = list[j].get(0);
                int shift = tree.query(earliest);
                if (earliest - shift <= k) {
                    sb.append(j);
                    list[j].remove(0);
                    k -= earliest - shift;
                    tree.update(earliest + 1, 1);
                    break;
                }
            }
        }
        return sb.toString();
    }

    class FenwickTree {
        int[] tree;

        FenwickTree(int n) {
            tree = new int[n + 1];
        }

        void update(int i, int delta) {
            while (i < tree.length) {
                tree[i] += delta;
                i += i & -i;
            }
        }

        int query(int i) {
            int sum = 0;
            while (i > 0) {
                sum += tree[i];
                i -= i & -i;
            }
            return sum;
        }
    }
}

class Solution {
    public int numSubmat(int[][] mat) {
        int m = mat.length, n = mat[0].length;
        int[][] dp = new int[m][n];

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (mat[i][j] == 1) {
                    if (j == 0) {
                        dp[i][j] = 1;
                    } else {
                        dp[i][j] = dp[i][j-1] + 1;
                    }
                }
            }
        }

        int res = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (dp[i][j] == 0) continue;
                int width = dp[i][j];
                int height = 1;
                res += width;
                for (int k = i+1; k < m; k++) {
                    width = Math.min(width, dp[k][j]);
                    if (width == 0) break;
                    height++;
                    res += width;
                }
            }
        }

        return res;
    }
}

