class Solution {
    public int findMaxValueOfEquation(int[][] points, int k) {
        int n = points.length;
        Deque<int[]> q = new LinkedList<>();
        int ans = Integer.MIN_VALUE;
        for (int i = 0; i < n; i++) {
            int[] curr = points[i];
            while (!q.isEmpty() && curr[0]-q.peekFirst()[0] > k) q.pollFirst();
            if (!q.isEmpty()) ans = Math.max(ans, q.peekFirst()[1]+curr[1]+curr[0]-q.peekFirst()[0]);
            while (!q.isEmpty() && curr[1]-curr[0] > q.peekLast()[1]-q.peekLast()[0]) q.pollLast();
            q.addLast(curr);
        }
        return ans;
    }
}

class Solution {
    public int numSubseq(int[] nums, int target) {
        int MOD = 1000000007;
        Arrays.sort(nums);
        int n = nums.length;
        int[] power = new int[n];
        power[0] = 1;
        for (int i = 1; i < n; i++) {
            power[i] = power[i-1]*2 % MOD;
        }
        int ans = 0;
        int l = 0, r = n-1;
        while (l <= r) {
            if (nums[l] + nums[r] <= target) {
                ans = (ans + power[r-l]) % MOD;
                l++;
            } else {
                r--;
            }
        }
        return ans;
    }
}

class Solution {
    public boolean canArrange(int[] arr, int k) {
        int[] modArr = new int[k];
        for(int num : arr) {
            int mod = num % k;
            if(mod < 0) mod += k;
            modArr[mod]++;
        }
        if(modArr[0] % 2 != 0) return false;
        for(int i = 1; i <= k / 2; i++) {
            if(modArr[i] != modArr[k - i]) {
                return false;
            }
        }
        return true;
    }
}

