class Solution {
    public List<List<Integer>> findCriticalAndPseudoCriticalEdges(int n, int[][] edges) {
        List<List<Integer>> res = new ArrayList<>();
        UnionFind uf = new UnionFind(n);
        for (int i = 0; i < edges.length; i++) {
            edges[i] = new int[]{edges[i][0], edges[i][1], edges[i][2], i};
        }
        Arrays.sort(edges, (a, b) -> a[2] - b[2]);
        int mst = kruskal(n, edges, uf, -1, -1);
        List<Integer> crit = new ArrayList<>();
        List<Integer> nonCrit = new ArrayList<>();
        for (int i = 0; i < edges.length; i++) {
            uf = new UnionFind(n);
            int v = kruskal(n, edges, uf, -1, i);
            if (v > mst || (v == mst && findCritical(n, edges, uf, i))) {
                crit.add(edges[i][3]);
            } else if (findPseudoCritical(n, edges, uf, i)) {
                nonCrit.add(edges[i][3]);
            }
        }
        res.add(crit);
        res.add(nonCrit);
        return res;
    }
    
    private int kruskal(int n, int[][] edges, UnionFind uf, int pick, int skip) {
        int res = 0;
        if (pick >= 0 && pick < edges.length) {
            uf.union(edges[pick][0], edges[pick][1]);
            res += edges[pick][2];
        }
        for (int i = 0; i < edges.length; i++) {
            if (i == skip) continue;
            if (uf.union(edges[i][0], edges[i][1])) {
                res += edges[i][2];
            }
        }
        return uf.count == 1 ? res : Integer.MAX_VALUE;
    }
    
    private boolean findCritical(int n, int[][] edges, UnionFind uf, int skip) {
        for (int i = 0; i < edges.length; i++) {
            if (i == skip) continue;
            if (uf.union(edges[i][0], edges[i][1])) {
                return false;
            }
        }
        return true;
    }
    
    private boolean findPseudoCritical(int n, int[][] edges, UnionFind uf, int pick) {
        uf.union(edges[pick][0], edges[pick][1]);
        int res = edges[pick][2];
        for (int i = 0; i < edges.length; i++) {
            if (i == pick) continue;
            if (uf.union(edges[i][0], edges[i][1])) {
                res += edges[i][2];
            }
        }
        for (int i = 0; i < n - 1; i++) {
            if (!uf.union(edges[i][0], edges[i][1])) {
                return false;
            }
        }
        return res == kruskal(n, edges, new UnionFind(n), pick, -1);
    }
    
    class UnionFind {
        int[] parent;
        int[] rank;
        int count;
        
        public UnionFind(int n) {
            parent = new int[n];
            for (int i = 0; i < n; i++) {
                parent[i] = i;
            }
            rank = new int[n];
            count = n;
        }
        
        public int find(int i) {
            if (parent[i] != i) {
                parent[i] = find(parent[i]);
            }
            return parent[i];
        }
        
        public boolean union(int i, int j) {
            int pi = find(i), pj = find(j);
            if (pi == pj) return false;
            if (rank[pi] < rank[pj]) {
                parent[pi] = pj;
            } else if (rank[pi] > rank[pj]) {
                parent[pj] = pi;
            } else {
                parent[pj] = pi;
                rank[pi]++;
            }
            count--;
            return true;
        }
    }
}

class Solution {
    public int[] avoidFlood(int[] rains) {
        int n = rains.length;
        int[] ans = new int[n];
        Arrays.fill(ans, -1);
        Map<Integer, Integer> fullLakes = new HashMap<>();
        TreeSet<Integer> dryDays = new TreeSet<>();

        for (int i = 0; i < n; i++) {
            if (rains[i] == 0) {
                dryDays.add(i);
                ans[i] = 1;
            } else {
                int lake = rains[i];
                if (fullLakes.containsKey(lake)) {
                    Integer day = dryDays.ceiling(fullLakes.get(lake));
                    if (day == null) return new int[0];
                    ans[day] = lake;
                    dryDays.remove(day);
                }
                fullLakes.put(lake, i);
            }
        }
        return ans;
    }
}

class Solution {
    public String[] getFolderNames(String[] names) {
        Map<String, Integer> map = new HashMap<>();
