        for (int i = 0; i < names.length; i++) {
            if (!map.containsKey(names[i])) {
                result[i] = names[i];
                map.put(names[i], 1);
            } else {
                int k = map.get(names[i]);
                String newName = names[i] + "(" + k + ")";
                while (map.containsKey(newName)) {
                    k++;
                    newName = names[i] + "(" + k + ")";
                }
                result[i] = newName;
                map.put(names[i], k+1);
                map.put(newName, 1);
            }
        }
        return result;
    }
}

