class Solution {
    public int minCost(int[] houses, int[][] cost, int m, int n, int target) {
        int INF = 10000000;
        int[][][] dp = new int[m][n][target + 1];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                Arrays.fill(dp[i][j], INF);
            }
        }
        if (houses[0] == 0) {
            for (int i = 0; i < n; i++) {
                dp[0][i][1] = cost[0][i];
            }
        } else {
            dp[0][houses[0] - 1][1] = 0;
        }
        for (int i = 1; i < m; i++) {
            if (houses[i] == 0) {
                for (int j = 0; j < n; j++) {
                    for (int k = 1; k <= target; k++) {
                        dp[i][j][k] = Math.min(dp[i][j][k], dp[i - 1][j][k] + cost[i][j]);
                        for (int j0 = 0; j0 < n; j0++) {
                            if (j != j0) {
                                dp[i][j][k] = Math.min(dp[i][j][k], dp[i - 1][j0][k - 1] + cost[i][j]);
                            }
                        }
                    }
                }
            } else {
                int j = houses[i] - 1;
                for (int k = 1; k <= target; k++) {
                    dp[i][j][k] = INF;
                    for (int j0 = 0; j0 < n; j0++) {
                        if (j != j0) {
                            dp[i][j][k] = Math.min(dp[i][j][k], dp[i - 1][j0][k - 1]);
                        }
                    }
                }
                for (int k = 1; k <= target; k++) {
                    dp[i][j][k] = Math.min(dp[i][j][k], dp[i - 1][j][k]);
                }
            }
        }
        int ans = INF;
        for (int i = 0; i < n; i++) {
            ans = Math.min(ans, dp[m - 1][i][target]);
        }
        if (ans == INF) {
            return -1;
        }
        return ans;
    }
}

class BrowserHistory {
    private List<String> history = new ArrayList<>();
    private int curr = 0;
    
    public BrowserHistory(String homepage) {
        history.add(homepage);
    }
    
    public void visit(String url) {
        while (history.size() > curr + 1) {
            history.remove(history.size()-1);
        }
        history.add(url);
        curr = history.size() - 1;
    }
    
    public String back(int steps) {
        curr = Math.max(curr - steps, 0);
        return history.get(curr);
    }
    
    public String forward(int steps) {
        curr = Math.min(curr + steps, history.size()-1);
        return history.get(curr);
    }
}

