class Solution {
    public int[] getStrongest(int[] arr, int k) {
        Arrays.sort(arr);
        int n = arr.length, median = arr[(n - 1) / 2], i = 0, j = n - 1;
        int[] res = new int[k];
        while (i <= j && k > 0) {
            if (Math.abs(arr[j] - median) >= Math.abs(arr[i] - median)) {
                res[--k] = arr[j--];
            } else {
                res[--k] = arr[i++];
            }
        }
        return res;
    }
}

class Solution {
    public int[] shuffle(int[] nums, int n) {
        int[] res = new int[2*n];
        for(int i = 0; i < n; i++) {
            res[2*i] = nums[i];
            res[2*i+1] = nums[i+n];
        }
        return res;
    }
}

class Solution {
    double[][] memo;
    int[] pre;
    int k, n;
    
    public double getProbability(int[] balls) {
        Arrays.sort(balls);
        k = balls.length;
        n = balls.length / 2;
        pre = new int[k+1];
        memo = new double[1<<k][n+1];
        for (int i = 1; i <= k; i++) {
            pre[i] = pre[i-1] + balls[i-1];
        }
        return dfs(0, 0);
    }
    
    private double dfs(int state, int cnt) {
        if (cnt == n) {
            int sum = 0, count = 0;
            for (int i = 0; i < k; i++) {
                if ((state & (1 << i)) != 0) {
                    count++;
                    sum += pre[i+1] - pre[i];
                    if (count > n) {
                        break;
                    }
                }
            }
            if (count == n) {
                return sum == pre[k] / 2 ? 1 : 0;
            } else {
                return 0;
            }
        }
        if (memo[state][cnt] != 0) {
            return memo[state][cnt];
        }
        double res = 0;
        for (int i = 0; i < k; i++) {
            if ((state & (1 << i)) != 0) {
                continue;
            }
            for (int j = i+1; j <= k; j++) {
                if (j == k || ((state & (1 << j)) == 0)) {
                    int newState = state | ((1 << i) | (1 << j));
                    double coef = 1;
                    for (int m = i; m < j; m++) {
                        coef *= pre[m+1] - pre[i];
                    }
                    coef /= (pre[j] - pre[i]) * (pre[k] - pre[j]);
                    res += coef * dfs(newState, cnt+1);
                }
            }
        }
        memo[state][cnt] = res;
        return res;
    }
}

class Solution {
    public int minReorder(int n, int[][] connections) {
        List<List<Integer>> graph = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            graph.add(new ArrayList<>());
        }
        for (int[] connection : connections) {
            int u = connection[0];
            int v = connection[1];
            graph.get(u).add(v);
            graph.get(v).add(-u);
        }
        Queue<Integer> queue = new LinkedList<>();
        boolean[] visited = new boolean[n];
        visited[0] = true;
        queue.offer(0);
        int res = 0;
        while (!queue.isEmpty()) {
            int curr = queue.poll();
            for (int neighbor : graph.get(curr)) {
                if (!visited[Math.abs(neighbor)]) {
                    visited[Math.abs(neighbor)] = true;
                    if (neighbor > 0) {
                        res++;
                    }
                    queue.offer(Math.abs(neighbor));
                }
            }
        }
        return res;
    }
}

class Solution {
    public int maxArea(int h, int w, int[] hor, int[] ver) {
        Arrays.sort(hor);
        Arrays.sort(ver);
        int maxH = Math.max(hor[0], h - hor[hor.length-1]);
        int maxV = Math.max(ver[0], w - ver[ver.length-1]);
        for (int i = 1; i < hor.length; i++) {
            maxH = Math.max(maxH, hor[i] - hor[i-1]);
        }
        for (int i = 1; i < ver.length; i++) {
            maxV = Math.max(maxV, ver[i] - ver[i-1]);
        }
        return (int)((long)maxH * maxV % 1000000007);
    }
}

