class Solution {
    public int minDistance(int[] houses, int k) {
        int n = houses.length;
        Arrays.sort(houses);
        int[][] dp = new int[k + 1][n];
        for(int i = 1; i <= k; i++){
            for(int j = i - 1; j < n; j++){
                if(i == 1){
                    dp[i][j] = helper(houses, 0, j);
                }else{
                    int min = Integer.MAX_VALUE;
                    for(int p = i - 2; p < j; p++){
                        min = Math.min(min, dp[i - 1][p] + helper(houses, p + 1, j));
                    }
                    dp[i][j] = min;
                }
            }
        }
        return dp[k][n - 1];
    }
    
    private int helper(int[] houses, int start, int end){
        int res = 0;
        int i = start, j = end;
        while(i < j){
            res += houses[j] - houses[i];
            i++;
            j--;
        }
        return res;
    }
}

class Solution {
    public int[] finalPrices(int[] prices) {
        int n = prices.length;
        int[] res = new int[n];
        for (int i = 0; i < n; i++) {
            int discount = 0;
            for (int j = i+1; j < n; j++) {
                if (prices[j] <= prices[i]) {
                    discount = prices[j];
                    break;
                }
            }
            res[i] = prices[i] - discount;
        }
        return res;
    }
}

class Solution {
    public int maxDotProduct(int[] nums1, int[] nums2) {
        int n = nums1.length, m = nums2.length;
        int[][] dp = new int[n][m];
        dp[0][0] = nums1[0] * nums2[0];
        for (int i = 1; i < n; i++) {
            dp[i][0] = Math.max(dp[i-1][0], nums1[i] * nums2[0]);
        }
        for (int i = 1; i < m; i++) {
            dp[0][i] = Math.max(dp[0][i-1], nums1[0] * nums2[i]);
        }
        for (int i = 1; i < n; i++) {
            for (int j = 1; j < m; j++) {
                dp[i][j] = Math.max(Math.max(dp[i-1][j], dp[i][j-1]), Math.max(nums1[i]*nums2[j], dp[i-1][j-1]+nums1[i]*nums2[j]));
            }
        }
        return dp[n-1][m-1];
    }
}

class Solution {
    int ans = 0;
    public int pseudoPalindromicPaths (TreeNode root) {
        int[] freq = new int[10];
        dfs(root, freq);
        return ans;
    }
    private void dfs(TreeNode root, int[] freq) {
        if(root == null) return;
        freq[root.val]++;
        if(root.left == null && root.right == null) {
            int oddCount = 0;
            for(int i=1;i<=9;i++) {
                if((freq[i] & 1) == 1) {
                    oddCount++;
                }
            }
            if(oddCount <= 1) ans++;
        }
        dfs(root.left, freq);
        dfs(root.right, freq);
        freq[root.val]--;
    }
}

class Solution {
    public int maxVowels(String s, int k) {
        int maxVowels = 0;
        int currentVowels = 0;
        int left = 0;
        int right = 0;
        while (right < s.length()) {
            if (isVowel(s.charAt(right))) {
                currentVowels++;
            }
            if (right - left + 1 > k) {
                if (isVowel(s.charAt(left))) {
                    currentVowels--;
                }
                left++;
            }
            maxVowels = Math.max(maxVowels, currentVowels);
            right++;
        }
        return maxVowels;
    }
    
    private boolean isVowel(char c) {
        return c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u';
    }
}

