class Solution {
    public int numPoints(int[][] points, int r) {
        int n = points.length, ans = 1;
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                double d = dist(points[i], points[j]);
                if (d > 2 * r) continue;
                double xc = (points[i][0] + points[j][0]) / 2.0;
                double yc = (points[i][1] + points[j][1]) / 2.0;
                double r2 = r * r;
                double d1 = Math.sqrt(r2 - (d / 2.0) * (d / 2.0));
                double x1 = xc + d1 * (points[j][1] - points[i][1]) / d;
                double y1 = yc - d1 * (points[j][0] - points[i][0]) / d;
                int count1 = 0;
                for (int k = 0; k < n; k++) {
                    if (dist(new int[]{x1, y1}, points[k]) <= r + 1e-7) count1++;
                }
                ans = Math.max(ans, count1);
                double x2 = xc - d1 * (points[j][1] - points[i][1]) / d;
                double y2 = yc + d1 * (points[j][0] - points[i][0]) / d;
                int count2 = 0;
                for (int k = 0; k < n; k++) {
                    if (dist(new int[]{x2, y2}, points[k]) <= r + 1e-7) count2++;
                }
                ans = Math.max(ans, count2);
            }
        }
        return ans;
    }

    private double dist(int[] a, int[] b) {
        double dx = a[0] - b[0];
        double dy = a[1] - b[1];
        return Math.sqrt(dx * dx + dy * dy);
    }
}

class Solution {
    public List<Integer> peopleIndexes(List<List<String>> favoriteCompanies) {
        List<Integer> res = new ArrayList<>();
        int n = favoriteCompanies.size();
        for (int i = 0; i < n; i++) {
            boolean isSubset = false;
            for (int j = 0; j < n && !isSubset; j++) {
                if (i == j) continue;
                List<String> list1 = favoriteCompanies.get(i);
                List<String> list2 = favoriteCompanies.get(j);
                if (isSubset(list1, list2)) {
                    isSubset = true;
                }
            }
            if (!isSubset) {
                res.add(i);
            }
        }
        return res;
    }

    private boolean isSubset(List<String> list1, List<String> list2) {
        if (list1.size() > list2.size()) {
            return false;
        }
        Set<String> set = new HashSet<>(list2);
        for (String s : list1) {
            if (!set.contains(s)) {
                return false;
            }
        }
        return true;
    }
}

class Solution {
    public String arrangeWords(String text) {
        String[] words = text.toLowerCase().split(" ");
        Arrays.sort(words, (a, b) -> a.length() - b.length());
        StringBuilder sb = new StringBuilder();
        sb.append(words[0].substring(0, 1).toUpperCase() + words[0].substring(1));
