class Solution {
    private static final int MOD = 1000000007;
    private int[][] prefixSum;
    private int[][][] memo;

    public int ways(String[] pizza, int k) {
        int m = pizza.length;
        int n = pizza[0].length();
        prefixSum = new int[m + 1][n + 1];
        memo = new int[m + 1][n + 1][k + 1];
        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                prefixSum[i][j] = prefixSum[i - 1][j] + prefixSum[i][j - 1] - prefixSum[i - 1][j - 1] + (pizza[i - 1].charAt(j - 1) == 'A' ? 1 : 0);
            }
        }
        return dfs(0, 0, k);
    }

    private int dfs(int row, int col, int k) {
        if (k == 0) {
            return 1;
        }
        if (memo[row][col][k] != 0) {
            return memo[row][col][k];
        }
        int ans = 0;
        for (int i = row + 1; i <= prefixSum.length - 1; i++) {
            if (prefixSum[i - 1][prefixSum[0].length - 1] - prefixSum[row][prefixSum[0].length - 1] == 0) {
                break;
            }
            int count = prefixSum[i - 1][col] - prefixSum[row][col];
            if (count > 0) {
                ans = (ans + dfs(i, col, k - 1)) % MOD;
            }
        }
        for (int j = col + 1; j <= prefixSum[0].length - 1; j++) {
            if (prefixSum[prefixSum.length - 1][j - 1] - prefixSum[prefixSum.length - 1][col] == 0) {
                break;
            }
            int count = prefixSum[row][j - 1] - prefixSum[row][col];
            if (count > 0) {
                ans = (ans + dfs(row, j, k - 1)) % MOD;
            }
        }
        memo[row][col][k] = ans;
        return ans;
    }
}

class Solution {
    public int minTime(int n, int[][] edges, List<Boolean> hasApple) {
        Map<Integer, List<Integer>> tree = new HashMap<>();
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1];
            tree.putIfAbsent(u, new ArrayList<>());
            tree.putIfAbsent(v, new ArrayList<>());
            tree.get(u).add(v);
            tree.get(v).add(u);
        }
        Set<Integer> visited = new HashSet<>();
        visited.add(0);
        int res = dfs(0, tree, visited, hasApple);
        return res > 0 ? res : 0;
    }

    private int dfs(int node, Map<Integer, List<Integer>> tree, Set<Integer> visited, List<Boolean> hasApple) {
        int res = 0;
        for (int neighbor : tree.getOrDefault(node, new ArrayList<>())) {
            if (visited.contains(neighbor)) continue;
            visited.add(neighbor);
            int subRes = dfs(neighbor, tree, visited, hasApple);
            if (subRes > 0 || hasApple.get(neighbor)) {
                res += subRes + 2;
            }
        }
        return res;
    }
}

class Solution {
    public int countTriplets(int[] arr) {
        int n = arr.length, count = 0;
        for (int i = 0; i < n - 1; i++) {
            int x = arr[i];
            for (int k = i + 1; k < n; k++) {
                x ^= arr[k];
                if (x == 0) {
                    count += k - i;
                }
            }
        }
        return count;
    }
}

class Solution {
    public List<String> buildArray(int[] target, int n) {
        List<String> res = new ArrayList<>();
        int i = 1;
        for (int num : target) {
            while (num != i) {
                res.add("Push");
                res.add("Pop");
                i++;
