        for (int i = 0; i <= 2 * n - 2; i++) {
            for (int j = 0; j <= i && j < n; j++) {
                int k = i - j;
                if (k >= 0 && k < nums.get(j).size()) {
                    res.add(nums.get(j).get(k));
                }
            }
        }
