class Solution {
    public int maxScore(String s) {
        int zeros = 0, ones = 0;
        for (char c : s.toCharArray()) {
            if (c == '0') {
                zeros++;
            } else {
                ones++;
            }
        }
        int maxScore = 0, leftZeros = 0, rightOnes = ones;
        for (int i = 0; i < s.length() - 1; i++) {
            if (s.charAt(i) == '0') {
                leftZeros++;
            } else {
                rightOnes--;
            }
            maxScore = Math.max(maxScore, leftZeros + rightOnes);
        }
        return maxScore;
    }
}

class Solution {
    int MOD = 1000000007;

    public int numOfArrays(int n, int m, int k) {
        int[][][] dp = new int[n + 1][m + 1][k + 1];
        for (int j = 1; j <= m; j++) dp[1][j][1] = 1;
        for (int i = 2; i <= n; i++) {
            for (int j = 1; j <= m; j++) {
                for (int p = 1; p <= k; p++) {
                    dp[i][j][p] = (int)(((long)j * dp[i - 1][j][p]) % MOD);
                    for (int q = 1; q < j; q++) {
                        dp[i][j][p] = (dp[i][j][p] + dp[i - 1][q][p - 1]) % MOD; 
                    }
                }
            }
        }
        int ans = 0;
        for (int j = 1; j <= m; j++) {
            ans = (ans + dp[n][j][k]) % MOD;
        }
        return ans;
    }
}

class Solution {
    public int minNumberOfFrogs(String croakOfFrogs) {
        int[] count = new int[5];
        int frogs = 0, maxFrogs = 0;
        for (char c : croakOfFrogs.toCharArray()) {
            switch (c) {
                case 'c':
                    count[0]++;
                    frogs++;
                    break;
                case 'r':
                    if (count[0] == 0) return -1;
                    count[1]++;
                    count[0]--;
                    break;
                case 'o':
                    if (count[1] == 0) return -1;
                    count[2]++;
                    count[1]--;
                    break;
                case 'a':
                    if (count[2] == 0) return -1;
                    count[3]++;
                    count[2]--;
                    break;
                case 'k':
                    if (count[3] == 0) return -1;
                    count[4]++;
                    count[3]--;
                    frogs--;
                    break;
            }
            maxFrogs = Math.max(maxFrogs, frogs);
        }
        return frogs == 0 ? maxFrogs : -1;
    }
}

