class Solution {
    public String reformat(String s) {
        List<Character> letters = new ArrayList<>();
        List<Character> digits = new ArrayList<>();
        for (char c : s.toCharArray()) {
            if (Character.isLetter(c)) {
                letters.add(c);
            } else {
                digits.add(c);
            }
        }
        int diff = letters.size() - digits.size();
        if (diff < -1 || diff > 1) {
            return "";
        }
        StringBuilder sb = new StringBuilder();
        int i = 0, j = 0;
        boolean isLetter = letters.size() >= digits.size();
        while (i < letters.size() && j < digits.size()) {
            if (isLetter) {
                sb.append(letters.get(i++));
            } else {
                sb.append(digits.get(j++));
            }
            isLetter = !isLetter;
        }
        if (i < letters.size()) {
            sb.append(letters.get(i));
        }
        if (j < digits.size()) {
            sb.append(digits.get(j));
        }
        return sb.toString();
    }
}

class Solution {
    private final int MOD = 1000000007;
    
    public int numberWays(int[][] hats) {
        int n = hats.length;
        List<Integer>[] hatList = new List[41];
        for (int i = 1; i <= 40; i++) {
            hatList[i] = new ArrayList<>();
        }
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < hats[i].length; j++) {
                int hat = hats[i][j];
                hatList[hat].add(i);
            }
        }
        Integer[][] memo = new Integer[1 << n][41];
        return dfs(0, 1, n, hatList, memo);
    }
    
    private int dfs(int mask, int hat, int n, List<Integer>[] hatList, Integer[][] memo) {
        if (mask == (1 << n) - 1) {
            return 1;
        }
        if (hat > 40) {
            return 0;
        }
        if (memo[mask][hat] != null) {
            return memo[mask][hat];
        }
        int ways = dfs(mask, hat + 1, n, hatList, memo);
        for (int i = 0; i < hatList[hat].size(); i++) {
            int person = hatList[hat].get(i);
            if ((mask & (1 << person)) == 0) {
                ways += dfs(mask | (1 << person), hat + 1, n, hatList, memo);
                ways %= MOD;
            }
        }
        return memo[mask][hat] = ways;
    }
}

