class Solution {
    public int maxDiff(int num) {
        String s = String.valueOf(num);
        char[] a = s.toCharArray();
        char[] b = s.toCharArray();

        char x = ' ';
        char y = ' ';

        for (int i = 0; i < a.length; i++) {
            if (a[i] != '9') {
                x = a[i];
                break;
            }
        }

        if (x == ' ') {
            return 8;
        }

        for (int i = 0; i < b.length; i++) {
            if (b[i] != '1' && (i != 0 || b[i] != '0')) {
                y = b[i];
                break;
            }
        }
        if (y == ' ') {
            return 8;
        }

        for (int i = 0; i < a.length; i++) {
            if (a[i] == x) {
                a[i] = '9';
            }
        }

        for (int i = 0; i < b.length; i++) {
            if (b[i] == y) {
                b[i] = '1';
            }
        }

        int maxA = Integer.valueOf(new String(a));
        int maxB = Integer.valueOf(new String(b));

        return maxA - maxB;
    }
}

