class Solution {
    private static final int MOD = 1000000007;
    public int numberOfArrays(String s, int k) {
        int n = s.length();
        long[] dp = new long[n+1];
        dp[0] = 1;
        for (int i = 1; i <= n; i++) {
            long num = 0;
            for (int j = i; j >= 1; j--) {
                num = num*10 + (s.charAt(j-1) - '0');
                if (num > k) {
                    break;
                }
                dp[i] += dp[j-1];
                dp[i] %= MOD;
            }
        }
        return (int) dp[n];
    }
}

class Solution {
    public String getHappyString(int n, int k) {
        List<String> res = new ArrayList<>();
        backtrack(new StringBuilder(), n, res);
        return res.size() >= k ? res.get(k-1) : "";
    }
    private void backtrack(StringBuilder sb, int n, List<String> res) {
        if (sb.length() == n) {
            res.add(sb.toString());
            return;
        }
        for (char c : new char[]{'a', 'b', 'c'}) {
            if (sb.length() == 0 || sb.charAt(sb.length()-1) != c) {
                sb.append(c);
                backtrack(sb, n, res);
                sb.deleteCharAt(sb.length()-1);
            }
        }
    }
}

class Solution {
    public int findMinFibonacciNumbers(int k) {
        int a = 1, b = 1;
        while (b <= k) {
            int temp = b;
            b += a;
            a = temp;
        }
        int count = 0;
        while (k > 0) {
            if (a <= k) {
                count++;
                k -= a;
            }
            int temp = b - a;
            b = a;
            a = temp;
        }
        return count;
    }
}

