class Solution {
    int MOD = 1000000007;
    public int findGoodStrings(int n, String s1, String s2, String evil) {
        int m = evil.length();
        int[][][] dp = new int[n+1][2][2];
        int[][] fail = new int[m][26];
        int j = 0;
        for (int i = 1; i < m; i++) {
            while (j > 0 && evil.charAt(i) != evil.charAt(j)) {
                j = fail[j-1][evil.charAt(j)-'a'];
            }
            if (evil.charAt(i) == evil.charAt(j)) {
                j++;
            }
            fail[i][evil.charAt(i)-'a'] = j;
        }
        char[] e = evil.toCharArray();
        boolean a = true;
        for (int i = n-1; i >= 0; i--) {
            boolean l = (i==0 || s1.charAt(i-1) < s2.charAt(i-1));
            boolean r = (i==0 || s1.charAt(i-1) > s2.charAt(i-1));
            for (char c = 'a'; c <= 'z'; c++) {
                int k = m;
                while (k > 0 && c != e[k-1]) {
                    k = fail[k-1][c-'a'];
                }
                if (c == e[k-1]) {
                    k--;
                }
                if (k < m && l) {
                    dp[i][0][1] = (dp[i][0][1] + dp[i+1][0][1]) % MOD;
                    dp[i][0][1] = (dp[i][0][1] + dp[i+1][0][0]) % MOD;
                    dp[i][0][1] = (dp[i][0][1] + dp[i+1][1][1]) % MOD;
                    dp[i][0][1] = (dp[i][0][1] + dp[i+1][1][0]) % MOD;
                }
                if (k == m && r) {
                    dp[i][1][0] = (dp[i][1][0] + dp[i+1][0][0]) % MOD;
                    dp[i][1][0] = (dp[i][1][0] + dp[i+1][1][0]) % MOD;
                }
                if (r) {
                    dp[i][a&&c==s1.charAt(i)?0:1][a&&c==s2.charAt(i)?1:0] = (dp[i][a&&c==s1.charAt(i)?0:1][a&&c==s2.charAt(i)?1:0] + 1) % MOD;
                }
            }
            a &= s1.charAt(i) == s2.charAt(i);
        }
        return (dp[0][0][1] + dp[0][1][0]) % MOD;
    }
}

class UndergroundSystem {

    Map<Integer, Pair<String, Integer>> checkIns;
    Map<String, Pair<Integer, Integer>> travelTimes;

    public UndergroundSystem() {
        checkIns = new HashMap<>();
        travelTimes = new HashMap<>();
    }

    public void checkIn(int id, String stationName, int t) {
        checkIns.put(id, new Pair<>(stationName, t));
    }

    public void checkOut(int id, String stationName, int t) {
        Pair<String, Integer> checkIn = checkIns.get(id);
        String route = checkIn.getKey() + "," + stationName;
        int travelTime = t - checkIn.getValue();
        Pair<Integer, Integer> totalTime = travelTimes.getOrDefault(route, new Pair<>(0, 0));
        travelTimes.put(route, new Pair<>(totalTime.getKey() + travelTime, totalTime.getValue() + 1));
        checkIns.remove(id);
    }

    public double getAverageTime(String startStation, String endStation) {
        String route = startStation + "," + endStation;
        Pair<Integer, Integer> totalTime = travelTimes.get(route);
        return (double) totalTime.getKey() / totalTime.getValue();
    }
}

