class Solution {
    public double frogPosition(int n, int[][] edges, int t, int target) {
        List<List<Integer>> graph = new ArrayList<>();
        for (int i = 0; i <= n; i++) {
            graph.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            graph.get(edge[0]).add(edge[1]);
            graph.get(edge[1]).add(edge[0]);
        }
        boolean[] visited = new boolean[n+1];
        visited[1] = true;
        return dfs(graph, visited, 1, t, target);
    }
    private double dfs(List<List<Integer>> graph, boolean[] visited, int curr, int t, int target) {
        if (t == 0) {
            return curr == target ? 1 : 0;
        }
        double res = 0;
        int count = 0;
        for (int next : graph.get(curr)) {
            if (!visited[next]) {
                visited[next] = true;
                res += dfs(graph, visited, next, t-1, target);
                visited[next] = false;
                count++;
            }
        }
        if (count == 0) {
            res = curr == target ? 1 : 0;
        }
        return res / count;
    }
}

class Solution {
    public int numOfMinutes(int n, int headID, int[] manager, int[] informTime) {
        int[] dp = new int[n];
        int res = 0;
        for (int i = 0; i < n; i++) {
            res = Math.max(res, dfs(i, manager, dp, informTime));
        }
        return res;
    }
    
    private int dfs(int i, int[] manager, int[] dp, int[] informTime) {
        if (manager[i] == -1) {
            return 0;
        }
        if (dp[i] != 0) {
            return dp[i];
        }
        dp[i] = dfs(manager[i], manager, dp, informTime) + informTime[manager[i]];
        return dp[i];
    }
}

