class Solution {
    public int maxSizeSlices(int[] slices) {
        int n = slices.length;
        int m = n/3;
        int[][] dp = new int[n+1][m+1];

        for(int i=1; i <=n; i++){
            for(int j=1; j<=m; j++){
                dp[i][j] = Integer.MIN_VALUE;
                for(int k=1; k<i-1+(j>=2?1:0); k++){
                    dp[i][j] = Math.max(dp[i][j],dp[k-1][j-1]+sum(slices,k,i-1));
                }
            }
        }

        return dp[n][m];
    }

    private int sum(int[] slices, int start, int end){
        int res = 0;
        for(int i=start; i<=end; i++){
            res += slices[i-1];
        }
        return res;
    }
}

class Solution {
    public int getKth(int lo, int hi, int k) {
        Map<Integer, Integer> powerMap = new HashMap<>();
        for (int i = lo; i <= hi; i++) {
            powerMap.put(i, getPower(i));
        }
        List<Map.Entry<Integer, Integer>> sortedPowerList = new ArrayList<>(powerMap.entrySet());
        sortedPowerList.sort((entry1, entry2) -> {
            int powerCompare = Integer.compare(entry1.getValue(), entry2.getValue());
            return powerCompare == 0 ? Integer.compare(entry1.getKey(), entry2.getKey()) : powerCompare;
        });
        return sortedPowerList.get(k - 1).getKey();
    }
    
    private int getPower(int n) {
        int power = 0;
        while (n != 1) {
            if (n % 2 == 0) {
                n /= 2;
            } else {
                n = n * 3 + 1;
            }
            power++;
        }
        return power;
    }
}

