            if (col >= 2 && col <= 9)
                map.put(row, map.getOrDefault(row, 0) | (1 << (col - 2)));
        }
        int count = (n - map.size()) * 2; 
        for (int row: map.keySet()) {
            int reserved = map.get(row);
            if (((reserved >> 1) & reserved) == 0) count++;
            if (((reserved >> 3) & reserved) == 0 && ((reserved >> 2) & reserved) == 0 && ((reserved >> 1) & reserved) == 0) count++;
            if (((reserved >> 7) & reserved) == 0 && ((reserved >> 6) & reserved) == 0 && ((reserved >> 5) & reserved) == 0) count++;
        }
        return count;
    }
}

