class Solution {
    public boolean isPossible(int[] target) {
        PriorityQueue<Integer> pq = new PriorityQueue<>(Collections.reverseOrder());
        long sum = 0;
        for (int num : target) {
            pq.add(num);
            sum += num;
        }
        while (pq.peek() != 1) {
            int curr = pq.remove();
            sum -= curr;
            if (curr <= sum || sum < 1) {
                return false;
            }
            int prev = curr % ((int)sum);
            sum += prev;
            pq.add(prev == 0 ? (int)sum : prev);
        }
        return true;
    }
}

