    public int longestZigZag(TreeNode root) {
        dfs(root.left, 1, true);
        dfs(root.right, 1, false);
        return res;
    }
    private void dfs(TreeNode node, int len, boolean isLeft) {
        if (node == null) {
            res = Math.max(res, len - 1);
            return;
        }
        if (isLeft) {
            dfs(node.right, len + 1, false);
            dfs(node.left, 1, true);
        } else {
            dfs(node.left, len + 1, true);
            dfs(node.right, 1, false);
        }
    }
}

class Solution {
    public int findTheLongestSubstring(String s) {
        int[] pos = new int[32];
        Arrays.fill(pos, -1);
        pos[0] = 0;
        int cur = 0, res = 0;
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if (c == 'a') cur ^= 1;
            else if (c == 'e') cur ^= 2;
            else if (c == 'i') cur ^= 4;
            else if (c == 'o') cur ^= 8;
            else if (c == 'u') cur ^= 16;
            if (pos[cur] >= 0) res = Math.max(res, i + 1 - pos[cur]);
            else pos[cur] = i + 1;
        }
        return res;
    }
}

