class Solution {
    public int maxStudents(char[][] seats) {
        int m = seats.length, n = seats[0].length;
        int[] validRows = new int[m];
        for (int i = 0; i < m; i++) {
            int row = 0;
            for (int j = 0; j < n; j++) {
                row <<= 1;
                if (seats[i][j] == '.') row |= 1;
            }
            validRows[i] = row;
        }
        int[][] dp = new int[m][1 << n];
        for (int row = 0; row < m; row++) {
            for (int state = 0; state < (1 << n); state++) {
                boolean isValid = true;
                for (int j = 0; j < n && isValid; j++) {
                    if ((state & (1 << j)) != 0 && ((validRows[row] & (1 << j)) == 0)) {
                        isValid = false;
                    }
                    if (j > 0 && (state & (1 << j)) != 0 && (state & (1 << (j - 1))) != 0) {
                        isValid = false;
                    }
                    if (j > 0 && (state & (1 << j)) != 0 && ((validRows[row] & (1 << (j - 1))) != 0) && ((dp[row][state - (1 << j)] > 0))) {
                        isValid = false;
                    }
                    if (j < n - 1 && (state & (1 << j)) != 0 && ((validRows[row] & (1 << (j + 1))) != 0) && ((dp[row][state + (1 << (j + 1))] > 0))) {
                        isValid = false;
                    }
                }
                if (isValid) {
                    for (int lastState = 0; lastState < (1 << n); lastState++) {
                        if ((lastState & state) == 0) {
                            int count = Integer.bitCount(state);
                            if (row == 0) {
                                dp[row][state] = count;
                            } else {
                                dp[row][state] = Math.max(dp[row][state], dp[row - 1][lastState] + count);
                            }
                        }
                    }
                }
            }
        }
        int res = 0;
        for (int state = 0; state < (1 << n); state++) {
            res = Math.max(res, dp[m - 1][state]);
        }
        return res;
    }
}

