class Solution {
    public int maxJumps(int[] arr, int d) {
        int n=arr.length, res=0;
        int[] dp=new int[n];
        Arrays.fill(dp, -1);
        for(int i=0;i<n;i++)
            getLongestPath(arr, dp, i, d);
        for(int i=0;i<n;i++)
            res=Math.max(res, dp[i]);
        return res;
    }
    private int getLongestPath(int[] arr, int[] dp, int i, int d){
        if(dp[i]!=-1)
            return dp[i];
        dp[i]=1;
        for(int j=i-1;j>=Math.max(0, i-d);j--){
            if(arr[j]>=arr[i])
                break;
            dp[i]=Math.max(dp[i], 1+getLongestPath(arr, dp, j, d));
        }
        for(int j=i+1;j<=Math.min(arr.length-1, i+d);j++){
            if(arr[j]>=arr[i])
                break;
            dp[i]=Math.max(dp[i], 1+getLongestPath(arr, dp, j, d));
        }
        return dp[i];
    }
}

class Solution {
    private static final int MOD = 1000000007;
    private long res = Long.MIN_VALUE;
    private int totalSum = 0;

    public int maxProduct(TreeNode root) {
        totalSum = getTotalSum(root);
        dfs(root);
        return (int) (res % MOD);
    }

    private int getTotalSum(TreeNode root) {
        if (root == null) {
            return 0;
        }
        return root.val + getTotalSum(root.left) + getTotalSum(root.right);
    }

    private int dfs(TreeNode root) {
        if (root == null) {
            return 0;
        }
        int currSum = root.val + dfs(root.left) + dfs(root.right);
        res = Math.max(res, (long) (totalSum - currSum) * currSum);
        return currSum;
    }
}

class Solution {
    public int minSetSize(int[] arr) {
        Map<Integer, Integer> freqMap = new HashMap<>();
        for(int num : arr) {
            freqMap.put(num, freqMap.getOrDefault(num, 0) + 1);
        }
        List<Integer> frequencies = new ArrayList<>(freqMap.values());
        Collections.sort(frequencies, Collections.reverseOrder());
        int newSize = 0, count = 0;
        for(int frequency : frequencies) {
            count += frequency;
            newSize++;
            if(count >= arr.length / 2) {
                break;
            }
        }
        return newSize;
    }
}

class Solution {
    public int[] kWeakestRows(int[][] mat, int k) {
        PriorityQueue<int[]> pq=new PriorityQueue<>((a,b)->{
            if(a[0]!=b[0]){
                return b[0]-a[0];
            }
            return b[1]-a[1];
        });
        for(int i=0;i<mat.length;i++){
            int lo=0,hi=mat[i].length-1;
            while(lo<=hi){
                int mid=(lo+hi)/2;
                if(mat[i][mid]==1){
                    lo=mid+1;
                }else{
                    hi=mid-1;
                }
            }
            pq.add(new int[]{lo,i});
            if(pq.size()>k){
                pq.poll();
            }
        }
        int[] res=new int[k];
        while(k-- >0){
            res[k]=pq.poll()[1];
        }
        return res;
    }
}

class Solution {
    public int countOrders(int n) {
        long mod = (long) 1e9 + 7;
        long ans = 1;
        for (int i = 1; i <= n; i++) {
            ans = ans * i % mod;
            ans = ans * (2 * i - 1) % mod;
        }
        return (int) ans;
    }
}

class Solution {
    public int numberOfSubstrings(String s) {
        int[] counts = {0,0,0};
        int left = 0, result = 0;
        for (int right = 0; right < s.length(); right++) {
            counts[s.charAt(right)-'a']++;
            while (counts[0] > 0 && counts[1] > 0 && counts[2] > 0) {
                counts[s.charAt(left)-'a']--;
                left++;
            }
            result += left;
        }
        return result;
    }
}

class Cashier {
    int n, discount, cnt;
    Map<Integer, Integer> price;
    public Cashier(int n, int discount, int[] products, int[] prices) {
        this.n = n;
        this.discount = discount;
        cnt = 0;
        price = new HashMap<>();
        for (int i = 0; i < products.length; i++) {
            price.put(products[i], prices[i]);
        }
    }

    public double getBill(int[] product, int[] amount) {
        double res = 0.0;
        for (int i = 0; i < product.length; i++) {
            res += price.get(product[i]) * amount[i];
        }
        cnt++;
        if (cnt == n) {
            cnt = 0;
            res = res * (100 - discount) / 100;
        }
        return res;
    }
}

class Solution {
    public int[] sortByBits(int[] arr) {
        Integer[] boxed = Arrays.stream(arr).boxed().toArray(Integer[]::new);
        Arrays.sort(boxed, (a,b) -> Integer.bitCount(a) == Integer.bitCount(b) ? a - b : Integer.bitCount(a) - Integer.bitCount(b));
        return Arrays.stream(boxed).mapToInt(i -> i).toArray();
    }
}

class Solution {
    public int minDifficulty(int[] jobDifficulty, int d) {
        int n = jobDifficulty.length;
        if (n < d) return -1;
        int[][] dp = new int[d][n];
        dp[0][0] = jobDifficulty[0];
        for (int j = 1; j < n; j++) {
            dp[0][j] = Math.max(dp[0][j-1], jobDifficulty[j]);
        }
        for (int i = 1; i < d; i++) {
            for (int j = i; j < n; j++) {
                int maxd = 0;
                dp[i][j] = Integer.MAX_VALUE;
                for (int k = j; k >= i; k--) {
                    maxd = Math.max(maxd, jobDifficulty[k]);
                    dp[i][j] = Math.min(dp[i][j], dp[i-1][k-1] + maxd);
                }
            }
        }
        return dp[d-1][n-1];
    }
}

class Solution {
    public int findTheCity(int n, int[][] edges, int distanceThreshold) {
        int[][] dist = new int[n][n];
        for (int i = 0; i < n; i++) {
            Arrays.fill(dist[i], 10001);
            dist[i][i] = 0;
        }
        for (int[] edge : edges) {
            dist[edge[0]][edge[1]] = edge[2];
            dist[edge[1]][edge[0]] = edge[2];
        }
        for (int k = 0; k < n; k++) {
            for (int i = 0; i < n; i++) {
                for (int j = 0; j < n; j++) {
                    dist[i][j] = Math.min(dist[i][j], dist[i][k] + dist[k][j]);
                }
            }
        }
        int ans = -1, minCount = n;
        for (int i = 0; i < n; i++) {
            int count = 0;
            for (int j = 0; j < n; j++) {
                if (i != j && dist[i][j] <= distanceThreshold) {
                    count++;
                }
            }
            if (count <= minCount) {
                ans = i;
                minCount = count;
            }
        }
        return ans;
    }
}

class Solution {
    public List<Integer> filterRestaurants(int[][] restaurants, int veganFriendly, int maxPrice, int maxDistance) {
        List<Integer> res = new ArrayList<>();
        PriorityQueue<int[]> pq = new PriorityQueue<>((a,b) -> {
            if (a[1] != b[1]) {
                return b[1] - a[1];
            }
            return b[0] - a[0];
        });
        for (int[] r : restaurants) {
            if (r[3] <= maxPrice && r[4] <= maxDistance && (veganFriendly == 0 || r[2] == 1)) {
                pq.offer(r);
            }
        }
        while (!pq.isEmpty()) {
            res.add(pq.poll()[0]);
        }
        return res;
    }
}

class Solution {
    public int removePalindromeSub(String s) {
        if (s.length() == 0) 
            return 0;
        int i = 0, j = s.length() - 1;
        while (i < j) {
            if (s.charAt(i) != s.charAt(j)) 
                return 2;
            i++;
            j--;
        }
        return 1;
    }
}

class Solution {
    public int minTaps(int n, int[] ranges) {
        int[] dp = new int[n + 1];
        Arrays.fill(dp, n + 2);
        dp[0] = 0;
        for (int i = 0; i <= n; i++) {
            int left = Math.max(i - ranges[i] + 1, 0);
            int right = Math.min(i + ranges[i], n);
            for (int j = left; j <= right; j++) {
                dp[j] = Math.min(dp[j], dp[Math.max(left - 1, 0)] + 1);
            }
        }
        return dp[n] == n + 2 ? -1 : dp[n];
    }
}

class Solution {
    public TreeNode removeLeafNodes(TreeNode root, int target) {
        if (root == null) return null;
        root.left = removeLeafNodes(root.left, target);
        root.right = removeLeafNodes(root.right, target);
        if (root.left == null && root.right == null && root.val == target) return null;
        return root;
    }
}

class Solution {
    public List<String> printVertically(String s) {
        List<String> res = new ArrayList<>();
        String[] words = s.split(" ");
        int maxLength = 0;
        for (String w : words) {
            maxLength = Math.max(maxLength, w.length());
        }
        for (int i = 0; i < maxLength; i++) {
            StringBuilder sb = new StringBuilder();
            for (String w : words) {
                if (i < w.length()) {
                    sb.append(w.charAt(i));
                } else {
                    sb.append(" ");
                }
            }
            while (sb.charAt(sb.length()-1) == ' ') {
                sb.deleteCharAt(sb.length()-1);
            }
            res.add(sb.toString());
        }
        return res;
    }
}

class Solution {
    public int maximum69Number (int num) {
        String s = Integer.toString(num);
        StringBuffer sb = new StringBuffer(s);
        for(int i=0;i<s.length();i++){
            if(s.charAt(i)=='6'){
                sb.setCharAt(i,'9');
                break;
            }
        }
        return Integer.parseInt(sb.toString());
    }
}

class Solution {
    public int minJumps(int[] arr) {
        Map<Integer, List<Integer>> graph = new HashMap<>();
        for (int i = 0; i < arr.length; i++) {
            graph.computeIfAbsent(arr[i], x -> new ArrayList<>()).add(i);
        }
        Queue<Integer> q = new LinkedList<>();
        boolean[] visited = new boolean[arr.length];
        q.offer(0);
        visited[0] = true;
        int steps = 0;
        while (!q.isEmpty()) {
            int size = q.size();
            for (int i = 0; i < size; i++) {
                int cur = q.poll();
                if (cur == arr.length - 1) {
                    return steps;
                }
                List<Integer> neighbors = graph.getOrDefault(arr[cur], new ArrayList<>());
                neighbors.add(cur - 1);
                neighbors.add(cur + 1);
                for (int neighbor : neighbors) {
                    if (neighbor >= 0 && neighbor < arr.length && !visited[neighbor]) {
                        visited[neighbor] = true;
                        q.offer(neighbor);
                    }
                }
            }
            steps++;
        }
        return -1;
    }
}

class Solution {
    public double angleClock(int hour, int minutes) {
        double h = (hour%12 + (double)minutes/60)*30;
        double m = minutes*6;
        double angle = Math.abs(h-m);
        return Math.min(angle, 360-angle);
    }
}

class Solution {
    public int numOfSubarrays(int[] arr, int k, int threshold) {
        int sum = 0;
        int ans = 0;
        int target = k * threshold;
        for (int i = 0; i < k; i++) {
            sum += arr[i];
        }
        if (sum >= target) {
            ans++;
        }
        for (int i = k; i < arr.length; i++) {
            sum += arr[i] - arr[i-k];
            if (sum >= target) {
                ans++;
            }
        }
        return ans;
    }
}

class Solution {
    public int numberOfSteps (int num) {
        int count = 0;
        while (num > 0) {
            if (num % 2 == 0) {
                num /= 2;
            } else {
                num -= 1;
            }
            count++;
        }
        return count;
    }
}

class Solution {
    public int minimumDistance(String word) {
        int[][][] dp = new int[27][27][301];
        int n = word.length();
        for(int i = n-1; i >= 0; --i){
            int letter = word.charAt(i) - 'A';
            for(int j = 0; j < 27; ++j){
                for(int k = 0; k < 27; ++k){
                    int x = j/6, y = j%6, nx = letter/6, ny = letter%6;
                    dp[letter][k][i] = Math.min(dp[letter][k][i], dp[j][k][i+1]+(Math.abs(x-nx)+Math.abs(y-ny)));
                    x = k/6;
                    y = k%6;
                    dp[j][letter][i] = Math.min(dp[j][letter][i], dp[j][k][i+1]+(Math.abs(x-nx)+Math.abs(y-ny)));
                }
            }
        }
        int ans = Integer.MAX_VALUE;
        for(int i = 0; i < 27; ++i){
            for(int j = 0; j < 27; ++j){
                ans = Math.min(ans, dp[i][j][0]);
            }
        }
        return ans;
    }
}

class Solution {
    public int makeConnected(int n, int[][] connections) {
        if (connections.length < n - 1) return -1;
        int[] parent = new int[n];
        for (int i = 0; i < n; i++) parent[i] = i;
        for (int[] conn : connections) {
            int p1 = find(parent, conn[0]);
            int p2 = find(parent, conn[1]);
            parent[p1] = p2;
        }
        int count = 0;
        for (int i = 0; i < n; i++) {
            if (parent[i] == i) count++;
        }
        return count - 1;
    }
    private int find(int[] parent, int x) {
        if (parent[x] != x) parent[x] = find(parent, parent[x]);
        return parent[x];
    }
}

class Solution {
    public int minFlips(int a, int b, int c) {
        int flips = 0;
        for (int i = 0; i < 31; i++) {
            int bitA = (a >> i) & 1;
            int bitB = (b >> i) & 1;
            int bitC = (c >> i) & 1;
            if ((bitA | bitB) != bitC) {
                if (bitC == 1) {
                    flips++;
                } else {
                    flips += (bitA + bitB);
                }
            }
        }
        return flips;
    }
}

class Solution {
    public int[] getNoZeroIntegers(int n) {
        for (int i = 1; i <= n / 2; i++) {
            if (!String.valueOf(i).contains("0") && !String.valueOf(n - i).contains("0")) {
                return new int[]{i, n - i};
            }
        }
        return new int[]{};
    }
}

class Solution {
    public int minInsertions(String s) {
        int n = s.length();
        int[][] dp = new int[n][n];
        for (int len = 2; len <= n; len++) {
            for (int i = 0, j = len - 1; j < n; i++, j++) {
                dp[i][j] = (s.charAt(i) == s.charAt(j)) ? dp[i + 1][j - 1] : Math.min(dp[i][j - 1], dp[i + 1][j]) + 1;
            }
        }
        return dp[0][n - 1];
    }
}

class Solution {
    public List<String> watchedVideosByFriends(List<List<String>> watchedVideos, int[][] friends, int id, int level) {
        Queue<Integer> queue = new LinkedList<>();
        boolean[] visited = new boolean[friends.length];
        visited[id] = true;
        queue.offer(id);
        int curLevel = 0;
        Map<String, Integer> freqMap = new HashMap<>();
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                int cur = queue.poll();
                if (curLevel == level) {
                    for (String video : watchedVideos.get(cur)) {
                        freqMap.put(video, freqMap.getOrDefault(video, 0) + 1);
                    }
                } else {
                    for (int friend : friends[cur]) {
                        if (!visited[friend]) {
                            visited[friend] = true;
                            queue.offer(friend);
                        }
                    }
                }
            }
            curLevel++;
        }
        List<String> res = new ArrayList<>(freqMap.keySet());
        Collections.sort(res, (a, b) -> freqMap.get(a) == freqMap.get(b) ? a.compareTo(b) : freqMap.get(a) - freqMap.get(b));
        return res;
    }
}

class Solution {
    public int[] xorQueries(int[] arr, int[][] queries) {
        int n = arr.length;
        int[] prefix = new int[n+1];
        for (int i = 1; i <= n; i++) {
            prefix[i] = prefix[i-1] ^ arr[i-1];
        }
        int m = queries.length;
        int[] ans = new int[m];
        for (int i = 0; i < m; i++) {
            int left = queries[i][0], right = queries[i][1];
            ans[i] = prefix[right+1] ^ prefix[left];
        }
        return ans;
    }
}

class Solution {
    public String freqAlphabets(String s) {
        StringBuilder sb = new StringBuilder();
        int i = 0;
        while (i < s.length()) {
            if (i + 2 < s.length() && s.charAt(i + 2) == '#') {
                int num = Integer.parseInt(s.substring(i, i + 2));
                sb.append((char) ('a' + num - 1));
                i += 3;
            } else {
                int num = s.charAt(i) - '0';
                sb.append((char) ('a' + num - 1));
                i++;
            }
        }
        return sb.toString();
    }
}

class Encrypter {
    private Map<String, Character> decryptMap;
    
    public Encrypter(char[] keys, String[] values, String[] dictionary) {
        decryptMap = new HashMap<>();
        for (int i = 0; i < values.length; i++) {
            decryptMap.put(values[i], keys[i]);
        }
    }
    
    public String encrypt(String word1) {
        StringBuilder sb = new StringBuilder();
        for (char c : word1.toCharArray()) {
            String value = decryptMap.get(String.valueOf(c));
            if (value == null) {
                return "";
            }
            sb.append(value);
        }
        return sb.toString();
    }
    
    public int decrypt(String word2) {
        Set<String> possibleWords = new HashSet<>();
        for (int i = 0; i < word2.length(); i += 2) {
            String substring = word2.substring(i, i + 2);
            if (decryptMap.containsKey(substring)) {
                char c = decryptMap.get(substring);
                if (possibleWords.isEmpty()) {
                    possibleWords.add(String.valueOf(c));
                } else {
                    Set<String> newPossibleWords = new HashSet<>();
                    for (String word : possibleWords) {
                        newPossibleWords.add(word + c);
                    }
                    possibleWords = newPossibleWords;
                }
            }
        }
        int count = 0;
        for (String word : possibleWords) {
            if (Arrays.binarySearch(dictionary, word) >= 0) {
                count++;
            }
        }
        return count;
    }
}

class Solution {
    public List<List<Integer>> ancestors(int n, int[][] edges) {
        List<List<Integer>> graph = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            graph.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            graph.get(edge[1]).add(edge[0]);
        }
        List<List<Integer>> result = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            result.add(new ArrayList<>());
            dfs(graph, result.get(i), i, new boolean[n]);
            Collections.sort(result.get(i));
        }
        return result;
    }
    
    private void dfs(List<List<Integer>> graph, List<Integer> ancestors, int node, boolean[] visited) {
        visited[node] = true;
        for (int parent : graph.get(node)) {
            if (!visited[parent]) {
                ancestors.add(parent);
                dfs(graph, ancestors, parent, visited);
            }
        }
    }
}

class Solution {
    public int kBeauty(int num, int k) {
        String s = String.valueOf(num);
        int count = 0;
        for (int i = 0; i <= s.length() - k; i++) {
            int curr = Integer.parseInt(s.substring(i, i + k));
            if (curr != 0 && num % curr == 0) {
                count++;
            }
        }
        return count;
    }
}

class Solution {
    public boolean isSolvable(String[] words, String result) {
        int[] freq = new int[26];
        boolean[] used = new boolean[10];
        int n = words.length;
        String[] reverseWords = new String[n];
        for (int i = 0; i < n; i++) {
            reverseWords[i] = new StringBuilder(words[i]).reverse().toString();
            if (i == n - 1) {
                reverseWords[i] = result;
            }
            if (reverseWords[i].length() > 1) {
                freq[reverseWords[i].charAt(0) - 'A'] = 1;
            }
        }
        return dfs(reverseWords, freq, used, 0, 0, n, result.length() - 1);
    }
    
    private boolean dfs(String[] words, int[] freq, boolean[] used, int index, int carry, int n, int len) {
        if (index == len + 1) {
            return carry == 0;
        }
        if (index == n) {
            int sum = 0;
            for (String word : words) {
                for (int i = 0; i < word.length(); i++) {
                    sum += freq[word.charAt(i) - 'A'];
                }
            }
            return sum == carry;
        }
        String word = words[index];
        int curFreq = 0;
        if (word.length() - 1 == index) {
            curFreq = carry;
        }
        for (int i = word.length() - 1 - index; i >= 0; i--) {
            char c = word.charAt(i);
            if (freq[c - 'A'] != 0) {
                curFreq += freq[c - 'A'];
            }
        }
        int cur = curFreq % 10;
        if (used[cur]) {
            return false;
        }
        used[cur] = true;
        boolean res = dfs(words, freq, used, index + 1, curFreq / 10, n, len);
        if (res) {
            return true;
        }
        used[cur] = false;
        return false;
    }
}

class Solution {
    public boolean canReach(int[] arr, int start) {
        if (start >= 0 && start < arr.length && arr[start] >= 0) {
            if (arr[start] == 0) return true;
            arr[start] = -arr[start];
            return canReach(arr, start + arr[start]) || canReach(arr, start - arr[start]);
        }
        return false;
    }
}

class Solution {
    public List<Integer> getAllElements(TreeNode root1, TreeNode root2) {
        List<Integer> list1 = new ArrayList<>();
        List<Integer> list2 = new ArrayList<>();
        inorder(root1, list1);
        inorder(root2, list2);
        List<Integer> result = new ArrayList<>();
        int i = 0, j = 0;
        while (i < list1.size() && j < list2.size()) {
            if (list1.get(i) < list2.get(j)) {
                result.add(list1.get(i));
                i++;
            } else {
                result.add(list2.get(j));
                j++;
            }
        }
        while (i < list1.size()) {
            result.add(list1.get(i));
            i++;
        }
        while (j < list2.size()) {
            result.add(list2.get(j));
            j++;
        }
        return result;
    }
    
    private void inorder(TreeNode root, List<Integer> list) {
        if (root == null) {
            return;
        }
        inorder(root.left, list);
        list.add(root.val);
        inorder(root.right, list);
    }
}

class Solution {
    public int[] sumZero(int n) {
        int[] result = new int[n];
        int idx = 0;
        if(n % 2 != 0) {
            result[idx++] = 0;
        }
        for(int i = 1; i <= n/2; i++) {
            result[idx++] = i;
            result[idx++] = -i;
        }
        return result;
    }
}

class Solution {
    public int maxCandies(int[] status, int[] candies, int[][] keys, int[][] containedBoxes, int[] initialBoxes) {
        int n = status.length;
        boolean[] visited = new boolean[n];
        boolean[] open = new boolean[n];
        Queue<Integer> queue = new LinkedList<>();
        int ans = 0;

        for (int i : initialBoxes) {
            queue.offer(i);
            visited[i] = true;
        }

        while (!queue.isEmpty()) {
            int cur = queue.poll();
            if (status[cur] == 1 && !open[cur]) {
                open[cur] = true;
                ans += candies[cur];
                for (int key : keys[cur]) {
                    status[key] = 1;
                    if (!visited[key] && open[key]) {
                        queue.offer(key);
                        visited[key] = true;
                    }
                }
                for (int box : containedBoxes[cur]) {
                    if (!visited[box]) {
                        queue.offer(box);
                        visited[box] = true;
                    }
                }
            }
        }

        return ans;
    }
}

class Solution {
    public int maxFreq(String s, int maxLetters, int minSize, int maxSize) {
        Map<String, Integer> map = new HashMap<>();
        int maxFreq = 0;
        for (int i = 0; i + minSize - 1 < s.length(); i++) {
            String sub = s.substring(i, i + minSize);
            if (countUnique(sub) > maxLetters) continue;
            int freq = map.getOrDefault(sub, 0) + 1;
            map.put(sub, freq);
            maxFreq = Math.max(maxFreq, freq);
        }
        return maxFreq;
    }
    
    private int countUnique(String s) {
        boolean[] seen = new boolean[26];
        int count = 0;
        for (char c : s.toCharArray()) {
            if (!seen[c-'a']) {
                seen[c-'a'] = true;
                count++;
            }
        }
        return count;
    }
}

class Solution {
    public boolean isPossibleDivide(int[] nums, int k) {
        if (nums.length % k != 0) return false;
        TreeMap<Integer, Integer> map = new TreeMap<>();
        for (int num : nums) {
            map.put(num, map.getOrDefault(num, 0) + 1);
        }
        while (!map.isEmpty()) {
            int first = map.firstKey();
            for (int i = first; i < first + k; i++) {
                if (!map.containsKey(i)) return false;
                int count = map.get(i);
                if (count == 1) {
                    map.remove(i);
                } else {
                    map.put(i, count - 1);
                }
            }
        }
        return true;
    }
}

class Solution {
    public int findNumbers(int[] nums) {
