        for (int num : nums) {
            if ((int) Math.log10(num) % 2 == 1) {
                count++;
            }
        }
        return count;
    }
}

class Solution {
    public int findMinDifference(int[] nums, int k) {
        Arrays.sort(nums);
        int n = nums.length;
        int ans = Integer.MAX_VALUE;
        for (int i = k - 1; i < n; i++) {
            ans = Math.min(ans, nums[i] - nums[i - k + 1]);
        }
        return ans;
    }
}

class Solution {
    public int shortestPath(int[][] grid, int k) {
        int m = grid.length;
        int n = grid[0].length;
        int[][] direcs = {{1,0},{-1,0},{0,1},{0,-1}};
        Queue<int[]> queue = new LinkedList<>();
        boolean[][][] visited = new boolean[m][n][k+1];
        visited[0][0][0] = true;
        queue.offer(new int[]{0,0,0});
        int steps = 0;
        while(!queue.isEmpty()){
            int size = queue.size();
            for(int i=0; i<size; i++){
                int[] curr = queue.poll();
                int x = curr[0];
                int y = curr[1];
                int curK = curr[2];
                if(x == m-1 && y == n-1) return steps;
                for(int[] direc : direcs){
                    int newX = x + direc[0];
                    int newY = y + direc[1];
                    if(newX < 0 || newX >= m || newY < 0 || newY >= n) continue;
                    int newK = curK + grid[newX][newY];
                    if(newK <= k && !visited[newX][newY][newK]){
                        visited[newX][newY][newK] = true;
                        queue.offer(new int[]{newX,newY,newK});
                    }
                }
            }
            steps++;
        }
        return -1;
    }
}

class Solution {
    public int maxSideLength(int[][] mat, int threshold) {
        int m = mat.length, n = mat[0].length;
        int[][] dp = new int[m+1][n+1];
        int res = 0;
        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                dp[i][j] = mat[i-1][j-1] + dp[i-1][j] + dp[i][j-1] - dp[i-1][j-1];
                if (i >= res && j >= res && dp[i][j] - dp[i-res-1][j] - dp[i][j-res-1] + dp[i-res-1][j-res-1] <= threshold) {
                    res++;
                }
            }
        }
        return res;
    }
}

class Solution {
    public int getDecimalValue(ListNode head) {
