        while (head.next != null) {
            num = num * 2 + head.next.val;
            head = head.next;
        }
        return num;
    }
}

class Solution {
    public int minFlips(int[][] mat) {
        int m = mat.length, n = mat[0].length;
        int[][] dirs = {{0,1},{0,-1},{1,0},{-1,0},{0,0}};
        Queue<int[][]> queue = new LinkedList<>();
        Set<String> visited = new HashSet<>();
        queue.offer(mat);
        visited.add(Arrays.deepToString(mat));
        int steps = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int k = 0; k < size; k++) {
                int[][] curr = queue.poll();
                if (isZero(curr)) return steps;
                for (int i = 0; i < m; i++) {
                    for (int j = 0; j < n; j++) {
                        int[][] next = new int[m][n];
                        for (int r = 0; r < m; r++) {
                            for (int c = 0; c < n; c++) {
                                next[r][c] = curr[r][c];
                            }
                        }
                        next[i][j] = 1 - next[i][j];
                        for (int[] dir : dirs) {
                            int row = i + dir[0], col = j + dir[1];
                            if (row < 0 || row >= m || col < 0 || col >= n) continue;
                            next[row][col] = 1 - next[row][col];
                        }
                        if (!visited.contains(Arrays.deepToString(next))) {
                            queue.offer(next);
                            visited.add(Arrays.deepToString(next));
                        }
                    }
                }
            }
            steps++;
        }
        return -1;
    }
    
    private boolean isZero(int[][] mat) {
        for (int[] row : mat) {
            for (int cell : row) {
                if (cell == 1) return false;
            }
        }
        return true;
    }
}

class Solution {
    public int smallestDivisor(int[] nums, int threshold) {
        int left = 1, right = (int)1e6;
        while (left < right) {
            int mid = (left + right) / 2;
            int sum = 0;
            for (int num : nums) {
                sum += (num + mid - 1) / mid;
            }
            if (sum > threshold) {
                left = mid + 1;
            } else {
                right = mid;
            }
        }
        return left;
    }
}

class Solution {
    public List<List<Integer>> groupThePeople(int[] groupSizes) {
