        for (int i = 0; i < groupSizes.length; i++) {
            int size = groupSizes[i];
            List<Integer> group = map.getOrDefault(size, new ArrayList<>());
            group.add(i);
            if (group.size() == size) {
                groups.add(group);
                map.put(size, new ArrayList<>());
            } else {
                map.put(size, group);
            }
        }
        return groups;
    }
}

class Solution {
    public int subtractProductAndSum(int n) {
        int product = 1; 
        int sum = 0; 
        
        while (n != 0) {
            int digit = n % 10; 
            product *= digit; 
            sum += digit; 
            n /= 10; 
        }
        
        return product - sum; 
    }
}

class Solution {
    public int palindromePartition(String s, int k) {
        int n = s.length();
        int[][] cost = new int[n][n];
        for (int len = 2; len <= n; len++) {
            for (int i = 0, j = len - 1; j < n; i++, j++) {
                cost[i][j] = cost[i+1][j-1] + (s.charAt(i) == s.charAt(j) ? 0 : 1);
            }
        }
        int[][] dp = new int[n+1][k+1];
        for (int i = 1; i <= n; i++) {
            Arrays.fill(dp[i], Integer.MAX_VALUE);
            dp[i][1] = cost[0][i-1];
            for (int j = 2; j <= k; j++) {
                for (int p = j-1; p < i; p++) {
                    dp[i][j] = Math.min(dp[i][j], dp[p][j-1] + cost[p][i-1]);
                }
            }
        }
        return dp[n][k];
    }
}

class Solution {
    public int countSquares(int[][] matrix) {
        int m = matrix.length, n = matrix[0].length, count = 0;
        int[][] dp = new int[m][n];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (matrix[i][j] == 1) {
                    dp[i][j] = 1;
                    if (i > 0 && j > 0) {
                        dp[i][j] += Math.min(dp[i-1][j-1], Math.min(dp[i-1][j], dp[i][j-1]));
                    }
                    count += dp[i][j];
                }
            }
        }
        return count;
    }
}

class Solution {
    public List<Integer> numOfBurgers(int tomatoSlices, int cheeseSlices) {
        List<Integer> res = new ArrayList<>();
        int x = tomatoSlices - cheeseSlices * 2;
        if (x < 0 || x % 2 == 1 || cheeseSlices * 4 - tomatoSlices < 0) return res;
        res.add(x / 2);
        res.add(cheeseSlices - x / 2);
        return res;
    }
}

class Solution {
    public String tictactoe(int[][] moves) {
        int[][] grid = new int[3][3];
        int player = 1;
        for (int[] move : moves) {
            grid[move[0]][move[1]] = player;
            player = player == 1 ? 2 : 1;
        }
        for (int i = 0; i < 3; i++) {
            if (grid[i][0] == grid[i][1] && grid[i][1] == grid[i][2] && grid[i][0] != 0)
                return grid[i][0] == 1 ? "A" : "B";
            if (grid[0][i] == grid[1][i] && grid[1][i] == grid[2][i] && grid[0][i] != 0)
                return grid[0][i] == 1 ? "A" : "B";
        }
        if (grid[0][0] == grid[1][1] && grid[1][1] == grid[2][2] && grid[0][0] != 0)
            return grid[0][0] == 1 ? "A" : "B";
        if (grid[0][2] == grid[1][1] && grid[1][1] == grid[2][0] && grid[0][2] != 0)
            return grid[0][2] == 1 ? "A" : "B";
        return moves.length == 9 ? "Draw" : "Pending";
    }
}

class Solution {
    public int numWays(int steps, int arrLen) {
        int mod = 1000000007;
        int maxPos = Math.min(steps / 2, arrLen - 1);
        int[][] dp = new int[steps + 1][maxPos + 1];
        dp[0][0] = 1;
        for (int i = 1; i <= steps; i++) {
            for (int j = 0; j <= maxPos; j++) {
                dp[i][j] = dp[i - 1][j];
                if (j > 0) {
                    dp[i][j] = (dp[i][j] + dp[i - 1][j - 1]) % mod;
                }
                if (j < maxPos) {
                    dp[i][j] = (dp[i][j] + dp[i - 1][j + 1]) % mod;
                }
            }
        }
        return dp[steps][0];
    }
}

class Solution {
    public List<List<String>> suggestedProducts(String[] products, String searchWord) {
        Arrays.sort(products);
        List<List<String>> res = new ArrayList<>();
        int start = 0, end = products.length - 1;
        for (int i = 0; i < searchWord.length(); i++) {
            List<String> list = new ArrayList<>();
            char c = searchWord.charAt(i);
            while (start <= end && (products[start].length() <= i || products[start].charAt(i) != c)) {
                start++;
            }
            while (start <= end && (products[end].length() <= i || products[end].charAt(i) != c)) {
                end--;
            }
            int num = Math.min(3, end - start + 1);
            for (int j = 0; j < num; j++) {
                list.add(products[start + j]);
            }
            res.add(list);
        }
        return res;
    }
}

class Solution {
