class Solution {
    public int minTimeToVisitAllPoints(int[][] points) {
        int seconds = 0;
        for (int i = 1; i < points.length; i++) {
            int xDiff = Math.abs(points[i][0] - points[i-1][0]);
            int yDiff = Math.abs(points[i][1] - points[i-1][1]);
            seconds += Math.max(xDiff, yDiff);
        }
        return seconds;
    }
}

class Solution {
    public int minCost(int[][] grid, int[][] moveCost) {
        int m = grid.length;
        int n = grid[0].length;
        int[][] dp = new int[m][n];
        for (int i = 0; i < m; i++) {
            Arrays.fill(dp[i], Integer.MAX_VALUE);
        }
        dp[0][0] = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                for (int k = 0; k < n; k++) {
                    int ni = i + 1;
                    int nj = k;
                    if (grid[i][j] == (ni * n + k) && dp[i][j] != Integer.MAX_VALUE) {
                        dp[ni][nj] = Math.min(dp[ni][nj], dp[i][j] + moveCost[grid[i][j]][k]);
                    }
                }
                for (int k = n - 1; k >= 0; k--) {
                    int ni = i + 1;
                    int nj = k;
                    if (grid[i][j] == (ni * n + k) && dp[i][j] != Integer.MAX_VALUE) {
                        dp[ni][nj] = Math.min(dp[ni][nj], dp[i][j] + moveCost[grid[i][j]][k]);
                    }
                }
            }
        }
        int ans = Integer.MAX_VALUE;
        for (int j = 0; j < n; j++) {
            ans = Math.min(ans, dp[m - 1][j]);
        }
        return ans;
    }
}

class Solution {
