class Solution {
    int[][] dirs = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
    public int minPushBox(char[][] grid) {
        int m = grid.length, n = grid[0].length;
        int[][][] memo = new int[m][n][2];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                Arrays.fill(memo[i][j], -1);
            }
        }
        int[] player = null, box = null, target = null;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 'S') player = new int[]{i, j};
                else if (grid[i][j] == 'B') box = new int[]{i, j};
                else if (grid[i][j] == 'T') target = new int[]{i, j};
            }
        }
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{player[0], player[1], box[0], box[1], 0});
        memo[player[0]][player[1]][0] = 0;
        while (!queue.isEmpty()) {
            int[] curr = queue.poll();
            int px = curr[0], py = curr[1], bx = curr[2], by = curr[3], steps = curr[4];
            if (bx == target[0] && by == target[1]) return steps;
            for (int[] dir : dirs) {
                int npx = px + dir[0], npy = py + dir[1];
                if (npx < 0 || npx >= m || npy < 0 || npy >= n || grid[npx][npy] == '#') continue;
                if (bx == npx && by == npy) {
                    int nbx = bx + dir[0], nby = by + dir[1];
                    if (nbx < 0 || nbx >= m || nby < 0 || nby >= n || grid[nbx][nby] == '#' || memo[npx][npy][1] != -1) continue;
                    memo[npx][npy][1] = steps + 1;
                    queue.offer(new int[]{npx, npy, nbx, nby, steps + 1});
                } else {
                    if (memo[npx][npy][0] != -1 && steps + memo[npx][npy][0] <= memo[npx][npy][1] || memo[npx][npy][1] != -1 && steps + 1 >= memo[npx][npy][1]) continue;
                    memo[npx][npy][0] = steps + 1;
                    queue.offer(new int[]{npx, npy, bx, by, steps + 1});
                }
            }
        }
        return -1;
    }
}

class Solution {
    public int maxSumDivThree(int[] nums) {
        int[] dp = new int[] {0, Integer.MIN_VALUE, Integer.MIN_VALUE};
        for (int num : nums) {
            int[] dpNext = new int[3];
            for (int i = 0; i < 3; i++) {
                dpNext[(i + num) % 3] = Math.max(dp[(i + num) % 3], dp[i] + num);
            }
            dp = dpNext;
        }
        return dp[0];
    }
}

class FindElements {
    
    private TreeNode root;

    public FindElements(TreeNode root) {
        this.root = root;
        recoverTree(root, 0);
    }
    
    private void recoverTree(TreeNode node, int val) {
        if (node == null) return;
        node.val = val;
        recoverTree(node.left, 2 * val + 1);
        recoverTree(node.right, 2 * val + 2);
    }
    
    public boolean find(int target) {
        return findTarget(root, target);
    }
    
    private boolean findTarget(TreeNode node, int target) {
        if (node == null) return false;
        if (node.val == target) return true;
        return findTarget(node.left, target) || findTarget(node.right, target);
    }
}

class Solution {
    public int[][] shiftGrid(int[][] grid, int k) {
        int m = grid.length;
        int n = grid[0].length;
        int[][] shifted = new int[m][n];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                int newColumn = (j + k) % n;
                int wrapAroundCount = (j + k) / n;
                int newRow = (i + wrapAroundCount) % m;
                shifted[newRow][newColumn] = grid[i][j];
            }
        }
        return shifted;
    }
}

class Solution {
    public double calculateTax(int[][] brackets, int income) {
        double tax = 0.0;
        int prevUpper = 0;
        int i = 0;
        while (income > 0 && i < brackets.length) {
            int upper = brackets[i][0];
            int percent = brackets[i][1];
            int taxableIncome = Math.min(income, upper - prevUpper);
            tax += taxableIncome * percent / 100.0;
            income -= taxableIncome;
            prevUpper = upper;
            i++;
        }
        return tax;
    }
}

class Solution {
    public int maxScoreWords(String[] words, char[] letters, int[] score) {
        int[] freq = new int[26];
        for (char c : letters) {
            freq[c - 'a']++;
        }
        int[][] wordFreq = new int[words.length][26];
        for (int i = 0; i < words.length; i++) {
            String word = words[i];
            for (char c : word.toCharArray()) {
                wordFreq[i][c - 'a']++;
            }
        }
        return dfs(words, 0, freq, wordFreq, score);
    }
    
    private int dfs(String[] words, int start, int[] freq, int[][] wordFreq, int[] score) {
        int maxScore = 0;
        for (int i = start; i < words.length; i++) {
            if (isValid(words[i], freq)) {
                int curScore = calculateScore(words[i], score);
                for (int j = 0; j < 26; j++) {
                    freq[j] -= wordFreq[i][j];
                }
                curScore += dfs(words, i + 1, freq, wordFreq, score);
                for (int j = 0; j < 26; j++) {
                    freq[j] += wordFreq[i][j];
                }
                maxScore = Math.max(maxScore, curScore);
            }
        }
        return maxScore;
    }
    
    private boolean isValid(String word, int[] freq) {
        int[] wordFreq = new int[26];
        for (char c : word.toCharArray()) {
            wordFreq[c - 'a']++;
            if (wordFreq[c - 'a'] > freq[c - 'a']) {
                return false;
            }
        }
        return true;
    }
    
    private int calculateScore(String word, int[] score) {
        int sum = 0;
        for (char c : word.toCharArray()) {
            sum += score[c - 'a'];
        }
        return sum;
    }
}

class Solution {
    public int closedIsland(int[][] grid) {
        int count = 0;
        for (int i = 1; i < grid.length - 1; i++) {
            for (int j = 1; j < grid[0].length - 1; j++) {
                if (grid[i][j] == 0) {
                    if (dfs(grid, i, j)) {
                        count++;
                    }
                }
            }
        }
        return count;
    }
    
    private boolean dfs(int[][] grid, int i, int j) {
        if (i < 0 || j < 0 || i >= grid.length || j >= grid[0].length) {
            return false;
        }
        if (grid[i][j] == 1) {
            return true;
        }
        grid[i][j] = 1;
        boolean up = dfs(grid, i - 1, j);
        boolean down = dfs(grid, i + 1, j);
        boolean left = dfs(grid, i, j - 1);
        boolean right = dfs(grid, i, j + 1);
        return up && down && left && right;
    }
}

class Solution {
    public int[][] reconstructMatrix(int upper, int lower, int[] colsum) {
        int n = colsum.length;
        int[][] res = new int[2][n];
        for (int i = 0; i < n; i++) {
            if (colsum[i] == 2) {
                if (upper == 0 || lower == 0) {
                    return new int[][]{};
                }
                res[0][i] = 1;
                res[1][i] = 1;
                upper--;
                lower--;
            } else if (colsum[i] == 1) {
                if (upper >= lower && upper > 0) {
                    res[0][i] = 1;
                    upper--;
                } else if (lower > 0) {
                    res[1][i] = 1;
                    lower--;
                } else {
                    return new int[][]{};
                }
            } else {
                res[0][i] = 0;
                res[1][i] = 0;
            }
        }
        if (upper != 0 || lower != 0) {
            return new int[][]{};
        }
        return res;
    }
}

class Solution {
    public int oddCells(int m, int n, int[][] indices) {
        int[] row = new int[m];
        int[] col = new int[n];
        for (int[] idx : indices) {
            row[idx[0]]++;
            col[idx[1]]++;
        }
        int oddCount = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if ((row[i] + col[j]) % 2 == 1) {
                    oddCount++;
                }
            }
        }
        return oddCount;
    }
}

class Solution {
    public int[][][] dp;
    public int[] dfs(int[][] prices, int h, int w) {
        if (dp[h][w][0] > 0) {
            return dp[h][w];
        }
        int id = 0, cur = 0;
        for (int i = 0; i < prices.length; i++) {
            int[] pre = new int[3];
            if (prices[i][0] == h) {
                pre = dfs(prices, h, w - prices[i][1]);
                cur = pre[0] + prices[i][2];
            } else if (prices[i][1] == w) {
                pre = dfs(prices, h - prices[i][0], w);
                cur = pre[0] + prices[i][2];
            }
            if (cur > dp[h][w][0]) {
                dp[h][w][0] = cur;
                dp[h][w][1] = pre[1];
                dp[h][w][2] = pre[2];
                id = i;
            }
        }
        if (dp[h][w][0] == 0) {
            return dp[h][w];
        }
        if (prices[id][0] == h) {
            dp[h][w][1] = dp[h][w - prices[id][1]][1];
            dp[h][w][2] = dp[h][w - prices[id][1]][2] + 1;
        } else {
            dp[h][w][1] = dp[h - prices[id][0]][w][1] + 1;
            dp[h][w][2] = dp[h - prices[id][0]][w][2];
        }
        return dp[h][w];
    }
    public int maxProfit(int m, int n, int[][] prices) {
        dp = new int[m + 1][n + 1][3];
        return dfs(prices, m, n)[0];
    }
}

class Solution {
    public int[] getPalindrome(int[] queries, int intLength) {
        int[] ans = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int idx = queries[i]-1;
            if (idx < 0 || idx >= (int)Math.pow(10, (intLength+1)/2)) {
                ans[i] = -1;
            } else {
                String s = String.valueOf(idx);
                StringBuilder sb = new StringBuilder(s);
                if (intLength % 2 == 1) {
                    sb.deleteCharAt(sb.length()-1);
                }
                ans[i] = Integer.valueOf(s + sb.reverse().toString());
            }
        }
        return ans;
    }
}

class Solution {
