            for (int j = i + 1; j < nums.length; j++) {
                int prod = nums[i] * nums[j];
                if (map.containsKey(prod)) {
                    res += 8 * map.get(prod);
                    map.put(prod, map.get(prod) + 1);
                } else {
                    map.put(prod, 1);
                }
            }
        }
        return res;
    }
