class Solution {
    public String findGreatest(String s) {
        boolean[] lower = new boolean[26], upper = new boolean[26];
        for (char c : s.toCharArray()) {
            if (c >= 'a' && c <= 'z') {
                lower[c - 'a'] = true;
            } else if (c >= 'A' && c <= 'Z') {
                upper[c - 'A'] = true;
            }
        }
        for (int i = 25; i >= 0; i--) {
            if (lower[i] && upper[i]) {
                return Character.toUpperCase((char) (i + 'a')) + "";
            }
        }
        return "";
    }
}

