class Solution {
    public int tilingRectangle(int n, int m) {
        int[][] dp = new int[14][14];
        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= m; j++) {
                dp[i][j] = Integer.MAX_VALUE;
                if (i == j) {
                    dp[i][j] = 1;
                } else {
                    for (int k = 1; k <= i / 2; k++) {
                        dp[i][j] = Math.min(dp[i][j], dp[k][j] + dp[i - k][j]);
                    }
                    for (int k = 1; k <= j / 2; k++) {
                        dp[i][j] = Math.min(dp[i][j], dp[i][k] + dp[i][j - k]);
                    }
                }
            }
        }
        return dp[n][m];
    }
}

class Solution {
    public int maxLength(List<String> arr) {
        List<Integer> dp = new ArrayList<>();
        dp.add(0);
        int res = 0;
        for (String s : arr) {
            int a = 0, dup = 0;
            for (char c : s.toCharArray()) {
                int t = 1 << (c - 'a');
                dup |= (a & t);
                a |= t;
            }
            if (dup > 0) continue;
            for (int i = dp.size() - 1; i >= 0; --i) {
                if ((dp.get(i) & a) > 0) continue;
                dp.add(dp.get(i) | a);
                res = Math.max(res, Integer.bitCount(dp.get(dp.size() - 1)));
            }
        }
        return res;
    }
}

