class Solution {
    public int[][] findLocalExtrema(int[][] A) {
        List<Integer> winners = new ArrayList<>();
        List<Integer> losers = new ArrayList<>();
        Map<Integer, Integer> winCount = new HashMap<>();
        Map<Integer, Integer> loseCount = new HashMap<>();
        for (int[] match : A) {
            int winner = match[0];
            int loser = match[1];
            winCount.put(winner, winCount.getOrDefault(winner, 0) + 1);
            loseCount.put(loser, loseCount.getOrDefault(loser, 0) + 1);
        }
        for (int player : winCount.keySet()) {
            if (winCount.get(player) + loseCount.getOrDefault(player, 0) == A.length) {
                if (winCount.get(player) == A.length - 1) {
                    winners.add(player);
                } else if (!loseCount.containsKey(player)) {
                    winners.add(player);
                }
            }
        }
        for (int player : loseCount.keySet()) {
            if (winCount.getOrDefault(player, 0) + loseCount.get(player) == A.length) {
                if (loseCount.get(player) == 1) {
                    losers.add(player);
                }
            }
        }
        int[][] result = new int[2][];
        result[0] = winners.stream().mapToInt(i -> i).toArray();
        result[1] = losers.stream().mapToInt(i -> i).toArray();
        return result;
    }
}

