        for (int[] queen : queens) {
            board[queen[0]][queen[1]] = true;
        }
        List<List<Integer>> result = new ArrayList<>();
        for (int i = -1; i <= 1; i++) {
            for (int j = -1; j <= 1; j++) {
                if (i == 0 && j == 0) continue;
                int x = king[0] + i;
                int y = king[1] + j;
                while (x >= 0 && x < 8 && y >= 0 && y < 8) {
                    if (board[x][y]) {
                        result.add(Arrays.asList(x, y));
                        break;
                    }
                    x += i;
                    y += j;
                }
            }
        }
        return result;
    }
}

