class DiningPhilosophers {
    boolean[] forks = new boolean[5];
    
    public DiningPhilosophers() {
        
    }

    private boolean pickFork(int fork) {
        synchronized(this) {
            if(!forks[fork]) {
                forks[fork] = true;
                return true;
            }
            return false;
        }
    }

    private void putFork(int fork) {
        synchronized (this) {
            forks[fork] = false;
        }
    }
  
    public void wantsToEat(int philosopher,
                            Callable<Void> pickLeftFork,
                            Callable<Void> pickRightFork,
                            Callable<Void> eat,
                            Callable<Void> putLeftFork,
                            Callable<Void> putRightFork) throws Exception {
        
        int leftFork = philosopher;
        int rightFork = (philosopher + 1) % 5;
        
        while (true) {
            if(pickFork(leftFork)) {
                if(pickFork(rightFork)) {
                    pickLeftFork.call();
                    pickRightFork.call();
                    eat.call();
                    putLeftFork.call();
                    putFork(leftFork);
                    putRightFork.call();
                    putFork(rightFork);
                    break;
                } else {
                    putFork(leftFork);
                }
            }
            Thread.yield();
        }
    }
}

