class Solution {
    public int maxProduct(String s) {
        int n = s.length();
        int[] dp = new int[1 << n];
        for (int i = 1; i < (1 << n); i++) {
            String curr = getStr(i, s);
            if (isPalindrome(curr)) {
                dp[i] = curr.length();
            } else {
                for (int j = i; j > 0; j = (j - 1) & i) {
                    dp[i] = Math.max(dp[i], dp[j] * dp[i - j]);
                }
            }
        }
        return dp[(1 << n) - 1];
    }
    
    private String getStr(int bitmask, String s) {
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < s.length(); i++) {
            if (((bitmask >> i) & 1) != 0) {
                sb.append(s.charAt(i));
            }
        }
        return sb.toString();
    }
    
    private boolean isPalindrome(String s) {
        int left = 0, right = s.length() - 1;
        while (left < right) {
            if (s.charAt(left) != s.charAt(right)) {
                return false;
            }
            left++;
            right--;
        }
        return true;
    }
}

class Solution {
    public int maxCandies(int[] candies, int k) {
        int maxCandies = 0;
        for(int candy: candies){
            maxCandies = Math.max(maxCandies, candy);
        }
        int left = 1, right = maxCandies;
        while(left <= right){
            int mid = left + (right - left) / 2;
            if(isPossible(candies, k, mid)){
                left = mid + 1;
            } else {
                right = mid - 1;
            }
        }
        return right;
    }
    
    private boolean isPossible(int[] candies, int k, int target){
        int count = 0;
        for(int candy: candies){
            count += candy / target;
            if(count >= k){
                return true;
            }
        }
        return false;
    }
}

class Solution {
    public int getNoOfIntegers(int num, int k) {
        if (num < k) {
            return -1;
        }
        if (num == k) {
            return 1;
        }
        int count = 0;
        while (num > 0) {
            int digit = num % 10;
            if (digit == k) {
                count++;
            }
            num = num / 10;
        }
        return count;
    }
}

class Solution {
    public int[] sortByMapping(int[] mapping, int[] nums) {
        Map<Integer, List<Integer>> map = new HashMap<>();
        for (int num : nums) {
            int mapped = 0;
            int multiplier = 1;
            while (num > 0) {
                int digit = num % 10;
                mapped += mapping[digit] * multiplier;
                multiplier *= 10;
                num /= 10;
            }
            map.putIfAbsent(mapped, new ArrayList<>());
            map.get(mapped).add(num);
        }
        List<Integer> sortedMapped = new ArrayList<>(map.keySet());
        Collections.sort(sortedMapped);
        int[] result = new int[nums.length];
        int index = 0;
        for (int mapped : sortedMapped) {
            List<Integer> list = map.get(mapped);
            Collections.sort(list);
            for (int num : list) {
                result[index++] = num;
            }
        }
        return result;
    }
}

class Solution {
    public int countVowelPermutation(int n) {
        long aCount = 1, eCount = 1, iCount = 1, oCount = 1, uCount = 1;
        final int MOD = 1000000007;
        for (int j = 2; j <= n; j++) {
            long temp_aCount = (eCount + iCount + uCount) % MOD;
            long temp_eCount = (aCount + iCount) % MOD;
            long temp_iCount = (eCount + oCount) % MOD;
            long temp_oCount = iCount;
            long temp_uCount = (iCount + oCount) % MOD;
            aCount = temp_aCount;
            eCount = temp_eCount;
            iCount = temp_iCount;
            oCount = temp_oCount;
            uCount = temp_uCount;
        }
        long total = (aCount + eCount + iCount + oCount + uCount) % MOD;
        return (int)total;
    }
}

class Solution {
    public int getMaximumGold(int[][] grid) {
        int maxGold = 0;
        for (int i = 0; i < grid.length; i++) {
            for (int j = 0; j < grid[0].length; j++) {
                if (grid[i][j] != 0) {
                    maxGold = Math.max(maxGold, dfs(grid, i, j));
                }
            }
        }
        return maxGold;
    }
    
    private int dfs(int[][] grid, int i, int j) {
        if (i < 0 || i >= grid.length || j < 0 || j >= grid[0].length || grid[i][j] == 0) {
            return 0;
        }
        int temp = grid[i][j];
        grid[i][j] = 0;
        int maxGold = 0;
        maxGold = Math.max(maxGold, dfs(grid, i + 1, j));
        maxGold = Math.max(maxGold, dfs(grid, i - 1, j));
        maxGold = Math.max(maxGold, dfs(grid, i, j + 1));
        maxGold = Math.max(maxGold, dfs(grid, i, j - 1));
        grid[i][j] = temp;
        return maxGold + temp;
    }
}

class Solution {
    public int longestSubsequence(int[] arr, int difference) {
        Map<Integer,Integer> dp=new HashMap<>();
        int n=arr.length,res=1;
        for(int i=0;i<n;i++){
            dp.put(arr[i],dp.getOrDefault(arr[i]-difference,0)+1);
            res=Math.max(res,dp.get(arr[i]));
        }
        return res;
    }
}

