class Solution {
    public int sumOfFlooredPairs(int[] nums) {
        int N = 100001;
        int MOD = 1000000007;
        int[] cnt = new int[N];
        int[] preSum = new int[N];
        for (int num : nums) cnt[num]++;
        for (int i = 1; i < N; i++) preSum[i] = preSum[i - 1] + cnt[i];
        long ans = 0;
        for (int num : nums) {
            for (int i = 1; i * num < N; i++) {
                int l = i * num - 1;
                int r = Math.min(i * num + num - 1, N - 1);
                ans += (long) (preSum[r] - preSum[l]) * i * cnt[num];
                ans %= MOD;
            }
        }
        return (int) ans;
    }
}

class Solution {
    public double maxProbability(int n, int[][] edges, double[] succProb, int start, int end) {
        Map<Integer, List<int[]>> graph = new HashMap<>();
        for (int i = 0; i < edges.length; i++) {
            int u = edges[i][0], v = edges[i][1];
            graph.computeIfAbsent(u, x -> new ArrayList<>()).add(new int[]{v, i});
            graph.computeIfAbsent(v, x -> new ArrayList<>()).add(new int[]{u, i});
        }
        PriorityQueue<double[]> pq = new PriorityQueue<>((a, b) -> Double.compare(b[1], a[1]));
        pq.offer(new double[]{start, 1.0});
        double[] prob = new double[n];
        prob[start] = 1.0;
        while (!pq.isEmpty()) {
            double[] cur = pq.poll();
            int node = (int) cur[0];
            double p = cur[1];
            if (node == end) return p;
            if (p < prob[node]) continue;
            for (int[] next : graph.getOrDefault(node, new ArrayList<>())) {
                int nei = next[0], idx = next[1];
                if (p * succProb[idx] > prob[nei]) {
                    prob[nei] = p * succProb[idx];
                    pq.offer(new double[]{nei, p * succProb[idx]});
                }
            }
        }
        return 0.0;
    }
}

class Solution {
    public int[] findBall(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        int[] ans = new int[n];
        for (int i = 0; i < n; i++) {
            int c = i, r = 0;
            while (r < m) {
                if (grid[r][c] == 1) {
                    if (c == n - 1 || grid[r][c + 1] == -1)
                        break;
                    c++;
                } else {
                    if (c == 0 || grid[r][c - 1] == 1)
                        break;
                    c--;
                }
                r++;
            }
            ans[i] = r == m ? c : -1;
        }
        return ans;
    }
}

class Solution {
    public int minimumMoves(int[][] grid) {
        int n = grid.length;
        int[][][] dist = new int[n][n][2];
        for (int[][] arr : dist) {
            for (int[] row : arr) {
                Arrays.fill(row, n * n);
            }
        }
        dist[0][0][0] = 0;
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{0, 0, 0});
        int[] dr = {0, 1, 0, -1};
        int[] dc = {1, 0, -1, 0};
        while (!queue.isEmpty()) {
            int[] curr = queue.poll();
            int r1 = curr[0], c1 = curr[1], isH = curr[2];
            int d = dist[r1][c1][isH];
            if (r1 == n - 1 && c1 == n - 2 && isH == 0) {
                return d;
            }
            int r2 = r1 + (isH == 1 ? 0 : 1);
            int c2 = c1 + (isH == 0 ? 0 : 1);
            for (int i = 0; i < 4; i++) {
                int nr1 = r1 + dr[i], nc1 = c1 + dc[i], nr2 = r2 + dr[i], nc2 = c2 + dc[i];
                if (nr1 < 0 || nr1 >= n || nc1 < 0 || nc1 >= n || nr2 < 0 || nr2 >= n || nc2 < 0 || nc2 >= n || grid[nr1][nc1] == 1 || grid[nr2][nc2] == 1) {
                    continue;
                }
                if (dist[nr1][nc1][isH] > d + 1) {
                    dist[nr1][nc1][isH] = d + 1;
                    queue.offer(new int[]{nr1, nc1, isH});
                }
                if (isH == 0 && nc1 == nc2 && dist[nr1][nc1][1] > d + 1) {
                    dist[nr1][nc1][1] = d + 1;
                    queue.offer(new int[]{nr1, nc1, 1});
                } else if (isH == 1 && r1 == r2 && dist[r1][c1][0] > d + 1) {
                    dist[r1][c1][0] = d + 1;
                    queue.offer(new int[]{r1, c1, 0});
                }
            }
        }
        return -1;
    }
}

class Solution {
    public int equalSubstring(String s, String t, int maxCost) {
        int left = 0, right = 0, cost = 0, maxLength = 0;
        while (right < s.length()) {
            cost += Math.abs(s.charAt(right) - t.charAt(right));
            while (cost > maxCost) {
                cost -= Math.abs(s.charAt(left) - t.charAt(left));
                left++;
            }
            maxLength = Math.max(maxLength, right - left + 1);
            right++;
        }
        return maxLength;
    }
}

class Solution {
    public String removeDuplicates(String s, int k) {
        int[] count = new int[s.length()];
        StringBuilder sb = new StringBuilder();
        for (char c : s.toCharArray()) {
            sb.append(c);
            int last = sb.length() - 1;
            count[last] = 1 + (last > 0 && sb.charAt(last) == sb.charAt(last - 1) ? count[last - 1] : 0);
            if (count[last] == k) {
                sb.delete(last - k + 1, last + 1);
            }
        }
        return sb.toString();
    }
}

