class FizzBuzz {
    private int n;
    private int curr;
    private Semaphore fizzSem, buzzSem, fizzBuzzSem, numSem;
    
    public FizzBuzz(int n) {
        this.n = n;
        this.curr = 1;
        this.fizzSem = new Semaphore(0);
        this.buzzSem = new Semaphore(0);
        this.fizzBuzzSem = new Semaphore(0);
        this.numSem = new Semaphore(1);
    }

    public void fizz(Runnable printFizz) throws InterruptedException {
        while (true) {
            fizzSem.acquire();
            if (curr > n) {
                break;
            }
            printFizz.run();
            curr++;
            releaseSem();
        }
    }

    public void buzz(Runnable printBuzz) throws InterruptedException {
        while (true) {
            buzzSem.acquire();
            if (curr > n) {
                break;
            }
            printBuzz.run();
            curr++;
            releaseSem();
        }
    }

    public void fizzbuzz(Runnable printFizzBuzz) throws InterruptedException {
        while (true) {
            fizzBuzzSem.acquire();
            if (curr > n) {
                break;
            }
            printFizzBuzz.run();
            curr++;
            releaseSem();
        }
    }

    public void number(IntConsumer printNumber) throws InterruptedException {
        while (true) {
            numSem.acquire();
            if (curr > n) {
                break;
            }
            if (curr % 3 != 0 && curr % 5 != 0) {
                printNumber.accept(curr);
                curr++;
                releaseSem();
            } else {
                fizzBuzzSem.release();
                fizzSem.release();
                buzzSem.release();
            }
        }
        fizzSem.release();
        buzzSem.release();
        fizzBuzzSem.release();
    }
    
    private void releaseSem() {
        if (curr % 3 == 0 && curr % 5 == 0) {
            fizzBuzzSem.release();
        } else if (curr % 3 == 0) {
            fizzSem.release();
        } else if (curr % 5 == 0) {
            buzzSem.release();
        } else {
            numSem.release();
        }
    }
}

class Solution {
    public int waysToBuildRooms(int[] prevRoom) {
        int n = prevRoom.length;
        int[] factorial = new int[n+1];
        factorial[0] = 1;
        for (int i = 1; i <= n; i++) {
            factorial[i] = (int)((long)factorial[i-1] * i % 1000000007);
        }
        int[] invFactorial = new int[n+1];
        invFactorial[n] = pow(factorial[n], 1000000005);
        for (int i = n-1; i >= 0; i--) {
            invFactorial[i] = (int)((long)invFactorial[i+1] * (i+1) % 1000000007);
        }
        int[] sz = new int[n];
        int[] fact = new int[n];
        List<Integer>[] adj = new List[n];
        for (int i = 0; i < n; i++) {
            adj[i] = new ArrayList<>();
        }
        for (int i = 1; i < n; i++) {
            adj[prevRoom[i]].add(i);
        }
        dfs(0, adj, sz, fact, factorial, invFactorial);
        return fact[0];
    }
    
    private void dfs(int u, List<Integer>[] adj, int[] sz, int[] fact, int[] factorial, int[] invFactorial) {
        sz[u] = 1;
        fact[u] = 1;
        for (int v : adj[u]) {
            dfs(v, adj, sz, fact, factorial, invFactorial);
            sz[u] += sz[v];
            fact[u] = (int)((long)fact[u] * invFactorial[sz[v]] % 1000000007 * fact[v] % 1000000007);
        }
        fact[u] = (int)((long)fact[u] * factorial[sz[u]-1] % 1000000007);
    }
    
    private int pow(int a, int b) {
        int res = 1;
        while (b > 0) {
            if ((b & 1) == 1) {
                res = (int)((long)res * a % 1000000007);
            }
            a = (int)((long)a * a % 1000000007);
            b >>= 1;
        }
        return res;
    }
}

class Solution {
