            }
        }
        return count;
    }
}

class Solution {
    public int largestMagicSquare(int[][] grid) {
        int m = grid.length, n = grid[0].length, res = 1;
        for (int k = Math.min(m, n); k > 1 && k > res; k--) {
            for (int i = 0; i <= m - k; i++) {
                for (int j = 0; j <= n - k; j++) {
                    if (isMagic(grid, k, i, j)) {
                        res = k;
                        break;
                    }
                }
            }
        }
        return res;
    }
    
    private boolean isMagic(int[][] grid, int k, int row, int col) {
        int sum = 0, diag1 = 0, diag2 = 0;
        for (int i = 0; i < k; i++) {
            sum += grid[row][col+i];
            diag1 += grid[row+i][col+i];
            diag2 += grid[row+i][col+k-i-1];
        }
        if (sum != diag1 || diag1 != diag2) return false;
        for (int i = 1; i < k; i++) {
            int rSum = 0, cSum = 0;
            for (int j = 0; j < k; j++) {
                rSum += grid[row+i][col+j];
                cSum += grid[row+j][col+i];
            }
            if (rSum != sum || cSum != sum) return false;
        }
        return true;
    }
}

class Solution {
    public int countSteps(int[] plants, int capacity) {
        int cur = -1, res = 0, cnt = capacity;
        for (int i = 0; i < plants.length; i++) {
            if (plants[i] <= cnt) {
                cnt -= plants[i];
            } else {
                res += (i - cur) * 2;
                cnt = capacity - plants[i];
                cur = i - 1;
            }
        }
        return res + plants.length - cur - 1;
    }
}

