class Solution {
    public String smallestStringWithSwaps(String s, List<List<Integer>> pairs) {
        int[] parent = new int[s.length()];
        for (int i = 0; i < s.length(); i++) parent[i] = i;
        for (List<Integer> pair : pairs) {
            int x = find(parent, pair.get(0)), y = find(parent, pair.get(1));
            if (x != y) parent[x] = y;
        }
        Map<Integer, PriorityQueue<Character>> map = new HashMap<>();
        for (int i = 0; i < s.length(); i++) map.computeIfAbsent(find(parent, i), k -> new PriorityQueue<>()).offer(s.charAt(i));
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < s.length(); i++) sb.append(map.get(find(parent, i)).poll());
        return sb.toString();
    }
    
    private int find(int[] parent, int i) {
        if (parent[i] != i) parent[i] = find(parent, parent[i]);
        return parent[i];
    }
}

class Solution {
    public int nthUglyNumber(int n, int a, int b, int c) {
        long ab = lcm(a,b);
        long ac = lcm(a,c);
        long bc = lcm(b,c);
        long abc = lcm(a,b,c);
        long left = 1, right = (long)2e9;
        while(left < right){
            long mid = left + right >> 1;
            long count = mid / a + mid / b + mid / c - mid / ab - mid / ac - mid / bc + mid / abc;
            if(count < n)
                left = mid + 1;
            else
                right = mid;
        }
        return (int)left;
    }
    private long lcm(long a, long b){ return a * b / gcd(a, b);}
    private long gcd(long a, long b){ return b == 0 ? a : gcd(b, a % b);}
}

class Solution {
    public List<List<Integer>> minimumAbsDifference(int[] arr) {
        Arrays.sort(arr);
        int minDiff = Integer.MAX_VALUE;
        List<List<Integer>> result = new ArrayList<>();
        for (int i = 1; i < arr.length; i++) {
            int diff = arr[i] - arr[i-1];
            if (diff < minDiff) {
                minDiff = diff;
                result.clear();
                result.add(Arrays.asList(arr[i-1], arr[i]));
            } else if (diff == minDiff) {
                result.add(Arrays.asList(arr[i-1], arr[i]));
            }
        }
        return result;
    }
}

class Solution {
    public int[] canSeePersonsCount(int[] heights) {
        int n = heights.length;
        int[] res = new int[n];
        Stack<Integer> stack = new Stack<>();
        for (int i = n - 1; i >= 0; i--) {
            while (!stack.isEmpty() && heights[i] > heights[stack.peek()]) {
                res[stack.pop()]++;
            }
            if (!stack.isEmpty()) {
                res[stack.peek()]++;
            }
            stack.push(i);
        }
        return res;
    }
}

class Solution {
    public String longestDiverseString(int a, int b, int c) {
        StringBuilder sb = new StringBuilder();
        int total = a + b + c;
        int countA = 0, countB = 0, countC = 0;
        for (int i = 0; i < total; i++) {
            String nextChar = getNextChar(a, b, c, countA, countB, countC);
            if (nextChar.equals("a")) {
                countA++;
                a--;
                countB = 0;
                countC = 0;
            } else if (nextChar.equals("b")) {
                countB++;
                b--;
                countA = 0;
                countC = 0;
            } else {
                countC++;
                c--;
                countA = 0;
                countB = 0;
            }
            sb.append(nextChar);
            if (sb.length() == 2 && sb.charAt(0) == sb.charAt(1)) {
                break;
            }
        }
        return sb.toString();
    }
    
    private String getNextChar(int a, int b, int c, int countA, int countB, int countC) {
        if (a >= b && a >= c) {
            if (countA < 2) {
                return "a";
            } else if (b >= c && countB < 1 || countC >= 1) {
                return "b";
            } else {
                return "c";
            }
        } else if (b >= a && b >= c) {
            if (countB < 2) {
                return "b";
            } else if (a >= c && countA < 1 || countC >= 1) {
                return "a";
            } else {
                return "c";
            }
        } else {
            if (countC < 2) {
                return "c";
            } else if (a >= b && countA < 1 || countB >= 1){
                return "a";
            } else {
                return "b";
            }
        }
    }
}

