class Solution {
    private int time = 0;
    
    public List<List<Integer>> criticalConnections(int n, List<List<Integer>> connections) {
        List<List<Integer>> result = new ArrayList<>();
        int[] visited = new int[n];
        int[] low = new int[n];
        int[] parent = new int[n];
        Map<Integer, List<Integer>> graph = new HashMap<>();
        for (List<Integer> conn : connections) {
            int from = conn.get(0);
            int to = conn.get(1);
            if (!graph.containsKey(from)) {
                graph.put(from, new ArrayList<>());
            }
            if (!graph.containsKey(to)) {
                graph.put(to, new ArrayList<>());
            }
            graph.get(from).add(to);
            graph.get(to).add(from);
        }
        for (int i = 0; i < n; i++) {
            parent[i] = -1;
        }
        for (int i = 0; i < n; i++) {
            if (visited[i] == 0) {
                dfs(i, visited, low, parent, graph, result);
            }
        }
        return result;
    }
    
    private void dfs(int current, int[] visited, int[] low, int[] parent, Map<Integer, List<Integer>> graph, List<List<Integer>> result) {
        visited[current] = low[current] = ++time;
        for (int neighbor : graph.get(current)) {
            if (visited[neighbor] == 0) {
                parent[neighbor] = current;
                dfs(neighbor, visited, low, parent, graph, result);
                low[current] = Math.min(low[current], low[neighbor]);
                if (low[neighbor] > visited[current]) {
                    result.add(Arrays.asList(current, neighbor));
                }
            } else if (neighbor != parent[current]) {
                low[current] = Math.min(low[current], visited[neighbor]);
            }
        }
    }
}

class Solution {
    public int kConcatenationMaxSum(int[] arr, int k) {
        long maxSoFar=0;
        long maxEndingHere=0;
        long total=0;
        int MOD=1000000007;
        int n=arr.length;
        for(int i=0;i<n;i++){
            total+=arr[i];
            maxEndingHere=Math.max(maxEndingHere+arr[i],0);
            maxSoFar=Math.max(maxSoFar,maxEndingHere);
        }
        if(total>0 && k>1){
            maxSoFar+=Math.max(total*(k-2),0);
        }
        return (int)(maxSoFar%MOD);
    }
}

class Solution {
