class TreeAncestor {
    int[][] dp;
    public TreeAncestor(int n, int[] parent) {
        dp = new int[n][16];
        for (int i = 0; i < n; i++) {
            dp[i][0] = parent[i];
        }
        for (int j = 1; j < 16; j++) {
            for (int i = 0; i < n; i++) {
                if (dp[i][j-1] == -1) {
                    dp[i][j] = -1;
                } else {
                    dp[i][j] = dp[dp[i][j-1]][j-1];
                }
            }
        }
    }
    
    public int getKthAncestor(int node, int k) {
        for (int i = 0; i < 16; i++) {
            if (((k >> i) & 1) == 1) {
                node = dp[node][i];
                if (node == -1) return -1;
            }
        }
        return node;
    }
}

