        int n = nums.length;
        int[][] dp = new int[n][n];
        for (int i = 0; i < n; i++) {
            Arrays.fill(dp[i], Integer.MAX_VALUE);
        }
        for (int i = 0; i < n; i++) {
            if (nums[i] == arr1[0]) {
                dp[0][i] = 0;
            } else if (nums[i] > arr1[0]) {
                dp[0][i] = 1;
            }
        }
        for (int i = 1; i < arr1.length; i++) {
            for (int j = i; j < n; j++) {
                if (nums[j] <= arr1[i]) {
                    continue;
                }
                for (int k = 0; k < j; k++) {
                    if (nums[k] >= arr1[i-1] && nums[k] < nums[j]) {
                        dp[i][j] = Math.min(dp[i][j], dp[i-1][k] + (j - k - 1));
                    }
                }
            }
        }
        int res = Integer.MAX_VALUE;
        for (int j = 0; j < n; j++) {
            res = Math.min(res, dp[arr1.length-1][j]);
        }
        return res == Integer.MAX_VALUE ? -1 : res;
    }
}

class Solution {
    public String dayOfTheWeek(int day, int month, int year) {
        String[] days = {"Sunday", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday"};
        int[] months = {0, 3, 2, 5, 0, 3, 5, 1, 4, 6, 2, 4};
        if (month < 3) {
            year--;
        }
        int c = year / 100;
        year %= 100;
        int w = (c / 4 - 2 * c + year + year / 4 + 13 * (months[month - 1] + day - 1) / 5) % 7;
        if (w < 0) {
            w += 7;
        }
        return days[w];
    }
}

class Solution {
    public int maximumSum(int[] arr) {
        int n = arr.length;
        int[] dp1 = new int[n];
        int[] dp2 = new int[n];
        dp1[0] = arr[0];
        dp2[0] = 0;
        int res = arr[0];
        for (int i = 1; i < n; i++) {
            dp1[i] = Math.max(dp1[i-1] + arr[i], arr[i]);
            dp2[i] = Math.max(dp2[i-1] + arr[i], dp1[i-1]);
            res = Math.max(res, Math.max(dp1[i], dp2[i]));
        }
        return res;
    }
}

class Solution {
    public int distanceBetweenBusStops(int[] distance, int start, int destination) {
        int n = distance.length;
        int total = 0;
        for (int i = 0; i < n; i++) {
            total += distance[i];
        }
        int clockwise = 0;
        int current = start;
        while (current != destination) {
            clockwise += distance[current];
            current = (current + 1) % n;
        }
        int counterclockwise = total - clockwise;
        return Math.min(clockwise, counterclockwise);
    }
}

class Solution {
    public int constrainedSubsetSum(int[] nums, int k) {
        int[] dp = new int[nums.length];
        Deque<Integer> deque = new LinkedList<>();
        int maxSum = Integer.MIN_VALUE;
        for (int i = 0; i < nums.length; i++) {
            if (!deque.isEmpty() && deque.peekFirst() < i - k) {
                deque.pollFirst();
            }
            dp[i] = Math.max(nums[i], nums[i] + (deque.isEmpty() ? 0 : dp[deque.peekFirst()]));
            while (!deque.isEmpty() && dp[i] >= dp[deque.peekLast()]) {
                deque.pollLast();
            }
            deque.offerLast(i);
            maxSum = Math.max(maxSum, dp[i]);
        }
        return maxSum;
    }
}

class Solution {
    public TreeNode balanceBST(TreeNode root) {
        List<Integer> nodes = new ArrayList<>();
        inorderTraversal(root, nodes);
        return buildBalancedBST(nodes, 0, nodes.size()-1);
    }
    
    private void inorderTraversal(TreeNode node, List<Integer> nodes) {
        if (node == null) return;
        inorderTraversal(node.left, nodes);
        nodes.add(node.val);
        inorderTraversal(node.right, nodes);
    }
    
    private TreeNode buildBalancedBST(List<Integer> nodes, int start, int end) {
        if (start > end) return null;
        int mid = (start + end) / 2;
        TreeNode root = new TreeNode(nodes.get(mid));
        root.left = buildBalancedBST(nodes, start, mid-1);
        root.right = buildBalancedBST(nodes, mid+1, end);
        return root;
    }
}

class Solution {
    public int sumFourDivisors(int[] nums) {
        int res = 0;
        for (int num : nums) {
            int sum = 0, count = 0;
            for (int i = 1; i * i <= num; i++) {
                if (num % i == 0) {
                    sum += i;
                    count++;
                    if (i * i != num) {
                        sum += num / i;
                        count++;
                    }
                    if (count > 4) break;
                }
            }
            if (count == 4) res += sum;
        }
        return res;
    }
}

