class Solution {
    public List<Integer> findNumOfValidWords(String[] words, String[] puzzles) {
        Map<Integer, Integer> freq = new HashMap<>();
        for (String word : words) {
            int mask = 0;
            for (char c : word.toCharArray()) {
                mask |= 1 << (c - 'a');
            }
            freq.put(mask, freq.getOrDefault(mask, 0) + 1);
        }
        List<Integer> res = new ArrayList<>();
        for (String puzzle : puzzles) {
            int count = 0;
            int first = 1 << (puzzle.charAt(0) - 'a');
            int subset = first;
            int mask = 0;
            for (char c : puzzle.toCharArray()) {
                mask |= 1 << (c - 'a');
            }
            while (subset > 0) {
                int s = subset | first;
                if (freq.containsKey(s) && (s & mask) == s) {
                    count += freq.get(s);
                }
                subset = (subset - 1) & mask;
            }
            res.add(count);
        }
        return res;
    }
}

class Solution {
    public boolean[] canMakePaliQueries(String s, int[][] queries) {
        int n = s.length();
        int[][] freq = new int[n+1][26];
        for (int i = 1; i <= n; i++) {
            freq[i] = freq[i-1].clone();
            freq[i][s.charAt(i-1) - 'a']++;
        }
        boolean[] res = new boolean[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int left = queries[i][0], right = queries[i][1], k = queries[i][2];
            int oddFreq = 0;
            for (int j = 0; j < 26; j++) {
                int freqDiff = freq[right+1][j] - freq[left][j];
                if (freqDiff % 2 == 1) {
                    oddFreq++;
                }
            }
            int maxReplace = (right - left + 1) / 2;
            res[i] = (oddFreq / 2) <= k && maxReplace <= k;
        }
        return res;
    }
}

class Solution {
    public int numPrimeArrangements(int n) {
        int primeCount = countPrimes(n);
        long ans = 1;
        for (int i = 1; i <= primeCount; i++) {
            ans = (ans * i) % 1000000007;
        }
        for (int i = 1; i <= n - primeCount; i++) {
            ans = (ans * i) % 1000000007;
        }
        return (int) ans;
    }
    
    public int countPrimes(int n) {
        if (n < 2) {
            return 0;
        }
        boolean[] isPrime = new boolean[n];
        Arrays.fill(isPrime, 2, n, true);
        for (int i = 2; i * i < n; i++) {
            if (!isPrime[i]) {
                continue;
            }
            for (int j = i * i; j < n; j += i) {
                isPrime[j] = false;
            }
        }
        int count = 0;
        for (boolean prime : isPrime) {
            if (prime) {
                count++;
            }
        }
        return count;
    }
}

