class Solution {
    public boolean validateBinaryTreeNodes(int n, int[] leftChild, int[] rightChild) {
        int[] indegrees = new int[n];
        for (int i = 0; i < n; i++) {
            if (leftChild[i] != -1) {
                indegrees[leftChild[i]]++;
            }
            if (rightChild[i] != -1) {
                indegrees[rightChild[i]]++;
            }
        }
        int root = -1;
        for (int i = 0; i < n; i++) {
            if (indegrees[i] == 0) {
                if (root != -1) {
                    return false;
                }
                root = i;
            } else if (indegrees[i] > 1) {
                return false;
            }
        }
        if (root == -1) {
            return false;
        }
        boolean[] visited = new boolean[n];
        dfs(root, leftChild, rightChild, visited);
        for (boolean v : visited) {
            if (!v) {
                return false;
            }
        }
        return true;
    }
    
    private void dfs(int node, int[] leftChild, int[] rightChild, boolean[] visited) {
        if (node == -1 || visited[node]) {
            return;
        }
        visited[node] = true;
        dfs(leftChild[node], leftChild, rightChild, visited);
        dfs(rightChild[node], leftChild, rightChild, visited);
    }
}

class Solution {
    private int[] daysInMonth = new int[]{31,28,31,30,31,30,31,31,30,31,30,31};
    
    public int daysBetweenDates(String date1, String date2) {
        return Math.abs(daysSince1971(date1) - daysSince1971(date2));
    }
    
    private int daysSince1971(String date) {
        String[] parts = date.split("-");
        int year = Integer.parseInt(parts[0]);
        int month = Integer.parseInt(parts[1]);
        int day = Integer.parseInt(parts[2]);
        int days = 0;
        for (int i = 1971; i < year; i++) {
            days += isLeapYear(i) ? 366 : 365;
        }
        for (int i = 0; i < month - 1; i++) {
            days += daysInMonth[i];
        }
        if (month > 2 && isLeapYear(year)) {
            days++;
        }
        days += day;
        return days;
    }
    
    private boolean isLeapYear(int year) {
        return year % 4 == 0 && (year % 100 != 0 || year % 400 == 0);
    }
}

class Solution {
    public int[] numSmallerByFrequency(String[] queries, String[] words) {
        int[] counts = new int[11];
        for (String word : words) {
            int count = f(word);
            counts[count]++;
        }
        int[] prefixSums = new int[11];
        int sum = 0;
        for (int i = 10; i >= 0; i--) {
            sum += counts[i];
            prefixSums[i] = sum;
        }
        int[] results = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int qCount = f(queries[i]);
            results[i] = prefixSums[qCount + 1];
        }
        return results;
    }
    
    private int f(String s) {
        char minChar = 'z' + 1;
        int count = 0;
        for (char c : s.toCharArray()) {
            if (c < minChar) {
                minChar = c;
                count = 1;
            } else if (c == minChar) {
                count++;
            }
        }
        return count;
    }
}

