class DinnerPlates {
    TreeMap<Integer, Stack<Integer>> map;
    int cap;

    public DinnerPlates(int capacity) {
        map = new TreeMap<>();
        cap = capacity;
    }

    public void push(int val) {
        int index = 0;
        if (!map.isEmpty())
            index = map.firstKey();
        if (!map.containsKey(index))
            map.put(index, new Stack<>());
        if (map.get(index).size() == cap)
            index++;
        if (!map.containsKey(index))
            map.put(index, new Stack<>());
        map.get(index).push(val);
    }

    public int pop() {
        if (map.isEmpty())
            return -1;
        int index = map.lastKey();
        return popAtStack(index);
    }

    public int popAtStack(int index) {
        if (!map.containsKey(index) || map.get(index).isEmpty())
            return -1;
        Stack<Integer> stack = map.get(index);
        int val = stack.pop();
        if (stack.isEmpty())
            map.remove(index);
        return val;
    }
}

