class Solution {
    public int maxRepOpt1(String text) {
        int[] freq = new int[26];
        for(char c : text.toCharArray()) freq[c - 'a']++;
        int res = 0, l = 0, maxCount = 0, n = text.length();
        char[] s = text.toCharArray();
        for(int r = 0; r < n; r++) {
            int i = s[r] - 'a'; freq[i]--;
            maxCount = Math.max(maxCount, freq[i]);
            while(r - l + 1 > maxCount + 1) {
                freq[s[l++] - 'a']++;
            }
            res = Math.max(res, Math.min(maxCount, r - l + 1));
        }
        return res;
    }
}

