class Solution {
    public int[][] matrixRankTransform(int[][] matrix) {
        int m = matrix.length, n = matrix[0].length;
        int[] rank = new int[m + n];
        Map<Integer, List<int[]>> map = new HashMap<>();
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                List<int[]> list = map.getOrDefault(matrix[i][j], new ArrayList<>());
                list.add(new int[]{i, j});
                map.put(matrix[i][j], list);
            }
        }
        for (int key : new TreeSet<>(map.keySet())) {
            List<int[]> list = map.get(key);
            UnionFind uf = new UnionFind(m + n);
            int[] rank2 = rank.clone();
            for (int[] cell : list) {
                int i = cell[0], j = cell[1];
                int p = uf.find(i), q = uf.find(j + m);
                uf.union(p, q);
                rank2[p] = Math.max(rank2[p], rank2[q]);
            }
            for (int[] cell : list) {
                int i = cell[0];
                rank[i] = rank2[uf.find(i)] + 1;
                int j = cell[1];
                rank[j + m] = rank[i];
                matrix[i][j] = rank[i];
            }
        }
        return matrix;
    }

    class UnionFind {
        int[] parent;
        public UnionFind(int n) {
            parent = new int[n];
            for (int i = 0; i < n; i++) {
                parent[i] = i;
            }
        }
        public int find(int x) {
            if (x != parent[x]) {
                parent[x] = find(parent[x]);
            }
            return parent[x];
        }
        public void union(int x, int y) {
            parent[find(x)] = parent[find(y)];
        }
    }
}

