        }
        return arr;
    }
}

class Solution {
    public int maxValueAfterReverse(int[] nums) {
        int n = nums.length;
        int ans = 0;
        int min1 = Integer.MAX_VALUE, max1 = Integer.MIN_VALUE;
        int min2 = Integer.MAX_VALUE, max2 = Integer.MIN_VALUE;
        for (int i = 0; i < n - 1; i++) {
            int a = nums[i], b = nums[i + 1];
            ans += Math.abs(a - b);
            min1 = Math.min(min1, Math.max(a, b));
            max1 = Math.max(max1, Math.min(a, b));
        }
        int diff = Math.max(0, (max1 - min1) * 2);
        for (int i = 0; i < n - 1; i++) {
            int a = nums[i], b = nums[i + 1];
            min2 = Math.min(min2, Math.max(a, b));
            max2 = Math.max(max2, Math.min(a, b));
        }
        diff = Math.max(diff, Math.abs(min2 - max2));
        return ans + diff;
    }
}

class Solution {
    public int deepestLeavesSum(TreeNode root) {
        Queue<TreeNode> q = new LinkedList<>();
        q.add(root);

        int sum = 0;
        while (!q.isEmpty()) {
            sum = 0;
            int size = q.size();
            for (int i = 0; i < size; i++) {
                TreeNode curr = q.poll();
                sum += curr.val;
                if (curr.left != null) {
                    q.add(curr.left);
                }
                if (curr.right != null) {
                    q.add(curr.right);
                }
            }
        }

        return sum;
    }
}

class Solution {
    public int[][] diagonalSort(int[][] mat) {
        int m = mat.length, n = mat[0].length;
        Map<Integer, PriorityQueue<Integer>> map = new HashMap<>();
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                map.putIfAbsent(i - j, new PriorityQueue<>());
                map.get(i - j).offer(mat[i][j]);
            }
        }
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                mat[i][j] = map.get(i - j).poll();
            }
        }
        return mat;
    }
}

