class Solution {
    public boolean btreeGameWinningMove(TreeNode root, int n, int x) {
        count(root, x);
        int left = Math.max(0, Math.max(leftCount, rightCount));
        int right = Math.max(0, Math.min(leftCount, rightCount));
        return left > n / 2 || right > n / 2;
    }
    
    int leftCount;
    int rightCount;
    
    private int count(TreeNode node, int x) {
        if (node == null) return 0;
        int left = count(node.left, x);
        int right = count(node.right, x);
        if (node.val == x) {
            leftCount = left;
            rightCount = right;
        }
        return 1 + left + right;
    }
}

class Solution {
    public int movesToMakeZigzag(int[] nums) {
        int count1 = 0, count2 = 0;
        for (int i = 0; i < nums.length; i += 2) {
            int left = i == 0 ? 1001 : nums[i - 1];
            int right = i == nums.length - 1 ? 1001 : nums[i + 1];
            int target = Math.min(left, right) - 1;
            count1 += Math.max(0, nums[i] - target);
        }
        for (int i = 1; i < nums.length; i += 2) {
            int left = nums[i - 1];
            int right = i == nums.length - 1 ? 1001 : nums[i + 1];
            int target = Math.min(left, right) - 1;
            count2 += Math.max(0, nums[i] - target);
        }
        return Math.min(count1, count2);
    }
}

class Solution {
    public int distinctEchoSubstrings(String text) {
        Set<String> set = new HashSet<>();
        int n = text.length();
        for (int i = 0; i < n; i++) {
            for (int j = i+1; j < n; j+=2) {
                if (text.substring(i, j).equals(text.substring(j, j+(j-i)))) {
                    set.add(text.substring(i, j));
                }
            }
        }
        return set.size();
    }
}

class Solution {
    public int sumEvenGrandparent(TreeNode root) {
        if(root == null)
            return 0;
        
        int sum = 0;
        if(root.val % 2 == 0) {
            if(root.left != null) {
                if(root.left.left != null)
                    sum += root.left.left.val;
                if(root.left.right != null)
                    sum += root.left.right.val;
            }
            if(root.right != null) {
                if(root.right.left != null)
                    sum += root.right.left.val;
                if(root.right.right != null)
                    sum += root.right.right.val;
            }
        }
        
        return sum + sumEvenGrandparent(root.left) + sumEvenGrandparent(root.right);
    }
}

class Solution {
    public int[][] matrixBlockSum(int[][] mat, int k) {
        int m = mat.length, n = mat[0].length;
        int[][] prefixSum = new int[m+1][n+1];
        int r, c, sum;
        for(int i=1; i<=m; i++)
            for(int j=1; j<=n; j++)
                prefixSum[i][j] = prefixSum[i-1][j] + prefixSum[i][j-1] - prefixSum[i-1][j-1] + mat[i-1][j-1];
        
        int[][] ans = new int[m][n];
        for(int i=0; i<m; i++)
            for(int j=0; j<n; j++){
                r = Math.min(m-1, i+k);
                c = Math.min(n-1, j+k);
                sum = prefixSum[r+1][c+1] - prefixSum[r+1][j-k] - prefixSum[i-k][c+1] + prefixSum[i-k][j-k];
                ans[i][j] = sum;
            }
        
        return ans;
    }
}

