class Solution {
    public int stoneGameII(int[] piles) {
        int n = piles.length;
        int[][] dp = new int[n][n+1];
        int sum = 0;
        for (int i = n-1; i >= 0; i--) {
            sum += piles[i];
            for (int m = 1; m <= n; m++) {
                if (i+2*m >= n) {
                    dp[i][m] = sum;
                    continue;
                }
                for (int x = 1; x <= 2*m; x++) {
                    dp[i][m] = Math.max(dp[i][m], sum - dp[i+x][Math.max(x, m)]);
                }
            }
        }
        return dp[0][1];
    }
}

class Solution {
    public int largest1BorderedSquare(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        int[][] left = new int[m][n], top = new int[m][n];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    left[i][j] = (j > 0 ? left[i][j-1] : 0) + 1;
                    top[i][j] = (i > 0 ? top[i-1][j] : 0) + 1;
                }
            }
        }
        for (int len = Math.min(m, n); len > 0; len--) {
            for (int i = len - 1; i < m; i++) {
                for (int j = len - 1; j < n; j++) {
                    if (left[i][j] >= len && top[i][j] >= len && left[i-len+1][j] >= len && top[i][j-len+1] >= len) {
                        return len * len;
                    }
                }
            }
        }
        return 0;
    }
}

class Solution {
    public String alphabetBoardPath(String target) {
        StringBuilder sb = new StringBuilder();
        int x = 0, y = 0;
        for (char c : target.toCharArray()) {
            int i = (c - 'a') / 5, j = (c - 'a') % 5;
            if (j < y) {
                for (int k = y - j; k > 0; k--) sb.append('L');
            }
            if (i < x) {
                for (int k = x - i; k > 0; k--) sb.append('U');
            }
            if (i > x) {
                for (int k = i - x; k > 0; k--) sb.append('D');
            }
            if (j > y) {
                for (int k = j - y; k > 0; k--) sb.append('R');
            }
            sb.append('!');
            x = i;
            y = j;
        }
        return sb.toString();
    }
}

class Solution {
    public int tribonacci(int n) {
        if (n == 0) return 0;
        if (n == 1 || n == 2) return 1;
        int a = 0, b = 1, c = 1, d;
        for (int i = 3; i <= n; i++) {
            d = a + b + c;
            a = b;
            b = c;
            c = d;
        }
        return c;
    }
