class Solution {
    public int findBestValue(int[] arr, int target) {
        Arrays.sort(arr);
        int n = arr.length, i = 0;
        while (i < n && target > arr[i] * (n - i)) {
            target -= arr[i++];
        }
        return i == n ? arr[n - 1] : (int) Math.round((target - 0.0001) / (n - i));
    }
