class Solution {
    public int maxAbsValExpr(int[] arr1, int[] arr2) {
        int max1 = Integer.MIN_VALUE, max2 = Integer.MIN_VALUE, max3 = Integer.MIN_VALUE, max4 = Integer.MIN_VALUE;
        int min1 = Integer.MAX_VALUE, min2 = Integer.MAX_VALUE, min3 = Integer.MAX_VALUE, min4 = Integer.MAX_VALUE;
        int n = arr1.length;
        for (int i = 0; i < n; i++) {
            max1 = Math.max(max1, arr1[i] + arr2[i] + i);
            max2 = Math.max(max2, arr1[i] - arr2[i] + i);
            max3 = Math.max(max3, -arr1[i] + arr2[i] + i);
            max4 = Math.max(max4, -arr1[i] - arr2[i] + i);
            min1 = Math.min(min1, arr1[i] + arr2[i] + i);
            min2 = Math.min(min2, arr1[i] - arr2[i] + i);
            min3 = Math.min(min3, -arr1[i] + arr2[i] + i);
            min4 = Math.min(min4, -arr1[i] - arr2[i] + i);
        }
        return Math.max(Math.max(max1 - min1, max2 - min2), Math.max(max3 - min3, max4 - min4));
    }
}

class Solution {
    public int[] shortestAlternatingPaths(int n, int[][] red_edges, int[][] blue_edges) {
        int[][] redGraph = new int[n][n];
        int[][] blueGraph = new int[n][n];
        for (int[] redEdge : red_edges) {
            redGraph[redEdge[0]][redEdge[1]] = 1;
        }
        for (int[] blueEdge : blue_edges) {
            blueGraph[blueEdge[0]][blueEdge[1]] = 1;
        }
        int[] result = new int[n];
        Arrays.fill(result, -1);
        result[0] = 0;
        Queue<Integer> queue = new LinkedList<>();
        queue.offer(0);
        int step = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            step++;
            for (int i = 0; i < size; i++) {
                int node = queue.poll();
                for (int j = 0; j < n; j++) {
                    if ((redGraph[node][j] == 1 && (result[node] % 2 == 0)) || (blueGraph[node][j] == 1 && (result[node] % 2 == 1))) {
                        if (result[j] == -1) {
                            result[j] = step;
                            queue.offer(j);
                        }
                    }
                }
            }
        }
        return result;
    }
}

class Solution {
    public int mctFromLeafValues(int[] arr) {
        int n = arr.length;
        int[][] maxLeaf = new int[n][n];
        for (int i = 0; i < n; i++) {
            int curMax = 0;
            for (int j = i; j < n; j++) {
                curMax = Math.max(curMax, arr[j]);
                maxLeaf[i][j] = curMax;
            }
        }
        int[][] dp = new int[n][n];
        for (int len = 2; len <= n; len++) {
            for (int i = 0; i + len <= n; i++) {
                int j = i + len - 1;
                dp[i][j] = Integer.MAX_VALUE;
                for (int k = i; k < j; k++) {
                    dp[i][j] = Math.min(dp[i][j], dp[i][k] + dp[k + 1][j] + maxLeaf[i][k] * maxLeaf[k + 1][j]);
                }
            }
        }
        return dp[0][n - 1];
    }
}

