class Solution {
    public int minFallingPathSum(int[][] grid) {
        int n = grid.length;
        for (int i = 1; i < n; i++) {
            int[] prevRow = grid[i - 1];
            int[] currRow = grid[i];
            int min1 = Integer.MAX_VALUE, min2 = Integer.MAX_VALUE, minIndex = -1;
            for (int j = 0; j < n; j++) {
                int val = prevRow[j];
                if (val < min1) {
                    min2 = min1;
                    min1 = val;
                    minIndex = j;
                } else if (val < min2) {
                    min2 = val;
                }
            }
            for (int j = 0; j < n; j++) {
                currRow[j] += j == minIndex ? min2 : min1;
            }
        }
        int minPathSum = Integer.MAX_VALUE;
        for (int j = 0; j < n; j++) {
            minPathSum = Math.min(minPathSum, grid[n - 1][j]);
        }
        return minPathSum;
    }
}

class Solution {
    public List<Boolean> areConnected(int n, int threshold, int[][] queries) {
        List<Boolean> res = new ArrayList<>();
        int[] parent = new int[n + 1];
        Arrays.fill(parent, -1);
        for (int i = threshold + 1; i <= n; i++) {
            if (parent[i] == -1) {
                for (int j = i; j <= n; j += i) {
                    if (parent[j] == -1) {
                        parent[j] = i;
                    } else {
                        int pi = find(parent, i);
                        int pj = find(parent, parent[j]);
                        if (pi != pj) {
                            parent[pj] = pi;
                        }
                    }
                }
            }
        }
        for (int[] query : queries) {
            int x = query[0], y = query[1];
            if (find(parent, x) == find(parent, y)) {
                res.add(true);
            } else {
                res.add(false);
            }
        }
        return res;
    }
    private int find(int[] parent, int x) {
        if (parent[x] == -1) {
            return x;
        }
        parent[x] = find(parent, parent[x]);
        return parent[x];
    }
}

class Solution {
