class Solution {
    public int[] smallestSufficientTeam(String[] req_skills, List<List<String>> people) {
        Map<String, Integer> skillMap = new HashMap<>();
        for (int i = 0; i < req_skills.length; i++) {
            skillMap.put(req_skills[i], i);
        }
        Map<Integer, List<Integer>> teamMap = new HashMap<>();
        teamMap.put(0, new ArrayList<>());
        for (int i = 0; i < people.size(); i++) {
            int skillMask = 0;
            for (String skill : people.get(i)) {
                skillMask |= 1 << skillMap.get(skill);
            }
            for (int teamMask : new ArrayList<>(teamMap.keySet())) {
                int newMask = teamMask | skillMask;
                if (!teamMap.containsKey(newMask) || teamMap.get(newMask).size() > teamMap.get(teamMask).size() + 1) {
                    List<Integer> newTeam = new ArrayList<>(teamMap.get(teamMask));
                    newTeam.add(i);
                    teamMap.put(newMask, newTeam);
                }
            }
        }
        List<Integer> result = teamMap.get((1 << req_skills.length) - 1);
        int[] ans = new int[result.size()];
        for (int i = 0; i < result.size(); i++) {
            ans[i] = result.get(i);
        }
        return ans;
    }
}

class Solution {
    public int longestWPI(int[] hours) {
        int n = hours.length;
        int[] prefixSum = new int[n+1];
        for(int i=1;i<=n;i++){
            prefixSum[i] = prefixSum[i-1] + (hours[i-1]>8?1:-1);
        }
        Stack<Integer> stack = new Stack<>();
        for(int i=0;i<=n;i++){
            if(stack.isEmpty() || prefixSum[stack.peek()]>prefixSum[i]){
                stack.push(i);
            }
        }
        int ans = 0;
        for(int i=n;i>=0;i--){
            while(!stack.isEmpty() && prefixSum[stack.peek()]<prefixSum[i]+1){
                int j = stack.pop();
                ans = Math.max(ans,i-j);
            }
        }
        return ans;
    }
}

class Solution {
    public TreeNode lcaDeepestLeaves(TreeNode root) {
        return helper(root).node;
    }
    
    private Result helper(TreeNode node) {
        if (node == null) {
            return new Result(null, 0);
        }
        Result left = helper(node.left);
        Result right = helper(node.right);
        if (left.depth == right.depth) {
            return new Result(node, left.depth + 1);
        } else if (left.depth > right.depth) {
            return new Result(left.node, left.depth + 1);
        } else {
            return new Result(right.node, right.depth + 1);
        }
    }
    
    private class Result {
        TreeNode node;
        int depth;
        
        public Result(TreeNode node, int depth) {
            this.node = node;
            this.depth = depth;
        }
    }
}

class Solution {
    public int[] relativeSortArray(int[] arr1, int[] arr2) {
        int[] freq = new int[1001];
        int[] res = new int[arr1.length];
        for (int num : arr1) {
            freq[num]++;
        }
        int idx = 0;
        for (int num : arr2) {
            while (freq[num] > 0) {
                res[idx++] = num;
                freq[num]--;
            }
        }
        for (int i = 0; i < freq.length; i++) {
            while (freq[i] > 0) {
                res[idx++] = i;
                freq[i]--;
            }
        }
        return res;
    }
}

class ZeroEvenOdd {
    private int n;
    private boolean zeroTurn = true;
    private boolean oddTurn = false;

    public ZeroEvenOdd(int n) {
        this.n = n;
    }

    public synchronized void zero(IntConsumer printNumber) throws InterruptedException {
        for (int i = 1; i <= n; i++) {
            while (!zeroTurn) {
                wait();
            }
            printNumber.accept(0);
            zeroTurn = false;
            notifyAll();
        }
    }

    public synchronized void even(IntConsumer printNumber) throws InterruptedException {
        int evenNumber = 2;
        for (int i = 1; i <= n / 2; i++) {
            while (zeroTurn || !oddTurn) {
                wait();
            }
            printNumber.accept(evenNumber);
            evenNumber += 2;
            zeroTurn = true;
            oddTurn = false;
            notifyAll();
        }
    }

    public synchronized void odd(IntConsumer printNumber) throws InterruptedException {
        int oddNumber = 1;
        for (int i = 1; i <= (n + 1) / 2; i++) {
            while (zeroTurn || oddTurn) {
                wait();
            }
            printNumber.accept(oddNumber);
            oddNumber += 2;
            zeroTurn = true;
            oddTurn = true;
            notifyAll();
        }
    }
}

class Solution {
    public List<Integer> sequentialDigits(int low, int high) {
        List<Integer> result = new ArrayList<>();
        for (int digit = 1; digit < 9; digit++) {
            int num = digit;
            for (int nextDigit = digit + 1; nextDigit <= 9; nextDigit++) {
                num = num * 10 + nextDigit;
                if (num >= low && num <= high) {
                    result.add(num);
                }
            }
        }
        Collections.sort(result);
        return result;
    }
}

class CombinationIterator {
    private String characters;
    private int combinationLength;
    private int[] indices;
    private boolean hasNext;

    public CombinationIterator(String characters, int combinationLength) {
        this.characters = characters;
        this.combinationLength = combinationLength;
        this.indices = new int[combinationLength];
        for (int i = 0; i < combinationLength; i++) {
            indices[i] = i;
        }
        this.hasNext = true;
    }

    public String next() {
        StringBuilder sb = new StringBuilder();
        for (int index : indices) {
            sb.append(characters.charAt(index));
        }

        int i = combinationLength - 1;
        while (i >= 0 && indices[i] == characters.length() - combinationLength + i) {
            i--;
        }

        if (i < 0) {
            hasNext = false;
        } else {
            indices[i]++;
            for (int j = i + 1; j < combinationLength; j++) {
                indices[j] = indices[j - 1] + 1;
            }
        }

        return sb.toString();
    }

    public boolean hasNext() {
        return hasNext;
    }
}

