class Foo {
    private boolean firstDone;
    private boolean secondDone;
    private final Object lock = new Object();

    public Foo() {
        firstDone = false;
        secondDone = false;
    }

    public void first(Runnable printFirst) throws InterruptedException {
        synchronized(lock) {
            printFirst.run();
            firstDone = true;
            lock.notifyAll();
        }
    }

    public void second(Runnable printSecond) throws InterruptedException {
        synchronized(lock) {
            while (!firstDone) {
                lock.wait();
            }
            printSecond.run();
            secondDone = true;
            lock.notifyAll();
        }
    }

    public void third(Runnable printThird) throws InterruptedException {
        synchronized(lock) {
            while (!secondDone) {
                lock.wait();
            }
            printThird.run();
        }
    }
}

class Solution {
    public boolean parseBoolExpr(String expression) {
        Stack<Character> opStack = new Stack<>();
        Stack<Character> valueStack = new Stack<>();
        for (char c : expression.toCharArray()) {
            if (c == '&' || c == '|' || c == '!') {
                opStack.push(c);
            } else if (c == 't' || c == 'f' || c == '(') {
                valueStack.push(c);
            } else if (c == ')') {
                List<Character> values = new ArrayList<>();
                while (valueStack.peek() != '(') {
                    values.add(valueStack.pop());
                }
                valueStack.pop();
                char op = opStack.pop();
                if (op == '!') {
                    valueStack.push(values.get(0) == 't' ? 'f' : 't');
                } else if (op == '&') {
                    boolean result = true;
                    for (char value : values) {
                        if (value == 'f') {
                            result = false;
                            break;
                        }
                    }
                    valueStack.push(result ? 't' : 'f');
                } else {
                    boolean result = false;
                    for (char value : values) {
                        if (value == 't') {
                            result = true;
                            break;
                        }
                    }
                    valueStack.push(result ? 't' : 'f');
                }
            }
        }
        return valueStack.pop() == 't';
    }
}

class Solution {
    public int minHeightShelves(int[][] books, int shelf_width) {
        int n = books.length;
        int[] dp = new int[n+1];
        dp[0] = 0;
        for (int i = 1; i <= n; i++) {
            int width = books[i-1][0];
            int height = books[i-1][1];
            dp[i] = dp[i-1] + height;
            for (int j = i-1; j > 0 && width+books[j-1][0] <= shelf_width; j--) {
                height = Math.max(height, books[j-1][1]);
                width += books[j-1][0];
                dp[i] = Math.min(dp[i], dp[j-1] + height);
            }
        }
        return dp[n];
    }
}

class Solution {
    public int[] distributeCandies(int candies, int num_people) {
        int[] ans = new int[num_people];
        int i = 0;
        while (candies > 0) {
            ans[i % num_people] += Math.min(candies, i + 1);
            candies -= i + 1;
            i++;
        }
        return ans;
    }
}

class Solution {
    public List<Integer> pathInZigZagTree(int label) {
        List<Integer> path = new ArrayList<>();
        int level = 1;
        while (Math.pow(2, level) - 1 < label) {
            level++;
        }
        while (level > 0) {
            path.add(label);
            int maxLabel = (int) Math.pow(2, level) - 1;
            int minLabel = (int) Math.pow(2, level - 1);
            label = maxLabel - (label - minLabel);
            label /= 2;
            level--;
        }
        Collections.reverse(path);
        path.set(0, 1);
        return path;
    }
}

class Solution {
    public String[] braceExpansionII(String expression) {
        List<Set<String>> groups = new ArrayList<>();
        groups.add(new HashSet<>());
        int level = 0;
        int start = 0;
        boolean inBrackets = false;
        for (int i = 0; i < expression.length(); i++) {
            char c = expression.charAt(i);
            if (c == '{' && !inBrackets) {
                if (level == groups.size()) {
                    groups.add(new HashSet<>());
                }
                level++;
                start = i + 1;
            } else if (c == '}' && !inBrackets) {
                String group = expression.substring(start, i);
                Set<String> set = computeGroup(group);
                groups.set(level - 1, set);
                level--;
            } else if (c == ',' && level == groups.size()) {
                groups.add(new HashSet<>());
            } else if (Character.isLetter(c) && !inBrackets) {
                String letter = Character.toString(c);
                groups.get(level).add(letter);
            } else if (c == '{') {
                inBrackets = true;
            } else if (c == '}') {
                inBrackets = false;
            }
        }
        Set<String> result = groups.get(0);
        for (int i = 1; i < groups.size(); i++) {
            result = union(result, groups.get(i));
        }
        String[] ans = new String[result.size()];
        int i = 0;
        for (String word : result) {
            ans[i++] = word;
        }
        Arrays.sort(ans);
        return ans;
    }
    
    private Set<String> computeGroup(String groupStr) {
        Solution sol = new Solution();
        Set<String> group = sol.braceExpansionII(groupStr);
        return group;
    }
    
    private Set<String> union(Set<String> set1, Set<String> set2) {
        Set<String> union = new HashSet<>();
        for (String s1 : set1) {
            for (String s2 : set2) {
                union.add(s1 + s2);
            }
        }
        union.addAll(set1);
        union.addAll(set2);
        return union;
    }
}

ProblemDescription:
Can you solve this real interview question? Print FooBar Alternately - Suppose you are given the following code:


class FooBar {
  public void foo() {
    for (int i = 0; i < n; i++) {
      print("foo");
    }
  }

  public void bar() {
    for (int i = 0; i < n; i++) {
      print("bar");
    }
  }
}


The same instance of FooBar will be passed to two different threads:

 * thread A will call foo(), while
 * thread B will call bar().

Modify the given program to output "foobar" n times.

 

Example 1:


Input: n = 1
Output: "foobar"
Explanation: There are two threads being fired asynchronously. One of them calls foo(), while the other calls bar().
"foobar" is being output 1 time.


Example 2:


Input: n = 2
Output: "foobarfoobar"
Explanation: "foobar" is being output 2 times.


 

Constraints:

 * 1 <= n <= 1000

Answer_Java:
class FooBar {
    private int n;
    private boolean flag = false;
    private Object lock = new Object();
    
    public FooBar(int n) {
        this.n = n;
    }

    public void foo(Runnable printFoo) throws InterruptedException {
        
        for (int i = 0; i < n; i++) {
            synchronized(lock) {
                while (flag) {
                    lock.wait();
                }
                printFoo.run();
                flag = true;
                lock.notifyAll();
            }
        }
    }

    public void bar(Runnable printBar) throws InterruptedException {
        
        for (int i = 0; i < n; i++) {
            synchronized(lock) {
                while (!flag) {
                    lock.wait();
                }
                printBar.run();
                flag = false;
                lock.notifyAll();
            }
        }
    }
}

