class Solution {
    public int findInMountainArray(int target, MountainArray mountainArr) {
        int n = mountainArr.length();
        int peak = findPeak(mountainArr, 0, n-1);
        int left = binarySearch(mountainArr, 0, peak, target, true);
        if (left != -1) return left;
        int right = binarySearch(mountainArr, peak+1, n-1, target, false);
        return right;
    }
    
    private int findPeak(MountainArray arr, int left, int right) {
        while (left < right) {
            int mid = left + (right - left) / 2;
            if (arr.get(mid) < arr.get(mid+1)) {
                left = mid + 1;
            } else {
                right = mid;
            }
        }
        return left;
    }
    
    private int binarySearch(MountainArray arr, int left, int right, int target, boolean isAsc) {
        while (left <= right) {
            int mid = left + (right - left) / 2;
            int midVal = arr.get(mid);
            if (midVal == target) {
                return mid;
            } else if (midVal < target) {
                left = isAsc ? mid+1 : left;
                right = isAsc ? right : mid-1;
            } else {
                right = isAsc ? mid-1 : right;
                left = isAsc ? left : mid+1;
            }
        }
        return -1;
    }
}

