class Solution {
    public double[] sampleStats(int[] count) {
        double[] res = new double[5];
        int n = count.length;
        int totalCount = 0;
        int maxCount = 0, mode = 0;
        int left = -1, right = -1;
        for (int i = 0; i < n; i++) {
            if (count[i] > 0) {
                if (left == -1) left = i;
                right = i;
                totalCount += count[i];
                res[2] += i * count[i];
                if (count[i] > maxCount) {
                    maxCount = count[i];
                    mode = i;
                }
            }
        }
        res[0] = left;
        res[1] = right;
        res[2] /= totalCount;
        if (totalCount % 2 == 1) {
            int medianIndex = totalCount / 2 + 1;
            int countSoFar = 0;
            for (int i = 0; i < n; i++) {
                if (count[i] > 0) {
                    countSoFar += count[i];
                    if (countSoFar >= medianIndex) {
                        res[3] = i;
                        break;
                    }
                }
            }
        } else {
            int medianIndex1 = totalCount / 2;
            int medianIndex2 = totalCount / 2 + 1;
            int countSoFar = 0;
            int prev = -1, curr = -1;
            for (int i = 0; i < n; i++) {
                if (count[i] > 0) {
                    countSoFar += count[i];
                    if (countSoFar >= medianIndex1 && prev == -1) {
                        prev = i;
                    }
                    if (countSoFar >= medianIndex2) {
                        res[3] = prev == -1 ? (i + prev) / 2.0 : (i + prev) / 2.0;
                        break;
                    }
                }
            }
        }
        res[4] = mode;
        return res;
    }
}

