class Solution {
    public int maxSatisfied(int[] customers, int[] grumpy, int minutes) {
        int satisfied = 0;
        int maxSatisfied = 0;
        int n = customers.length;
        int windowStart = 0;
        int windowEnd = 0;
        int grumpyWindow = 0;
        while (windowEnd < n) {
            satisfied += grumpy[windowEnd] == 0 ? customers[windowEnd] : 0;
            grumpyWindow += grumpy[windowEnd] == 1 ? customers[windowEnd] : 0;
            if (windowEnd - windowStart + 1 > minutes) {
                if (grumpy[windowStart] == 1) {
                    grumpyWindow -= customers[windowStart];
                }
                windowStart++;
            }
            maxSatisfied = Math.max(maxSatisfied, satisfied + grumpyWindow);
            windowEnd++;
        }
        return maxSatisfied;
    }
}

