class Solution {
    public int lastStoneWeightII(int[] stones) {
        int n = stones.length;
        int sum = 0;
        for (int i = 0; i < n; i++) {
            sum += stones[i];
        }
        boolean[] dp = new boolean[sum / 2 + 1];
        dp[0] = true;
        for (int i = 0; i < n; i++) {
            for (int j = sum / 2; j >= stones[i]; j--) {
                dp[j] |= dp[j - stones[i]];
            }
        }
        for (int i = sum / 2; i >= 0; i--) {
            if (dp[i]) {
                return sum - i - i;
            }
        }
        return 0;
    }
}

class Solution {
    public int longestStrChain(String[] words) {
        Map<String, Integer> dp = new HashMap<>();
        Arrays.sort(words, (a, b) -> a.length() - b.length());
        int maxLength = 1;
        for (String word : words) {
            int currentMaxLength = 1;
            for (int i = 0; i < word.length(); i++) {
                StringBuilder sb = new StringBuilder(word);
                sb.deleteCharAt(i);
                String predecessor = sb.toString();
                int predecessorLength = dp.getOrDefault(predecessor, 0);
                currentMaxLength = Math.max(currentMaxLength, predecessorLength + 1);
            }
            dp.put(word, currentMaxLength);
            maxLength = Math.max(maxLength, currentMaxLength);
        }
        return maxLength;
    }
}

