class Solution {
    public int[] numMovesStonesII(int[] stones) {
        Arrays.sort(stones);
        int n = stones.length, i = 0, j = 0, low = n;
        int high = Math.max(stones[n-1] - n + 2 - stones[1], stones[n-2] - (stones[0] + n - 2)) - n + 2;
        for (i = 0; i < n; ++i) {
            while (j + 1 < n && stones[j+1] - stones[i] + 1 <= n) ++j;
            int cost = n - (j - i + 1);
            if (j - i + 1 == n - 1 && stones[j] - stones[i] + 1 == n - 1) cost = 2;
            low = Math.min(low, cost);
        }
        return new int[]{low, high};
    }
}

class Solution {
    public int countCharacters(String[] words, String chars) {
        int[] count = new int[26];
        int res = 0;
        for (char c : chars.toCharArray()) {
            count[c-'a']++;
        }
        for (String word : words) {
            int[] cur = new int[26];
            boolean valid = true;
            for (char c : word.toCharArray()) {
                cur[c-'a']++;
                if (cur[c-'a'] > count[c-'a']) {
                    valid = false;
                    break;
                }
            }
            if (valid) {
                res += word.length();
            }
        }
        return res;
    }
}

class Solution {
    public int minScoreTriangulation(int[] values) {
        int n = values.length;
        int[][] dp = new int[n][n];
        for (int len = 3; len <= n; len++) {
            for (int i = 0; i + len - 1 < n; i++) {
                int j = i + len - 1;
                dp[i][j] = Integer.MAX_VALUE;
                for (int k = i + 1; k < j; k++) {
                    dp[i][j] = Math.min(dp[i][j], dp[i][k] + dp[k][j] + values[i] * values[k] * values[j]);
                }
            }
        }
        return dp[0][n - 1];
    }
}

class Solution {
    private static final int[][] DIRS = {{1,0}, {-1,0}, {0,1}, {0,-1}};
    
    public boolean isEscapePossible(int[][] blocked, int[] source, int[] target) {
        Set<String> blockedSet = buildBlockedSet(blocked);
        return bfs(blockedSet, source, target) && bfs(blockedSet, target, source);
    }
    
    private Set<String> buildBlockedSet(int[][] blocked) {
        Set<String> set = new HashSet<>();
        for (int[] b : blocked) {
            String s = b[0] + "," + b[1];
            set.add(s);
        }
        return set;
    }
    
    private boolean bfs(Set<String> blocked, int[] source, int[] target) {
        Set<String> visited = new HashSet<>();
        visited.add(source[0]+","+source[1]);
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(source);
        int limit = blocked.size();
        int count = 0;
        while (!queue.isEmpty()) {
            int[] curr = queue.poll();
            count++;
            if (count > limit || count > 20000) return true;
            if (curr[0] == target[0] && curr[1] == target[1]) return true;
            for (int[] dir : DIRS) {
                int x = curr[0] + dir[0];
                int y = curr[1] + dir[1];
                String key = x+","+y;
                if (x<0 || x>999999 || y<0 || y>999999 || visited.contains(key) || blocked.contains(key)) continue;
                visited.add(key);
                queue.offer(new int[]{x,y});
            }
        }
        return false;
    }
}

class Solution {
    public int maxUncrossedLines(int[] nums1, int[] nums2) {
        int m = nums1.length, n = nums2.length;
        int[][] dp = new int[m+1][n+1];
        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                if (nums1[i-1] == nums2[j-1])
                    dp[i][j] = dp[i-1][j-1] + 1;
                else
                    dp[i][j] = Math.max(dp[i-1][j], dp[i][j-1]);
            }
        }
        return dp[m][n];
    }
}

class Solution {
    private int[][] dirs = {{0,1},{0,-1},{1,0},{-1,0}};
    
    public int[][] colorBorder(int[][] grid, int row, int col, int color) {
        dfs(grid, row, col, grid[row][col]);
        for (int i = 0; i < grid.length; i++) {
            for (int j = 0; j < grid[0].length; j++) {
                if (grid[i][j] < 0) {
                    grid[i][j] = color;
                }
            }
        }
        return grid;
    }
    
    private void dfs(int[][] grid, int row, int col, int color) {
        if (row < 0 || col < 0 || row == grid.length || col == grid[0].length || grid[row][col] != color) {
            return;
        }
        grid[row][col] = -color;
        for (int[] dir : dirs) {
            dfs(grid, row + dir[0], col + dir[1], color);
        }
        if (row > 0 && row < grid.length - 1 && col > 0 && col < grid[0].length - 1 &&
           Math.abs(grid[row+1][col]) == color && Math.abs(grid[row-1][col]) == color &&
           Math.abs(grid[row][col+1]) == color && Math.abs(grid[row][col-1]) == color) {
            grid[row][col] = color;
        }
    }
}

class Solution {
    public int[] numMovesStones(int a, int b, int c) {
        int[] stones = new int[]{a, b, c};
