class Solution {
    public int maxSumTwoNoOverlap(int[] nums, int firstLen, int secondLen) {
        int n = nums.length;
        int[] preSum = new int[n+1];
        for(int i=1; i<=n; i++)
            preSum[i] = preSum[i-1] + nums[i-1];
        int maxSum = 0;
        for(int i=firstLen+secondLen; i<=n; i++){
            int currSum = preSum[i] - preSum[i-firstLen-secondLen];
            int firstSum = maxSum(preSum, 0, i-firstLen, firstLen);
            int secondSum = maxSum(preSum, i-secondLen, i-firstLen, secondLen);
            maxSum = Math.max(maxSum, Math.max(firstSum + currSum, secondSum + currSum));
        }
        return maxSum;
    }
    public int maxSum(int[] preSum, int start, int end, int len){
        int max = preSum[start+len] - preSum[start];
        for(int i=start+len+1; i<=end; i++){
            int currSum = preSum[i] - preSum[i-len];
            max = Math.max(max, currSum);
        }
        return max;
    }
}

