class Solution {
    public String smallestEquivalentString(String s1, String s2, String baseStr) {
        int[] parent = new int[26];
        for (int i = 0; i < 26; i++) {
            parent[i] = i;
        }
        for (int i = 0; i < s1.length(); i++) {
            int root1 = find(parent, s1.charAt(i) - 'a');
            int root2 = find(parent, s2.charAt(i) - 'a');
            parent[root1] = Math.min(root1, root2);
            parent[root2] = Math.min(root1, root2);
        }
        StringBuilder res = new StringBuilder();
        for (char c : baseStr.toCharArray()) {
            res.append((char)('a' + find(parent, c - 'a')));
        }
        return res.toString();
    }
    
    private int find(int[] parent, int x) {
        if (parent[x] != x) {
            parent[x] = find(parent, parent[x]);
        }
        return parent[x];
    }
}

class Solution {
    public int numDupDigitsAtMostN(int n) {
        int res = 0;
        for (int i = 1; i < n; ++i) {
            if (check(i)) ++res;
        }
        return res;
    }
    
    private boolean check(int n) {
        int used = 0, digits = 0;
        while (n > 0) {
            int tmp = 1 << (n % 10);
            if ((used & tmp) != 0) return true;
            used |= tmp;
            n /= 10;
            ++digits;
        }
        return false;
    }
}

class Solution {
    public int shipWithinDays(int[] weights, int days) {
        int left = 0, right = 0;
        for (int weight : weights) {
            left = Math.max(left, weight);
            right += weight;
        }
        while (left < right) {
            int mid = (left + right) / 2;
            int need = 1, cur = 0;
            for (int weight : weights) {
                if (cur + weight > mid) {
                    need++;
                    cur = 0;
                }
                cur += weight;
            }
            if (need <= days) {
                right = mid;
            } else {
                left = mid + 1;
            }
        }
        return left;
    }
}

class Solution {
    public int numPairsDivisibleBy60(int[] time) {
        int[] remainders = new int[60];
        int count = 0;
        for (int t : time) {
            if (t % 60 == 0) {
                count += remainders[0];
            } else {
                count += remainders[60 - t % 60];
            }
            remainders[t % 60]++;
        }
        return count;
    }
}

