class Solution {
    public TreeNode bstFromPreorder(int[] preorder) {
        if(preorder == null || preorder.length == 0) return null;
        return buildBST(preorder, 0, preorder.length-1);
    }
    
    private TreeNode buildBST(int[] preorder, int start, int end){
        if(start > end) return null;
        TreeNode node = new TreeNode(preorder[start]);
        int rightStart = start+1;
        while(rightStart <= end && preorder[rightStart] < node.val) rightStart++;
        node.left = buildBST(preorder, start+1, rightStart-1);
        node.right = buildBST(preorder, rightStart, end);
        return node;
    }
}

class Solution {
    public int minDominoRotations(int[] tops, int[] bottoms) {
        int[] countTops = new int[7];
        int[] countBottoms = new int[7];
        int[] common = new int[7];
        int n = tops.length;
        for (int i = 0; i < n; i++) {
            countTops[tops[i]]++;
            countBottoms[bottoms[i]]++;
            if (tops[i] == bottoms[i]) common[tops[i]]++;
        }
        for (int i = 1; i <= 6; i++) {
            if (countTops[i] + countBottoms[i] - common[i] == n) {
                return n - Math.max(countTops[i], countBottoms[i]);
            }
        }
        return -1;
    }
}

class Solution {
    public int clumsy(int n) {
        int[] nums = new int[]{n, n-1, n-2};
        n -= 3;
        int index = 0;
        int sum = calc(nums, index, n);
        while (n > 0) {
            index++;
            nums[index%3] = n;
            n--;
            index++;
            nums[index%3] = n;
            n--;
            index++;
            nums[index%3] = n;
            n--;
            sum -= calc(nums, index, n);
        }
        return sum;
    }
    
    private int calc(int[] nums, int index, int n) {
        int res = nums[index%3];
        if (index % 3 == 0) {
            res *= n+1;
        } else if (index % 3 == 1) {
            res /= n+1;
        } else {
            res += n+1;
        }
        return res;
    }
}

class Solution {
    public int largestSumAfterKNegations(int[] nums, int k) {
        PriorityQueue<Integer> pq = new PriorityQueue<>();
        for(int num: nums) pq.offer(num);
        while(k-- > 0) pq.offer(-pq.poll());
        int sum = 0;
        while(!pq.isEmpty()) sum += pq.poll();
        return sum;
    }
}

class Solution {
    public int longestOnes(int[] nums, int k) {
        int left = 0, right;
        for (right = 0; right < nums.length; right++) {
            if (nums[right] == 0) k--;
            if (k < 0 && nums[left++] == 0) k++;
        }
        return right - left;
    }
}

class Solution {
    public boolean isValid(String s) {
        Stack<Character> stack = new Stack<>();
        for (char c : s.toCharArray()) {
            if (c == 'c') {
                if (stack.isEmpty() || stack.pop() != 'b') {
                    return false;
                }
                if (stack.isEmpty() || stack.pop() != 'a') {
                    return false;
                }
            } else {
                stack.push(c);
            }
        }
        return stack.isEmpty();
    }
}

class Solution {
    public List<Character> commonChars(String[] words) {
        List<Character> result = new ArrayList<>();
        int[] count = new int[26];
        Arrays.fill(count, Integer.MAX_VALUE);
        
        for (String word : words) {
            int[] currCount = new int[26];
            for (char ch : word.toCharArray()) {
                currCount[ch - 'a']++;
            }
            
            for (int i = 0; i < 26; i++) {
                count[i] = Math.min(count[i], currCount[i]);
            }
        }
        
        for (int i = 0; i < 26; i++) {
            while (count[i] > 0) {
                result.add((char)(i + 'a'));
                count[i]--;
            }
        }
        
        return result;
    }
}

class Solution {
    public int[] gridIllumination(int n, int[][] lamps, int[][] queries) {
        int[] ans = new int[queries.length];
        Map<Integer, Integer> rows = new HashMap<>();
        Map<Integer, Integer> cols = new HashMap<>();
        Map<Integer, Integer> diag1 = new HashMap<>();
        Map<Integer, Integer> diag2 = new HashMap<>();
        Set<String> lampSet = new HashSet<>();
        for (int[] lamp : lamps) {
            int row = lamp[0], col = lamp[1];
            int id1 = row-col, id2 = row+col;
            rows.put(row, rows.getOrDefault(row, 0)+1);
            cols.put(col, cols.getOrDefault(col, 0)+1);
            diag1.put(id1, diag1.getOrDefault(id1, 0)+1);
            diag2.put(id2, diag2.getOrDefault(id2, 0)+1);
            lampSet.add(row + "," + col);
        }
        for (int i = 0; i < queries.length; i++) {
            int row = queries[i][0], col = queries[i][1];
            if (rows.containsKey(row) || cols.containsKey(col) || diag1.containsKey(row-col) || diag2.containsKey(row+col)) {
                ans[i] = 1;
            }
            for (int r = row-1; r <= row+1; r++) {
                for (int c = col-1; c <= col+1; c++) {
                    if (r >= 0 && r < n && c >= 0 && c < n && lampSet.contains(r + "," + c)) {
                        int id1 = r-c, id2 = r+c;
                        rows.put(r, rows.getOrDefault(r, 0)-1);
                        cols.put(c, cols.getOrDefault(c, 0)-1);
                        diag1.put(id1, diag1.getOrDefault(id1, 0)-1);
                        diag2.put(id2, diag2.getOrDefault(id2, 0)-1);
                        lampSet.remove(r + "," + c);
                    }
                }
            }
        }
        return ans;
    }
}

class Solution {
    public int mergeStones(int[] stones, int k) {
        int n = stones.length;
        if ((n - 1) % (k - 1) != 0) return -1;
        int[] prefix = new int[n + 1];
        for (int i = 1; i <= n; i++) {
            prefix[i] = prefix[i - 1] + stones[i - 1];
        }
        int[][] dp = new int[n][n];
        for (int len = k; len <= n; len++) {
            for (int i = 0; i + len - 1 < n; i++) {
                int j = i + len - 1;
                dp[i][j] = Integer.MAX_VALUE;
                for (int t = i; t < j; t += k - 1) {
                    dp[i][j] = Math.min(dp[i][j], dp[i][t] + dp[t + 1][j]);
                }
                if ((j - i) % (k - 1) == 0) {
                    dp[i][j] += prefix[j + 1] - prefix[i];
                }
            }
        }
        return dp[0][n - 1];
    }
}

class Solution {
    public int numRookCaptures(char[][] board) {
        int x = 0, y = 0;
        for (int i = 0; i < 8; i++) {
            for (int j = 0; j < 8; j++) {
                if (board[i][j] == 'R') {
                    x = i;
                    y = j;
                    break;
                }
            }
        }

        int ans = 0;
        int[] dx = {-1, 0, 1, 0};
        int[] dy = {0, 1, 0, -1};

        for (int i = 0; i < 4; i++) {
            for (int step = 0; ; step++) {
                int tx = x + step * dx[i];
                int ty = y + step * dy[i];
                if (tx < 0 || tx >= 8 || ty < 0 || ty >= 8 || board[tx][ty] == 'B') {
                    break;
                }
                if (board[tx][ty] == 'p') {
                    ans++;
                    break;
                }
            }
        }

        return ans;
    }
}

class Solution {
