class Solution {
    public int numSquarefulPerms(int[] nums) {
        int n = nums.length;
        Arrays.sort(nums);
        boolean[][] graph = new boolean[n][n];
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                int sqrt = (int) Math.sqrt(nums[i] + nums[j]);
                if (sqrt * sqrt == nums[i] + nums[j]) {
                    graph[i][j] = graph[j][i] = true;
                }
            }
        }
        int[] factorial = new int[n + 1];
        factorial[0] = 1;
        for (int i = 1; i <= n; i++) {
            factorial[i] = factorial[i - 1] * i;
        }
        int[] count = new int[n];
        boolean[] visited = new boolean[n];
        int res = 0;
        for (int i = 0; i < n; i++) {
            if (i > 0 && nums[i] == nums[i - 1]) {
                continue;
            }
            Arrays.fill(count, 0);
            count[i] = 1;
            visited[i] = true;
            res += dfs(i, 1, n, count, visited, graph, factorial);
            visited[i] = false;
        }
        return res;
    }
    private int dfs(int curr, int len, int n, int[] count, boolean[] visited, boolean[][] graph, int[] factorial) {
        if (len == n) {
            int res = factorial[n];
            for (int i : count) {
                res /= factorial[i];
            }
            return res;
        }
        int res = 0;
        for (int i = 0; i < n; i++) {
            if (visited[i] || !graph[curr][i]) {
                continue;
            }
            if (i > 0 && nums[i] == nums[i - 1] && !visited[i - 1]) {
                continue;
            }
            visited[i] = true;
            count[i]++;
            res += dfs(i, len + 1, n, count, visited, graph, factorial);
            count[i]--;
            visited[i] = false;
        }
        return res;
    }
    private int[] nums;
}

class Solution {
    public int minKBitFlips(int[] nums, int k) {
        int n = nums.length;
        int[] diff = new int[n + 1];
        int ans = 0, flip = 0;
        for (int i = 0; i < n; i++) {
            flip ^= diff[i];
            if (nums[i] == flip) {
                if (i + k > n) {
                    return -1;
                }
                ans++;
                flip ^= 1;
                diff[i + k] ^= 1;
            }
        }
        return ans;
    }
}

class Solution {
    public int orangesRotting(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;
        int minutes = -1;
        int[] dx = {0, 0, 1, -1};
        int[] dy = {1, -1, 0, 0};
        Queue<int[]> queue = new LinkedList<>();
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 2) {
                    queue.offer(new int[]{i, j});
                }
            }
        }
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                int[] curr = queue.poll();
                int x = curr[0], y = curr[1];
                for (int j = 0; j < 4; j++) {
                    int nx = x + dx[j], ny = y + dy[j];
                    if (nx < 0 || nx >= m || ny < 0 || ny >= n || grid[nx][ny] == 0 || grid[nx][ny] == 2) {
                        continue;
                    }
                    grid[nx][ny] = 2;
                    queue.offer(new int[]{nx, ny});
                }
            }
            minutes++;
        }
        for (int[] row : grid) {
            for (int cell : row) {
                if (cell == 1) {
                    return -1;
                }
            }
        }
        return minutes < 0 ? 0 : minutes;
    }
}

class Solution {
    public boolean isCousins(TreeNode root, int x, int y) {
        Queue<TreeNode> queue = new LinkedList<>();
        queue.offer(root);
        while (!queue.isEmpty()) {
            int size = queue.size();
            boolean foundX = false;
            boolean foundY = false;
            for (int i = 0; i < size; i++) {
                TreeNode node = queue.poll();
                if (node.val == x) foundX = true;
                if (node.val == y) foundY = true;
                if (node.left != null && node.right != null) {
                    if (node.left.val == x && node.right.val == y) return false;
                    if (node.left.val == y && node.right.val == x) return false;
                }
                if (node.left != null) queue.offer(node.left);
                if (node.right != null) queue.offer(node.right);                    
            }
            if (foundX && foundY) return true;
            if (foundX || foundY) return false;
        }
        return false;
    }
}

class Solution {
    public int subarraysWithKDistinct(int[] nums, int k) {
        Map<Integer, Integer> count = new HashMap<>();
        int distinct = 0, res = 0, left1 = 0, left2 = 0;
        for (int right = 0; right < nums.length; right++) {
            count.put(nums[right], count.getOrDefault(nums[right], 0) + 1);
            if (count.get(nums[right]) == 1) {
                distinct++;
            }
            while (distinct > k) {
                count.put(nums[left1], count.get(nums[left1]) - 1);
                if (count.get(nums[left1]) == 0) {
                    distinct--;
                }
                left1++;
            }
            while (distinct >= k) {
                count.put(nums[left2], count.get(nums[left2]) - 1);
                if (count.get(nums[left2]) == 0) {
                    distinct--;
                }
                left2++;
            }
            res += left2 - left1;
        }
        return res;
    }
}

class Solution {
    public int brokenCalc(int startValue, int target) {
        int res = 0;
        while (target > startValue) {
            res++;
            if (target % 2 == 1) {
                target++;
            } else {
                target /= 2;
            }
        }
        return res + startValue - target;
    }
}

class Solution {
    public boolean equationsPossible(String[] equations) {
        int[] parent = new int[26];
        for (int i = 0; i < 26; i++) parent[i] = i;
        for (String e : equations)
            if (e.charAt(1) == '=') parent[find(parent, e.charAt(0) - 'a')] = find(parent, e.charAt(3) - 'a');
        for (String e : equations)
            if (e.charAt(1) == '!' && find(parent, e.charAt(0) - 'a') == find(parent, e.charAt(3) - 'a'))
                return false;
        return true;
    }
    public int find(int[] parent, int x) {
        return parent[x] == x ? x : find(parent, parent[x]);
    }
}

class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        List<Integer> res = new ArrayList<>();
        int n = num.length, carry = 0;
        for (int i = n - 1; i >= 0; i--) {
            int sum = num[i] + k % 10 + carry;
            res.add(sum % 10);
            carry = sum / 10;
            k /= 10;
        }
        while (k > 0 || carry > 0) {
            int sum = k % 10 + carry;
            res.add(sum % 10);
            carry = sum / 10;
            k /= 10;
        }
        Collections.reverse(res);
        return res;
    }
}

class Solution {
    public String smallestFromLeaf(TreeNode root) {
        return dfs(root, "");
    }
    
    private String dfs(TreeNode node, String suffix) {
        if (node == null) return suffix;
        String cur = (char)('a' + node.val) + suffix;
        if (node.left == null && node.right == null) return cur;
        if (node.left == null || node.right == null) {
            return dfs(node.left == null ? node.right : node.left, cur);
        }
        String left = dfs(node.left, cur);
        String right = dfs(node.right, cur);
        return left.compareTo(right) <= 0 ? left : right;
    }
}

class Solution {
    private Map<Integer, List<int[]>> map = new HashMap<>();
    public List<List<Integer>> verticalTraversal(TreeNode root) {
        dfs(root, 0, 0);
        List<List<Integer>> res = new ArrayList<>();
        List<Integer> keys = new ArrayList<>(map.keySet());
        Collections.sort(keys);
        for (int key : keys) {
            List<int[]> list = map.get(key);
            Collections.sort(list, new Comparator<int[]>() {
                public int compare(int[] a, int[] b) {
                    if (a[0] != b[0]) {
                        return a[0] - b[0];
                    } else {
                        return a[1] - b[1];
                    }
                }
            });
            List<Integer> level = new ArrayList<>();
            for (int[] node : list) {
                level.add(node[1]);
            }
            res.add(level);
        }
        return res;
    }
    
    private void dfs(TreeNode root, int x, int y) {
        if (root == null) return;
        dfs(root.left, x - 1, y + 1);
        if (!map.containsKey(x)) {
            map.put(x, new ArrayList<>());
        }
        map.get(x).add(new int[]{y, root.val});
        dfs(root.right, x + 1, y + 1);
    }
}

class Solution {
    public int[][] intervalIntersection(int[][] firstList, int[][] secondList) {
        List<int[]> res = new ArrayList<>();
        int i = 0, j = 0;
        while (i < firstList.length && j < secondList.length) {
            int start = Math.max(firstList[i][0], secondList[j][0]);
            int end = Math.min(firstList[i][1], secondList[j][1]);
            if (start <= end) {
                res.add(new int[]{start, end});
            }
            if (firstList[i][1] < secondList[j][1]) {
                i++;
            } else {
                j++;
            }
        }
        return res.toArray(new int[res.size()][]);
    }
}

class Solution {
    public int[] sumEvenAfterQueries(int[] nums, int[][] queries) {
        int sumEven = 0;
        for (int x : nums) {
            if (x % 2 == 0) sumEven += x;
        }
        int[] ans = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int val = queries[i][0];
            int index = queries[i][1];
            if (nums[index] % 2 == 0) sumEven -= nums[index];
            nums[index] += val;
            if (nums[index] % 2 == 0) sumEven += nums[index];
            ans[i] = sumEven;
        }
        return ans;
    }
}

class Solution {
    public String strWithout3a3b(int A, int B) {
        StringBuilder sb = new StringBuilder();
        char a = 'a', b = 'b';
        int countA = A, countB = B;
        if (B > A) {
            a = 'b';
            b = 'a';
            countA = B;
            countB = A;
        }
        while (countA > 0 || countB > 0) {
            if (countA > 0) {
                sb.append(a);
                countA--;
            }
            if (countA > countB) {
                sb.append(a);
                countA--;
            }
            if (countB > 0) {
                sb.append(b);
                countB--;
            }
        }
        return sb.toString();
    }
}

class Solution {
    public int mincostTickets(int[] days, int[] costs) {
        int[] dp = new int[366];
        boolean[] travel = new boolean[366];
        for (int day : days) {
            travel[day] = true;
        }
        for (int i = 1; i < dp.length; i++) {
            if (!travel[i]) {
                dp[i] = dp[i-1];
            } else {
                dp[i] = Math.min(dp[i-1] + costs[0], Math.min(dp[Math.max(0, i-7)] + costs[1], dp[Math.max(0, i-30)] + costs[2]));
            }
        }
        return dp[365];
    }
}

class Solution {
    public int countTriplets(int[] nums) {
        int n = nums.length, ans = 0;
        int[] cnt = new int[1 << 16];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                cnt[nums[i] & nums[j]]++;
            }
        }
        for (int i = 0; i < n; i++) {
            for (int x = 0; x < (1 << 16); x++) {
                if ((nums[i] & x) == 0) {
                    ans += cnt[x];
                }
            }
        }
        return ans;
    }
}

class TimeMap {
    Map<String, TreeMap<Integer, String>> map;
    
    public TimeMap() {
        map = new HashMap<>();
    }
    
    public void set(String key, String value, int timestamp) {
        if (!map.containsKey(key)) map.put(key, new TreeMap<>());
        map.get(key).put(timestamp, value);
    }
    
    public String get(String key, int timestamp) {
        if (!map.containsKey(key)) return "";
        TreeMap<Integer, String> treeMap = map.get(key);
        Integer floor = treeMap.floorKey(timestamp);
        if (floor == null) return "";
        return treeMap.get(floor);
    }
}

class Solution {
    public int uniquePathsIII(int[][] grid) {
        int[] start = new int[2], end = new int[2];
        int empty = 1, m = grid.length, n = grid[0].length;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 0) {
                    empty++;
                } else if (grid[i][j] == 1) {
                    start = new int[]{i, j};
                } else if (grid[i][j] == 2) {
                    end = new int[]{i, j};
                }
            }
        }
        return dfs(grid, start[0], start[1], end, empty);
    }
    
    private int dfs(int[][] grid, int i, int j, int[] end, int empty) {
        if (i < 0 || j < 0 || i >= grid.length || j >= grid[0].length || grid[i][j] == -1) {
            return 0;
        }
        if (i == end[0] && j == end[1]) {
            return empty == 0 ? 1 : 0;
        }
        grid[i][j] = -1;
        int paths = dfs(grid, i + 1, j, end, empty - 1)
                  + dfs(grid, i - 1, j, end, empty - 1)
                  + dfs(grid, i, j + 1, end, empty - 1)
                  + dfs(grid, i, j - 1, end, empty - 1);
        grid[i][j] = 0;
        return paths;
    }
}

class Solution {
    int ans;
    public int distributeCoins(TreeNode root) {
        ans = 0;
        dfs(root);
        return ans;
    }
    
    private int dfs(TreeNode node) {
        if (node == null) return 0;
        int left = dfs(node.left);
        int right = dfs(node.right);
        ans += Math.abs(left) + Math.abs(right);
        return node.val + left + right - 1;
    }
}

class Solution {
    public int maxTurbulenceSize(int[] arr) {
        int n = arr.length;
        int[] dp = new int[n];
        Arrays.fill(dp,1);
        int ans = 1;
        for(int i=1;i<n;i++){
            if(arr[i] > arr[i-1]) dp[i] = dp[i-1] < 0 ? 1 : dp[i-1] + 1;
            else if(arr[i] < arr[i-1]) dp[i] = dp[i-1] > 0 ? -1 * (dp[i-1] + 1) : -1;
            ans = Math.max(ans,Math.abs(dp[i]));
        }
        return ans;
    }
}

class Solution {
    public int[] sortedSquares(int[] nums) {
        int[] result = new int[nums.length];
        int left = 0, right = nums.length - 1;
        int i = nums.length - 1;
        while (left <= right) {
            if (Math.abs(nums[left]) > Math.abs(nums[right])) {
                result[i--] = nums[left] * nums[left];
                left++;
            } else {
                result[i--] = nums[right] * nums[right];
                right--;
            }
        }
        return result;
    }
}

class Solution {
    public int largestPerimeter(int[] nums) {
        Arrays.sort(nums);
        for (int i = nums.length - 1; i >= 2; i--) {
            if (nums[i - 2] + nums[i - 1] > nums[i]) {
                return nums[i - 2] + nums[i - 1] + nums[i];
            }
        }
        return 0;
    }
}

class Solution {
    public int oddEvenJumps(int[] arr) {
        int n = arr.length;
        boolean[] odd = new boolean[n], even = new boolean[n];
        odd[n-1] = even[n-1] = true;
        TreeMap<Integer, Integer> map = new TreeMap<>();
        map.put(arr[n-1], n-1);
        int res = 1;
        for (int i = n-2; i >= 0; i--) {
            Integer ceil = map.ceilingKey(arr[i]), floor = map.floorKey(arr[i]);
            if (ceil != null) odd[i] = even[map.get(ceil)];
            if (floor != null) even[i] = odd[map.get(floor)];
            if (odd[i]) res++;
            map.put(arr[i], i);
        }
        return res;
    }
}

class Solution {
    public int subarraysDivByK(int[] nums, int k) {
        int[] count = new int[k];
        count[0] = 1;
        int prefixSum = 0, res = 0;
        for (int num : nums) {
            prefixSum = (prefixSum + num % k + k) % k;
            res += count[prefixSum]++;
        }
        return res;
    }
}

class Solution {
    public int[][] kClosest(int[][] points, int k) {
        PriorityQueue<int[]> pq = new PriorityQueue<>((a,b) -> (b[1]*b[1] + b[0]*b[0]) - (a[1]*a[1] + a[0]*a[0]));
        for(int[] point : points){
            pq.offer(point);
            if(pq.size() > k) pq.poll();
        }
        int[][] res = new int[k][2];
        while(k-- > 0) res[k] = pq.poll();
        return res;
    }
}

class Solution {
    public int fib(int n) {
        if (n == 0)
            return 0;
        if (n == 1)
            return 1;
        int[] dp = new int[n+1];
        dp[0] = 0;
        dp[1] = 1;
        for (int i = 2; i <= n; i++) {
            dp[i] = dp[i-1] + dp[i-2];
        }
        return dp[n];
    }
}

class Solution {
    public boolean isRationalEqual(String s, String t) {
        double A = getValue(s);
        double B = getValue(t);
        return Math.abs(A - B) < 1e-9;
    }
    
    private double getValue(String str) {
        int i = str.indexOf('(');
        if (i != -1) {
            String nonRepeatingPart = str.substring(0, i);
            String repeatingPart = str.substring(i + 1, str.length() - 1);
            return Double.parseDouble(nonRepeatingPart + repeatingPart.repeat(20)) / (Math.pow(10, nonRepeatingPart.length()) * (Math.pow(10, repeatingPart.length() * 20) - 1));
        } else {
            return Double.parseDouble(str);
        }
    }
}

class Solution {
    List<Integer> flips = new ArrayList<>();
    int index = 0;
    
    public List<Integer> flipMatchVoyage(TreeNode root, int[] voyage) {
        if (dfs(root, voyage)) {
            return flips;
        } else {
            return Arrays.asList(-1);
        }
    }
    
    private boolean dfs(TreeNode node, int[] voyage) {
        if (node == null) {
            return true;
        }
        if (node.val != voyage[index++]) {
            return false;
        }
        if (node.left != null && node.left.val != voyage[index]) {
            flips.add(node.val);
            return dfs(node.right, voyage) && dfs(node.left, voyage);
        }
        return dfs(node.left, voyage) && dfs(node.right, voyage);
    }
}

class Solution {
    public List<Integer> powerfulIntegers(int x, int y, int bound) {
        Set<Integer> set = new HashSet<>();
        for (int i = 1; i < bound; i *= x > 1 ? x : bound) {
            for (int j = 1; i + j <= bound; j *= y > 1 ? y : bound) {
                set.add(i + j);
                if (y == 1) break;
            }
            if (x == 1) break;
        }
        return new ArrayList<>(set);
    }
}

class Solution {
    public List<Integer> pancakeSort(int[] arr) {
        List<Integer> res = new ArrayList<>();
        int n = arr.length;
        for (int i = n; i > 1; i--) {
            int maxIdx = findMaxIndex(arr, i);
            if (maxIdx != i-1) {
                flip(arr, maxIdx+1);
                res.add(maxIdx+1);
                flip(arr, i);
                res.add(i);
            }
        }
        return res;
    }
    
    private int findMaxIndex(int[] arr, int n) {
        int maxIdx = 0;
        for (int i = 0; i < n; i++) {
            if (arr[i] > arr[maxIdx]) {
                maxIdx = i;
            }
        }
        return maxIdx;
    }
    
    private void flip(int[] arr, int k) {
        int i = 0, j = k-1;
        while (i < j) {
            int temp = arr[i];
            arr[i] = arr[j];
            arr[j] = temp;
            i++;
            j--;
        }
    }
}

class Solution {
    public int minCameraCover(TreeNode root) {
        if (dfs(root) == 0) {
            ans++;
        }
        return ans;
    }
    
    private int ans = 0;
    
    private int dfs(TreeNode node) {
        if (node == null) {
            return 2;
        }
        int left = dfs(node.left);
        int right = dfs(node.right);
        if (left == 0 || right == 0) {
            ans++;
            return 1;
        }
        if (left == 1 || right == 1) {
            return 2;
        }
        return 0;
    }
}

class Solution {
    public int[] numsSameConsecDiff(int n, int k) {
        List<Integer> res = new ArrayList<>();
        if (n == 1) {
            res.add(0);
        }
        dfs(n, k, 0, 0, res);
        int[] ans = new int[res.size()];
        for (int i = 0; i < ans.length; i++) {
            ans[i] = res.get(i);
        }
        return ans;
    }
    
    private void dfs(int n, int k, int num, int prev, List<Integer> res) {
        if (n == 0) {
            res.add(num);
            return;
        }
        if (prev + k < 10) {
            dfs(n-1, k, num*10+prev+k, prev+k, res);
        }
        if (k != 0 && prev - k >= 0) {
            dfs(n-1, k, num*10+prev-k, prev-k, res);
        }
    }
}

class Solution {
    public String[] spellchecker(String[] wordlist, String[] queries) {
        Map<String, String> cases = new HashMap<>();
        Map<String, String> vowels = new HashMap<>();
        Set<String> words = new HashSet<>();
        for (String word : wordlist) {
            words.add(word);
            StringBuilder sb = new StringBuilder();
            for (char c : word.toCharArray()) {
                sb.append(Character.toLowerCase(c));
            }
            String lower = sb.toString();
            if (!cases.containsKey(lower)) {
                cases.put(lower, word);
            }
            sb = new StringBuilder();
            for (char c : lower.toCharArray()) {
                sb.append(isVowel(c) ? '*' : c);
            }
            String pattern = sb.toString();
            if (!vowels.containsKey(pattern)) {
                vowels.put(pattern, word);
            }
        }
        String[] res = new String[queries.length];
        for (int i = 0; i < queries.length; i++) {
            String query = queries[i];
            if (words.contains(query)) {
                res[i] = query;
                continue;
            }
            String lower = query.toLowerCase();
            if (cases.containsKey(lower)) {
                res[i] = cases.get(lower);
                continue;
            }
            StringBuilder sb = new StringBuilder();
            for (char c : lower.toCharArray()) {
                sb.append(isVowel(c) ? '*' : c);
            }
            String pattern = sb.toString();
            if (vowels.containsKey(pattern)) {
                res[i] = vowels.get(pattern);
                continue;
            }
            res[i] = "";
        }
        return res;
    }
    
    private boolean isVowel(char c) {
        return c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u';
    }
}

class Solution {
    public boolean isUnivalTree(TreeNode root) {
        if(root == null)
            return true;
        if(root.left != null && root.left.val != root.val)
            return false;
        if(root.right != null && root.right.val != root.val)
            return false;
        return isUnivalTree(root.left) && isUnivalTree(root.right);
    }
}

class Solution {
    public int leastOpsExpressTarget(int x, int target) {
        int pos = 0, neg = 0, k = 0, pos_prev, neg_prev, cur;
        while (target > 0) {
            cur = target % x;
            target /= x;
            if (k > 0) {
                pos_prev = Math.min(cur * k + pos, (cur + 1) * k + neg);
                neg_prev = Math.min((x - cur) * k + pos, (x - cur - 1) * k + neg);
                pos = pos_prev;
                neg = neg_prev;
            } else {
                pos = cur * 2;
                neg = (x - cur) * 2;
            }
            k++;
        }
        return Math.min(pos, k + neg - 1);
    }
}

class Solution {
    public double minAreaFreeRect(int[][] points) {
        Map<String, List<int[]>> map = new HashMap<>();
        int n = points.length;
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                int[] p1 = points[i], p2 = points[j];
                double center_x = (p1[0] + p2[0]) / 2.0;
                double center_y = (p1[1] + p2[1]) / 2.0;
                double distance = Math.sqrt((p1[0] - p2[0]) * (p1[0] - p2[0]) + (p1[1] - p2[1]) * (p1[1] - p2[1]));
                String key = center_x + "," + center_y + "," + distance;
                List<int[]> list = map.getOrDefault(key, new ArrayList<>());
                list.add(new int[]{i, j});
                map.put(key, list);
            }
        }
        double minArea = Double.MAX_VALUE;
        for (List<int[]> list : map.values()) {
            int m = list.size();
            for (int i = 0; i < m; i++) {
                for (int j = i + 1; j < m; j++) {
                    int[] p1 = points[list.get(i)[0]], p2 = points[list.get(i)[1]];
                    int[] p3 = points[list.get(j)[0]];
                    double area = Math.sqrt((p1[0] - p2[0]) * (p1[0] - p2[0]) + (p1[1] - p2[1]) * (p1[1] - p2[1]))
                                 * Math.sqrt((p2[0] - p3[0]) * (p2[0] - p3[0]) + (p2[1] - p3[1]) * (p2[1] - p3[1]));
                    minArea = Math.min(minArea, area);
                }
            }
        }
        return minArea == Double.MAX_VALUE ? 0 : minArea;
    }
}

class Solution {
    public int maxWidthRamp(int[] nums) {
        int n = nums.length, res = 0;
        Deque<Integer> stack = new LinkedList<>();
        for (int i = 0; i < n; i++) {
            if (stack.isEmpty() || nums[stack.peek()] > nums[i]) {
                stack.push(i);
            }
        }
        for (int i = n - 1; i > res; i--) {
            while (!stack.isEmpty() && nums[stack.peek()] <= nums[i]) {
                res = Math.max(res, i - stack.pop());
            }
        }
        return res;
    }
}

class Solution {
    public int repeatedNTimes(int[] nums) {
        int n = nums.length/2;
        Map<Integer,Integer> map = new HashMap<>();
        for(int num : nums){
            map.put(num, map.getOrDefault(num, 0) + 1);
            if(map.get(num) == n) return num;
        }
        return -1;
    }
}

class Solution {
    public int minDeletionSize(String[] strs) {
        int n = strs[0].length();
        int[] dp = new int[n];
        Arrays.fill(dp, 1);
        for (int j = 1; j < n; j++) {
            for (int i = 0; i < j; i++) {
                boolean valid = true;
                for (String str : strs) {
                    if (str.charAt(i) > str.charAt(j)) {
                        valid = false;
                        break;
                    }
                }
                if (valid) {
                    dp[j] = Math.max(dp[j], dp[i] + 1);
                }
            }
        }
        return n - Arrays.stream(dp).max().getAsInt();
    }
}

class Solution {
    public int regionsBySlashes(String[] grid) {
        int n = grid.length;
        int[][] regions = new int[3*n][3*n];
        for (int i = 0; i < 3*n; i++) {
            for (int j = 0; j < 3*n; j++) {
                if (i==0 || i==3*n-1 || j==0 || j==3*n-1)
                    regions[i][j] = 1;
            }
        }
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                int r = i*3;
                int c = j*3;
                if (grid[i].charAt(j) == '/') {
                    regions[r][c+2] = 2;
                    regions[r+1][c+1] = 2;
                    regions[r+2][c] = 2;
                } else if (grid[i].charAt(j) == '\\') {
                    regions[r][c] = 2;
                    regions[r+1][c+1] = 2;
                    regions[r+2][c+2] = 2;
                }
            }
        }
        int count = 0;
        for (int i = 0; i < 3*n; i++) {
            for (int j = 0; j < 3*n; j++) {
                if (regions[i][j] == 0) {
                    dfs(regions, i, j);
                    count++;
                }
            }
        }
        return count;
    }
    
    private void dfs(int[][] regions, int i, int j) {
        int n = regions.length;
        if (i<0 || i>=n || j<0 || j>=n || regions[i][j]!=0)
            return;
        regions[i][j] = 1;
        dfs(regions, i-1, j);
        dfs(regions, i+1, j);
        dfs(regions, i, j-1);
        dfs(regions, i, j+1);
    }
}

class Solution {
    public boolean isCompleteTree(TreeNode root) {
        if (root == null) return true;
        Queue<TreeNode> queue = new LinkedList<>();
        boolean end = false;
        queue.offer(root);
        while (!queue.isEmpty()) {
            TreeNode curr = queue.poll();
            if (curr == null) end = true;
            else {
                if (end) return false;
                queue.offer(curr.left);
                queue.offer(curr.right);
            }
        }
        return true;
    }
}

class Solution {
    public int[] prisonAfterNDays(int[] cells, int n) {
        Set<String> set = new HashSet<>();
        boolean hasCycle = false;
        int cycle = 0;
        for (int i = 0; i < n; i++) {
            int[] next = nextDay(cells);
            String key = Arrays.toString(next);
            if (!set.contains(key)) {
                set.add(key);
                cycle++;
            } else {
                hasCycle = true;
                break;
            }
            cells = next;
        }
        if (hasCycle) {
            n %= cycle;
            for (int i = 0; i < n; i++) {
                cells = nextDay(cells);
            }
        }
        return cells;
    }
    
    private int[] nextDay(int[] cells) {
        int[] next = new int[8];
        for (int i = 1; i < 7; i++) {
            next[i] = cells[i - 1] == cells[i + 1] ? 1 : 0;
        }
        return next;
    }
}

class Solution {
    public int tallestBillboard(int[] rods) {
        int[] dp = new int[5001];
        Arrays.fill(dp, -1);
        dp[0] = 0;
        for (int rod : rods) {
            int[] cur = dp.clone();
            for (int i = 0; i + rod < dp.length; i++) {
                if (cur[i] == -1) continue;
                dp[i + rod] = Math.max(dp[i + rod], cur[i]);
                dp[Math.abs(i - rod)] = Math.max(dp[Math.abs(i - rod)], cur[i] + Math.min(i, rod));
            }
        }
        return dp[0];
    }
}

class Solution {
    public int minDeletionSize(String[] strs) {
        int n = strs.length, m = strs[0].length(), res = 0;
        boolean[] sorted = new boolean[n-1];
        for (int j = 0; j < m; j++) {
            boolean[] sortedNow = Arrays.copyOf(sorted, n-1);
            for (int i = 0; i < n-1; i++) {
                if (!sortedNow[i] && strs[i].charAt(j) > strs[i+1].charAt(j)) {
                    res++;
                    break;
                }
                sorted[i] |= strs[i].charAt(j) < strs[i+1].charAt(j);
            }
            if (Arrays.equals(sorted, sortedNow)) break;
        }
        return res;
    }
}

class Solution {
    public boolean canReorderDoubled(int[] arr) {
        Map<Integer,Integer> map = new TreeMap<>();
        for(int num:arr){
            map.put(num,map.getOrDefault(num,0)+1);
        }
        for(int num:map.keySet()){
            if(map.get(num)==0) continue;
            int target = num<0?num/2:num*2;
            if(num<0 && num%2!=0 || map.getOrDefault(target,0)<map.get(num)) return false;
            map.put(target,map.get(target)-map.get(num));
        }
        return true;
    }
}

class Solution {
    public boolean isAlienSorted(String[] words, String order) {
        int[] index = new int[26];
        for (int i = 0; i < order.length(); i++) {
            index[order.charAt(i) - 'a'] = i;
        }
        for (int i = 0; i < words.length - 1; i++) {
            for (int j = 0; j < words[i].length(); j++) {
                if (j >= words[i + 1].length()) {
                    return false;
                }
                if (words[i].charAt(j) != words[i + 1].charAt(j)) {
                    if (index[words[i].charAt(j) - 'a'] > index[words[i + 1].charAt(j) - 'a']) {
                        return false;
                    } else {
                        break;
                    }
                }
            }
        }
        return true;
    }
}

class Solution {
    public int largestComponentSize(int[] nums) {
        int n = nums.length;
        int[] parent = new int[n];
        Arrays.fill(parent, -1);
        Map<Integer, Integer> map = new HashMap<>();
        for (int i = 0; i < n; i++) {
            int x = nums[i];
            for (int j = 2; j * j <= x; j++) {
                if (x % j == 0) {
                    if (!map.containsKey(j)) {
                        map.put(j, i);
                    } else {
                        union(parent, map.get(j), i);
                    }
                    if (!map.containsKey(x / j)) {
                        map.put(x / j, i);
                    } else {
                        union(parent, map.get(x / j), i);
                    }
                }
            }
            if (!map.containsKey(x)) {
                map.put(x, i);
            } else {
                union(parent, map.get(x), i);
            }
        }
        int ans = 1;
        int[] count = new int[n];
        for (int i = 0; i < n; i++) {
            if (parent[i] == -1) {
                count[i] = 1;
                ans = Math.max(ans, dfs(i, parent, count));
            }
        }
        return ans;
    }
    private int find(int[] parent, int i) {
        if (parent[i] == -1) {
            return i;
        }
        parent[i] = find(parent, parent[i]);
        return parent[i];
    }
    private void union(int[] parent, int i, int j) {
        int p1 = find(parent, i);
        int p2 = find(parent, j);
        if (p1 != p2) {
            parent[p1] = p2;
        }
    }
    private int dfs(int u, int[] parent, int[] count) {
        int cnt = 1;
        for (int v = 0; v < parent.length; v++) {
            if (v != u && parent[v] == u) {
                cnt += dfs(v, parent, count);
            }
        }
        count[u] = cnt;
        return cnt;
    }
}

class Solution {
    public boolean flipEquiv(TreeNode root1, TreeNode root2) {
        if (root1 == null && root2 == null) return true;
        if (root1 == null || root2 == null || root1.val != root2.val) return false;
        return (flipEquiv(root1.left, root2.left) && flipEquiv(root1.right, root2.right)) 
            || (flipEquiv(root1.left, root2.right) && flipEquiv(root1.right, root2.left));
    }
}

class Solution {
    public int[] deckRevealedIncreasing(int[] deck) {
        Arrays.sort(deck);
        int n = deck.length;
        Queue<Integer> index = new LinkedList<>();
        for (int i = 0; i < n; i++) {
            index.add(i);
        }
        int[] ans = new int[n];
        for (int card : deck) {
            ans[index.poll()] = card;
            if (!index.isEmpty()) {
                index.add(index.poll());
            }
        }
        return ans;
    }
}

class Solution {
    public String largestTimeFromDigits(int[] arr) {
        int maxTime = -1;
        for (int i = 0; i < 4; i++) {
            for (int j = 0; j < 4; j++) {
                if (i == j) {
                    continue;
                }
                for (int k = 0; k < 4; k++) {
                    if (k == i || k == j) {
                        continue;
                    }
                    int l = 6 - i - j - k;
                    int hours = arr[i] * 10 + arr[j];
                    int mins = arr[k] * 10 + arr[l];
                    if (hours < 24 && mins < 60) {
                        maxTime = Math.max(maxTime, hours * 60 + mins);
                    }
                }
            }
        }
        return maxTime == -1 ? "" : String.format("%02d:%02d", maxTime / 60, maxTime % 60);
    }
}

class Solution {
    public int bagOfTokensScore(int[] tokens, int power) {
        Arrays.sort(tokens);
        int left = 0, right = tokens.length-1;
        int score = 0, maxScore = 0;
        while (left <= right) {
            if (power >= tokens[left]) {
                power -= tokens[left++];
                score++;
                maxScore = Math.max(maxScore, score);
            } else if (score > 0) {
                power += tokens[right--];
                score--;
            } else {
                break;
            }
        }
        return maxScore;
    }
}

class Solution {
    public int removeStones(int[][] stones) {
        int n = stones.length;
        UnionFind uf = new UnionFind(n);
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                if (stones[i][0] == stones[j][0] || stones[i][1] == stones[j][1]) {
                    uf.union(i, j);
                }
            }
        }
        return n - uf.getCount();
    }
}

class UnionFind {
    int[] parent;
    int count;

    public UnionFind(int n) {
        parent = new int[n];
        count = n;
        for (int i = 0; i < n; i++) {
            parent[i] = i;
        }
    }

    public int find(int p) {
        while (p != parent[p]) {
            parent[p] = parent[parent[p]];
            p = parent[p];
        }
        return p;
    }

    public void union(int p, int q) {
        int rootP = find(p);
        int rootQ = find(q);
        if (rootP != rootQ) {
            parent[rootP] = rootQ;
            count--;
        }
    }

    public int getCount() {
        return count;
    }
}

class Solution {
    public boolean validateStackSequences(int[] pushed, int[] popped) {
        Stack<Integer> stack = new Stack<>();
        int i = 0;
        for (int num : pushed) {
            stack.push(num);
            while (!stack.isEmpty() && stack.peek() == popped[i]) {
                stack.pop();
                i++;
            }
        }
        return stack.isEmpty();
    }
}

class Solution {
    public int minIncrementForUnique(int[] nums) {
        Arrays.sort(nums);
        int res = 0, need = 0;
        for (int num : nums) {
            res += Math.max(need - num, 0);
            need = Math.max(num, need) + 1;
        }
        return res;
    }
}

class Solution {
    public int minDeletionSize(String[] strs) {
        int count = 0;
        for (int i = 0; i < strs[0].length(); i++) {
            for (int j = 1; j < strs.length; j++) {
                if (strs[j-1].charAt(i) > strs[j].charAt(i)) {
                    count++;
                    break;
                }
            }
