        if (root == null) return 0;
        if (root.val < low) return rangeSumBST(root.right, low, high);
        if (root.val > high) return rangeSumBST(root.left, low, high);
        return root.val + rangeSumBST(root.left, low, high) + rangeSumBST(root.right, low, high);
    }
}

class Solution {
    public String[] reorderLogFiles(String[] logs) {
        Arrays.sort(logs, (log1, log2) -> {
            String[] split1 = log1.split(" ", 2);
            String[] split2 = log2.split(" ", 2);
            boolean isDigit1 = Character.isDigit(split1[1].charAt(0));
            boolean isDigit2 = Character.isDigit(split2[1].charAt(0));
            if (!isDigit1 && !isDigit2) {
                int cmp = split1[1].compareTo(split2[1]);
                if (cmp != 0) return cmp;
                return split1[0].compareTo(split2[0]);
            }
            return isDigit1 ? (isDigit2 ? 0 : 1) : -1;
        });
        return logs;
    }
}

class Solution {
    public int[] movesToStamp(String stamp, String target) {
        List<Integer> res = new ArrayList<>();
        char[] s = target.toCharArray();
        char[] t = new char[s.length];
        Arrays.fill(t, '?');
        boolean[] visited = new boolean[s.length];
        int stars = 0;
        while (stars < s.length) {
            boolean doneReplace = false;
            for (int i = 0; i <= s.length - stamp.length(); i++) {
                if (visited[i]) {
                    continue;
                }
                int match = canReplace(s, i, stamp);
                if (match == -1) {
                    continue;
                }
                doneReplace = true;
                visited[i] = true;
                stars += match;
                for (int j = i; j < i + stamp.length(); j++) {
                    if (s[j] != '*') {
                        t[j] = s[j];
                        s[j] = '*';
                    }
                }
                res.add(i);
                if (stars == s.length) {
                    break;
                }
            }
            if (!doneReplace) {
                return new int[0];
            }
        }
        Collections.reverse(res);
        int[] ans = new int[res.size()];
        for (int i = 0; i < ans.length; i++) {
            ans[i] = res.get(i);
        }
        return ans;
    }
    
    private int canReplace(char[] s, int i, String stamp) {
        int count = 0;
        for (int j = 0; j < stamp.length(); j++) {
            if (s[i + j] == stamp.charAt(j) || s[i + j] == '*') {
                count++;
            } else {
                return -1;
            }
        }
        return count;
    }
}

class Solution {
    public int knightDialer(int n) {
        int[][] moves = new int[][]{{4, 6}, {6, 8}, {7, 9}, {4, 8}, {3, 9, 0}, {}, {1, 7, 0}, {2, 6}, {1, 3}, {2, 4}};
        int mod = (int)1e9 + 7;
        int[][] dp = new int[n + 1][10];
        int ans = 0;
        for (int j = 0; j < dp[0].length; j++) {
            dp[1][j] = 1;
        }
        for (int i = 2; i < dp.length; i++) {
            for (int j = 0; j < dp[i].length; j++) {
                for (int move : moves[j]) {
                    dp[i][j] = (dp[i][j] + dp[i - 1][move]) % mod;
                }
            }
        }
        for (int j = 0; j < dp[n].length; j++) {
            ans = (ans + dp[n][j]) % mod;
        }
        return ans;
    }
}

class Solution {
    public int shortestBridge(int[][] grid) {
        int n = grid.length;
        int[] direction = new int[]{0, 1, 0, -1, 0};
        Queue<int[]> queue = new LinkedList<>();
        boolean[][] visited = new boolean[n][n];
        boolean found = false;
        
        for (int i = 0; i < n; i++) {
            if (found) {
                break;
            }
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    dfs(grid, i, j, queue, visited);
                    found = true;
                    break;
                }
            }
        }
        
        int steps = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                int[] curr = queue.poll();
                for (int j = 0; j < 4; j++) {
                    int newRow = curr[0] + direction[j];
                    int newCol = curr[1] + direction[j+1];
                    if (newRow >= 0 && newRow < n && newCol >= 0 && newCol < n && !visited[newRow][newCol]) {
                        if (grid[newRow][newCol] == 1) {
                            return steps;
                        }
                        queue.offer(new int[]{newRow, newCol});
                        visited[newRow][newCol] = true;
                    }
                }
            }
            steps++;
        }
        return -1;
    }
    
    private void dfs(int[][] grid, int row, int col, Queue<int[]> queue, boolean[][] visited) {
        int n = grid.length;
        if (row < 0 || row >= n || col < 0 || col >= n || visited[row][col] || grid[row][col] == 0) {
            return;
        }
        visited[row][col] = true;
        queue.offer(new int[]{row, col});
        dfs(grid, row-1, col, queue, visited);
        dfs(grid, row+1, col, queue, visited);
        dfs(grid, row, col-1, queue, visited);
        dfs(grid, row, col+1, queue, visited);
    }
}

