class Solution {
    public int minMalwareSpread(int[][] graph, int[] initial) {
        int n = graph.length, m = initial.length, ans = 0, node = -1;
        int[] id = new int[n], sz = new int[n];
        Arrays.sort(initial);
        for (int i = 0; i < n; ++i) id[i] = i;
        for (int u = 0; u < n; ++u)
            for (int v = u + 1; v < n; ++v)
                if (graph[u][v] == 1) union(id, sz, u, v);
        int[] cnt = new int[n];
        for (int u : initial) cnt[find(id, u)]++;
        for (int u : initial) {
            int p = find(id, u);
            if (cnt[p] == 1) {
                if (sz[p] > ans) {
                    ans = sz[p];
                    node = u;
                }
                else if (sz[p] == ans && u < node) node = u;
            }
        }
        return node == -1 ? initial[0] : node;
    }
    
    void union(int[] id, int[] sz, int u, int v) {
        int p = find(id, u), q = find(id, v);
        if (p == q) return;
        sz[p] += sz[q];
        id[q] = p;
    }
    
    int find(int[] id, int u) {
        while (u != id[u]) {
            id[u] = id[id[u]];
            u = id[u];
        }
        return u;
    }
}

class Solution {
    public int[] threeEqualParts(int[] arr) {
        int numOnes = 0;
        for (int i : arr) {
            if (i == 1) {
                numOnes++;
            }
        }
        if (numOnes % 3 != 0) {
            return new int[]{-1, -1};
        }
        if (numOnes == 0) {
            return new int[]{0, arr.length - 1};
        }
        int onesInEachPart = numOnes / 3;
        int firstEnd = findEnd(arr, 0, onesInEachPart);
        int secondEnd = findEnd(arr, firstEnd + 1, onesInEachPart);
        int thirdEnd = findEnd(arr, secondEnd + 1, onesInEachPart);
        while (thirdEnd < arr.length && arr[firstEnd] == arr[secondEnd] && arr[secondEnd] == arr[thirdEnd]) {
            firstEnd++;
            secondEnd++;
            thirdEnd++;
        }
        if (thirdEnd == arr.length) {
            return new int[]{firstEnd - 1, secondEnd};
        } else {
            return new int[]{-1, -1};
        }
    }
    
    private int findEnd(int[] arr, int start, int onesInEachPart) {
        int count = 0;
        for (int i = start; i < arr.length; i++) {
            if (arr[i] == 1) {
                count++;
            }
            if (count == onesInEachPart) {
                return i;
            }
        }
        return -1;
    }
}

