class Solution {
    public int minMalwareSpread(int[][] graph, int[] initial) {
        int n = graph.length;
        int[] colors = new int[n];
        Arrays.fill(colors, -1);
        int color = 0;
        for (int i = 0; i < n; i++) {
            if (colors[i] == -1) {
                dfs(i, graph, colors, color++);
            }
        }
        int[] groupSizes = new int[color];
        for (int c : colors) {
            groupSizes[c]++;
        }
        int[] initialGroups = new int[color];
        for (int node : initial) {
            initialGroups[colors[node]]++;
        }
        int result = Integer.MAX_VALUE;
        int resultNode = -1;
        Arrays.sort(initial);
        for (int node : initial) {
            int c = colors[node];
            if (initialGroups[c] == 1) {
                if (resultNode == -1) {
                    resultNode = node;
                    result = groupSizes[c];
                } else if (groupSizes[c] > result) {
                    resultNode = node;
                    result = groupSizes[c];
                } else if (groupSizes[c] == result && node < resultNode) {
                    resultNode = node;
                }
            }
        }
        if (resultNode == -1) {
            for (int node : initial) {
                resultNode = Math.min(resultNode, node);
            }
        }
        return resultNode;
    }
    private void dfs(int node, int[][] graph, int[] colors, int color) {
        colors[node] = color;
        for (int i = 0; i < graph.length; i++) {
            if (graph[node][i] == 1 && colors[i] == -1) {
                dfs(i, graph, colors, color);
            }
        }
    }
}

class Solution {
    public int threeSumMulti(int[] arr, int target) {
        int MOD = 1000000007;
        long[] count = new long[101];
        for (int a : arr) {
            count[a]++;
        }
        long res = 0;
        for (int i = 0; i <= 100; i++) {
            for (int j = i; j <= 100; j++) {
                int k = target - i - j;
                if (k < 0 || k > 100) {
                    continue;
                }
                long a = count[i], b = count[j], c = count[k];
                if (i == j && j == k) {
                    res += (a * (a - 1) * (a - 2) / 6) % MOD;
                } else if (i == j && j != k) {
                    res += (a * (a - 1) / 2 * c) % MOD;
                } else if (i < j && j < k) {
                    res += (a * b * c) % MOD;
                }
            }
        }
        return (int) (res % MOD);
    }
}

class Solution {
    public int[] sortArrayByParityII(int[] nums) {
        int i = 0, j = 1, n = nums.length;
        while (i < n && j < n) {
            while (i < n && nums[i] % 2 == 0) {
                i += 2;
            }
            while (j < n && nums[j] % 2 == 1) {
                j += 2;
            }
            if (i < n && j < n) {
                swap(nums, i, j);
            }
        }
        return nums;
    }
    
    private void swap(int[] nums, int i, int j) {
        int temp = nums[i];
        nums[i] = nums[j];
        nums[j] = temp;
    }
}

