        int leftMax = nums[0];
        int max = nums[0];
        int partition = 0;
        for (int i = 1; i < nums.length; i++) {
            max = Math.max(max, nums[i]);
            if (nums[i] < leftMax) {
                partition = i;
                leftMax = max;
