class Solution {
    public boolean hasGroupsSizeX(int[] deck) {
        Map<Integer, Integer> count = new HashMap<>();
        int minCount = Integer.MAX_VALUE;
        for (int num : deck) {
            count.put(num, count.getOrDefault(num, 0) + 1);
        }
        for (int val : count.values()) {
            minCount = Math.min(minCount, val);
        }
        if (minCount < 2) {
            return false;
        }
        for (int i = 2; i <= minCount; i++) {
            boolean found = true;
            for (int val : count.values()) {
                if (val % i != 0) {
                    found = false;
                    break;
                }
            }
            if (found) {
                return true;
            }
        }
        return false;
    }
}

class Solution {
    public int catMouseGame(int[][] graph) {
        int n = graph.length;
        int[][][] dp = new int[2*n][n][n];
        for (int i = 0; i < 2*n; i++) {
            for (int j = 0; j < n; j++) {
                Arrays.fill(dp[i][j], -1);
            }
        }
        Queue<int[]> queue = new LinkedList<>();
        for (int i = 1; i < n; i++) {
            for (int k = 0; k < 2; k++) {
                dp[k][i][i] = 1;
                queue.offer(new int[]{k, i, i});
                dp[k+n][i][i] = 2;
                queue.offer(new int[]{k+n, i, i});
            }
        }
        for (int i = 1; i < n; i++) {
            dp[0][0][i] = 2;
            queue.offer(new int[]{0, 0, i});
            dp[n][0][i] = 1;
            queue.offer(new int[]{n, 0, i});
        }
        while (!queue.isEmpty()) {
            int[] curr = queue.poll();
            int turn = curr[0], m = curr[1], c = curr[2];
            for (int prev : (turn < n ? graph[m] : graph[c])) {
                if (prev == 0) {
                    continue;
                }
                int[] prevTurns = getPrevTurns(turn, prev, m, c);
                int prevTurn = prevTurns[0], prevM = prevTurns[1], prevC = prevTurns[2];
                if (dp[prevTurn][prevM][prevC] == -1) {
                    if (prevTurn == turn && dp[turn][m][c] == 0) {
                        dp[turn][m][c] = 0;
                        queue.offer(new int[]{turn, m, c});
                    } else if (prevTurn == turn) {
                        continue;
                    } else if (prevTurn == 0) {
                        dp[prevTurn][prevM][prevC] = 1;
                        queue.offer(new int[]{prevTurn, prevM, prevC});
                    } else if (check(dp, prevTurn, prevM, prevC)) {
                        dp[prevTurn][prevM][prevC] = prevTurn > n ? 2 : 1;
                        queue.offer(new int[]{prevTurn, prevM, prevC});
                    }
                }
            }
        }
        return dp[0][1][2];
    }
    
    private int[] getPrevTurns(int turn, int pos, int m, int c) {
        if (turn < pos) {
            return new int[]{turn+n, m, pos};
        } else if (pos == c) {
            return new int[]{turn%n, m, pos};
        } else {
            return new int[]{turn, pos, c};
        }
    }
    
    private boolean check(int[][][] dp, int turn, int m, int c) {
        for (int prev : dp[turn < dp.length/2 ? n+m : n+c]) {
            if (prev != -1) {
                return true;
            }
        }
        return false;
    }
}

class Solution {
    public int[] sortArray(int[] nums) {
        quickSort(nums, 0, nums.length-1);
        return nums;
    }
    
    private void quickSort(int[] nums, int left, int right) {
        if (left >= right) return;
        int pivot = nums[(left+right)/2];
        int index = partition(nums, left, right, pivot);
        quickSort(nums, left, index-1);
        quickSort(nums, index, right);
    }
    
    private int partition(int[] nums, int left, int right, int pivot) {
        while (left <= right) {
            while (nums[left] < pivot) left++;
            while (nums[right] > pivot) right--;
            if (left <= right) {
                swap(nums, left, right);
                left++;
                right--;
            }
        }
        return left;
    }
    
    private void swap(int[] nums, int i, int j) {
        int temp = nums[i];
        nums[i] = nums[j];
        nums[j] = temp;
    }
}

