class Solution {
    public int smallestRangeII(int[] nums, int k) {
        Arrays.sort(nums);
        int n = nums.length;
        int res = nums[n-1] - nums[0];
        for (int i = 0; i < n-1; i++) {
            int maxVal = Math.max(nums[i]+k, nums[n-1]-k);
            int minVal = Math.min(nums[i+1]-k, nums[0]+k);
            res = Math.min(res, maxVal-minVal);
        }
        return res;
    }
}

class Solution {
    public int snakesAndLadders(int[][] board) {
        int n = board.length;
        int[] nums = new int[n * n + 1];
        int index = 1;
        boolean fromRight = true;
        for (int i = n - 1; i >= 0; i--) {
            if (fromRight) {
                for (int j = 0; j < n; j++) {
                    nums[index++] = board[i][j];
                }
            } else {
                for (int j = n - 1; j >= 0; j--) {
                    nums[index++] = board[i][j];
                }
            }
            fromRight = !fromRight;
        }
        int[] dist = new int[n * n + 1];
        Arrays.fill(dist, -1);
        Queue<Integer> queue = new LinkedList<>();
        queue.offer(1);
        dist[1] = 0;
        while (!queue.isEmpty()) {
            int curr = queue.poll();
            for (int i = 1; i <= 6 && curr + i <= n * n; i++) {
                int next = nums[curr + i] == -1 ? curr + i : nums[curr + i];
                if (dist[next] == -1) {
                    dist[next] = dist[curr] + 1;
                    queue.offer(next);
                }
            }
        }
        return dist[n * n];
    }
}

