class Solution {
    public int atMostNGivenDigitSet(String[] digits, int n) {
        String strN = String.valueOf(n);
        int lenN = strN.length(), lenD = digits.length, ans = 0;
        for (int i = 1; i < lenN; i++) ans += Math.pow(lenD, i);
        for (int i = 0; i < lenN; i++) {
            boolean sameNum = false;
            for (String d : digits) {
                if (d.charAt(0) < strN.charAt(i)) ans += Math.pow(lenD, lenN - i - 1);
                else if (d.charAt(0) == strN.charAt(i)) sameNum = true;
            }
            if (!sameNum) return ans;
        }
        return ans + 1;
    }
}

