class Solution {
    public List<String> findAndReplacePattern(String[] words, String pattern) {
        List<String> res = new ArrayList<>();
        for (String word : words) {
            if (matchPattern(word, pattern)) {
                res.add(word);
            }
        }
        return res;
    }
    
    private boolean matchPattern(String word, String pattern) {
        if (word.length() != pattern.length()) {
            return false;
        }
        int[] map1 = new int[26];
        int[] map2 = new int[26];
        for (int i = 0; i < word.length(); i++) {
            char c1 = word.charAt(i);
            char c2 = pattern.charAt(i);
            if (map1[c1 - 'a'] == 0 && map2[c2 - 'a'] == 0) {
                map1[c1 - 'a'] = c2;
                map2[c2 - 'a'] = c1;
            } else if (map1[c1 - 'a'] != c2 || map2[c2 - 'a'] != c1) {
                return false;
            }
        }
        return true;
    }
}

class Solution {
    public TreeNode constructFromPrePost(int[] preorder, int[] postorder) {
        return buildTree(preorder, 0, preorder.length-1, postorder, 0, postorder.length-1);
    }
    
    private TreeNode buildTree(int[] pre, int preStart, int preEnd, int[] post, int postStart, int postEnd) {
        if(preStart>preEnd) return null;
        TreeNode root = new TreeNode(pre[preStart]);
        if(preStart==preEnd) return root;
        int index = postStart;
        while(index<=postEnd && post[index]!=pre[preStart+1]) {
            index++;
        }
        int leftSize = index-postStart+1;
        root.left = buildTree(pre, preStart+1, preStart+leftSize, post, postStart, index);
        root.right = buildTree(pre, preStart+1+leftSize, preEnd, post, index+1, postEnd-1);
        return root;
    }
}

