class Solution {
    public boolean possibleBipartition(int n, int[][] dislikes) {
        List<Integer>[] adj = new List[n];
        for (int i = 0; i < n; i++) {
            adj[i] = new ArrayList<>();
        }
        for (int[] d : dislikes) {
            adj[d[0] - 1].add(d[1] - 1);
            adj[d[1] - 1].add(d[0] - 1);
        }
        int[] colors = new int[n];
        for (int i = 0; i < n; i++) {
            if (colors[i] == 0) {
                colors[i] = 1;
                if (!dfs(i, adj, colors)) {
                    return false;
                }
            }
        }
        return true;
    }
    
    private boolean dfs(int node, List<Integer>[] adj, int[] colors) {
        for (int nei : adj[node]) {
            if (colors[nei] == colors[node]) {
                return false;
            }
            if (colors[nei] == 0) {
                colors[nei] = -colors[node];
                if (!dfs(nei, adj, colors)) {
                    return false;
                }
            }
        }
        return true;
    }
}

