        int idx = 1, len = 0, dir = 0, steps = 1;
        while (idx < rows * cols) {
            if (dir == 0 || dir == 2) len++;
            for (int i = 0; i < len; i++) {
                rStart += steps * (dir == 0 ? 1 : -1);
                if (rStart >= 0 && rStart < rows && cStart >= 0 && cStart < cols) {
                    res[idx][0] = rStart;
                    res[idx][1] = cStart;
