class Solution {
    public int reachableNodes(int[][] edges, int maxMoves, int n) {
        int[][] graph = new int[n][n];
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1], c = edge[2];
            graph[u][v] = graph[v][u] = c;
        }
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> b[1] - a[1]);
        pq.offer(new int[]{0, maxMoves});
        Map<Integer, Integer> seen = new HashMap<>();
        while (!pq.isEmpty()) {
            int curr = pq.peek()[0], moves = pq.poll()[1];
            if (seen.containsKey(curr)) continue;
            seen.put(curr, moves);
            for (int i = 0; i < n; i++) {
                int nextMoves = moves - graph[curr][i] - graph[i][curr];
                if (graph[curr][i] > 0 && nextMoves >= 0 && !seen.containsKey(i))
                    pq.offer(new int[]{i, nextMoves});
            }
        }
        int res = seen.size();
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1], c = edge[2];
            int uMoves = seen.getOrDefault(u, -1), vMoves = seen.getOrDefault(v, -1);
            if (uMoves >= 0 && vMoves >= 0)
                res += Math.min(c, uMoves + vMoves);
        }
        return res;
    }
}

