class Solution {
    private int[][] rects;
    private Random rand;
    private int[] prefixSum;
    private int totalPoints;
    
    public Solution(int[][] rects) {
        this.rects = rects;
        rand = new Random();
        prefixSum = new int[rects.length];
        totalPoints = 0;
        for (int i = 0; i < rects.length; i++) {
            int points = (rects[i][2] - rects[i][0] + 1) * (rects[i][3] - rects[i][1] + 1);
            totalPoints += points;
            prefixSum[i] = totalPoints;
        }
    }
    
    public int[] pick() {
        int pointIdx = rand.nextInt(totalPoints);
        int rectIdx = findRectIdx(pointIdx);
        int[] rect = rects[rectIdx];
        int x = rand.nextInt(rect[2] - rect[0] + 1) + rect[0];
        int y = rand.nextInt(rect[3] - rect[1] + 1) + rect[1];
        return new int[]{x, y};
    }
    
    private int findRectIdx(int pointIdx) {
        int left = 0, right = rects.length - 1;
        while (left < right) {
            int mid = left + (right - left) / 2;
            if (prefixSum[mid] <= pointIdx) {
                left = mid + 1;
            } else {
                right = mid;
            }
        }
        return left;
    }
}

