class Solution {

    private int[] prefixSum;
    private int totalSum;

    public Solution(int[] w) {
        prefixSum = new int[w.length];
        prefixSum[0] = w[0];
        for (int i = 1; i < w.length; i++) {
            prefixSum[i] = prefixSum[i-1]+w[i];
        }
        totalSum = prefixSum[w.length-1];
    }

    public int pickIndex() {
        int target = (int) (Math.random() * totalSum);
        int left = 0, right = prefixSum.length-1;
        while (left < right) {
            int mid = left + (right-left)/2;
            if (prefixSum[mid] <= target) {
                left = mid + 1;
            } else {
                right = mid;
            }
        }
        return left;
    }
}

class Solution {
    public int profitableSchemes(int n, int minProfit, int[] group, int[] profit) {
        int[][][] dp = new int[101][101][101];
        int MOD = (int) 1e9 + 7;
        for (int i = 0; i <= n; i++) {
            dp[0][i][0] = 1;
        }
        for (int i = 1; i <= group.length; i++) {
            int members = group[i-1], earn = profit[i-1];
            for (int j = 0; j <= n; j++) {
                for (int k = 0; k <= minProfit; k++) {
                    dp[i][j][k] = dp[i-1][j][k];
                    if (j >= members) {
                        int left = Math.max(0, k - earn);
                        dp[i][j][k] = (dp[i][j][k] + dp[i-1][j-members][left]) % MOD;
                    }
                }
            }
        }
        int sum = 0;
        for (int i = 0; i <= n; i++) {
            sum = (sum + dp[group.length][i][minProfit]) % MOD;
        }
        return sum;
    }
}

class Solution {
    public int nthMagicalNumber(int n, int a, int b) {
        int MOD = 1_000_000_007;
        long lcm = lcm(a, b);
        long left = 2, right = (long)1e15;
        while (left < right) {
            long mid = (left + right) / 2;
            if (mid / a + mid / b - mid / lcm < n) 
                left = mid + 1;
            else 
                right = mid;
        }
        return (int)(left % MOD);
    }
    
    public long gcd(long a, long b) {
        return b == 0 ? a : gcd(b, a % b);
    }
    
    public long lcm(long a, long b) {
        return a * b / gcd(a, b);
    }
}

class Solution {
    public boolean stoneGame(int[] piles) {
        int n = piles.length;
        int[][] dp = new int[n][n];
        for (int i = 0; i < n; i++) {
            dp[i][i] = piles[i];
        }
        for (int len = 2; len <= n; len++) {
            for (int i = 0; i <= n - len; i++) {
                int j = i + len - 1;
                int left = piles[i] - dp[i+1][j];
                int right = piles[j] - dp[i][j-1];
                dp[i][j] = Math.max(left, right);
            }
        }
        return dp[0][n-1] > 0;
    }
}

