class Solution {
    public int minRefuelStops(int target, int startFuel, int[][] stations) {
        PriorityQueue<Integer> pq = new PriorityQueue<>(Collections.reverseOrder());
        int stops = 0;
        int prevPos = 0;
        int currFuel = startFuel;
        for (int[] station : stations) {
            int pos = station[0];
            int fuel = station[1];
            currFuel -= pos - prevPos;
            while (!pq.isEmpty() && currFuel < 0) {
                currFuel += pq.poll();
                stops++;
            }
            if (currFuel < 0) {
                return -1;
            }
            pq.offer(fuel);
            prevPos = pos;
        }
        currFuel -= target - prevPos;
        while (!pq.isEmpty() && currFuel < 0) {
            currFuel += pq.poll();
            stops++;
        }
        if (currFuel < 0) {
            return -1;
        }
        return stops;
    }
}

class Solution {
    public int[] advantageCount(int[] nums1, int[] nums2) {
        int n = nums1.length;
        int[] result = new int[n];
        Arrays.sort(nums1);
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> b[0] - a[0]);
        for (int i = 0; i < n; i++) {
            pq.offer(new int[]{nums2[i], i});
        }
        int left = 0, right = n - 1;
        while (!pq.isEmpty()) {
            int[] curr = pq.poll();
            int num2 = curr[0], index = curr[1];
            if (nums1[right] > num2) {
                result[index] = nums1[right--];
            } else {
                result[index] = nums1[left++];
            }
        }
        return result;
    }
}

class Solution {
    public boolean reorderedPowerOf2(int n) {
        long c = counter(n);
        for (int i = 0; i < 32; i++)
            if (counter(1 << i) == c)
                return true;
        return false;
    }
    public long counter(int N) {
        long res = 0;
        for (; N > 0; N /= 10)
            res += (int)Math.pow(10, N % 10);
        return res;
    }
}

class Solution {
    public int binaryGap(int n) {
        int maxDist = 0;
        int lastOneIndex = -1;
        for (int i = 0; i < 32; i++) {
            if (((n >> i) & 1) == 1) {
                if (lastOneIndex != -1) {
                    maxDist = Math.max(maxDist, i - lastOneIndex);
                }
                lastOneIndex = i;
            }
        }
        return maxDist;
    }
}

