class Solution {
    public int primePalindrome(int n) {
        if(n <= 2)
            return 2;
        int res = n % 2 == 0 ? n + 1 : n;
        while(true){
            if(isPalindrome(res) && isPrime(res))
                return res;
            res += 2;
            if(res > 10_000_000 && res < 100_000_000)   
                res = 100_000_001;
        }
    }
    
    public boolean isPalindrome(int n){
        String s = Integer.toString(n);
        int i = 0;
        int j = s.length() - 1;
        while(i < j){
            if(s.charAt(i) != s.charAt(j))
                return false;
            i++;
            j--;
        }
        return true;
    }
    
    public boolean isPrime(int n){
        if(n < 2)
            return false;
        for(int i = 2; i <= Math.sqrt(n); i++){
            if(n % i == 0)
                return false;
        }
        return true;
    }
}

class Solution {
    public TreeNode subtreeWithAllDeepest(TreeNode root) {
        if(root==null)
            return null;
        int leftHeight = height(root.left);
        int rightHeight = height(root.right);
        if(leftHeight==rightHeight)
            return root;
        else if(leftHeight>rightHeight)
            return subtreeWithAllDeepest(root.left);
        else
            return subtreeWithAllDeepest(root.right);
    }
    private int height(TreeNode root){
        if(root==null)
            return 0;
        return 1+Math.max(height(root.left),height(root.right));
    }
}

class Solution {
    public int shortestPathAllKeys(String[] grid) {
        int m = grid.length, n = grid[0].length(), totalKeys = 0, startX = 0, startY = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                char ch = grid[i].charAt(j);
                if (ch == '@') {
                    startX = i;
                    startY = j;
                }
                if (ch >= 'a' && ch <= 'f') {
                    totalKeys++;
                }
            }
        }
        int endState = (1 << totalKeys) - 1, steps = 0;
        Queue<int[]> queue = new LinkedList<>();
        Set<String> visited = new HashSet<>();
        queue.offer(new int[]{startX, startY, 0});
        visited.add(startX + "_" + startY + "_0");
        int[][] dirs = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                int[] cur = queue.poll();
                int x = cur[0], y = cur[1], state = cur[2];
                if (state == endState) {
                    return steps;
                }
                for (int[] dir : dirs) {
                    int nx = x + dir[0], ny = y + dir[1];
                    if (nx < 0 || nx >= m || ny < 0 || ny >= n || grid[nx].charAt(ny) == '#') {
                        continue;
                    }
                    char ch = grid[nx].charAt(ny);
                    int nstate = state;
                    if (ch >= 'a' && ch <= 'f') {
                        int index = ch - 'a';
                        nstate = (state | (1 << index));
                    } else if (ch >= 'A' && ch <= 'F') {
                        int index = ch - 'A';
                        if ((state & (1 << index)) == 0) {
                            continue;
                        }
                    }
                    if (!visited.contains(nx + "_" + ny + "_" + nstate)) {
                        queue.offer(new int[]{nx, ny, nstate});
                        visited.add(nx + "_" + ny + "_" + nstate);
                    }
                }
            }
            steps++;
        }
        return -1;
    }
}

class Solution {
    Map<Integer, Integer> map = new HashMap<>();
    int size;

    public Solution(int n, int[] blacklist) {
        Set<Integer> set = new HashSet<>();
        for (int i : blacklist) {
            set.add(i);
        }
        size = n - set.size();
        int last = n - 1;
        for (int b : blacklist) {
            if (b >= size) {
                continue;
            }
            while (set.contains(last)) {
                last--;
            }
            map.put(b, last);
            last--;
        }
    }

    public int pick() {
        int rand = (int) (Math.random() * size);
        if (map.containsKey(rand)) {
            return map.get(rand);
        }
        return rand;
    }
}

class Solution {
    public List<Integer> distanceK(TreeNode root, TreeNode target, int k) {
        List<Integer> res = new ArrayList<>();
        Map<TreeNode, TreeNode> parentMap = new HashMap<>();
        findParent(root, null, parentMap);
        Queue<TreeNode> queue = new LinkedList<>();
        Set<TreeNode> visited = new HashSet<>();
        queue.offer(target);
        visited.add(target);
        int dist = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            if (dist == k) {
                for (int i = 0; i < size; i++) {
                    res.add(queue.poll().val);
                }
                return res;
            }
            for (int i = 0; i < size; i++) {
                TreeNode curr = queue.poll();
                if (curr.left != null && !visited.contains(curr.left)) {
                    visited.add(curr.left);
                    queue.offer(curr.left);
                }
                if (curr.right != null && !visited.contains(curr.right)) {
                    visited.add(curr.right);
                    queue.offer(curr.right);
                }
                if (parentMap.containsKey(curr) && !visited.contains(parentMap.get(curr))) {
                    visited.add(parentMap.get(curr));
                    queue.offer(parentMap.get(curr));
                }
            }
            dist++;
        }
        return res;
    }
    
    private void findParent(TreeNode node, TreeNode parent, Map<TreeNode, TreeNode> parentMap) {
        if (node == null) return;
        parentMap.put(node, parent);
        findParent(node.left, node, parentMap);
        findParent(node.right, node, parentMap);
    }
}

class Solution {
    public int shortestSubarray(int[] nums, int k) {
        int n = nums.length;
        int[] prefixSum = new int[n+1];
        for (int i = 0; i < n; i++) {
            prefixSum[i+1] = prefixSum[i] + nums[i];
        }
        int ans = n+1, head = 0;
        Deque<Integer> q = new LinkedList<>();
        for (int i = 0; i <= n; i++) {
            while (!q.isEmpty() && prefixSum[i] - prefixSum[q.peekFirst()] >= k) {
                ans = Math.min(ans, i - q.pollFirst());
            }
            while (!q.isEmpty() && prefixSum[i] <= prefixSum[q.peekLast()]) {
                q.pollLast();
            }
            q.offerLast(i);
        }
        return ans == n+1 ? -1 : ans;
    }
}

class Solution {
    public int matrixScore(int[][] grid) {
        int m = grid.length, n = grid[0].length, res = 0;
        for (int j = 0; j < n; j++) {
            int count = 0;
            for (int i = 0; i < m; i++) {
                count += (grid[i][j] ^ grid[i][0]);
            }
            res += Math.max(count, m - count) * (1 << (n - j - 1));
        }
        return res;
    }
}

class Solution {
