class Solution {
    public boolean buddyStrings(String s, String goal) {
        if (s.length() != goal.length()) {
            return false;
        }
        if (s.equals(goal)) {
            int[] count = new int[26];
            for (int i = 0; i < s.length(); i++) {
                count[s.charAt(i) - 'a']++;
            }
            for (int c : count) {
                if (c > 1) {
                    return true;
                }
            }
            return false;
        } else {
            int first = -1;
            int second = -1;
            for (int i = 0; i < s.length(); i++) {
                if (s.charAt(i) != goal.charAt(i)) {
                    if (first == -1) {
                        first = i;
                    } else if (second == -1) {
                        second = i;
                    } else {
                        return false;
                    }
                }
            }
            return (second != -1 && s.charAt(first) == goal.charAt(second) && s.charAt(second) == goal.charAt(first));
        }
    }
}

class Solution {
    public int mirrorReflection(int p, int q) {
        int gcd = gcd(p, q);
        p = (p/gcd) % 2 == 0 ? 2 : 1;
        q = (q/gcd) % 2 == 0 ? 2 : 1;
        return p == 1 ? q : 3 - q;
    }
    
    private int gcd(int a, int b) {
        if (b == 0) return a;
        return gcd(b, a % b);
    }
}

class Solution {
    public double mincostToHireWorkers(int[] quality, int[] wage, int k) {
        int n = quality.length;
        int[][] workers = new int[n][2];
        for (int i = 0; i < n; i++) {
            workers[i] = new int[]{quality[i], wage[i]};
        }
        Arrays.sort(workers, (a, b) -> Double.compare((double) a[1] / a[0], (double) b[1] / b[0]));
        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> b - a);
        double res = Double.MAX_VALUE;
        int qSum = 0;
        for (int[] worker : workers) {
            qSum += worker[0];
            pq.offer(worker[0]);
            if (pq.size() > k) {
                qSum -= pq.poll();
            }
            if (pq.size() == k) {
                res = Math.min(res, qSum * ((double) worker[1] / worker[0]));
            }
        }
        return res;
    }
}

class Solution {
    public int scoreOfParentheses(String s) {
        Stack<Integer> stack = new Stack<>();
        stack.push(0);
        for (char c : s.toCharArray()) {
            if (c == '(') {
                stack.push(0);
            } else {
                int score = stack.pop();
                int prevScore = stack.pop();
                stack.push(prevScore + Math.max(2 * score, 1));
            }
        }
        return stack.pop();
    }
}

class ExamRoom {
    private TreeSet<Integer> seats;
    private int n;

    public ExamRoom(int n) {
        seats = new TreeSet<>();
        this.n = n;
    }

    public int seat() {
        int ans = 0;
        if (!seats.isEmpty()) {
            int dist = seats.first();
            Integer prev = null;
            for (int s : seats) {
                if (prev != null) {
                    int d = (s - prev) / 2;
                    if (d > dist) {
                        dist = d;
                        ans = prev + dist;
                    }
                }
                prev = s;
            }
            if (n - 1 - seats.last() > dist)
                ans = n - 1;
        }
        seats.add(ans);
        return ans;
    }

    public void leave(int p) {
        seats.remove(p);
    }
}

class Solution {
    public int kSimilarity(String s1, String s2) {
        if (s1.equals(s2)) return 0;
        Queue<String> queue = new LinkedList<>();
        Set<String> visited = new HashSet<>();
        queue.offer(s1);
        visited.add(s1);
        int count = 0;
        while (!queue.isEmpty()) {
            count++;
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                String cur = queue.poll();
                int j = 0;
                while (cur.charAt(j) == s2.charAt(j)) j++;
                for (int k = j + 1; k < cur.length(); k++) {
                    if (cur.charAt(k) == s2.charAt(j) && cur.charAt(k) != s2.charAt(k)) {
                        String temp = swap(cur, j, k);
                        if (temp.equals(s2)) return count;
                        if (!visited.contains(temp)) {
                            visited.add(temp);
                            queue.offer(temp);
                        }
                    }
                }
            }
        }
        return -1;
    }
    
    private String swap(String s, int i, int j) {
        char[] arr = s.toCharArray();
        char temp = arr[i];
        arr[i] = arr[j];
        arr[j] = temp;
        return new String(arr);
    }
}

class Solution {
    public int carFleet(int target, int[] position, int[] speed) {
        int n = position.length;
        int[][] cars = new int[n][2];
        for (int i = 0; i < n; i++) {
            cars[i][0] = position[i];
            cars[i][1] = speed[i];
        }
        Arrays.sort(cars, (a, b) -> b[0] - a[0]);
        int fleets = 0;
        double prevTime = -1;
        for (int i = 0; i < n; i++) {
            double currTime = (double) (target - cars[i][0]) / cars[i][1];
            if (currTime > prevTime) {
                fleets++;
                prevTime = currTime;
            }
        }
        return fleets;
    }
}

class Solution {
    public int peakIndexInMountainArray(int[] arr) {
        int left = 0, right = arr.length - 1;
        while (left < right) {
            int mid = left + (right - left) / 2;
            if (arr[mid] < arr[mid + 1]) {
                left = mid + 1;
            } else {
                right = mid;
            }
        }
        return left;
    }
}

class Solution {
    public int[] loudAndRich(int[][] richer, int[] quiet) {
        int n = quiet.length;
        int[] res = new int[n];
        Arrays.fill(res, -1);
        Map<Integer, List<Integer>> map = new HashMap<>();
        for (int i = 0; i < n; i++) {
            map.put(i, new ArrayList<>());
        }
        for (int[] r : richer) {
            map.get(r[1]).add(r[0]);
        }
        for (int i = 0; i < n; i++) {
            dfs(i, quiet, res, map);
        }
        return res;
    }
    private int dfs(int i, int[] quiet, int[] res, Map<Integer, List<Integer>> map) {
        if (res[i] >= 0) {
            return res[i];
        }
        res[i] = i;
        for (int j : map.get(i)) {
            int k = dfs(j, quiet, res, map);
            if (quiet[k] < quiet[res[i]]) {
                res[i] = k;
            }
        }
        return res[i];
    }
}

class Solution {
    private static final int MOD = 1000000007;
    
    public int rectangleArea(int[][] rectangles) {
        Set<Integer> xSet = new TreeSet<>();
        Set<Integer> ySet = new TreeSet<>();
        for (int[] rec : rectangles) {
            xSet.add(rec[0]);
            xSet.add(rec[2]);
            ySet.add(rec[1]);
            ySet.add(rec[3]);
        }
        List<Integer> xList = new ArrayList<>(xSet);
        List<Integer> yList = new ArrayList<>(ySet);
        int[][] grid = new int[xList.size()][yList.size()];
        for (int[] rec : rectangles) {
            int x1 = Collections.binarySearch(xList, rec[0]);
            int x2 = Collections.binarySearch(xList, rec[2]);
            int y1 = Collections.binarySearch(yList, rec[1]);
            int y2 = Collections.binarySearch(yList, rec[3]);
            for (int i = x1; i < x2; i++) {
                for (int j = y1; j < y2; j++) {
                    grid[i][j] = 1;
                }
            }
        }
        long ans = 0;
        for (int i = 0; i < xList.size(); i++) {
            for (int j = 0; j < yList.size(); j++) {
                ans += (long) (xList.get(i+1) - xList.get(i)) * (yList.get(j+1) - yList.get(j)) * grid[i][j];
                ans %= MOD;
            }
        }
        return (int) ans;
    }
}

class Solution {
    public int maxDistToClosest(int[] seats) {
        int n = seats.length;
        int left = -1, right = 0, ans = 0;
        for (int i = 0; i < n; i++) {
            if (seats[i] == 1) {
                if (left == -1) {
                    ans = i;
                } else {
                    ans = Math.max(ans, (i - left) / 2);
                }
                left = i;
            } else {
                while (right < n && seats[right] == 0 || right < i) {
                    right++;
                }
                if (right == n) {
                    ans = Math.max(ans, i - left);
                } else {
                    ans = Math.max(ans, Math.min(right - i, i - left));
                }
            }
        }
        return ans;
    }
}

class Solution {
    public String shiftingLetters(String s, int[] shifts) {
        int n = s.length();
        int[] prefixSum = new int[n];
        prefixSum[n-1] = shifts[n-1];
        for(int i = n-2; i >= 0; i--) {
            prefixSum[i] = prefixSum[i+1] + shifts[i];
        }
        StringBuilder sb = new StringBuilder(s);
        for(int i = 0; i < n; i++) {
            char c = sb.charAt(i);
            int shift = prefixSum[i] % 26;
            char shifted = (char) ((c - 'a' + shift) % 26 + 'a');
            sb.setCharAt(i, shifted);
        }
        return sb.toString();
    }
}

class Solution {
    public int shortestPathLength(int[][] graph) {
        int n = graph.length;
        int[][] dist = new int[n][1<<n];
        Queue<int[]> queue = new LinkedList<>();
        for(int i=0;i<n;i++) {
            Arrays.fill(dist[i], Integer.MAX_VALUE);
            dist[i][1<<i] = 0;
            queue.offer(new int[] {i,1<<i});
        }
        while(!queue.isEmpty()) {
            int[] curr = queue.poll();
            int node = curr[0], state = curr[1], d = dist[node][state];
            if(state == (1<<n)-1) return d;
            for(int nei : graph[node]) {
                int nextState = state | (1<<nei);
                if(dist[nei][nextState] > d+1) {
                    dist[nei][nextState] = d+1;
                    queue.offer(new int[] {nei,nextState});
                }
            }
        }
        return -1;
    }
}

class Solution {
    public boolean isPossibleDivide(int[] hand, int groupSize) {
        if (hand.length % groupSize != 0) {
            return false;
        }
        TreeMap<Integer, Integer> frequencyMap = new TreeMap<>();
        for (int card : hand) {
            frequencyMap.put(card, frequencyMap.getOrDefault(card, 0) + 1);
        }
        for (int card : frequencyMap.keySet()) {
            while (frequencyMap.get(card) > 0) {
                for (int i = 0; i < groupSize; i++) {
                    if (!frequencyMap.containsKey(card + i) || frequencyMap.get(card + i) <= 0) {
                        return false;
                    }
                    frequencyMap.put(card + i, frequencyMap.get(card + i) - 1);
                }
            }
        }
        return true;
    }
}

class Solution {
    public int longestMountain(int[] arr) {
        int n = arr.length;
        int ans = 0, base = 0;
        while (base < n) {
            int end = base;
            if (end + 1 < n && arr[end] < arr[end + 1]) {
                while (end + 1 < n && arr[end] < arr[end + 1]) end++;
                if (end + 1 < n && arr[end] > arr[end + 1]) {
                    while (end + 1 < n && arr[end] > arr[end + 1]) end++;
                    ans = Math.max(ans, end - base + 1);
                }
            }
            base = Math.max(end, base + 1);
        }
        return ans;
    }
}

class Solution {
    public boolean backspaceCompare(String s, String t) {
        int sIndex = s.length() - 1, tIndex = t.length() - 1; 
        int sSkip = 0, tSkip = 0;
        while (sIndex >= 0 || tIndex >= 0) { 
            while (sIndex >= 0) { 
                if (s.charAt(sIndex) == '#') {sSkip++; sIndex--;}
                else if (sSkip > 0) {sSkip--; sIndex--;}
                else break;
            }
            while (tIndex >= 0) {
                if (t.charAt(tIndex) == '#') {tSkip++; tIndex--;}
                else if (tSkip > 0) {tSkip--; tIndex--;}
                else break;
            }
            if (sIndex >= 0 && tIndex >= 0 && s.charAt(sIndex) != t.charAt(tIndex)) {
                return false;
            }
            if ((sIndex >= 0) != (tIndex >= 0)) {
                return false;
            }
            sIndex--; tIndex--;
        }
        return true;
    }
}

class Solution {
    public List<Integer> splitIntoFibonacci(String num) {
        List<Integer> res = new ArrayList<>();
        backtrack(num, res, 0);
        return res;
    }
    
    private boolean backtrack(String num, List<Integer> res, int index) {
        int n = num.length();
        if (index == n && res.size() >= 3) {
            return true;
        }
        for (int i = index; i < n; i++) {
            if (num.charAt(index) == '0' && i > index) {
                break;
            }
            long curr = Long.parseLong(num.substring(index, i + 1));
            if (curr > Integer.MAX_VALUE) {
                break;
            }
            int size = res.size();
            if (size >= 2 && curr > res.get(size - 1) + res.get(size - 2)) {
                break;
            }
            if (size <= 1 || curr == res.get(size - 1) + res.get(size - 2)) {
                res.add((int)curr);
                if (backtrack(num, res, i + 1)) {
                    return true;
                }
                res.remove(res.size() - 1);
            }
        }
        return false;
    }
}

class Solution {
    public boolean canVisitAllRooms(List<List<Integer>> rooms) {
        boolean[] visited = new boolean[rooms.size()];
        dfs(0, visited, rooms);
        for (boolean v : visited) {
            if (!v) {
                return false;
            }
        }
        return true;
    }
    
    private void dfs(int room, boolean[] visited, List<List<Integer>> rooms) {
        visited[room] = true;
        for (int key : rooms.get(room)) {
            if (!visited[key]) {
                dfs(key, visited, rooms);
            }
        }
    }
}

