class Solution {
    public int numSimilarGroups(String[] strs) {
        int n = strs.length;
        int groupCount = 0;
        boolean[] visited = new boolean[n];
        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                dfs(i, strs, visited);
                groupCount++;
            }
        }
        return groupCount;
    }
    
    public void dfs(int i, String[] strs, boolean[] visited) {
        visited[i] = true;
        for (int j = 0; j < strs.length; j++) {
            if (!visited[j] && isSimilar(strs[i], strs[j])) {
                dfs(j, strs, visited);
            }
        }
    }
    
    public boolean isSimilar(String s1, String s2) {
        if (s1.equals(s2)) return true;
        int n = s1.length();
        int diffCount = 0;
        for (int i = 0; i < n; i++) {
            if (s1.charAt(i) != s2.charAt(i)) {
                diffCount++;
                if (diffCount > 2) return false;
            }
        }
        return diffCount == 2;
    }
}

class Solution {
    public String pushDominoes(String dominoes) {
        char[] dom = dominoes.toCharArray();
        int n = dom.length;
        int[] forces = new int[n];
        int force = 0;
        for (int i = 0; i < n; i++) {
            if (dom[i] == 'R') force = n;
            else if (dom[i] == 'L') force = 0;
            else force = Math.max(force - 1, 0);
            forces[i] += force;
        }
        force = 0;
        for (int i = n - 1; i >= 0; i--) {
            if (dom[i] == 'L') force = n;
            else if (dom[i] == 'R') force = 0;
            else force = Math.max(force - 1, 0);
            forces[i] -= force;
        }
        StringBuilder sb = new StringBuilder();
        for (int f : forces) {
            sb.append(f > 0 ? 'R' : (f < 0 ? 'L' : '.'));
        }
        return sb.toString();
    }
}

class Solution {
    public double new21Game(int n, int k, int maxPts) {
        double[] dp = new double[n + maxPts + 1];
        double sum = 0;
        for (int i = k; i <= n; i++) {
            dp[i] = 1;
            sum += dp[i];
        }
        if (k == 0 || n < k) return 1;
        for (int i = k - 1; i >= 0; i--) {
            dp[i] = sum / maxPts;
            sum -= dp[i + n];
            sum += dp[i];
        }
        return dp[0];
    }
}

