class Solution {
    public int largestOverlap(int[][] img1, int[][] img2) {
        int n = img1.length;
        int[][] shiftX = new int[2 * n + 1][2 * n + 1];
        int[][] shiftY = new int[2 * n + 1][2 * n + 1];
        int maxOverlap = 0;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (img1[i][j] == 1) {
                    for (int x = 0; x < n; x++) {
                        for (int y = 0; y < n; y++) {
                            if (img2[x][y] == 1) {
                                shiftX[i - x + n][j - y + n]++;
                                shiftY[i - x + n][j - y + n]++;
                                maxOverlap = Math.max(maxOverlap, shiftX[i - x + n][j - y + n]);
                                maxOverlap = Math.max(maxOverlap, shiftY[i - x + n][j - y + n]);
                            }
                        }
                    }
                }
            }
        }
        return maxOverlap;
    }
}

class Solution {
    int[] ans, count;
    List<List<Integer>> tree;
    int n;
    
    public int[] sumOfDistancesInTree(int n, int[][] edges) {
        this.n = n;
        ans = new int[n];
        count = new int[n];
        tree = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            tree.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            int u = edge[0], v = edge[1];
            tree.get(u).add(v);
            tree.get(v).add(u);
        }
        dfs1(0, -1);
        dfs2(0, -1);
        return ans;
    }
    
    private void dfs1(int node, int parent) {
        for (int child : tree.get(node)) {
            if (child != parent) {
                dfs1(child, node);
                count[node] += count[child];
                ans[node] += ans[child] + count[child];
            }
        }
        count[node]++;
    }
    
    private void dfs2(int node, int parent) {
        for (int child : tree.get(node)) {
            if (child != parent) {
                ans[child] = ans[node] - count[child] + n - count[child];
                dfs2(child, node);
            }
        }
    }
}

class Solution {
    public String findReplaceString(String s, int[] indices, String[] sources, String[] targets) {
        Map<Integer, Integer> indexMap = new HashMap<>();
        for (int i = 0; i < indices.length; i++) {
            indexMap.put(indices[i], i);
        }
        StringBuilder sb = new StringBuilder();
        int i = 0;
        while (i < s.length()) {
            if (indexMap.containsKey(i)) {
                int k = indexMap.get(i);
                if (s.startsWith(sources[k], i)) {
                    sb.append(targets[k]);
                    i += sources[k].length();
                } else {
                    sb.append(s.charAt(i));
                    i++;
                }
            } else {
                sb.append(s.charAt(i));
                i++;
            }
        }
        return sb.toString();
    }
}

class Solution {
    public int[][] flipAndInvertImage(int[][] image) {
        for (int i = 0; i < image.length; i++) {
            int start = 0, end = image[i].length - 1;
            while (start < end) {
                int temp = image[i][start];
                image[i][start++] = image[i][end] ^ 1;
                image[i][end--] = temp ^ 1;
            }
            if (start == end) image[i][start] ^= 1;
        }
        return image;
    }
}

class MyCircularQueue {
    private int[] queue;
    private int front;
    private int rear;
    private int size;

    public MyCircularQueue(int k) {
        queue = new int[k];
        front = -1;
        rear = -1;
        size = 0;
    }

    public boolean enQueue(int value) {
        if (isFull()) {
            return false;
        }
        if (isEmpty()) {
            front = 0;
        }
        rear = (rear + 1) % queue.length;
        queue[rear] = value;
        size++;
        return true;
    }

    public boolean deQueue() {
        if (isEmpty()) {
            return false;
        }
        if (front == rear) {
            front = -1;
            rear = -1;
        } else {
            front = (front + 1) % queue.length;
        }
        size--;
        return true;
    }

    public int Front() {
        if (isEmpty()) {
            return -1;
        }
        return queue[front];
    }

    public int Rear() {
        if (isEmpty()) {
            return -1;
        }
        return queue[rear];
    }

    public boolean isEmpty() {
        return size == 0;
    }

    public boolean isFull() {
        return size == queue.length;
    }
}

