class Solution {
    public int uniqueLetterString(String s) {
        int[] index = new int[26];
        int res = 0, cur = 0, mod = (int)1e9+7;
        Arrays.fill(index, -1);
        for (int i = 0; i < s.length(); i++) {
            int c = s.charAt(i) - 'A';
            cur = cur + i + 1 - (index[c] + 1) * 2 + mod;
            cur %= mod;
            res += cur;
            res %= mod;
            index[c] = i;
        }
        return res;
    }
}

class Solution {
    public int largestIsland(int[][] grid) {
        int n = grid.length;
        int[] sizes = new int[n*n+2];
        int index = 2;
        int maxArea = 0;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    int area = dfs(grid, i, j, index);
                    sizes[index++] = area;
                    maxArea = Math.max(maxArea, area);
                }
            }
        }
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 0) {
                    HashSet<Integer> set = new HashSet<>();
                    if (i > 0) set.add(grid[i-1][j]);
                    if (j > 0) set.add(grid[i][j-1]);
                    if (i < n-1) set.add(grid[i+1][j]);
                    if (j < n-1) set.add(grid[i][j+1]);
                    int area = 1;
                    for (int val : set) {
                        area += sizes[val];
                    }
                    maxArea = Math.max(maxArea, area);
                }
            }
        }
        return maxArea;
    }
    
    private int dfs(int[][] grid, int i, int j, int index) {
        int n = grid.length;
        if (i < 0 || i >= n || j < 0 || j >= n || grid[i][j] != 1) {
            return 0;
        }
        grid[i][j] = index;
        return 1 + dfs(grid, i-1, j, index) + dfs(grid, i+1, j, index) + dfs(grid, i, j-1, index) + dfs(grid, i, j+1, index);
    }
}

class Solution {
    public int maxProfitAssignment(int[] difficulty, int[] profit, int[] worker) {
        int n = difficulty.length;
        int[][] jobs = new int[n][2];
        for(int i = 0; i < n; i++) {
            jobs[i][0] = difficulty[i];
            jobs[i][1] = profit[i];
        }
        Arrays.sort(jobs, (a, b) -> a[0] - b[0]);
        Arrays.sort(worker);
        int i = 0, best = 0, res = 0;
        for(int skill: worker) {
            while(i < n && skill >= jobs[i][0]) {
                best = Math.max(best, jobs[i][1]);
                i++;
            }
            res += best;
        }
        return res;
    }
}

class Solution {
    public int numFriendRequests(int[] ages) {
        int[] count = new int[121];
        for (int age : ages) {
            count[age]++;
        }
        int ans = 0;
        for (int ageA = 1; ageA <= 120; ageA++) {
            int countA = count[ageA];
            for (int ageB = 1; ageB <= 120; ageB++) {
                int countB = count[ageB];
                if (ageA * 0.5 + 7 >= ageB) continue;
                if (ageA < ageB) continue;
                if (ageA < 100 && ageB > 100) continue;
                ans += countA * countB;
                if (ageA == ageB) ans -= countA;
            }
        }
        return ans;
    }
}

