class Solution {
    public int numFactoredBinaryTrees(int[] arr) {
        long mod = (long) 1e9 + 7;
        Arrays.sort(arr);
        Map<Integer, Long> dp = new HashMap<>();
        for (int i = 0; i < arr.length; i++) {
            dp.put(arr[i], 1L);
            for (int j = 0; j < i; j++) {
                if (arr[i] % arr[j] == 0 && dp.containsKey(arr[i] / arr[j])) {
                    dp.put(arr[i], (dp.get(arr[i]) + dp.get(arr[j]) * dp.get(arr[i] / arr[j])) % mod);
                }
            }
        }
        long ans = 0;
        for (long val : dp.values()) {
            ans += val;
            ans %= mod;
        }
        return (int) ans;
    }
}

class Solution {
    public int flipgame(int[] fronts, int[] backs) {
        Set<Integer> same = new HashSet<>();
        int n = fronts.length;
        for (int i = 0; i < n; i++) {
            if (fronts[i] == backs[i]) {
                same.add(fronts[i]);
            }
        }
        int ans = Integer.MAX_VALUE;
        for (int i = 0; i < n; i++) {
            if (!same.contains(fronts[i])) {
                ans = Math.min(ans, fronts[i]);
            }
            if (!same.contains(backs[i])) {
                ans = Math.min(ans, backs[i]);
            }
        }
        return ans == Integer.MAX_VALUE ? 0 : ans;
    }
}

class Solution {
    public int[] shortestToChar(String s, char c) {
        int[] ans = new int[s.length()];
        int prev = -10000;
        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) == c) prev = i;
            ans[i] = i - prev;
        }
        prev = 10000;
        for (int i = s.length() - 1; i >= 0; i--) {
            if (s.charAt(i) == c) prev = i;
            ans[i] = Math.min(ans[i], prev - i);
        }
        return ans;
    }
}

