}

class MyLinkedList {
    
    class Node {
        int val;
        Node next;
        Node(int val) {
            this.val = val;
            this.next = null;
        }
    }
    
    private Node head;
    private int size;

    public MyLinkedList() {
        head = null;
        size = 0;
    }
    
    public int get(int index) {
        if (index < 0 || index >= size) return -1;
        Node curr = head;
        for (int i = 0; i < index; i++) {
            curr = curr.next;
        }
        return curr.val;
    }
    
    public void addAtHead(int val) {
        Node newHead = new Node(val);
        newHead.next = head;
        head = newHead;
        size++;
    }
    
    public void addAtTail(int val) {
        if (size == 0) {
            addAtHead(val);
            return;
        }
        Node curr = head;
        while (curr.next != null) {
            curr = curr.next;
        }
        Node newNode = new Node(val);
        curr.next = newNode;
        size++;
    }
    
    public void addAtIndex(int index, int val) {
        if (index < 0 || index > size) return;
        if (index == 0) {
            addAtHead(val);
            return;
        }
        if (index == size) {
            addAtTail(val);
            return;
        }
        Node curr = head;
        for (int i = 0; i < index-1; i++) {
            curr = curr.next;
        }
        Node newNode = new Node(val);
        newNode.next = curr.next;
        curr.next = newNode;
        size++;
    }
    
    public void deleteAtIndex(int index) {
        if (index < 0 || index >= size) return;
        if (index == 0) {
            head = head.next;
            size--;
            return;
        }
        Node curr = head;
        for (int i = 0; i < index-1; i++) {
            curr = curr.next;
        }
        curr.next = curr.next.next;
        size--;
    }
}

class Solution {
    public String mostCommonWord(String paragraph, String[] banned) {
        Set<String> ban = new HashSet<>(Arrays.asList(banned));
        Map<String, Integer> count = new HashMap<>();
        String[] words = paragraph.replaceAll("\\pP" , " ").toLowerCase().split("\\s+");
        String res = "";
        int maxCount = 0;
        for (String word: words) {
            if (!ban.contains(word)) {
                count.put(word, count.getOrDefault(word, 0) + 1);
                if (count.get(word) > maxCount) {
                    maxCount = count.get(word);
                    res = word;
                }
            }
        }
        return res;
    }
}

class Solution {
    public int racecar(int target) {
        Queue<int[]> q = new LinkedList<>();
        q.offer(new int[] {0, 1});
        Set<String> visited = new HashSet<>();
        visited.add("0,1");
        int steps = 0;

        while (!q.isEmpty()) {
            int size = q.size();
            for (int i = 0; i < size; i++) {
                int[] curr = q.poll();
                int pos = curr[0], speed = curr[1];
                if (pos == target) {
                    return steps;
                }
                int[] next1 = new int[] {pos + speed, speed * 2};
                String key1 = next1[0] + "," + next1[1];
                if (!visited.contains(key1) && next1[0] > 0 && next1[0] < target * 2) {
                    q.offer(next1);
                    visited.add(key1);
                }
                int[] next2 = new int[] {pos, speed > 0 ? -1 : 1};
                String key2 = next2[0] + "," + next2[1];
                if (!visited.contains(key2) && next2[0] > 0 && next2[0] < target * 2) {
                    q.offer(next2);
                    visited.add(key2);
                }
            }
            steps++;
        }

        return -1;
    }
}

class Solution {
    public int numComponents(ListNode head, int[] nums) {
        Set<Integer> set = new HashSet<>();
        for (int num : nums) {
            set.add(num);
        }
        int count = 0;
        boolean connected = false;
        while (head != null) {
            if (set.contains(head.val)) {
                if (!connected) {
                    count++;
                }
                connected = true;
            } else {
                connected = false;
            }
            head = head.next;
        }
        return count;
    }
}

class Solution {
    public List<String> ambiguousCoordinates(String s) {
        List<String> res = new ArrayList<>();
        for (int i = 2; i < s.length() - 1; i++) {
            for (String left : make(s.substring(1, i))) {
                for (String right : make(s.substring(i, s.length() - 1))) {
                    res.add("(" + left + ", " + right + ")");
                }
            }
        }
        return res;
    }
    
    private List<String> make(String s) {
        List<String> res = new ArrayList<>();
        if (s.length() == 1 || s.charAt(0) != '0') {
            res.add(s);
        }
        for (int i = 1; i < s.length(); i++) {
            if (s.charAt(s.length() - 1) != '0' && s.charAt(i) == '0') {
                res.add(s.substring(0, i) + "." + s.substring(i));
                continue;
            }
            if (s.charAt(0) != '0') {
                res.add(s.substring(0, i) + "." + s.substring(i));
            }
        }
        return res;
    }
}

class Solution {
    public int numBusesToDestination(int[][] routes, int source, int target) {
        Map<Integer, List<Integer>> map = new HashMap<>();
        Set<Integer> visited = new HashSet<>();
        Set<Integer> targets = new HashSet<>();
        Queue<Integer> queue = new LinkedList<>();
        int res = 0;
        if (source == target) return 0;
        for (int i = 0; i < routes.length; i++) {
            for (int j = 0; j < routes[i].length; j++) {
                List<Integer> buses = map.getOrDefault(routes[i][j], new ArrayList<>());
                buses.add(i);
                map.put(routes[i][j], buses);
            }
        }
        queue.offer(source);
        visited.add(source);
        while (!queue.isEmpty()) {
            int size = queue.size();
            res++;
            for (int i = 0; i < size; i++) {
                int cur = queue.poll();
                for (int bus : map.get(cur)) {
                    if (visited.contains(cur)) continue;
                    visited.add(cur);
                    for (int next : routes[bus]) {
                        if (next == target) return res;
                        if (targets.contains(next)) continue;
                        targets.add(next);
                        queue.offer(next);
                    }
                }
            }
        }
        return -1;
    }
}

