class Solution {
    public double largestSumOfAverages(int[] nums, int k) {
        int n = nums.length;
        double[] prefix = new double[n + 1];
        for (int i = 0; i < n; i++) {
            prefix[i + 1] = prefix[i] + nums[i];
        }
        double[][] dp = new double[k + 1][n];
        for (int i = 0; i < n; i++) {
            dp[1][i] = (prefix[n] - prefix[i]) / (n - i);
        }
        for (int i = 2; i <= k; i++) {
            for (int j = n - 1; j >= 0; j--) {
                for (int p = j; p < n - 1; p++) {
                    dp[i][j] = Math.max(dp[i][j], dp[i - 1][p + 1] + (prefix[p + 1] - prefix[j]) / (p - j + 1));
                }
            }
        }
        return dp[k][0];
    }
}

class Solution {
    public double largestTriangleArea(int[][] points) {
        double res = 0;
        for (int i = 0; i < points.length; i++)
            for (int j = i + 1; j < points.length; j++)
                for (int k = j + 1; k < points.length; k++)
                    res = Math.max(res, 0.5 * Math.abs(points[i][0] * points[j][1] + points[j][0] * points[k][1] + points[k][0] * points[i][1] - points[j][0] * points[i][1] - points[k][0] * points[j][1] - points[i][0] * points[k][1]));
        return res;
    }
}

