class Solution {
    public int expressiveWords(String s, String[] words) {
        int res = 0;
        for (String word : words) {
            if (check(s, word)) res++;
        }
        return res;
    }
    private boolean check(String s, String word) {
        int i = 0, j = 0;
        while (i < s.length() && j < word.length()) {
            if (s.charAt(i) == word.charAt(j)) {
                int countS = 1, countW = 1;
                while (i < s.length() - 1 && s.charAt(i+1) == s.charAt(i)) {
                    i++;
                    countS++;
                }
                while (j < word.length() - 1 && word.charAt(j+1) == word.charAt(j)) {
                    j++;
                    countW++;
                }
                if (countS < countW || (countS > countW && countS < 3)) return false;
                i++;
                j++;
            } else {
                return false;
            }
        }
        return i == s.length() && j == word.length();
    }
}

class Solution {
    public double soupServings(int n) {
        if (n >= 4800) return 1.0;
        n = (n + 24) / 25;
        double[][] dp = new double[n + 1][n + 1];
        dp[0][0] = 0.5;
        for (int i = 1; i <= n; ++i) {
            dp[0][i] = 1.0;
            dp[i][0] = 0.0;
        }
        int[][] dirs = {{-4, 0}, {-3, -1}, {-2, -2}, {-1, -3}};
        for (int k = 1; k <= 10000; ++k) {
            boolean updated = false;
            for (int i = 1; i <= n; ++i) {
                for (int j = 1; j <= n; ++j) {
                    dp[i][j] = 0.0;
                    for (int[] d : dirs) {
                        int ni = i + d[0], nj = j + d[1];
                        if (ni < 0 || nj < 0) continue;
                        dp[i][j] += dp[Math.max(0, ni)][Math.max(0, nj)];
                    }
                    dp[i][j] *= 0.25;
                    if (i == n && j == n) {
                        updated = true;
                        break;
                    }
                }
                if (updated) break;
            }
            if (updated) {
                double res = 0.0;
                for (int i = 0; i <= n; ++i) {
                    res += dp[i][n - i];
                }
                return res;
            }
        }
        return -1.0;
    }
}

class Solution {
    public int maxIncreaseKeepingSkyline(int[][] grid) {
        int n = grid.length;
        int m = grid[0].length;
        int[] row_max = new int[n];
        int[] col_max = new int[m];
        int ans = 0;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                row_max[i] = Math.max(row_max[i], grid[i][j]);
                col_max[j] = Math.max(col_max[j], grid[i][j]);
            }
        }
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                ans += Math.min(row_max[i], col_max[j]) - grid[i][j];
            }
        }
        return ans;
    }
}

