}

class Solution {
    public int[] hitBricks(int[][] grid, int[][] hits) {
        int[] result = new int[hits.length];
        for (int[] hit : hits) {
            grid[hit[0]][hit[1]]--;
        }
        for (int j = 0; j < grid[0].length; j++) {
            dfs(grid, 0, j);
        }
        for (int i = hits.length - 1; i >= 0; i--) {
            int x = hits[i][0];
            int y = hits[i][1];
            grid[x][y]++;
            if (grid[x][y] == 1 && isConnected(grid, x, y)) {
                result[i] = dfs(grid, x, y) - 1;
            }
        }
        return result;
    }

    private boolean isConnected(int[][] grid, int i, int j) {
        if (i == 0) {
            return true;
        }
        int[][] dirs = {{1, 0}, {-1, 0}, {0, 1}, {0, -1}};
        for (int[] dir : dirs) {
            int x = i + dir[0];
            int y = j + dir[1];
            if (x >= 0 && x < grid.length && y >= 0 && y < grid[0].length && grid[x][y] == 2) {
                return true;
            }
        }
        return false;
    }

    private int dfs(int[][] grid, int i, int j) {
        if (i < 0 || i == grid.length || j < 0 || j == grid[0].length || grid[i][j] != 1) {
            return 0;
        }
        grid[i][j] = 2;
        return dfs(grid, i + 1, j) + dfs(grid, i - 1, j) + dfs(grid, i, j + 1) + dfs(grid, i, j - 1) + 1;
    }
}

class Solution {
    public List<Integer> eventualSafeNodes(int[][] graph) {
        List<Integer> result = new ArrayList<>();
        int N = graph.length;
        int[] color = new int[N];
        for(int i = 0; i < N; i++) {
            if(dfs(graph, color, i)) {
                result.add(i);
            }
        }
        return result;
    }

    private boolean dfs(int[][] graph, int[] color, int node) {
        if(color[node] > 0) {
            return color[node] == 2;
        }
        color[node] = 1;
        for(int next : graph[node]) {
            if(color[next] == 2) {
                continue;
            }
            if(color[next] == 1 || !dfs(graph, color, next)) {
                return false;
            }
        }
        color[node] = 2;
        return true;
    }
}

class Solution {
    public int minSwap(int[] nums1, int[] nums2) {
        int n = nums1.length;
        int[] swap = new int[n];
        int[] notswap = new int[n];
        swap[0] = 1;
        for (int i = 1; i < n; i++) {
            swap[i] = notswap[i] = n;
            if (nums1[i] > nums1[i - 1] && nums2[i] > nums2[i - 1]) {
                notswap[i] = notswap[i - 1];
                swap[i] = swap[i - 1] + 1;
            }
            if (nums1[i] > nums2[i - 1] && nums2[i] > nums1[i - 1]) {
                notswap[i] = Math.min(notswap[i], swap[i - 1]);
                swap[i] = Math.min(swap[i], notswap[i - 1] + 1);
            }
        }
        return Math.min(swap[n - 1], notswap[n - 1]);
    }
}

class MyHashMap {
    private ListNode[] nodes = new ListNode[10000];

    public void put(int key, int value) {
        int i = idx(key);
        if (nodes[i] == null)
            nodes[i] = new ListNode(-1, -1);
        ListNode prev = find(nodes[i], key);
        if (prev.next == null)
            prev.next = new ListNode(key, value);
        else prev.next.val = value;
    }

    public int get(int key) {
        int i = idx(key);
        if (nodes[i] == null)
            return -1;
        ListNode prev = find(nodes[i], key);
        return prev.next == null ? -1 : prev.next.val;
    }

    public void remove(int key) {
        int i = idx(key);
        if (nodes[i] == null) return;
        ListNode prev = find(nodes[i], key);
        if (prev.next == null) return;
        prev.next = prev.next.next;
    }

    int idx(int key) { return Integer.hashCode(key) % nodes.length;}

    ListNode find(ListNode bucket, int key) {
        ListNode node = bucket, prev = null;
        while (node != null && node.key != key) {
            prev = node;
            node = node.next;
        }
        return prev;
    }
}

