class Solution {
    public double champagneTower(int poured, int query_row, int query_glass) {
        double[] res = new double[query_row+2];
        res[0] = poured;
        for (int row = 1; row <= query_row; row++) {
            for (int i = row; i >= 0; i--) {
                res[i+1] += res[i] = Math.max(0.0, (res[i]-1)/2);
            }
        }
        return Math.min(res[query_glass], 1.0);
    }
}

class Solution {
    public int bestRotation(int[] nums) {
        int n = nums.length;
        int[] bad = new int[n];
        for (int i = 0; i < n; i++) {
            int left = (i - nums[i] + 1 + n) % n;
            int right = (i + 1) % n;
            bad[left]--;
            bad[right]++;
            if (left > right) {
                bad[0]--;
            }
        }
        int ans = -n, best = -n;
        for (int i = 0, cur = 0; i < n; i++) {
            cur += bad[i];
            if (cur > best) {
                best = cur;
                ans = i;
            }
        }
        return ans + 1;
    }
}

class Solution {
    public List<List<Integer>> allPathsSourceTarget(int[][] graph) {
        List<List<Integer>> res = new ArrayList<>();
        List<Integer> path = new ArrayList<>();
        path.add(0);
        dfs(graph, 0, path, res);
        return res;
    }
    
    private void dfs(int[][] graph, int node, List<Integer> path, List<List<Integer>> res) {
        if (node == graph.length - 1) {
            res.add(new ArrayList<>(path));
            return;
        }
        for (int next : graph[node]) {
            path.add(next);
            dfs(graph, next, path, res);
            path.remove(path.size() - 1);
        }
    }
}

