class Solution {
    public boolean validTicTacToe(String[] board) {
        int xCount = 0, oCount = 0;
        for (String row : board) {
            for (char c : row.toCharArray()) {
                if (c == 'X') xCount++;
                if (c == 'O') oCount++;
            }
        }
        if (oCount != xCount && oCount != xCount - 1) return false;
        if (win(board, 'X') && oCount != xCount - 1) return false;
        if (win(board, 'O') && oCount != xCount) return false;
        return true;
    }
    
    private boolean win(String[] b, char p) {
        for (int i = 0; i < 3; i++) {
            if (p == b[0].charAt(i) && p == b[1].charAt(i) && p == b[2].charAt(i)) return true;
            if (p == b[i].charAt(0) && p == b[i].charAt(1) && p == b[i].charAt(2)) return true;
        }
        if (p == b[0].charAt(0) && p == b[1].charAt(1) && p == b[2].charAt(2)) return true;
        if (p == b[0].charAt(2) && p == b[1].charAt(1) && p == b[2].charAt(0)) return true;
        return false;
    }
}

class Solution {
    public int preimageSizeFZF(int k) {
        long lo = 0, hi = 5L * (k + 1);
        while (lo <= hi) {
            long mid = (lo + hi) / 2;
            int zeros = countZeros(mid);
            if (zeros == k) {
                return 5;
            } else if (zeros < k) {
                lo = mid + 1;
            } else {
                hi = mid - 1;
            }
        }
        return 0;
    }
    
    private int countZeros(long num) {
        int count = 0;
        for (long div = 5; num / div >= 1; div *= 5) {
            count += num / div;
        }
        return count;
    }
}

class Solution {
    public int numMatchingSubseq(String s, String[] words) {
        int count = 0;
        for(String word: words) {
            if(isSubsequence(word, s)) count++;
        }
        return count;
    }
    
    private boolean isSubsequence(String word, String s) {
        int i = 0, j = 0;
        while(i < word.length() && j < s.length()) {
            if(word.charAt(i) == s.charAt(j)) i++;
            j++;
        }
        return i == word.length();
    }
}

class Solution {
    public String customSortString(String order, String s) {
        int[] count = new int[26];
        for (char c : s.toCharArray()) {
            count[c - 'a']++;
        }
        StringBuilder sb = new StringBuilder();
        for (char c : order.toCharArray()) {
            for (int i = 0; i < count[c - 'a']; i++) {
                sb.append(c);
            }
            count[c - 'a'] = 0;
        }
        for (char c = 'a'; c <= 'z'; c++) {
            for (int i = 0; i < count[c - 'a']; i++) {
                sb.append(c);
            }
        }
        return sb.toString();
    }
}

class Solution {
    private static final int MOD = 1000000007;
    
    public int numTilings(int n) {
        long[][] dp = new long[n+1][3];
        
        dp[0][0] = 1;
        dp[1][0] = 1;
        
        for (int i = 2; i <= n; i++) {
            dp[i][0] = (dp[i-1][0] + dp[i-2][0] + dp[i-2][1] + dp[i-2][2]) % MOD;
            dp[i][1] = (dp[i-2][0] + dp[i-1][2]) % MOD;
            dp[i][2] = (dp[i-2][0] + dp[i-1][1]) % MOD;
        }
        
        return (int) dp[n][0];
    }
}

class Solution {
    public boolean escapeGhosts(int[][] ghosts, int[] target) {
        int distance = Math.abs(target[0]) + Math.abs(target[1]);
        for (int[] ghost : ghosts) {
            int ghostDistance = Math.abs(ghost[0] - target[0]) + Math.abs(ghost[1] - target[1]);
            if (ghostDistance <= distance) {
                return false;
            }
        }
        return true;
    }
}
